INSERT INTO `aspak_new_alat` VALUES (1610, 'Elektrode cable/Kabel elektroda', '21401001', 6815, 'An electrode cable is a device composed of strands of insulated electrical conductors laid together around a central core and intended for medical purposes to connect an electrode from a patient to a diagnostic machine.', ',0,1598,1555,6815,1610,', 'Electrode cable', '14.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1611, 'Chronaximeter', '21401002', 9454, 'A chronaximeter is a device intended for medical purposes to measure neuromuscular excitability by means of a strength-duration curve that provides a basis for diagnosis and prognosis of neurological dysfunction.', ',0,1598,1555,6815,1611,', 'Kronaksimeter ', '14.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1612, 'Electromyograph', '21401003', 6815, 'peralatan yang digunakan untuk memonitor dan menampilkan sinyal bioelektrik yang dihasilkan oleh otot, merangsang saraf perifer dan untuk memonitor serta menampilkan aktivitas listrik yang dihasilkan oleh saraf, untuk diagnosis dan prognosis penyakit neuromuskuler.', ',0,1598,1555,6815,1612,', '', '14.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1614, 'Reflex hammer/Palu pengukur reflex', '21401005', 6815, 'Peralatan yang digunakan untuk memperoleh dan menentukan refleks tendon dalam.', ',0,1598,1555,6815,1614,', 'Powered reflex hammer', '14.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1644, 'Kursi roda', '11402026', 6816, 'A mechanical wheelchair is a manually operated device with wheels that is intended for medical purposes to provide mobility to persons restricted to a sitting position.', ',0,1598,1556,6816,1644,', 'Wheelchair', '14.02.026', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1645, 'Kursi roda elektrik/Powered wheelchair', '21402027', 6816, 'A powered wheelchair is a battery-operated device with wheels that is intended for medical purposes to provide mobility to persons restricted to a sitting position.', ',0,1598,1556,6816,1645,', 'Powered wheelchair', '14.02.027', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1657, 'Powered patient transport', '21403005', 8831, 'A powered patient stairway chair lift is a motorized lift equipped with a seat and permanently mounted in one location that is intended for use in mitigating mobility impairment caused by injury or other disease by moving a person up and down a stairway.', ',0,1598,1557,6817,1657,', 'Tandu pasien elektrik', '14.03.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1658, 'Air-fluidized bed', '21403006', 8830, 'An air-fluidized bed is a device employing the circulation of filtered air through ceramic spherules (small, round ceramic objects) that is intended for medical purposes to treat or prevent bedsores, to treat severe or extensive burns, or to aid circulation.', ',0,1598,1557,6817,1658,', 'Kasur udara terfluidasi', '14.03.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1663, 'Microwave diathermy', '21403011', 8825, 'A microwave diathermy for use in applying therapeutic deep heat for selected medical conditions is a device that applies to specific areas of the body electromagnetic energy in the microwave frequency bands of 915 megahertz to 2,450 megahertz and that is intended to generate deep heat within body tissues for the treatment of selected medical conditions such as relief of pain, muscle spasms, and joint contractures, but not for the treatment of malignancies.', ',0,1598,1557,6817,1663,', 'Diatermi gelombang mikro', '14.03.011', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1664, 'Shortwave diathermy', '21403012', 8824, 'A shortwave diathermy for use in applying therapeutic deep heat for selected medical conditions is a device that applies to specific areas of the body electromagnetic energy in the radio frequency bands of 13 megahertz to 27.12 megahertz and that is intended to generate deep heat within body tissues for the treatment of selected medical conditions such as relief of pain, muscle spasms, and joint contractures, but not for the treatment of malignancies.', ',0,1598,1557,6817,1664,', 'Diatermi gelombang pendek', '14.03.012', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1665, 'Ultrasonic diathermy', '21403013', 8823, 'An ultrasonic diathermy for use in applying therapeutic deep heat for selected medical conditions is a device that applies to specific areas of the body ultrasonic energy at a frequency beyond 20 kilohertz and that is intended to generate deep heat within body tissues for the treatment of selected medical conditions such as relief of pain, muscle spasms, and joint contractures, but not for the treatment of malignancies.', ',0,1598,1557,6817,1665,', 'Diatermi ultrasonik', '14.03.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1671, 'Infrared lamp', '21403019', 8818, 'An infrared lamp is a device intended for medical purposes that emits energy at infrared frequencies (approximately 700 nanometers to 50,000 nanometers) to provide topical heating.', ',0,1598,1557,6817,1671,', 'Lampu infra merah', '14.03.019', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1682, 'Stimulator Elektrik', '21403030', 6817, 'A powered muscle stimulator is an electrically powered device intended for medical purposes that repeatedly contracts muscles by passing electrical currents through electrodes contacting the affected body area.', ',0,1598,1557,6817,1682,', 'Stimulator sistem Galvanic/Faradic; Powered muscle stimulator', '14.03.030', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1683, 'Ultrasound and muscle stimulator', '21403031', 6817, 'An ultrasound and muscle stimulator for use in applying therapeutic deep heat for selected medical conditions is a device that applies to specific areas of the body ultrasonic energy at a frequency beyond 20 kilohertz and that is intended to generate deep heat within body tissues for the treatment of selected medical conditions such as relief of pain, muscle spasms, and joint contractures, but not for the treatment of malignancies. The device also passes electrical currents through the body area to stimulate or relax muscles.', ',0,1598,1557,6817,1683,', '', '14.03.031', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1685, 'Traction Unit', '21403033', 6817, 'Powered traction equipment consists of powered devices intended for medical purposes for use in conjunction with traction accessories, such as belts and harnesses, to exert therapeutic pulling forces on the patient\'s body.', ',0,1598,1557,6817,1685,', '', '14.03.033', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1689, 'Therapeutic vibrator', '11403037', 8799, 'A therapeutic vibrator is an electrically powered device intended for medical purposes that incorporates various kinds of pads and that is held in the hand or attached to the hand or to a table. It is intended for various uses, such as relaxing muscles and relieving minor aches and pains.', ',0,1598,1557,6817,1689,', 'Vibrator terapi', '14.03.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1690, 'ECT/Electro Convulsion Therapy', '11403038', 6817, '', ',0,1598,1557,6817,1690,', '', '14.03.038', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1691, 'Diathermy Machine', '11403039', 6817, 'Nama General dari SWD, MWD dan Ultrasonic Diathermy', ',0,1598,1557,6817,1691,', '', '14.03.039', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1692, 'Ultrasound theraphy', '11403040', 6817, '', ',0,1598,1557,6817,1692,', '', '14.03.040', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1693, 'Treadmill', '11403041', 6817, '', ',0,1598,1557,6817,1693,', '', '14.03.041', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1695, 'Bed-side Monitor/Bed-patient monitor/Patient monitor', '10901002', 6796, 'A bed-patient monitor is a battery-powered device placed under a mattress and used to indicate by an alarm or other signal when a patient attempts to leave the bed.', ',0,1599,1558,6796,1695,', '', '09.01.002', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1696, 'Electronic monitor for gravity flow infusion systems', '20901003', 7273, 'An electronic monitor for gravity flow infusion systems is a device used to monitor the amount of fluid being infused into a patient. The device consists of an electronic transducer and equipment for signal amplification, conditioning, and display.', ',0,1599,1558,6796,1696,', 'Monitor elektronik untuk sistem infus', '09.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1697, 'Electrically powered spinal fluid pressure monitor', '20901004', 7272, 'An electrically powered spinal fluid pressure monitor is an electrically powered device used to measure spinal fluid pressure by the use of a transducer which converts spinal fluid pressure into an electrical signal. The device includes signal amplification, conditioning, and display equipment.', ',0,1599,1558,6796,1697,', 'Monitor tekanan cairan spinal elektrik', '09.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1698, 'Spinal fluid manometer', '20901005', 7265, 'A spinal fluid manometer is a device used to measure spinal fluid pressure. The device uses a hollow needle, which is inserted into the spinal column fluid space, to connect the spinal fluid to a graduated column so that the pressure can be measured by reading the height of the fluid.', ',0,1599,1558,6796,1698,', 'Manometer cairan spinal', '09.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1699, 'Timbangan dewasa; ', '10901006', 6796, 'Perangkat medis yang ditujukan untuk menimbang pasien yang mampu berdiri di atas platform skala', ',0,1599,1558,6796,1699,', 'Timbangan Badan; Stand-on Patient Scale', '09.01.006', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1700, 'Timbangan Pasien', '10901007', 6796, 'Timbangan pasien adalah perangkat yang ditujukan untuk  mengukur berat pasien yang tidak mampu berdiri (posisi duduk atau berbaring)', ',0,1599,1558,6796,1700,', '', '09.01.007', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1701, 'Timbangan bayi', '10901020', 6796, 'Timbangan yang ditujukan untuk mengukur berat bayi (usia 0-12 bulan)', ',0,1599,1558,6796,1701,', 'Infant Scale; Baby Scale', '09.01.007', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1704, 'Clinical color change thermometer', '10901010', 7263, 'Termometer yang digunakan untuk mengukur suhu tubuh pasien secara oral, rektal, atau aksila (ketiak). Termometer merekam suhu tubuh menggunakan bahan kimia sensitif panas yang terbungkus plastik atau strip logam pada ujungnya. Panas tubuh menyebabkan perubahan warna pada termometer.', ',0,1599,1558,6796,1704,', 'Termometer dengan indikator perubahan warna', '09.01.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1705, 'Termometer digital', '20901011', 6796, 'Termometer yang digunakan untuk mengukur suhu tubuh pasien secara elektronik atau digital. ', ',0,1599,1558,6796,1705,', 'Clinical electronic thermometer', '09.01.011', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1706, 'Termometer air raksa', '20901012', 6796, 'Termometer yang digunakan untuk mengukur suhu secara oral, rektal, atau aksila (ketiak) dengan menggunakan ekspansi termal dari merkuri.', ',0,1599,1558,6796,1706,', 'Clinical mercury thermometer', '09.01.012', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1707, 'Apgar timer', '10901013', 7267, 'Alat untuk membantu petugas medik untuk menilai skor Apgar pada bayi baru lahir.', ',0,1599,1558,6796,1707,', 'Alat penilaian skor apgar', '09.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1709, 'Central Monitor', '20901015', 6796, '', ',0,1599,1558,6796,1709,', '', '09.01.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1710, 'Tensimeter, Air Raksa ', '10901016', 6796, '', ',0,1599,1558,6796,1710,', 'Sphygmomanometer Dewasa', '09.01.016', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1713, 'Timbangan anak', '10901019', 6796, 'Perangkat medis yang ditujukan untuk menimbang pasien yang mampu berdiri di atas platform skala (untuk anak)', ',0,1599,1558,6796,1713,', '', '09.01.019', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1714, 'I.V. Container', '20902001', 7325, 'Wadah yang terbuat dari plastik atau kaca yang digunakan untuk menahan campuran cairan untuk diberikan kepada pasien melalui serangkaian pemberian intravaskular.', ',0,1599,1559,6797,1714,', 'Kontainer infus, botol infus, kolf infus, kantong infus', '09.02.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1715, 'Medical recirculating air cleaner', '20902002', 7284, 'Alat yang digunakan untuk menghilangkan partikel dari udara yang berfungsi sebagai  presipitasi elektrostatik atau filtrasi.', ',0,1599,1559,6797,1715,', 'Pembersih udara resirkulasi', '09.02.002', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1716, 'Elastic bandage', '10902003', 7324, 'Perban elastis yang terdiri dari strip panjang yang digunakan untuk memfiksasi atau menopang bagian tubuh pasien.', ',0,1599,1559,6797,1716,', 'Plester elastis, perban elastis', '09.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1717, 'Liquid bandage.', '10902004', 7283, 'Perban cair merupakan alat yang steril berupa cairan, semiliquid, atau bubuk dan kombinasi cairan yang digunakan untuk menutupi luka di kulit atau sebagai penutup luka bakar. Alat ini juga digunakan sebagai pelindung permukaan kulit.', ',0,1599,1559,6797,1717,', 'Perban cair', '09.02.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1718, 'Bed patient electric', '20902005', 6797, 'Tempat tidur pasien yang menggunakan tenaga listrik untuk mengatur tinggi dan kontur permukaan tempat tidur dengan menggunakan remote control.', ',0,1599,1559,6797,1718,', 'Tempat tidur pasien elektrik', '09.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1719, 'Hydraulic adjustable hospital bed', '10902006', 7322, 'Tempat tidur pasien yang dioperasikan dengan menggunakan hidrolik oleh petugas untuk menyesuaikan ketinggian dan kontur permukaan tempat tidur. ', ',0,1599,1559,6797,1719,', 'Tempat tidur pasien hidraulik', '09.02.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1720, 'Bed patient', '10902007', 6797, 'Tempat tidur pasien yang dioperasikan secara manual oleh petugas untuk menyesuaikan ketinggian dan kontur permukaan tempat tidur. ', ',0,1599,1559,6797,1720,', 'Tempat tidur pasien; Manual Adjustbale hospital bed; tempat tidur manual', '09.02.007', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1721, 'Infant radiant warmer', '20902008', 7320, 'Alat yang terdiri dari elemen pemanas inframerah digunakan untuk menjaga suhu tubuh bayi dengan radiasi panas. Alat ini dilengkapi sensor suhu, mekanisme pengontrolan suhu dan sistem alarm (suhu bayi, mode manual jika ada dan alarm kegagalan) untuk memperingatkan operator kondisi suhu di atas atau di bawah suhu pengaturan, batas waktu modus manual dan kegagalan komponen alat. ', ',0,1599,1559,6797,1721,', 'Infant warmer, radiant warmer', '09.02.008', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1722, 'Pediatric hospital bed', '20902009', 7286, 'Tempat tidur yang dirancang untuk pasien anak, dengan rail tetap, dapat dipindahkan dan latchable. Kontur permukaan tidur dapat disesuaikan.', ',0,1599,1559,6797,1722,', 'Tempat tidur pasien anak', '09.02.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1723, 'Matras decubitus', '10902010', 6797, 'Matras yang berisi udara, cairan, atau bahan lain yang memiliki efek fungsional setara untuk menopang pasien dan menghindari tekanan berlebih pada daerah tubuh lokal. Alat ini untuk mengobati atau mencegah ulkus dekubitus.', ',0,1599,1559,6797,1723,', '', '09.02.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1731, 'Inkubator infant', '20902018', 6797, 'Peralatan elektromedik yang memiliki kompartemen yang dilengkapi dengan alat untuk mengontrol lingkungan infant terutama dengan menghangatkan udara di dalam kompartemennya.', ',0,1599,1559,6797,1731,', 'Neonatal incubator; Baby Incubator; Inkubator Perawatan', '09.02.018', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1732, 'Inkubator infant Tansport', '20902019', 6797, 'Peralatan elektromedik portable (mudah dibawa) yang memiliki kompartemen yang dilengkapi dengan alat untuk mengontrol lingkungan infant terutama dengan menghangatkan udara di dalam kompartemennya.', ',0,1599,1559,6797,1732,', 'Neonatal transport incubator', '09.02.019', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1735, 'Infusion set', '20902022', 6797, 'alat yang digunakan untuk mengelola cairan dari wadah ke sistem vaskular pasien melalui jarum atau kateter dimasukkan ke pembuluh darah. Perangkat dapat terdiri dari jarum atau kateter, tabung, regulator aliran, ruang tetes, infus penyaring baris, infus set stopcock, tabung cairan pengiriman, konektor. ', ',0,1599,1559,6797,1735,', '', '09.02.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1738, 'AC-powered patient lift', '20902025', 7303, 'perangkat bertenaga listrik baik tetap/permanen maupun mobile, digunakan untuk mengangkat dan mengangkut pasien dalam posisi horizontal atau posisi lainnya dari satu tempat ke tempat lain, seperti dari tempat tidur untuk mandi. Perangkat ini mencakup tali dan sling untuk mengangkat pasien.', ',0,1599,1559,6797,1738,', 'Alat bantu elektrik untuk mengangkat pasien', '09.02.025', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1739, 'Non-AC-powered patient lift', '10902026', 7282, 'A non-AC-powered patient lift is a hydraulic, battery, or mechanically powered device, either fixed or mobile, used to lift and transport a patient in the horizontal or other required position from one place to another, as from a bed to a bath. The device includes straps and a sling to support the patient.', ',0,1599,1559,6797,1739,', 'Pengangkat pasien manual', '09.02.026', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1741, 'Temperature regulated water mattress', '10902028', 7281, 'Perangkat yang ditujukan untuk tujuan medis yang terdiri dari matras dengan ukuran yang sesuai, diisi dengan air yang dapat dipanaskan atau didinginkan. Perangkat ini mencakup pemanas listrik dan komponen sirkulasi air dan komponen pendingin tambahan. Kontrol suhu dapat manual atau otomatis.', ',0,1599,1559,6797,1741,', 'Matras air dengan pengatur suhu', '09.02.028', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1747, 'Phototherapy unit', '20902034', 6797, 'alat yang digunakan untuk mengobati atau mencegah hiperbilirubinemia (peningkatan kadar serum bilirubin). Perangkat ini terdiri dari satu atau lebih lampu yang memancarkan spektrum cahaya tertentu, di mana bayi ditempatkan untuk terapi. ', ',0,1599,1559,6797,1747,', 'Neonatal phototherapy unit; Blue light therapy; Spot light therphy', '09.02.034', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1748, 'Infusion pump', '20902035', 7296, 'Alat pemompa cairan ke pasien dengan cara yang terkendali. Perangkat terdiri dari pompa piston, pompa roller, atau pompa peristaltik dan dapat didukung elektrik atau mekanis. Perangkat ini juga dapat beroperasi menggunakan gaya konstan untuk mendorong cairan melalui tabung sempit yang menentukan laju aliran. Perangkat mungkin termasuk sarana untuk mendeteksi suatu kondisi kesalahan, seperti udara, atau penyumbatan, garis infus dan untuk mengaktifkan alarm.', ',0,1599,1559,6797,1748,', 'Pompa infus', '09.02.035', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1749, 'Suction snakebite kit', '10902036', 7295, 'Perangkat yang terdiri dari pisau, perangkat hisap, dan tourniquet digunakan untuk pengobatan pertolongan pertama dari gigitan ular dengan membuang racun dari luka.', ',0,1599,1559,6797,1749,', 'Kit suction untuk bisa gigitan ular', '09.02.036', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1758, 'ICU Bed Electric', '20902045', 6797, '', ',0,1599,1559,6797,1758,', '', '09.02.045', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1759, 'Syringe Pump', '20902046', 6797, '', ',0,1599,1559,6797,1759,', '', '09.02.046', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1764, 'Cardiopulmonary resuscitation board', '10903005', 7389, 'Perangkat yang terdiri dari papan yang ditempatkan di bawah pasien untuk pendukung selama resusitasi cardiopulmonary.', ',0,1599,1560,6798,1764,', 'Papan CPR', '09.03.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1767, 'Kursi donor', '10903008', 6798, 'Perangkat yang terdiri dari kursi atau meja tanpa roda dan tidak bertenaga listrik yang untuk alasan khusus dapat ditambahkan baki makanan atau sandaran kepala atau fitur khusus seperti mekanisme menaikkan dan menurunkan atau dapat dilepas bagian lengannya yang ditujukan untuk penggunaan donor darah, pasien geriatri, atau pasien yang menjalani pengobatan atau pemeriksaan.', ',0,1599,1560,6798,1767,', '', '09.03.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1768, 'Ultrasonic cleaner for medical instruments', '10903009', 7337, 'An ultrasonic cleaner for medical instruments is a device intended for cleaning medical instruments by the emission of high frequency soundwaves.', ',0,1599,1560,6798,1768,', 'Pembersih ultrasonik untuk instrumen medis', '09.03.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1772, 'Tongue depressor', '10903013', 7382, 'A tongue depressor is a device intended to displace the tongue to facilitate examination of the surrounding organs and tissues.', ',0,1599,1560,6798,1772,', 'Sudip lidah, spatel lidah', '09.03.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1773, 'Hand scoen (steril)', '10903014', 6798, 'A patient examination glove is a disposable device intended for medical purposes that is worn on the examiner\'s hand or finger to prevent contamination between patient and examiner.', ',0,1599,1560,6798,1773,', 'Patient examination glove; Sarung Tangan Periksa', '09.03.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1775, 'Baju pasien', '10903016', 6798, 'An examination gown is a device intended for medical purposes that is made of cloth, paper, or other material that is draped over or worn by a patient as a body covering during a medical examination.', ',0,1599,1560,6798,1775,', '', '09.03.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1780, 'Examination light / Examination lamp / Lampu periksa / Hanging lamp', '10903021', 6798, 'AC or battery-powered medical examination light is a battery-powered device intended for medical purposes that is used to illuminate body surfaces and cavities during a medical examination.', ',0,1599,1560,6798,1780,', 'AC-powered medical examination light; Battery-powered medical examination light; Examination Lamp', '09.03.021', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1781, 'Examination Table', '10903022', 6798, 'Meja atau tempat tidur tanpa roda dan tidak bertenaga listrik  untuk memeriksa pasien.', ',0,1599,1560,6798,1781,', 'Meja Periksa, Tempat tidur periksa, Lampu periksa dan perlengkapannya', '09.03.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1785, 'UV Sterilizer', '20903026', 6798, 'A medical ultraviolet air purifier is a device intended for medical purposes that is used to destroy bacteria in the air by exposure to ultraviolet radiation', ',0,1599,1560,6798,1785,', 'UV Lamp; ', '09.03.026', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1788, 'Suction pump/Pompa vakum /Vacuum-powered body fluid suction apparatus; Suction Pump Mobile ', '20903029', 6798, 'A vacuum-powered body fluid suction apparatus is a device used to aspirate, remove, or sample body fluids. The device is powered by an external source of vacuum. This generic type of device includes vacuum regulators, vacuum collection bottles, suction catheters and tips, connecting flexible aspirating tubes, rigid suction tips, specimen traps, noninvasive tubing, and suction regulators (with gauge).', ',0,1599,1560,6798,1788,', 'Vacuum-powered body fluid suction apparatus; Suction Pump Mobile ', '09.03.029', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1790, 'Powered patient transfer device ', '20903031', 6798, 'A powered patient transfer device is a device consisting of a wheeled stretcher and a powered mechanism that has a broad, flexible band stretched over long rollers that can advance itself under a patient and transfer the patient with minimal disturbance in a horizontal position to the stretcher.', ',0,1599,1560,6798,1790,', 'Brankar elektrik', '09.03.031', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1792, 'Washers for body waste receptacles ', '10903033', 6798, 'A washer for body waste receptacles is a device intended for medical purposes that is used to clean and sanitize a body waste receptacle, such as a bedpan. The device consists of a wall-mounted plumbing fixture with a door through which a body waste receptacle is inserted. When the door is closed the body waste receptacle is cleaned by hot water, steam, or germicide', ',0,1599,1560,6798,1792,', 'Pencuci wadah limbah tubuh', '09.03.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1795, 'Ethylene oxide gas sterilizer', '20903036', 7363, 'An ethylene gas sterilizer is a nonportable device intended for use by a health care provider that uses ethylene oxide (ETO) to sterilize medical products.', ',0,1599,1560,6798,1795,', 'Alat pensteril dengan gas etilen oksida', '09.03.036', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1796, 'Dry-heat sterilizer', '20903037', 7362, 'A dry-heat sterilizer is a device that is intended for use by a health care provider to sterilize medical products by means of dry heat', ',0,1599,1560,6798,1796,', 'Alat pensteril dengan panas-kering', '09.03.037', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1797, 'Steam sterilizer', '20903038', 7361, 'A steam sterilizer (autoclave) is a device that is intended for use by a health care provider to sterilize medical products by means of pressurized steam.', ',0,1599,1560,6798,1797,', 'Alat pensteril dengan uap / autoclave', '09.03.038', 1, 1, 350, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1802, 'Syringe needle introducer', '20903043', 7357, 'A syringe needle introducer is a device that uses a spring-loaded mechanism to drive a hypodermic needle into a patient to a predetermined depth below the skin surface.', ',0,1599,1560,6798,1802,', 'Alat untuk memasukkan jarum suntik', '09.03.043', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1806, 'Tiang infus', '20903056', 6798, 'The infusion stand is a stationary or movable stand intended to hold infusion liquids, infusion accessories, and other medical devices.', ',0,1599,1560,6798,1806,', 'Infusion stand', '09.03.047', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1807, 'Medical washer', '20903048', 7353, 'A medical washer is a device that is intended for general medical purposes to clean and dry surgical instruments, anesthesia equipment, hollowware, and other medical devices.', ',0,1599,1560,6798,1807,', '', '09.03.048', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1808, 'Medical washer-disinfector', '20903049', 7352, 'A medical washer-disinfector is a device that is intended for general medical purposes to clean, decontaminate, disinfect, and dry surgical instruments, anesthesia equipment, hollowware, and other medical devices.', ',0,1599,1560,6798,1808,', '', '09.03.049', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1811, 'Aspirator/Vacuum/Suction pump portable', '20903052', 6798, 'Suction pump yang dapat dibawa/dijinjing.', ',0,1599,1560,6798,1811,', 'Alat Penghisap Lendir Elektrik', '09.03.052', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1812, 'Rigidity analyzer', '21001001', 8787, 'perangkat untuk mengukur tingkat kekakuan anggota tubuh pasien untuk menentukan efektivitas obat atau perawatan lain', ',0,1595,1541,6799,1812,', 'Alat analisa tingkat kekakuan anggota tubuh pasien', '10.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1813, 'Ataxiagraph', '11001002', 8786, 'sebuah perangkat yang digunakan untuk menentukan tingkat ataksia (kegagalan koordinasi otot) dengan mengukur jumlah goyangan tubuh ketika pasien berdiri tegak dan dengan mata tertutup.', ',0,1595,1541,6799,1813,', 'Ataxiagraf', '10.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1815, 'Echoencephalograph', '21001004', 8784, 'perangkat pemindaian ultrasonik (termasuk A-scan, B-scan, dan sistem doppler) yang menggunakan transduser invasif untuk mengukur interface intrakranial dan kecepatan aliran darah ke dan di kepala.', ',0,1595,1541,6799,1815,', 'Ekoensefalograf', '10.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1822, 'Electroencephalograph', '21001011', 8777, 'perangkat yang digunakan untuk mengukur dan mencatat aktivitas listrik otak pasien diperoleh dengan menempatkan dua atau lebih elektroda di kepala.', ',0,1595,1541,6799,1822,', 'EEG', '10.01.011', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1824, 'Electroencephalogram (EEG) signal spectrum analyzer', '11001013', 8775, 'sebuah perangkat yang digunakan untuk menampilkan konten frekuensi atau kepadatan spektral daya dari sinyal electroencephalogram.', ',0,1595,1541,6799,1824,', 'Alat analisa spektrum sinyal EEG', '10.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1827, 'Neurological endoscope', '21001016', 8772, 'instrumen dengan sumber cahaya digunakan untuk melihat bagian dalam ventrikel otak.', ',0,1595,1541,6799,1827,', 'Endoskopi pada syaraf', '10.01.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1828, 'Esthesiometer', '11001017', 8771, 'sebuah alat mekanik yang biasanya terdiri dari batang tunggal atau serat yang diadakan di jari-jari dokter atau pemeriksa lain dan yang digunakan untuk menentukan apakah pasien memiliki sensitivitas taktil.', ',0,1595,1541,6799,1828,', 'Esthesiometer, alat uji sensivitas sentuh', '10.01.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1829, 'Tuning fork', '11001018', 8770, 'perangkat mekanik yang beresonansi pada frekuensi tertentu dan digunakan untuk mendiagnosa gangguan pendengaran dan untuk menguji rasa getaran.', ',0,1595,1541,6799,1829,', 'Garpu tala', '10.01.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1834, 'Alpha monitor', '21001023', 8765, 'perangkat dengan elektroda yang ditempatkan pada kulit kepala pasien untuk memantau bahwa sebagian dari electroencephalogram yang disebut sebagai gelombang alpha.', ',0,1595,1541,6799,1834,', 'Monitor gelombang alfa', '10.01.023', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1839, 'Rheoencephalograph', '31001028', 8760, 'perangkat yang digunakan untuk memperkirakan serebral sirkulasi pasien (aliran darah di otak) dengan metode impedansi listrik dengan sambungan listrik langsung ke kulit kepala atau daerah leher.', ',0,1595,1541,6799,1839,', 'Rheoencephalograph, alat untuk memperkirakan sirkulasi aliran darah di otak', '10.01.028', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1842, 'Electroencephalogram (EEG) telemetry system', '21001031', 8757, 'Sebuah electroencephalogram sistem telemetri terdiri dari pemancar, penerima, dan komponen lain yang digunakan untuk jarak jauh memonitor atau mengukur sinyal EEG dengan cara sistem transmisi radio atau telepon.', ',0,1595,1541,6799,1842,', 'Sistem telemetri EEG', '10.01.031', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1848, 'Near Infrared (NIR) Brain Hematoma Detector ', '21001037', 6799, 'perangkat non-invasif yang menggunakan spektroskopi inframerah-dekat yang dimaksudkan untuk digunakan untuk mengevaluasi hematoma otak dicurigai.', ',0,1595,1541,6799,1848,', 'Detektor near infrared (NIR) hematoma otak', '10.01.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1849, 'Tremor transducer', '21001038', 8751, 'perangkat yang digunakan untuk mengukur tingkat getaran yang disebabkan oleh penyakit tertentu.', ',0,1595,1541,6799,1849,', 'Transduser pengukur tremor', '10.01.038', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1851, 'Ventricular cannula.', '11002002', 8835, 'perangkat yang digunakan untuk menusuk ventrikel otak untuk aspirasi atau untuk injeksi. Perangkat ini sering disebut sebagai jarum ventrikel.', ',0,1595,1542,6800,1851,', 'Kanula ventrikel', '10.02.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1852, 'Ventricular catheter', '21002003', 8869, 'sebuah perangkat yang digunakan untuk mendapatkan akses ke rongga otak untuk injeksi bahan ke, atau penghapusan bahan dari, otak.', ',0,1595,1542,6800,1852,', 'Kateter ventrikel', '10.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1853, 'Neurosurgical chair', '11002004', 8868, 'sebuah kursi ruang operasi yang digunakan untuk posisi dan dukungan pasien selama bedah saraf.', ',0,1595,1542,6800,1853,', 'Kursi bedah saraf', '10.02.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1864, 'Electric cranial drill motor', '21002016', 8856, 'sumber listrik yang dioperasikan secara elektrik digunakan dengan removable berputar alat pemotong bedah atau bor pada tengkorak pasien.', ',0,1595,1542,6800,1864,', 'Bor kranial elektrik', '10.02.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1865, 'Pneumatic cranial drill motor', '21002017', 8855, 'sumber listrik yang dioperasikan secara pneumatis digunakan dengan removable berputar alat pemotong bedah atau bor pada tengkorak pasien.', ',0,1595,1542,6800,1865,', 'Bor kranial pneumatik', '10.02.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1866, 'Radiofrequency lesion generator', '21002018', 8854, 'sebuah perangkat yang digunakan untuk menghasilkan lesi pada sistem saraf atau jaringan lain dengan penerapan langsung arus frekuensi radio untuk situs yang dipilih.', ',0,1595,1542,6800,1866,', 'Generator lesi (luka) bersumber radiofrekuensi', '10.02.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1867, 'Neurosurgical headrests', '11002019', 8853, 'perangkat yang digunakan untuk mendukung kepala pasien selama prosedur operasi.', ',0,1595,1542,6800,1867,', 'Sandaran kepala pada bedah saraf', '10.02.019', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1870, 'Microsurgical instrument', '11002022', 8850, 'alat bedah tanpa catu daya yang digunakan dalam prosedur mikro neurologis.', ',0,1595,1542,6800,1870,', 'Instrument bedah minor', '10.02.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1877, 'Radiofrequency lesion probe', '21002029', 6800, 'perangkat terhubung ke frekuensi radio (RF) lesi generator untuk memberikan energi RF ke situs dalam sistem saraf di mana lesi yang diinginkan.', ',0,1595,1542,6800,1877,', 'Probe lesi (luka) radiofrekuensi', '10.02.029', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1917, 'Arthroscope', '21301001', 8974, 'endoskop bertenaga listrik dimaksudkan untuk melihat bagian dalam sendi. The arthroscope dan aksesoris juga dimaksudkan untuk melakukan operasi sendi.', ',0,1594,1538,6812,1917,', 'Artroskop', '13.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1920, 'Goniometer', '11301004', 8971, 'perangkat bertenaga AC atau baterai dimaksudkan untuk menilai fungsi sendi dengan mengukur dan mencatat rentang gerak, akselerasi, atau kekuatan yang diberikan oleh sendi.', ',0,1594,1538,6812,1920,', 'Goniometer elektrik', '13.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1921, 'Goniometer non elektrik', '11301005', 6812, 'alat mekanis ditujukan untuk mengukur jangkauan gerak sendi.', ',0,1594,1538,6812,1921,', 'Nonpowered goniometer', '13.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1989, 'Calipers for clinical use', '11303001', 9088, 'perangkat kompas seperti dimaksudkan untuk digunakan dalam mengukur ketebalan atau diameter bagian tubuh atau jarak antara dua permukaan tubuh, seperti untuk mengukur spesimen tulang dipotong untuk menentukan ukuran pengganti yang tepat dari prosthesis.', ',0,1594,1540,6814,1989,', '', '13.03.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1997, 'Protractor for clinical use', '11303009', 9095, 'perangkat dimaksudkan untuk digunakan dalam mengukur sudut tulang, seperti pada x-ray atau operasi.', ',0,1594,1540,6814,1997,', 'Protraktor medis', '13.03.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (1999, 'Nonpowered orthopedic traction apparatus and accessories', '11303011', 9093, 'sebuah perangkat yang terdiri dari bingkai kaku dengan traksi aksesoris tanpa catu daya, seperti kabel, katrol, atau berat, dan yang dimaksudkan untuk menerapkan kekuatan menarik terapi untuk sistem kerangka', ',0,1594,1540,6814,1999,', 'Peralatan traksi ortopedi manual dan aksesori', '13.03.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2000, 'Noninvasive traction component', '11303012', 9092, 'perangkat, seperti tali kepala, sabuk panggul, atau belat traksi, yang tidak menembus kulit dan dimaksudkan untuk membantu menghubungkan pasien ke alat traksi sehingga kekuatan yang menarik terapi dapat diterapkan untuk tubuh pasien.', ',0,1594,1540,6814,2000,', 'Komponen traksi noninvasif', '13.03.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2004, 'Speculum and accessories', '11601001', 9253, 'A speculum is a device intended to be inserted into a body cavity to aid observation. It is either nonilluminated or illuminated and may have various accessories', ',0,1601,1565,6822,2004,', 'Spekulum dan aksesori', '16.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2006, 'Surgical mesh/Jala bedah', '21602002', 6823, 'Surgical mesh is a metallic or polymeric screen intended to be implanted to reinforce soft tissue or bone where weakness exists. Examples of surgical mesh are metallic and polymeric mesh for hernia repair, and acetabular and cement restrictor mesh used during orthopedic surgery', ',0,1601,1566,6823,2006,', 'Jala bedah', '16.02.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2009, 'Silicone gel-filled breast prosthesis', '31602005', 9198, 'Single-lumen silicone gel-filled breast prosthesis. A single-lumen silicone gel-filled breast prosthesis is a silicone rubber shell made of polysiloxane(s), such as polydimethylsiloxane and polydiphenylsiloxane. The shell either contains a fixed amount cross-linked polymerized silicone gel, filler, and stabilizers or is filled to the desired size with injectable silicone gel at time of implantation. The device is intended to be implanted to augment or reconstruct the female breast', ',0,1601,1566,6823,2009,', 'Payudara prostesis berisi gel silikon', '16.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2010, 'Chin prosthesis', '21602006', 9197, 'A chin prosthesis is a silicone rubber solid device intended to be implanted to augment or reconstruct the chin', ',0,1601,1566,6823,2010,', 'Dagu prostesis', '16.02.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2011, 'Ear prosthesis', '21602007', 9196, 'An ear prosthesis is a silicone rubber solid device intended to be implanted to reconstruct the external ear', ',0,1601,1566,6823,2011,', 'Telinga prostesis', '16.02.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2012, 'Esophageal prosthesis', '21602008', 9195, 'An esophageal prosthesis is a rigid, flexible, or expandable tubular device made of a plastic, metal, or polymeric material that is intended to be implanted to restore the structure and/or function of the esophagus. The metal esophageal prosthesis may be uncovered or covered with a polymeric material. This device may also include a device delivery system', ',0,1601,1566,6823,2012,', 'Esofagus prostesis', '16.02.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2013, 'Nose prosthesis', '21602009', 9194, 'A nose prosthesis is a silicone rubber solid device intended to be implanted to augment or reconstruct the nasal dorsum.', ',0,1601,1566,6823,2013,', 'Hidung prostesis', '16.02.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2014, 'Tracheal prosthesis', '21602010', 9193, 'The tracheal prosthesis is a rigid, flexible, or expandable tubular device made of a silicone, metal, or polymeric material that is intended to be implanted to restore the structure and/or function of the trachea or trachealbronchial tree. It may be unbranched or contain one or two branches. The metal tracheal prosthesis may be uncovered or covered with a polymeric material. This device may also include a device delivery system', ',0,1601,1566,6823,2014,', 'Trakea prostesis', '16.02.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2038, 'ESU/Electrosurgical Unit', '21603019', 6824, 'An electrosurgical cutting and coagulation device and accessories is a device intended to remove tissue and control bleeding by use of high-frequency electrical current', ',0,1601,1567,6824,2038,', 'ESU; Electrocauter', '16.03.019', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2039, 'Low energy ultrasound wound cleaner', '21603020', 8941, 'A low energy ultrasound wound cleaner is a device that uses ultrasound energy to vaporize a solution and generate a mist that is used for the cleaning and maintenance debridement of wounds. Low levels of ultrasound energy may be carried to the wound by the saline mist', ',0,1601,1567,6824,2039,', 'Pembersih luka ultrasound tenaga rendah', '16.03.020', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2048, 'Stainless steel suture', '21603029', 8933, 'A stainless steel suture is a needled or unneedled nonabsorbable surgical suture composed of 316L stainless steel, in USP sizes 12-0 through 10, or a substantially equivalent stainless steel suture, intended for use in abdominal wound closure, intestinal anastomosis, hernia repair, and sternal closure', ',0,1601,1567,6824,2048,', 'Benang bedah stainless steel', '16.03.029', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2050, 'Lampu operasi (Ceyling Type)', '21603031', 6824, 'A surgical lamp (including a fixture) is a device intended to be used to provide visible illumination of the surgical field or the patient', ',0,1601,1567,6824,2050,', 'Operating lamp; Surgical lamp', '16.03.031', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2064, 'Surgical instrument motors and accessories/attachments', '11603045', 8902, 'Surgical instrument motors and accessories are AC-powered, battery-powered, or air-powered devices intended for use during surgical procedures to provide power to operate various accessories or attachments to cut hard tissue or bone and soft tissue. Accessories or attachments may include a bur, chisel (osteotome), dermabrasion brush, dermatome, drill bit, hammerhead, pin driver, and saw blade', ',0,1601,1567,6824,2064,', 'Instrumen motor bedah dan aksesori', '16.03.045', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2068, 'Operating table, Manual', '11603049', 6824, 'A manual operating table and accessories and a manual operating chair and accessories are nonpowered devices, usually with movable components, intended to be used to support a patient during diagnostic examinations or surgical procedures', ',0,1601,1567,6824,2068,', 'Manual operating table and accessories and manual operating chair and accessories', '16.03.049', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2069, 'Operating table, electric', '11603050', 6824, 'Operating tables and accessories and operating chairs and accessories are AC-powered or air-powered devices, usually with movable components, intended for use during diagnostic examinations or surgical procedures to support and position a patient', ',0,1601,1567,6824,2069,', '', '16.03.050', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2078, 'Needle-type epilator', '11604002', 9472, 'Perangkat yang digunakan untuk menghancurkan papilla dermal rambut dengan menerapkan arus listrik di ujung jarum halus yang telah disisipkan dekat dengan batang rambut, di bawah kulit, dan ke papilla dermal. Arus listrik bisa AC frekuensi tinggi, kombinasi AC frekuensi tinggi dengan arus DC, atau hanya arus DC', ',0,1601,1568,6825,2078,', 'Jarum epilator', '16.04.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2079, 'Tweezer-type epilator', '11604003', 9471, 'The tweezer-type epilator is an electrical device intended to remove hair. The energy provided at the tip of the tweezer used to remove hair may be radio frequency, galvanic (direct current), or a combination of radio frequency and galvanic energy', ',0,1601,1568,6825,2079,', 'Tweezer epilator', '16.04.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2082, 'Nonpneumatic tourniquet', '11604006', 9469, 'A nonpneumatic tourniquet is a device consisting of a strap or tubing intended to be wrapped around a patient\'s limb and tightened to reduce circulation', ',0,1601,1568,6825,2082,', 'Nonpneumatic tourniquet', '16.04.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2083, ' Pneumatic tourniquet', '11604007', 9467, 'A pneumatic tourniquet is an air-powered device consisting of a pressure-regulating unit, connecting tubing, and an inflatable cuff. The cuff is intended to be wrapped around a patient\'s limb and inflated to reduce or totally occlude circulation during surgery', ',0,1601,1568,6825,2083,', 'Pneumatic tourniquet', '16.04.007', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2084, 'Audiometer', '20701001', 7406, 'An audiometer or automated audiometer is an electroacoustic device that produces controlled levels of test tones and signals intended for use in conducting diagnostic hearing evaluations and assisting in the diagnosis of possible otologic disorders', ',0,1600,1561,6787,2084,', 'Audiometri', '07.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2087, 'Audiometer calibration set', '10701004', 7396, 'An audiometer calibration set is an electronic reference device that is intended to calibrate an audiometer. It measures the sound frequency and intensity characteristics that emanate from an audiometer earphone. The device consists of an acoustic cavity of known volume, a sound level meter, a microphone with calibration traceable to the National Bureau of Standards, oscillators, frequency counters, microphone amplifiers, and a recorder. The device can measure selected audiometer test frequencies at a given intensity level, and selectable audiometer attenuation settings at a given test frequency', ',0,1600,1561,6787,2087,', 'Kalibrator audiometer', '07.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2088, 'Auditory impedance tester', '10701005', 7404, 'An auditory impedance tester is a device that is intended to change the air pressure in the external auditory canal and measure and graph the mobility characteristics of the tympanic membrane to evaluate the functional condition of the middle ear. The device is used to determine abnormalities in the mobility of the tympanic membrane due to stiffness, flaccidity, or the presence of fluid in the middle ear cavity. The device is also used to measure the acoustic reflex threshold from contractions of the stapedial muscle, to monitor healing of tympanic membrane grafts or stapedectomies, or to monitor followup treatment for inflammation of the middle ear', ',0,1600,1561,6787,2088,', 'Timpanometer', '07.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2091, 'Electroglottograph', '20701008', 7401, 'An electroglottograph is an AC-powered device that employs a pair of electrodes that are placed in contact with the skin on both sides of the larynx and held in place by a collar. It is intended to measure the electrical impedance of the larynx to aid in assessing the degree of closure of the vocal cords, confirm larygeal diagnosis, aid behavioral treatment of voice disorders, and aid research concerning the laryngeal mechanism', ',0,1600,1561,6787,2091,', 'Pengukur getaran pita suara', '07.01.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2092, 'Gustometer', '10701009', 7395, 'A gustometer is a battery-powered device that consists of two electrodes that are intended to be placed on both sides of the tongue at different taste centers and that provides a galvanic stimulus resulting in taste sensation. It is used for assessing the sense of taste', ',0,1600,1561,6787,2092,', 'Gustometer', '07.01.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2093, 'Olfactory test device', '20701010', 7400, 'An olfactory test device is used to determine whether an olfactory loss is present. The device includes one or more odorants that are presented to the patient\'s nose to subjectively assess the patient\'s ability to perceive odors.', ',0,1600,1561,6787,2093,', 'Odor test device / alat uji penciuman', '07.01.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2095, 'Surgical nerve stimulator/locator', '20701012', 7399, 'A surgical nerve stimulator/locator is a device that is intended to provide electrical stimulation to the body to locate and identify nerves and to test their excitability', ',0,1600,1561,6787,2095,', 'Alat untuk menemukan dan mengidentifikasi saraf', '07.01.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2096, 'Toynbee diagnostic tube', '10701013', 7398, 'The toynbee diagnostic tube is a listening device intended to determine the degree of openness of the eustachian tube', ',0,1600,1561,6787,2096,', 'Tabung diagnostik  toynbee', '07.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2097, 'Hearing Aid (bone conduction)', '10702001', 7413, 'A hearing aid is wearable sound-amplifying device that is intended to compensate for impaired hearing. This generic type of device includes the air-conduction hearing aid and the bone-conduction hearing aid, but excludes the group hearing aid or group auditory trainer (874.3320), master hearing aid (874.3330), and tinnitus masker (874.3400)', ',0,1600,1562,6788,2097,', 'Alat bantu dengar (bone conduction)', '07.02.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2098, 'Wireless air-conduction hearing aid', '20702002', 7410, 'A wireless air-conduction hearing aid is a wearable sound-amplifying device, intended to compensate for impaired hearing that incorporates wireless technology in its programming or use', ',0,1600,1562,6788,2098,', 'Alat bantu dengar dengan teknologi nirkabel', '07.02.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2099, 'Hearing aid calibrator and analysis system', '20702003', 7431, 'A hearing aid calibrator and analysis system is an electronic reference device intended to calibrate and assess the electroacoustic frequency and sound intensity characteristics emanating from a hearing aid, master hearing aid, group hearing aid or group auditory trainer. The device consists of an acoustic complex of known cavity volume, a sound level meter, a microphone, oscillators, frequency counters, microphone amplifiers, a distoration analyzer, a chart recorder, and a hearing aid test box', ',0,1600,1562,6788,2099,', 'Kalibrator alat bantu dengar', '07.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2101, 'Master hearing aid', '20702005', 7429, 'A master hearing aid is an electronic device intended to simulate a hearing aid during audiometric testing. It has adjustable acoustic output levels, such as those for gain, output, and frequency response. The device is used to select and adjust a person\'s wearable hearing aid', ',0,1600,1562,6788,2101,', 'Simulator alat bantu dengar', '07.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2108, 'Ear, nose, and throat synthetic polymer material', '20702012', 7423, 'Ear, nose, and throat synthetic polymer material is a device material that is intended to be implanted for use as a space-occupying substance in the reconstructive surgery of the head and neck. The device is used, for example, in augmentation rhinoplasty and in tissue defect closures in the esophagus. The device is shaped and formed by the suregon to conform to the patient\'s needs. This generic type of device is made of material such as polyamide mesh or foil and porous polyethylene', ',0,1600,1562,6788,2108,', 'Polimer sintetis sebagai bahan rekonstruksi THT', '07.02.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2110, 'Laryngeal prosthesis (Taub design)', '20702014', 7421, 'A laryngeal prosthesis (Taub design) is a device intended to direct pulmonary air flow to the pharynx in the absence of the larynx, thereby permitting esophageal speech. The device is interposed between openings in the trachea and the esophagus and may be removed and replaced each day by the patient. During phonation, air from the lungs is directed to flow through the device and over the esophageal mucosa to provide a sound source that is articulated as speech', ',0,1600,1562,6788,2110,', 'Prostesis laring', '07.02.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2118, 'Epistaxis balloon', '10703001', 7437, 'An epistaxis balloon is a device consisting of an inflatable balloon intended to control internal nasal bleeding by exerting pressure against the sphenopalatine artery', ',0,1600,1563,6789,2118,', 'Balon untuk mengendalikan pendarahan hidung internal', '07.03.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2119, 'Ear, nose, and throat bur', '10703002', 7436, 'An ear, nose, and throat bur is a device consisting of an interchangeable drill bit that is intended for use in an ear, nose, and throat electric or pneumatic surgical drill (874.4250) for incising or removing bone in the ear, nose, or throat area. The bur consists of a carbide cutting tip on a metal shank or a coating of diamond on a metal shank. The device is used in mastoid surgery, frontal sinus surgery, and surgery of the facial nerves', ',0,1600,1563,6789,2119,', 'Bor THT', '07.03.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2120, 'Nasopharyngeal catheter', '10703003', 7435, 'A nasopharyngeal catheter is a device consisting of a bougie or filiform catheter that is intended for use in probing or dilating the eustachian tube. This generic type of device includes eustachian catheters', ',0,1600,1563,6789,2120,', 'Kateter nasofaring', '07.03.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2125, 'Ear, nose, and throat microsurgical carbon dioxide laser.', '20703008', 7445, 'An ear, nose, and throat microsurgical carbon dioxide laser is a device intended for the surgical excision of tissue from the ear, nose, and throat area. The device is used, for example, in microsurgical procedures to excise lesions and tumors of the vocal cords and adjacent areas', ',0,1600,1563,6789,2125,', 'Laser CO2  untuk THT', '07.03.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2126, 'Bronchoscope (flexible or rigid) and accessories.', '20703009', 7444, 'A bronchoscope (flexible or rigid) and accessories is a tubular endoscopic device with any of a group of accessory devices which attach to the bronchoscope and is intended to examine or treat the larynx and tracheobronchial tree. It is typically used with a fiberoptic light source and carrier to provide illumination. The device is made of materials such as stainless steel or flexible plastic. This generic type of device includes the rigid ventilating bronchoscope, rigid nonventilating bronchoscope, nonrigid bronchoscope, laryngeal-bronchial telescope, flexible foreign body claw, bronchoscope tubing, flexible biopsy forceps, rigid biopsy curette, flexible biopsy brush, rigid biopsy forceps, flexible biopsy curette, and rigid bronchoscope aspirating tube, but excludes the fiberoptic light source and carrier', ',0,1600,1563,6789,2126,', 'Bronkoskop dan aksesori', '07.03.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2127, 'Esophagoscope (flexible or rigid) and accessories.', '20703010', 7443, 'An esophagoscope (flexible or rigid) and accessories is a tubular endoscopic device with any of a group of accessory devices which attach to the esophagoscope and is intended to examine or treat esophageal malfunction symptoms, esophageal or mediastinal disease, or to remove foreign bodies from the esophagus. When inserted, the device extends from the area of the hypopharynx to the stomach. It is typically used with a fiberoptic light source and carrier to provide illumination. The device is made of materials such as stainless steel or flexible plastic. This generic type of device includes the flexible foreign body claw, flexible biopsy forceps, rigid biopsy curette, flexible biopsy brush, rigid biopsy forceps and flexible biopsy curette, but excludes the fiberoptic light source and carrier', ',0,1600,1563,6789,2127,', 'Esofagoskop dan aksesori', '07.03.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2128, 'Mediastinoscope and accessories.', '20703011', 7442, 'A mediastinoscope and accessories is a tubular tapered electrical endoscopic device with any of a group of accessory devices which attach to the mediastinoscope and is intended to examine or treat tissue in the area separating the lungs. The device is inserted transthoracicly and is used in diagnosis of tumors and lesions and to determine whether excision of certain organs or tissues is indicated. It is typically used with a fiberoptic light source and carrier to provide illumination. The device is made of materials such as stainless steel. This generic type of device includes the flexible foreign body claw, flexible biopsy forceps, rigid biopsy curette, flexible biopsy brush, rigid biopsy forceps, and flexible biopsy curette, but excludes the fiberoptic light source and carrier', ',0,1600,1563,6789,2128,', 'Mediastinoskop dan aksesori', '07.03.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2129, 'Laryngostroboscope', '10703012', 7434, 'A laryngostroboscope is a device that is intended to allow observation of glottic action during phonation. The device operates by focusing a stroboscopic light through a lens for direct or mirror reflected viewing of glottic action. The light and microphone that amplifies acoustic signals from the glottic area may or may not contact the patient', ',0,1600,1563,6789,2129,', 'Laringostroboskop', '07.03.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2131, 'Otoscope', '10703014', 7440, 'An otoscope is a device intended to allow inspection of the external ear canal and tympanic membrane under magnification. The device provides illumination of the ear canal for observation by using an AC- or battery-powered light source and an optical magnifying system', ',0,1600,1563,6789,2131,', 'Otoskop', '07.03.014', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2132, 'Intranasal splint', '10703015', 7439, 'An intranasal splint is intended to minimize bleeding and edema and to prevent adhesions between the septum and the nasal cavity. It is placed in the nasal cavity after surgery or trauma. The intranasal splint is constructed from plastic, silicone, or absorbent material', ',0,1600,1563,6789,2132,', 'Splint intranasal', '07.03.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2133, 'Bone particle collector', '10703016', 7438, 'A bone particle collector is a filtering device intended to be inserted into a suction tube during the early stages of otologic surgery to collect bone particles for future use', ',0,1600,1563,6789,2133,', 'Alat penyaring untuk mengumpulkan partikel tulang', '07.03.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2135, 'THT Unit/Ent Diagnostik unit/ENT Examination set/ENT treatment', '10704002', 6790, 'An ear, nose, and throat examination and treatment unit is an AC-powered device intended to support a patient during an otologic examination while providing specialized features for examination and treatment. The unit consists of a patient chair and table, drawers for equipment, suction and blowing apparatus, and receptacles for connection of specialized lights and examining instruments', ',0,1600,1564,6790,2135,', 'ENT Unit; Ear, nose, and throat examination and treatment unit', '07.04.002', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2136, 'Suction antichoke device', '30704003', 6790, 'A suction antichoke device is a device intended to be used in an emergency situation to remove, by the application of suction, foreign objects that obstruct a patient\'s airway to prevent asphyxiation to the patient', ',0,1600,1564,6790,2136,', '', '07.04.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2138, 'Powered nasal irrigator', '10704005', 7459, 'A powered nasal irrigator is an AC-powered device intended to wash the nasal cavity by means of a pressure-controlled pulsating stream of water. The device consists of a control unit and pump connected to a spray tube and nozzle', ',0,1600,1564,6790,2138,', '', '07.04.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2139, 'External nasal splint', '10704006', 6790, 'An external nasal splint is a rigid or partially rigid device intended for use externally for immobilization of parts of the nose', ',0,1600,1564,6790,2139,', '', '07.04.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2140, 'Antistammering device', '10704007', 6790, 'An antistammering device is a device that electronically generates a noise when activated or when it senses the user\'s speech and that is intended to prevent the user from hearing the sounds of his or her own voice. The device is used to minimize a user\'s involuntary hesitative or repetitive speech', ',0,1600,1564,6790,2140,', '', '07.04.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2141, 'Gingival fluid measurer', '10601001', 7128, 'perangkat pengukur dimaksudkan untuk mengukur jumlah cairan dalam sulkus gingiva (depresi antara gigi dan gusi) untuk menentukan apakah ada kondisi gingivitis', ',0,1596,1544,6782,2141,', 'Pengukur cairan gingival', '06.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2142, 'Pulp tester', '20601002', 6782, 'AC atau perangkat bertenaga baterai yang dimaksudkan untuk mengevaluasi vitalitas pulpa gigi dengan menggunakan arus frekuensi tinggi ditularkan oleh elektroda untuk merangsang jaringan saraf dalam pulpa gigi.', ',0,1596,1544,6782,2142,', 'Pulp tester; alat uji pulpa gigi', '06.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2143, 'Electrode gel for pulp testers', '20601003', 6782, 'perangkat dimaksudkan untuk diterapkan pada permukaan gigi sebelum penggunaan tester bubur untuk membantu konduksi arus listrik', ',0,1596,1544,6782,2143,', 'Gel elektroda untuk alat uji pulpa gigi', '06.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2146, 'Pesawat Sinar-X, Dental Panoramic', '20601006', 6782, '', ',0,1596,1544,6782,2146,', 'Extraoral source x-ray system', '06.01.006', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2147, 'Pesawat Sinar-X, Dental', '20601007', 6782, 'perangkat AC-powered yang menghasilkan sinar-x dan ditujukan untuk pemeriksaan radiografi gigi dan diagnosis penyakit pada gigi, rahang, dan struktur oral. Sumber sinar-x (tabung) terletak di luar mulut. Ini jenis generik perangkat dapat mencakup pasien dan peralatan dukungan dan komponen', ',0,1596,1544,6782,2147,', 'Dental rontgen; Dental radiologi; Intraoral source x-ray system; Dental X-Ray', '06.01.007', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2149, 'Cephalometer', '20601009', 6782, 'perangkat yang digunakan dalam kedokteran gigi selama prosedur x-ray. Perangkat ini dimaksudkan untuk menempatkan dan untuk menahan kepala pasien dalam posisi standar selama gigi x-ray.', ',0,1596,1544,6782,2149,', 'Chephalometri', '06.01.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2153, 'Dental x-ray film holder', '10601013', 7130, 'perangkat dimaksudkan untuk posisi dan memegang film x-ray di dalam mulut.', ',0,1596,1544,6782,2153,', 'Pemegang film sinar x gigi, x- ray film position holders', '06.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2154, 'Dental sonography device', '10601014', 7127, 'perangkat bertenaga listrik, dimaksudkan untuk digunakan untuk memantau suara sendi temporomandibular. Perangkat mendeteksi dan merekam suara yang dibuat oleh sendi temporomandibular.', ',0,1596,1544,6782,2154,', 'Dental sonography, electrosonography', '06.01.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2158, 'Mercury and alloy dispenser (Timbangan amalgam; timbangan merkuri)', '10602003', 6783, 'perangkat dengan katup pegas-diaktifkan digunakan untuk mengukur dan mengeluarkan ke dalam kapsul pencampuran sejumlah tertentu merkuri gigi dalam bentuk tetesan dan jumlah premeasured paduan pelet.', ',0,1596,1545,6783,2158,', '', '06.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2159, 'Dental amalgamator; amalgamator', '10602004', 6783, 'Peralatan yang biasanya bertenaga AC, yang digunakan untuk campuran, dengan menggoncangkan, kapsul amalgam mengandung merkuri dan partikel paduan gigi, seperti perak, timah, seng, dan tembaga. Campuran bahan amalgam gigi ditujukan untuk mengisi karies gigi.', ',0,1596,1545,6783,2159,', 'Amalgamator', '06.02.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2160, 'Dental amalgam capsule; Kapsul amalgam', '10602005', 6783, 'Paduan perak yang digunakan untuk dicampur dengan merkuri untuk membentuk amalgam gigi.', ',0,1596,1545,6783,2160,', 'Kapsul amalgam', '06.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2167, 'Dental bur (Bur carbon steel atau tungsten carbide)', '10602012', 6783, 'Peralatan rotary cutting terbuat dari baja karbon atau tungsten carbide dimaksudkan untuk memotong struktur keras di mulut, seperti gigi atau tulang. Hal ini juga dimaksudkan untuk memotong logam keras, plastik, keramik, dan bahan sejenis untuk digunakan dalam pembuatan perangkat gigi.', ',0,1596,1545,6783,2167,', 'Bur carbon steel atau tungsten carbide', '06.02.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2193, 'Endosseous dental implant', '20602038', 7176, 'Peralatan yang terbuat dari bahan seperti titanium atau titanium alloy, digunakan untuk operasi yang ditempatkan di tulang lengkungan rahang atas atau bawah untuk memberikan dukungan perangkat prostetik, seperti gigi tiruan, dalam rangka mengembalikan fungsi mengunyah pasien.', ',0,1596,1545,6783,2193,', 'Abutment Implant gigi', '06.02.038', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2230, 'Dental operating light', '10603010', 7215, 'perangkat AC bertenaga dimaksudkan untuk menerangi struktur mulut dan daerah operasi.', ',0,1596,1546,6784,2230,', 'Lampu operasi gigi', '06.03.010', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2234, 'Ultrasonic scaler', '20603014', 7212, 'perangkat dimaksudkan untuk digunakan selama pembersihan gigi dan periodontal (gusi) terapi untuk menghilangkan deposit kalkulus dari gigi dengan aplikasi ultrasonik bergetar scaler tip pada gigi.', ',0,1596,1546,6784,2234,', 'Scaler ultrasonik', '06.03.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2236, 'Dental electrosurgical unit and accessories', '20603016', 6784, 'perangkat AC bertenaga yang terdiri dari sumber daya terkontrol dan satu set pemotongan dan koagulasi elektroda. Perangkat ini ditujukan untuk memotong atau menghapus jaringan lunak atau untuk mengontrol perdarahan selama prosedur bedah dalam rongga mulut. Melewati arus listrik melalui ujung elektroda ke dalam jaringan dan, tergantung pada modus operasi dipilih, memotong melalui jaringan lunak atau menggumpal jaringan.', ',0,1596,1546,6784,2236,', 'ESU gigi dan aksesori', '06.03.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2237, 'Light Curing', '20603017', 6784, '', ',0,1596,1546,6784,2237,', '', '06.03.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2238, 'Orthodontic appliance and accessories', '10604001', 7231, 'perangkat dimaksudkan untuk digunakan dalam perawatan ortodontik. Perangkat ini ditempelkan pada gigi sehingga tekanan yang bisa diberikan pada gigi. Perangkat ini termasuk band preformed ortodontik, bahan pita ortodontik, band elastis ortodontik, braket logam ortodontik, ortodontik kawat penjepit, preformed ortodontik ruang pengelola, ortodontik ekspansi penahan sekrup, musim semi ortodontik, tabung ortodontik, dan kawat ortodontik.', ',0,1596,1547,6785,2238,', 'Kawat gigi dan aksesori', '06.04.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2242, 'Teething ring', '10604005', 7227, 'divice yang dimaksudkan untuk digunakan oleh bayi untuk tujuan medis untuk menenangkan gusi selama proses tumbuh gigi.', ',0,1596,1547,6785,2242,', 'Teether tidak berisi air', '06.04.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2261, 'Dental unit', '10605017', 6786, 'Dental unit; dental system', ',0,1596,1548,6786,2261,', 'Dental operative unit and accessories', '06.05.017', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2265, 'Boiling water sterilizer', '10605021', 7234, 'perangkat AC-powered yang terdiri dari wadah untuk merebus air. Perangkat ini dimaksudkan untuk mensterilkan instrumen gigi dan bedah dengan perendaman dalam air mendidih dalam wadah.', ',0,1596,1548,6786,2265,', 'Sterilisator air panas', '06.05.021', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2273, 'Manual algesimeter', '10401001', 6919, 'alat mekanis dimaksudkan untuk menentukan sensitivitas pasien terhadap nyeri setelah pemberian agen anestesi, misalnya, dengan menusuk dengan titik yang tajam.', ',0,1592,1529,6773,2273,', 'Algometer/algesiometer manual', '04.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2274, 'Powered algesimeter', '20401002', 6918, 'perangkat menggunakan stimulasi listrik dimaksudkan untuk menentukan sensitivitas pasien terhadap nyeri setelah pemberian agen anestesi', ',0,1592,1529,6773,2274,', 'Algometer/algesiometer elektrik', '04.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2275, 'Argon gas analyzer', '20401003', 6917, 'perangkat dimaksudkan untuk mengukur konsentrasi argon dalam campuran gas untuk membantu dalam menentukan status ventilasi pasien. Perangkat mungkin menggunakan teknik seperti spektrometri massa atau konduktivitas termal.', ',0,1592,1529,6773,2275,', 'Alat pengukur gas argon', '04.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2281, 'Carbon dioxide gas analyzer', '20401009', 6911, 'perangkat dimaksudkan untuk mengukur konsentrasi karbon dioksida dalam campuran gas untuk membantu dalam menentukan ventilasi pasien, peredaran darah, dan status metabolik. Perangkat mungkin menggunakan teknik seperti titrasi kimia, penyerapan radiasi inframerah, kromatografi gas, atau spektrometri massa.', ',0,1592,1529,6773,2281,', 'Alat pengukur gas karbon dioksida', '04.01.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2282, 'Carbon monoxide gas analyzer.', '20401010', 6910, 'perangkat dimaksudkan untuk mengukur konsentrasi karbon monoksida dalam campuran gas untuk membantu dalam menentukan status ventilasi pasien. Perangkat mungkin menggunakan teknik seperti penyerapan inframerah atau kromatografi gas.', ',0,1592,1529,6773,2282,', 'Alat pengukur gas karbon monoksida', '04.01.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2286, 'Helium gas analyzer', '20401014', 6907, 'perangkat dimaksudkan untuk mengukur konsentrasi helium dalam campuran gas selama pengujian fungsi paru. Perangkat mungkin menggunakan teknik seperti konduktivitas termal, kromatografi gas, atau spektrometri massa.', ',0,1592,1529,6773,2286,', 'Alat pengukur gas helium', '04.01.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2287, 'Neon gas analyzer', '20401015', 6906, 'perangkat dimaksudkan untuk mengukur konsentrasi neon dalam campuran gas dihembuskan oleh pasien. Perangkat mungkin menggunakan teknik seperti spektrometri massa atau konduktivitas termal.', ',0,1592,1529,6773,2287,', 'Alat pengukur gas neon', '04.01.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2288, 'Nitrogen gas analyzer', '20401016', 6905, 'perangkat dimaksudkan untuk mengukur konsentrasi nitrogen dalam gas pernapasan untuk membantu dalam menentukan status ventilasi pasien. Perangkat mungkin menggunakan teknik seperti kromatografi gas atau spektrometri massa.', ',0,1592,1529,6773,2288,', 'Alat pengukur gas nitrogen', '04.01.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2289, 'Nitrous oxide gas analyzer', '20401017', 6904, 'perangkat dimaksudkan untuk mengukur konsentrasi nitrous oksida anestesi dalam campuran gas. Perangkat mungkin menggunakan teknik seperti penyerapan inframerah atau spektrometri massa.', ',0,1592,1529,6773,2289,', 'Alat pengukur gas dinitrogen oksida', '04.01.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2290, 'Oxygen gas analyzer', '20401018', 6903, 'perangkat dimaksudkan untuk mengukur konsentrasi oksigen dalam gas pernapasan dengan teknik seperti spektrometri massa, polarografi, konduktivitas termal, atau kromatografi gas. Ini jenis generik perangkat juga mencakup analisis paramagnetik.', ',0,1592,1529,6773,2290,', 'Alat pengukur gas oksigen', '04.01.018', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2295, 'Rhinoanemometer', '20401023', 6898, 'sebuah perangkat yang digunakan untuk menghitung jumlah hidung tersumbat dengan mengukur aliran udara melalui, dan perbedaan tekanan yang melintasi, saluran hidung pasien', ',0,1592,1529,6773,2295,', 'Rhinoanemometer', '04.01.023', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2297, 'Monitoring spirometer', '20401025', 6896, 'sebuah perangkat yang digunakan untuk mengukur terus volume tidal pasien (volume gas dihirup oleh pasien selama setiap siklus respirasi) atau volume menit (volume tidal dikalikan dengan laju respirasi selama 1 menit) untuk evaluasi status ventilasi pasien.', ',0,1592,1529,6773,2297,', 'Spirometer pemantauan', '04.01.025', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2308, 'Blood Gas Analyzer ', '10401036', 6773, '', ',0,1592,1529,6773,2308,', 'Analisa Gas Darah (AGD)', '04.01.036', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2309, 'Diagnostic spirometer', '10401037', 6897, 'sebuah perangkat yang digunakan dalam pengujian fungsi paru untuk mengukur volume gas yang bergerak dalam atau keluar dari paru-paru pasien', ',0,1592,1529,6773,2309,', 'Spirometer diagnostik', '04.01.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2323, 'Pneumotachometer', '20402013', 6932, 'perangkat ditujukan untuk tujuan medis yang digunakan untuk menentukan aliran gas dengan mengukur perbedaan tekanan di sepanjang perlawanan dikenal. Perangkat mungkin menggunakan satu set kapiler atau layar logam untuk elemen resistif', ',0,1592,1530,6774,2323,', 'Pneumotachometer', '04.02.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2324, 'Airway pressure monitor', '20402014', 6931, 'perangkat yang digunakan untuk mengukur tekanan dalam saluran napas bagian atas pasien. Perangkat mungkin termasuk pengukur tekanan dan alarm', ',0,1592,1530,6774,2324,', 'Monitor tekanan udara', '04.02.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2340, 'Mesin Anestesi', '20403078', 6775, '', ',0,1592,1531,6775,2340,', '', '04.03.078', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2362, 'Oxygen Concentrator / Portable Oxygen Generator. ', '20403030', 6775, 'perangkat yang dimaksudkan untuk melepaskan oksigen untuk terapi pernapasan dengan cara baik reaksi kimia atau cara fisik (misalnya, saringan molekuler)', ',0,1592,1531,6775,2362,', 'Oksigen Konsentrator', '04.03.030', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2363, 'Respiratory gas humidifier', '20403031', 6999, 'perangkat yang dimaksudkan untuk menambah kelembaban, dan kadang-kadang untuk menghangatkan, gas pernapasan untuk administrasi kepada pasien. Cascade, gas, dipanaskan, dan humidifier prefilled termasuk dalam jenis generik perangkat.  alat untuk meningkatkan parameter klinis dan dispnea (sesak nafas) pada pengobatan pasien dengan gagal napas akut. Alat ini merupakan terapi oksigen yang berfungsi sebagai alat bantu bagi pasien yang mengalami masalah pernapasan.', ',0,1592,1531,6775,2363,', 'Humidifier gas pernapasan', '04.03.031', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2365, 'Hyperbaric chamber', '20403033', 6998, 'perangkat yang ditujukan untuk meningkatkan tekanan oksigen lingkungan untuk mempromosikan gerakan oksigen dari lingkungan untuk jaringan pasien dengan cara bertekanan yang lebih besar daripada tekanan atmosfer. Perangkat ini tidak termasuk ruang oksigen topikal untuk ekstremitas (878.5650)', ',0,1592,1531,6775,2365,', 'Ruang hiperbarik', '04.03.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2366, 'Flexible laryngoscope', '10403034', 6951, 'perangkat fiberoptik yang digunakan untuk memeriksa dan memvisualisasikan saluran napas bagian atas pasien dan penempatan bantuan tabung trakea', ',0,1592,1531,6775,2366,', 'Laringoskop fleksibel', '04.03.034', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2367, 'Rigid laryngoscope', '10403035', 6950, 'sebuah perangkat yang digunakan untuk memeriksa dan memvisualisasikan saluran napas bagian atas pasien dan penempatan bantuan tabung trakea', ',0,1592,1531,6775,2367,', 'Laringoskop kaku', '04.03.035', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2371, 'Oxygen mask', '10403039', 6994, 'perangkat ditempatkan di atas pasien hidung, mulut, atau trakeostomi untuk mengelola oksigen atau aerosol', ',0,1592,1531,6775,2371,', 'Masker oksigen', '04.03.039', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2372, 'Scavenging mask', '10403040', 6993, 'perangkat diposisikan di atas hidung pasien untuk memberikan gas anestesi atau analgesik untuk saluran udara bagian atas dan untuk membuang kelebihan dan dihembuskan gas. Hal ini biasanya digunakan selama kedokteran gigi', ',0,1592,1531,6775,2372,', 'Masker scavenging', '04.03.040', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2376, 'Nebulizer', '20403044', 6990, 'perangkat dimaksudkan untuk menyemprot cairan dalam bentuk aerosol menjadi gas yang disampaikan langsung kepada pasien untuk bernafas. Dipanaskan, ultrasonik, gas, venturi, dan isi ulang nebulizers termasuk dalam jenis generik perangkat', ',0,1592,1531,6775,2376,', '', '04.03.044', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2384, 'Electrically powered oxygen tent', '20403052', 6984, 'perangkat yang membungkus kepala pasien dan, melalui unit bertenaga listrik, mengelola menghirup oksigen dan mengontrol suhu dan kelembaban gas pernapasan. Ini jenis perangkat generik termasuk tenda aerosol pediatrik', ',0,1592,1531,6775,2384,', 'Tenda oksigen bertenaga listrik', '04.03.052', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2400, 'Anesthetic vaporizer', '20403068', 6970, 'sebuah perangkat yang digunakan untuk menguapkan anestesi cair dan memberikan sejumlah dikendalikan dari uap kepada pasien', ',0,1592,1531,6775,2400,', 'Vapor anestesi', '04.03.068', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2402, 'Noncontinuous ventilator (IPPB). ', '20403070', 6775, 'perangkat dimaksudkan untuk memberikan sebentar-sebentar aerosol ke paru-paru pasien atau untuk membantu pernapasan pasien', ',0,1592,1531,6775,2402,', 'Ventilator non-kontinu (IPPB), non invasive ventilator', '04.03.070', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2403, 'Manual emergency ventilator', '20403071', 6967, 'perangkat, biasanya menggabungkan tas dan katup, dimaksudkan untuk memberikan bantuan darurat pernapasan melalui masker wajah atau tabung dimasukkan ke dalam jalan napas pasien', ',0,1592,1531,6775,2403,', 'Ventilator darurat manual', '04.03.071', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2404, 'Powered emergency ventilator', '20403072', 6966, 'katup demand atau inhalator dimaksudkan untuk memberikan bantuan darurat pernapasan melalui masker wajah atau tabung dimasukkan ke dalam jalan napas pasien', ',0,1592,1531,6775,2404,', 'Ventilator darurat elektrik / tekanan', '04.03.072', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2405, 'External negative pressure ventilator', '20403073', 6965, 'ruang perangkat yang dimaksudkan untuk mendukung ventilasi pasien dengan bergantian menerapkan dan melepaskan tekanan negatif eksternal atas diafragma dan atas batang pasien', ',0,1592,1531,6775,2405,', 'Ventilator tekanan negatif eksternal', '04.03.073', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2407, 'Continuous positive airway pressure (CPAP)', '20403075', 6775, '', ',0,1592,1531,6775,2407,', '', '04.03.075', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2410, 'Ventilator', '10403079', 6775, 'perangkat dimaksudkan untuk mekanis mengontrol atau membantu pernapasan pasien dengan memberikan persentase yang telah ditentukan oksigen dalam gas pernapasan. Dewasa, anak, dan bayi ventilator termasuk dalam jenis generik perangkat', ',0,1592,1531,6775,2410,', 'Continuous Ventilator', '04.03.079', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2411, 'Ventilator Transport, Portabel', '10403080', 6775, '', ',0,1592,1531,6775,2411,', '', '04.03.080', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2412, 'Mesin Anestesi ventilator', '10403081', 6775, '', ',0,1592,1531,6775,2412,', '', '04.03.081', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2413, 'Resusitator Dewasa', '20403081', 6775, '', ',0,1592,1531,6775,2413,', '', '04.03.082', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2414, 'Laringoskop', '20403082', 6775, 'Dewasa', ',0,1592,1531,6775,2414,', 'Laryngoscope', '04.03.083', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2427, 'Endoscopy', '20801004', 6791, '', ',0,1593,1533,6791,2427,', 'Endoscope and accessories. ', '08.01.004', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2428, 'Urodynamic', '20801005', 6791, '', ',0,1593,1533,6791,2428,', 'Urodynamics measurement system. ', '08.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2430, 'Electrogastrography system', '20801007', 6791, 'perangkat yang digunakan untuk mengukur aktivitas myoelectrical lambung sebagai bantuan dalam diagnosis gangguan motilitas lambung. Sistem perangkat meliputi perekam eksternal, amplifier, elektroda kulit, kertas pencatat, kabel, perangkat lunak analitis, dan aksesoris lainnya', ',0,1593,1533,6791,2430,', 'Sistem elektrogastrografi', '08.01.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2438, 'Endoscopic electrosurgical unit and accessories', '20804003', 7071, 'perangkat yang digunakan untuk melakukan prosedur electrosurgical melalui endoskopi. Ini jenis generik perangkat termasuk generator electrosurgical, piring pasien, listrik tang biopsi, elektroda, fleksibel snare, electrosurgical sistem alarm, power supply unit electrosurgical, penjepit listrik, snare diri pembukaan kaku, elektroda coagulator hisap yang fleksibel, kembali gelang pasien, hubungi jelly, adapter untuk kabel untuk instrumen bedah transurethral, kabel listrik untuk instrumen bedah transurethral, dan desikator transurethral', ',0,1593,1536,6794,2438,', 'ESU endoskopi', '08.04.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2439, 'Gastroenterology-urology evacuator', '20804004', 6794, 'sebuah perangkat yang digunakan untuk menghilangkan kotoran dan cairan selama prosedur Gastroenterological dan urologi oleh drainase, aspirasi, atau irigasi. Ini jenis generik perangkat termasuk sistem fluida evacuator, manual bertenaga kandung kemih evacuator, dan pompa vakum AC bertenaga', ',0,1593,1536,6794,2439,', '', '08.04.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2440, 'Hemorrhoidal ligator', '20804005', 7068, 'sebuah perangkat yang digunakan untuk memotong aliran darah ke jaringan hemoroid dengan cara ligatur atau Band ditempatkan di sekitar wasir', ',0,1593,1536,6794,2440,', 'Ligator hemorrhoidal', '08.04.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2441, 'Electrohydraulic lithotriptor', '20804006', 7067, 'perangkat AC bertenaga digunakan untuk fragmen batu kandung kemih. Ini terdiri dari sumber tegangan tinggi dihubungkan dengan kabel ke elektroda bipolar yang dimasukkan ke dalam kandung kemih melalui cystoscope. Elektroda diadakan terhadap batu dalam kandung kemih berisi air dan diulang muatan listrik antara dua kutub elektroda menyebabkan gelombang kejut electrohydraulic yang menghancurkan batu', ',0,1593,1536,6794,2441,', 'Lithotriptor elektrohidrolik', '08.04.006', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2442, 'Mechanical lithotriptor', '20804007', 7066, 'perangkat dengan rahang baja yang dimasukkan ke dalam kandung kemih melalui uretra untuk memahami dan menghancurkan batu kandung kemih', ',0,1593,1536,6794,2442,', 'Lithotriptor mekanik', '08.04.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2446, 'Ureteral stent', '20804011', 7062, 'tabung-seperti perangkat implan yang dimasukkan ke dalam ureter untuk memberikan kekakuan ureter dan memungkinkan berjalannya urin. Perangkat mungkin memiliki jari-seperti tonjolan atau berakhir doyan untuk menjaga tabung di tempat. Hal ini digunakan dalam pengobatan luka saluran kemih dan obstruksi saluran kemih', ',0,1593,1536,6794,2446,', 'Stent ureter', '08.04.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2450, 'Urethrotome', '20804015', 7058, 'sebuah alat yang dimasukkan ke dalam uretra dan digunakan untuk memotong striktur uretra dan memperbesar uretra. Ini adalah instrumen logam dilengkapi dengan pisau pemotong punggung-sirip yang bisa diangkat dari sarungnya. Beberapa urethrotomes menggabungkan saluran optik untuk pengendalian visual', ',0,1593,1536,6794,2450,', 'Urethrotome', '08.04.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2451, 'Gastro/Urological table and accessories', '20804016', 6794, 'sebuah perangkat yang terdiri dari sebuah meja, sanggurdi, dan ikat pinggang yang digunakan untuk mendukung pasien dalam posisi yang cocok untuk prosedur endoskopi saluran kemih bagian bawah. Tabel dapat disesuaikan ke posisi manual atau elektrik', ',0,1593,1536,6794,2451,', '', '08.04.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2456, 'Urological catheter and accessories', '20805005', 7121, 'perangkat tabung fleksibel yang dimasukkan melalui uretra dan digunakan untuk melewatkan cairan ke atau dari saluran kemih. Ini jenis generik perangkat termasuk radiopak kateter urologis, kateter ureter, kateter uretra, kateter Coude, balon kateter retensi jenis, kateter lurus, kateter saluran kemih bagian atas, double lumen kateter urethrographic perempuan, kateter ureter pakai, kateter urethrographic laki-laki, dan aksesoris kateter urologis termasuk stylets ureter kateter, kateter ureter adapter, pemegang kateter ureter, stylets kateter ureter, nampan kateterisasi saluran kemih, dan nampan irigasi gastro-urologis (untuk penggunaan urologis)', ',0,1593,1537,6795,2456,', 'Kateter urologi dan aksesori', '08.05.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2458, 'Enema kit ', '10805007', 6795, 'perangkat dimaksudkan untuk menanamkan air atau cairan lainnya ke dalam usus besar melalui nozzle dimasukkan ke dalam rektum untuk mempromosikan evakuasi isi usus yang lebih rendah. Perangkat ini terdiri dari wadah untuk cairan terhubung ke nosel baik secara langsung atau melalui pipa. Perangkat ini tidak termasuk sistem irigasi kolon', ',0,1593,1537,6795,2458,', 'Kit enema', '08.05.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2465, 'Esophageal dilator', '20805014', 7112, 'sebuah perangkat yang terdiri dari silinder instrumen yang mungkin berongga dan berbobot dengan merkuri atau berat zaitun berbentuk logam yang slide pada panduan, seperti string atau kawat dan digunakan untuk melebarkan striktur esofagus. Ini jenis generik perangkat termasuk bougies esofagus atau gastrointestinal dan dilator esofagus (logam zaitun)', ',0,1593,1537,6795,2465,', 'Dilator esofagus', '08.05.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2468, 'Urethral dilator', '20805017', 7109, 'sebuah perangkat yang terdiri dari berongga atau padat instrumen ramping yang terbuat dari logam, plastik, atau bahan lain yang cocok dalam bentuk silinder dan dalam berbagai ukuran dan fleksibilitas. Perangkat mungkin termasuk mekanisme untuk memperluas porsi perangkat di uretra dan menunjukkan tingkat ekspansi pada dial. Hal ini digunakan untuk melebarkan uretra. Ini jenis generik perangkat meliputi dilator mekanik uretra, bougies urologis, logam atau plastik suara uretra, urethrometer, filiform, dan filiform pengikut', ',0,1593,1537,6795,2468,', 'Dilator uretra', '08.05.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2469, 'Blood access device and accessories.', '30805018', 7108, 'perangkat dimaksudkan untuk memberikan akses ke darah pasien untuk hemodialisis atau penggunaan kronis lainnya. Ketika digunakan dalam hemodialisis, itu adalah bagian dari sistem ginjal buatan untuk pengobatan pasien dengan gagal ginjal atau kondisi toxemic dan menyediakan akses ke darah pasien untuk hemodialisis. Perangkat ini mencakup perangkat ditanamkan darah akses, perangkat akses nonimplanted darah, dan aksesoris untuk kedua perangkat akses darah ditanamkan dan nonimplanted', ',0,1593,1537,6795,2469,', 'Pengakses darah dan aksesori', '08.05.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2473, 'Hemodialisa', '20805022', 6795, '', ',0,1593,1537,6795,2473,', 'Hemodialysis system and accessories. ', '08.05.022', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2484, 'Gastrointestinal tube and accessories', '20805033', 7093, 'sebuah perangkat yang terdiri dari pipa fleksibel atau semi-kaku digunakan untuk menanamkan cairan ke dalam, menarik cairan dari, belat, atau perdarahan menekan dari saluran pencernaan. Perangkat ini dapat menggabungkan balon tiup terpisahkan untuk retensi atau hemostasis. Ini jenis generik perangkat termasuk tas hemostatik, irigasi dan aspirasi kateter (lambung, kolon, dll), kateter dubur, steril bayi gavage set, tali pencernaan dan tabung untuk mencari perdarahan internal, tabung lumen ganda untuk dekompresi usus atau intubasi, makan tabung, tabung gastroenterostomy, Levine tabung, tabung nasogastrik, tabung lumen tunggal dengan balon berat merkuri untuk intubasi usus atau dekompresi, dan nampan irigasi gastro-urologis (untuk penggunaan gastrological).', ',0,1593,1537,6795,2484,', 'Selang gastrointestinal dan aksesori ', '08.05.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2485, 'Extracorporeal shock wave lithotripter', '20805034', 7092, 'perangkat yang berfokus gelombang kejut ultrasonik ke dalam tubuh untuk noninvasively fragmen bate urine dalam ginjal atau ureter. Komponen utama dari perangkat ini generator gelombang kejut, pembangkit tegangan tinggi, kontrol konsol, pencitraan / sistem lokalisasi, dan meja pasien. Sebelum pengobatan, batu kemih ditargetkan baik menggunakan lokalisasi integral atau berdiri sendiri / sistem pencitraan. Gelombang kejut biasanya dihasilkan dengan menggunakan elektrostatik spark discharge (spark gap), membran elektromagnetik ditolak, atau array kristal piezoelektrik, dan difokuskan ke batu dengan baik reflektor dirancang khusus, piring, atau lensa akustik. Gelombang kejut yang dibuat di bawah air dalam generator gelombang kejut, dan akan ditransfer ke tubuh pasien menggunakan antarmuka akustik yang tepat. Setelah batu telah terfragmentasi oleh gelombang kejut terfokus, fragmen keluar dari tubuh dengan urin pasien.', ',0,1593,1537,6795,2485,', 'ESWL', '08.05.034', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2486, 'MRI/Magnetic Resonance Imaging', '21501001', 6819, 'A magnetic resonance diagnostic device is intended for general diagnostic use to present images which reflect the spatial distribution and/or magnetic resonance spectra which reflect frequency and distribution of nuclei exhibiting nuclear magnetic resonance. Other physical parameters derived from the images and/or spectra may also be produced. The device includes hydrogen-1 (proton) imaging, sodium-23 imaging, hydrogen-1 spectroscopy, phosphorus-31 spectroscopy, and chemical shift imaging (preserving simultaneous frequency and spatial information)', ',0,1603,1573,6819,2486,', 'Magnetic resonance diagnostic device', '15.01.001', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2487, 'Gamma Camera/Kamera Gamma/Scintillation (gamma) camera', '11501002', 6819, 'A scintillation (gamma) camera is a device intended to image the distribution of radionuclides in the body by means of a photon radiation detector. This generic type of device may include signal analysis and display equipment, patient and equipment supports, radionuclide anatomical markers, component parts, and accessories', ',0,1603,1573,6819,2487,', 'Scintillation (gamma) camera; Gamma Camera', '15.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2488, 'Positron camera', '11501003', 9306, 'A positron camera is a device intended to image the distribution of positron-emitting radionuclides in the body. This generic type of device may include signal analysis and display equipment, patient and equipment supports, radionuclide anatomical markers, component parts, and accessories', ',0,1603,1573,6819,2488,', 'Kamera positron', '15.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2490, 'Bone densitometer', '21501005', 9381, 'A bone densitometer is a device intended for medical purposes to measure bone density and mineral content by x-ray or gamma ray transmission measurements through the bone and adjacent tissues. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2490,', 'Densitometer tulang', '15.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2491, 'Bone sonometer', '21501006', 9333, 'A bone sonometer is a device that transmits ultrasound energy into the human body to measure acoustic properties of bone that indicate overall bone health and fracture risk. The primary components of the device are a voltage generator, a transmitting transducer, a receiving transducer, and hardware and software for reception and processing of the received ultrasonic signal', ',0,1603,1573,6819,2491,', 'Sonometer tulang', '15.01.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2495, 'Nuclear tomography system', '21501010', 9378, 'A nuclear tomography system is a device intended to detect nuclear radiation in the body and produce images of a specific cross-sectional plane of the body by blurring or eliminating detail from other planes. This generic type of devices may include signal analysis and display equipment, patient and equipment supports, radionuclide anatomical markers, component parts, and accessories', ',0,1603,1573,6819,2495,', 'Tomografi nuklir', '15.01.010', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2507, 'Ultrasonic pulsed doppler imaging system', '21501022', 9371, 'An ultrasonic pulsed doppler imaging system is a device that combines the features of continuous wave doppler-effect technology with pulsed-echo effect technology and is intended to determine stationary body tissue characteristics, such as depth or location of tissue interfaces or dynamic tissue characteristics such as velocity of blood or tissue motion. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2507,', 'Ultrasonograph (USG)', '15.01.022', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2509, 'Diagnostic ultrasonic transducer', '21501024', 9369, 'A diagnostic ultrasonic transducer is a device made of a piezoelectric material that converts electrical signals into acoustic signals and acoustic signals into electrical signals and intended for use in diagnostic ultrasonic medical devices. Accessories of this generic type of device may include transmission media for acoustically coupling the transducer to the body surface, such as acoustic gel, paste, or a flexible fluid container', ',0,1603,1573,6819,2509,', 'Transduser / probe (USG, pembuluh darah, jaringan)', '15.01.024', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2510, 'Angiographic x-ray system', '21501025', 9368, 'An angiographic x-ray system is a device intended for radiologic visualization of the heart, blood vessels, or lymphatic system during or after injection of a contrast medium. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2510,', 'Angiografi; Cathlab', '15.01.025', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2518, 'Pesawat Sinar-X, Stationer,Fixed Table x-ray system, general x-ray,Pesawat Rontgen', '21501033', 6819, 'A stationary x-ray system is a permanently installed diagnostic system intended to generate and control x-rays for examination of various anatomical regions. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2518,', 'Pesawat Rontgen Fixed; Fixed Table x-ray system ; General X-Ray;', '15.01.033', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2520, 'Pesawat Sinar-X, Mammografi', '21501035', 6819, 'A mammographic x-ray system is a device intended to be used to produce radiographs of the breast. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2520,', 'Pesawat Mammografi', '15.01.035', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2522, 'Pesawat Sinar-X, Mobile', '21501037', 6819, 'A mobile x-ray system is a transportable device system intended to be used to generate and control x-ray for diagnostic procedures. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2522,', '', '15.01.037', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2523, 'Pesawat Sinar-X, Fluoroscopy', '21501038', 6819, 'A photofluorographic x-ray system is a device that includes a fluoroscopic x-ray unit and a camera intended to be used to produce, then photograph, a fluoroscopic image of the body. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2523,', 'Photofluorographic x-ray system', '15.01.038', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2524, 'Pesawat Sinar-X, Tomografi', '21501039', 6819, 'A tomographic x-ray system is an x-ray device intended to be used to produce radiologic images of a specific cross-sectional plane of the body by blurring or eliminating detail from other planes. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2524,', 'Tomographic x-ray system', '15.01.039', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2525, 'CT-Scan ', '21501040', 6819, 'A computed tomography x-ray system is a diagnostic x-ray system intended to produce cross-sectional images of the body by computer reconstruction of x-ray transmission data from the same axial plane taken at different angles. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,2525,', 'Computed tomography x-ray system', '15.01.040', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2530, 'Radiographic film', '11501045', 9352, 'Radiographic film is a device that consists of a thin sheet of radiotransparent material coated on one or both sides with a photographic emulsion intended to record images during diagnostic radiologic procedures', ',0,1603,1573,6819,2530,', 'Film radiografi', '15.01.045', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2531, 'Radiographic film cassette', '21501046', 9351, 'A radiographic film cassette is a device intended for use during diagnostic x-ray procedures to hold a radiographic film in close contact with an x-ray intensifying screen and to provide a light-proof enclosure for direct exposure of radiographic film', ',0,1603,1573,6819,2531,', 'Kaset radiografi', '15.01.046', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2535, 'X-Ray Film Viewer', '11501050', 6819, 'A radiographic film illuminator is a device containing a visible light source covered with a translucent front that is intended to be used to view medical radiographs', ',0,1603,1573,6819,2535,', 'Radiographic film illuminator; Film Viewer', '15.01.050', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2536, ' Automatic film processor', '21501051', 6819, 'An automatic radiographic film processor is a device intended to be used to develop, fix, wash, and dry automatically and continuously film exposed for medical purposes', ',0,1603,1573,6819,2536,', '', '15.01.051', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2543, 'Radiologic table', '21501058', 9340, 'A radiologic table is a device intended for medical purposes to support a patient during radiologic procedures. The table may be fixed or tilting and may be electrically powered', ',0,1603,1573,6819,2543,', '', '15.01.058', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2550, 'Pesawat Sinar-X, C-Arm', '21501065', 6819, '', ',0,1603,1573,6819,2550,', '', '15.01.065', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2551, 'Medical linear accelerator ', '21502001', 9331, 'A medical charged-particle radiation therapy system is a device that produces by acceleration high energy charged particles (e.g., electrons and protons) intended for use in radiation therapy. This generic type of device may include signal analysis and display equipment, patient and equipment supports, treatment planning computer programs, component parts, and accessories', ',0,1603,1574,6820,2551,', 'LINAC (Linear Accelerator)', '15.02.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2556, 'Radionuclide brachytherapy source', '21502006', 9182, 'A radionuclide brachytherapy source is a device that consists of a radionuclide which may be enclosed in a sealed container made of gold, titanium, stainless steel, or platinum and intended for medical purposes to be placed onto a body surface or into a body cavity or tissue as a source of nuclear radiation for therapy', ',0,1603,1574,6820,2556,', 'Sumber radionuklida untuk brakhiterapi', '15.02.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2557, 'Radionuclide teletherapy source', '11502007', 9173, 'A radionuclide teletherapy source is a device consisting of a radionuclide enclosed in a sealed container. The device is intended for radiation therapy, with the radiation source located at a distance from the patient\'s body', ',0,1603,1574,6820,2557,', 'Sumber teleterapi radionuklida', '15.02.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2558, 'Radionuclide radiation therapy system', '21502008', 9181, 'A radionuclide radiation therapy system is a device intended to permit an operator to administer gamma radiation therapy, with the radiation source located at a distance from the patient\'s body. This generic type of device may include signal analysis and display equipment, patient and equipment supports, treatment planning computer programs, component parts (including beam-limiting devices), and accessories', ',0,1603,1574,6820,2558,', 'Radioterapi radionuklida', '15.02.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2561, 'Pesawat Sinar-X, Simulator', '21502011', 6820, 'A radiation therapy simulation system is a fluoroscopic or radiographic x-ray system intended for use in localizing the volume to be exposed during radiation therapy and confirming the position and size of the therapeutic irradiation field produced. This generic type of device may include signal analysis and display equipment, patient and equipment supports, treatment planning computer programs, component parts, and accessories', ',0,1603,1574,6820,2561,', 'Radiation therapy simulation system', '15.02.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2562, 'X-ray radiation therapy system/Radiation therapy simulation system', '21502012', 6820, 'An x-ray radiation therapy system is a device intended to produce and control x-rays used for radiation therapy. This generic type of device may include signal analysis and display equipment, patient and equipment supports, treatment planning computer programs, component parts, and accessories', ',0,1603,1574,6820,2562,', '', '15.02.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2564, 'Cobal Unit', '21502014', 6820, '', ',0,1603,1574,6820,2564,', '', '15.02.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2565, 'Personnel protective shield', '11503001', 9519, 'Apron/A personnel protective shield is a device intended for medical purposes to protect the patient, the operator, or other persons from unnecessary exposure to radiation during radiologic procedures by providing an attenuating barrier to radiation. This generic type of device may include articles of clothing, furniture, and movable or stationary structures', ',0,1603,1575,6821,2565,', 'Apron, clothing, furnitur, dan alat pelindung radiasi baik statis maupun dinamis', '15.03.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2566, 'Viscometer for cervical mucus', '11101001', 9056, '', ',0,1597,1549,6802,2566,', 'Viskometer untuk lendir seviks', '11.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2567, 'Endocervical aspirator', '21101002', 9077, 'aspirator endoserviks adalah alat yang didesain untuk menghapus jaringan dari endoserviks (selaput lendir yang melapisi kanal serviks uterus) dengan pengisapan dengan jarum suntik, bulb dan pipet, atau kateter. Perangkat ini digunakan untuk mengevaluasi jaringan endoserviks untuk mendeteksi lesi ganas dan pra-ganas.', ',0,1597,1549,6802,2567,', 'Aspirator endoserviks', '11.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2568, 'Endometrial aspirator', '21101003', 9076, '', ',0,1597,1549,6802,2568,', 'Aspirator endometrium', '11.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2573, 'Perineometer', '21101008', 9071, 'Perineometer adalah perangkat yang terdiri dari karung berisi cairan untuk digunakan intravaginal yang dilampirkan ke manometer eksternal. Perangkat mengukur kekuatan otot-otot perineum dengan menawarkan resistensi kontraksi otot-otot ini pasien sukarela dan digunakan untuk mendiagnosa dan memperbaiki, melalui latihan, inkontinensia uninary atau disfungsi seksual', ',0,1597,1549,6802,2573,', 'Perineometer', '11.01.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2577, 'Colposcope', '21101012', 9067, 'Colposcope adalah perangkat yang dirancang untuk memungkinkan melihat langsung jaringan dari vagina dan leher rahim oleh sistem teleskopik terletak di luar vagina. Hal ini digunakan untuk mendiagnosa kelainan dan pilih area untuk biopsi. Ini jenis generik perangkat mungkin termasuk sumber cahaya, kabel, dan komponen.', ',0,1597,1549,6802,2577,', 'Colposcope', '11.01.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2578, 'Culdoscope and accessories', '21101013', 9066, 'Culdoscope adalah perangkat yang dirancang untuk memungkinkan melihat langsung organ di dalam peritoneum oleh sistem teleskopik diperkenalkan ke dalam rongga panggul melalui vagina posterior forniks. Hal ini digunakan untuk melakukan prosedur diagnostik dan bedah alat kelamin perempuan. Ini jenis generik perangkat mungkin termasuk trocar dan kanula, instrumen yang digunakan melalui saluran operasi, preheaters lingkup, sumber cahaya dan kabel, dan komponen', ',0,1597,1549,6802,2578,', 'Culdoscope dan aksesori', '11.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2582, 'Gynecologic laparoscope and accessories.', '21101017', 9062, 'Sebuah laparoskopi ginekologi adalah alat yang digunakan untuk memungkinkan melihat langsung organ di dalam peritoneum oleh sistem teleskopik diperkenalkan melalui dinding perut. Hal ini digunakan untuk melakukan prosedur diagnostik dan bedah alat kelamin perempuan. Ini jenis generik perangkat mungkin termasuk: Trocar dan kanula, instrumen yang digunakan melalui saluran operasi, ruang lingkup preheater, sumber cahaya dan kabel, dan komponen', ',0,1597,1549,6802,2582,', 'Laparoskop ginekologi dan aksesori', '11.01.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2585, 'Obstetric-gynecologic ultrasonic imager', '21102002', 6803, 'Alat untuk menampilkan gambar obstetri dan ginekologi', ',0,1597,1550,6803,2585,', 'Alat untuk menampilkan gambar obstetri dan ginekologi', '11.02.002', 1, 1, 350, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2586, 'Fetal cardiac monitor.', '31102003', 9494, 'Sebuah monitor jantung janin adalah perangkat yang digunakan untuk aktivitas jantung janin memastikan selama kehamilan dan persalinan. Perangkat ini dirancang untuk memisahkan sinyal jantung janin dari sinyal jantung ibu dengan menganalisis sinyal elektrokardiografi (potensi listrik yang dihasilkan selama kontraksi dan relaksasi otot jantung) yang diperoleh dari perut ibu dengan elektroda eksternal. Ini jenis generik perangkat mungkin termasuk alarm yang sinyal ketika denyut jantung melintasi ambang preset. Ini jenis generik perangkat termasuk \"cardiotachometer janin (dengan sensor)\" dan \"monitor EKG janin', ',0,1597,1550,6803,2586,', 'Monitor jantung janin', '11.02.003', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2587, 'Fetal electroencephalographic monitor', '31102004', 9493, 'Sebuah monitor elektroensefalografik janin adalah alat yang digunakan untuk mendeteksi, mengukur, dan merekam dalam bentuk grafik (dengan cara satu atau lebih elektroda ditempatkan pada kulit kepala transcervically janin selama persalinan) potensi kulit listrik berirama bervariasi diproduksi oleh otak janin', ',0,1597,1550,6803,2587,', 'Monitor elektroensefalografi janin', '11.02.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2588, 'Fetal phonocardiographic monitor and accessories', '21102005', 9492, 'Sebuah monitor phonocardiographic janin adalah perangkat yang dirancang untuk mendeteksi, mengukur, dan merekam jantung janin terdengar elektronik, dalam bentuk grafik, dan noninvasively, dengan kondisi janin memastikan selama persalinan. Ini jenis generik perangkat termasuk aksesoris berikut: analisis sinyal dan peralatan display, pasien dan dukungan peralatan, dan komponen lainnya', ',0,1597,1550,6803,2588,', 'Monitor fonokardiografi janin dan aksesori', '11.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2589, 'Fetal ultrasonic monitor and accessories', '21102006', 9491, 'Sebuah monitor phonocardiographic janin adalah perangkat yang dirancang untuk mendeteksi, mengukur, dan merekam jantung janin terdengar elektronik, dalam bentuk grafik, dan noninvasively, dengan kondisi janin memastikan selama persalinan. Ini jenis generik perangkat termasuk aksesoris berikut: analisis sinyal dan peralatan display, pasien dan dukungan peralatan, dan komponen lainnya', ',0,1597,1550,6803,2589,', 'Fetal Doppler / Monitor ultrasonik janin dan aksesori / Doppler', '11.02.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2595, 'Obstetric ultrasonic transducer and accessories', '21102015', 9482, 'Sebuah kebidanan transduser ultrasonik merupakan alat yang digunakan untuk mengaplikasikan energi ultrasonik untuk, dan menerima energi ultrasonik dari, tubuh dalam hubungannya dengan monitor obstetrik atau Imager. Perangkat mengubah sinyal listrik menjadi energi ultrasonik, dan sebaliknya, dengan cara perakitan yang berbeda dari generator ultrasonik', ',0,1597,1550,6803,2595,', 'Transduser ultrasonik obstetri dan aksesori', '11.02.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2596, 'Telethermographic system', '11102016', 6803, 'Sebuah sistem telethermographic untuk skrining diagnostik tambahan untuk deteksi kanker payudara atau penggunaan lainnya adalah perangkat bertenaga listrik dengan detektor yang dimaksudkan untuk mengukur, tanpa menyentuh kulit pasien, radiasi inframerah diri berasal yang mengungkapkan variasi suhu permukaan tubuh.', ',0,1597,1550,6803,2596,', 'Sistem teletermografi', '11.02.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2597, ' Liquid crystal thermographic system', '11102017', 6803, 'Sebuah nonelectrically didukung atau sistem kristal cair AC bertenaga thermographic dimaksudkan untuk digunakan sebagai tambahan untuk palpasi fisik atau mamografi dalam screening diagnostik untuk deteksi kanker payudara atau penggunaan lainnya adalah nonelectrically didukung atau perangkat AC bertenaga diterapkan pada kulit yang menampilkan pola warna panas kristal cair sensitif cholesteric yang merespon variasi suhu permukaan tubuh.', ',0,1597,1550,6803,2597,', 'Sistem termografi liquid crystal ', '11.02.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2601, 'Fallopian tube prosthesis', '21103003', 9079, 'Sebuah tuba fallopi prosthesis adalah perangkat yang dirancang untuk mempertahankan patensi (keterbukaan) dari tuba fallopi dan digunakan setelah operasi rekonstruksi', ',0,1597,1551,6804,2601,', 'Prostesis tuba fallopi', '11.03.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2602, 'Vaginal stent', '21103004', 9078, 'Sebuah stent vagina adalah alat yang digunakan untuk memperbesar vagina dengan peregangan, atau untuk mendukung vagina dan untuk mengadakan cangkok kulit setelah operasi rekonstruksi', ',0,1597,1551,6804,2602,', 'Stent vagina', '11.03.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2603, 'Endoscopic electrocautery and accessories', '21104001', 9518, 'Sebuah elektrokauter endoskopik adalah alat yang digunakan untuk melakukan sterilisasi wanita di bawah pengamatan endoskopi. Hal ini dirancang untuk membekukan jaringan tuba fallopi dengan probe dipanaskan oleh energi tegangan rendah', ',0,1597,1552,6805,2603,', 'Alat pemotong endoskopi elektrik dan aksesori', '11.04.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2604, 'Gynecologic electrocautery and accessories', '21104002', 9517, 'Sebuah elektrokauter ginekologi merupakan perangkat yang dirancang untuk menghancurkan jaringan dengan suhu tinggi dengan kontak jaringan dengan probe yang dipanaskan dengan listrik. Hal ini digunakan untuk lesi serviks cukai, melakukan biopsi, atau mengobati servisitis kronis di bawah pengamatan visual langsung', ',0,1597,1552,6805,2604,', 'Alat pemotong ginekologi elektrik dan aksesori', '11.04.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2605, 'Bipolar endoscopic coagulator-cutter and accessories', '21104003', 9516, 'Sebuah bipolar endoskopik coagulator-cutter adalah alat yang digunakan untuk melakukan sterilisasi wanita dan prosedur operasi lainnya di bawah pengawasan endoskopik. Ini menghancurkan jaringan dengan suhu tinggi dengan mengarahkan arus listrik frekuensi tinggi melalui jaringan antara dua kontak listrik probe', ',0,1597,1552,6805,2605,', 'Pemotong dan koagulator endoskopi bipolar dan aksesori', '11.04.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2606, 'Unipolar endoscopic coagulator- cutter and accessories', '21104004', 9515, 'Sebuah unipolar endoskopi coagulator-cutter adalah perangkat yang dirancang untuk menghancurkan jaringan dengan suhu tinggi dengan mengarahkan arus listrik frekuensi tinggi melalui jaringan antara probe berenergi dan piring landasan. Hal ini digunakan dalam sterilisasi wanita dan prosedur operasi lainnya di bawah pengawasan endoskopik', ',0,1597,1552,6805,2606,', 'Pemotong dan koagulator endoskopi unipolar dan aksesori', '11.04.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2607, 'Spekulum Vagina/Cocor bebek', '31104005', 6805, 'Sebuah dilator serviks diupgrade adalah instrumen dengan dua pegangan dan dua bilah berlawanan digunakan secara manual untuk melebarkan (meregangkan terbuka) os serviks', ',0,1597,1552,6805,2607,', 'Cocor bebek, Expandable cervical dilator', '11.04.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2610, 'Fetal vacuum extractor', '21104008', 9513, 'Sebuah janin vacuum extractor adalah alat yang digunakan untuk memfasilitasi pengiriman. Perangkat ini memungkinkan traksi untuk diterapkan pada kepala janin (di jalan lahir) dengan cara secangkir hisap melekat pada kulit kepala dan didukung oleh sumber vakum eksternal', ',0,1597,1552,6805,2610,', 'Ekstraktor vakum janin', '11.04.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2611, 'Obstetric forceps', '21104009', 9512, 'Sebuah kebidanan forceps adalah perangkat yang terdiri dari dua bilah, dengan gagang, dirancang untuk memahami dan menerapkan traksi ke kepala janin dalam jalan lahir dan memfasilitasi pengiriman.', ',0,1597,1552,6805,2611,', 'Forcep obstetri', '11.04.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2615, 'Gynecologic surgical laser', '21104013', 9508, 'Sebuah laser bedah ginekologi adalah gelombang laser yang terus menerus karbon dioksida yang dirancang untuk menghancurkan jaringan termal atau menghapus jaringan dengan energi cahaya berseri-seri. Perangkat ini digunakan hanya dalam hubungannya dengan colposcope sebagai bagian dari sistem operasi ginekologi. Colposcope adalah sebuah sistem lensa pembesar yang digunakan untuk memeriksa vagina dan leher rahim', ',0,1597,1552,6805,2615,', 'Laser bedah ginekologi', '11.04.013', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2616, 'Obstetric table and accessories', '21104014', 9507, '', ',0,1597,1552,6805,2616,', 'Meja obstetri dan aksesori', '11.04.014', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2617, 'Gynecological Bed, Electric', '21104015', 6805, '', ',0,1597,1552,6805,2617,', '', '11.04.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2656, '[delete]Anomaloscope', '11201003', 1569, 'Alat untuk menguji anomali penglihatan warna dengan menampilkan garis spektrum campuran untuk dicocokkan pada pasien.', ',0,1602,1569,2656,', '', '12.01.003', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2658, '[delete]Opthalmic camera', '21201005', 1569, 'Alat untuk mengambil foto dari mata dan daerah sekitarnya.', ',0,1602,1569,2658,', '', '12.01.005', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2667, '[delete]Exophthalmometer', '11201014', 1569, 'Alat seperti penggaris, pengukur atau caliper yang digunakan untuk mengukur tingkat exophthalmos (penonjolan abnormal bola mata).', ',0,1602,1569,2667,', '', '12.01.014', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2679, '[delete]Diagnostic Hruby fundus lens', '11201026', 1569, 'Alat yang merupakan lensa diopter 55 yang digunakan untuk pemeriksaan vitreous dan fundus mata di bawah pencahayaan dan pembesaran slitlamp.', ',0,1602,1569,2679,', '', '12.01.026', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2681, '[delete]Ophthalmic trial lens set', '11201028', 1569, 'Alat yang terdiri dari satu set lensa berbagai kekuatan dioptric yang digenggam atau dimasukkan dalam bingkai percobaan untuk pengujian penglihatan guna menentukan pembiasan.', ',0,1602,1569,2681,', '', '12.01.028', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2682, '[delete]Ophthalmic trial lens clip', '11201029', 1569, 'Alat yang digunakan untuk menahan prisma, bola, silinder, atau occluders pada bingkai percobaan atau kacamata untuk pengujian penglihatan.', ',0,1602,1569,2682,', '', '12.01.029', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2683, '[delete]Ophthalmic trial lens frame', '11201030', 1569, 'Alat yang digunakan untuk menahan lensa percobaan untuk pengujian penglihatan.', ',0,1602,1569,2683,', '', '12.01.030', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2685, '[delete]Lens measuring instrument', '11201032', 1569, 'Alat yang digunakan untuk mengukur kekuatan lensa, prisma, dan pusat-pusatnya (misalnya, lensometer).', ',0,1602,1569,2685,', '', '12.01.032', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2690, '[delete]Headband mirror', '11201037', 1569, 'Alat yang diikatkan ke kepala pengguna untuk memantulkan cahaya yang digunakan dalam pemeriksaan mata.', ',0,1602,1569,2690,', '', '12.01.037', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2692, '[delete]Ophthalmoscope', '21201039', 1569, 'Alat yang berfungsi untuk menguji kesehatan pada mata (kornea, aqueous, lensa, dan vitreous) dan retina mata.', ',0,1602,1569,2692,', '', '12.01.039', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2693, '[delete]Perimeter', '11201040', 1569, 'Alat yang digunakan untuk menentukan sejauh mana bidang visual perifer pasien.', ',0,1602,1569,2693,', '', '12.01.040', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2695, '[delete]Ophthalmic preamplifier', '21201042', 1569, 'Alat yang digunakan untuk memperkuat sinyal listrik dari mata pada elektroretinografi (merekam arus aksi retina dari permukaan bola mata setelah stimulasi oleh cahaya), electrooculography (pengujian untuk disfungsi retina dengan membandingkan potensi berdiri di depan dan bagian belakang bola mata), dan elektromiografi (merekam arus listrik yang dihasilkan dalam otot aktif).', ',0,1602,1569,2695,', '', '12.01.042', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2701, '[delete]Ophthalmic projector', '11201048', 1569, 'Alat yang digunakan untuk memproyeksikan gambar pada layar untuk pengujian penglihatan.', ',0,1602,1569,2701,', '', '12.01.048', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2703, '[delete]Pupillometer', '11201050', 1569, 'Alat yang digunakan untuk mengukur cahaya yang dipantulkan oleh lebar atau diameter pupil mata.', ',0,1602,1569,2703,', '', '12.01.050', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2705, '[delete]Ophthalmic refractometer', '11201052', 1569, 'Alat yang terdiri dari sistem fiksasi, pengukuran dan sistem pencatatan, serta sistem alignment yang digunakan untuk mengukur kekuatan bias mata dengan mengukur refleks cahaya dari retina.', ',0,1602,1569,2705,', '', '12.01.052', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2706, '[delete]Manual refractor', '11201053', 1569, 'Alat yang terdiri dari satu set lensa dengan variasi kekuatan dioptri yang digunakan untuk mengukur kesalahan bias mata.', ',0,1602,1569,2706,', '', '12.01.053', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2707, '[delete]Retinoscope', '21201054', 1569, 'Alat yang digunakan untuk mengukur refraksi mata dengan menerangi retina dan mencatat arah gerakan cahaya pada permukaan retina dan pembiasan oleh mata dari cahaya tiba-tiba.', ',0,1602,1569,2707,', '', '12.01.054', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2712, '[delete]AC-powered slitlamp biomicroscope', '21201059', 1569, 'perangkat AC-powered yang merupakan mikroskop dimaksudkan untuk digunakan dalam pemeriksaan mata bahwa proyek-proyek ke mata pasien melalui diafragma kontrol, balok intens cahaya tipis.', ',0,1602,1569,2712,', '', '12.01.059', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2718, '[delete]Tonometer', '21201065', 1569, '', ',0,1602,1569,2718,', 'Tonometer and accessories', '12.01.065', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2720, '[delete]Transilluminator', '11201067', 1569, 'sumber cahaya dimaksudkan untuk mengirimkan cahaya melalui jaringan untuk membantu pemeriksaan pasien.', ',0,1602,1569,2720,', '', '12.01.067', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2721, 'Ophthalmic tantalum clip', '21202001', 8969, 'perangkat lunak metalik dimaksudkan untuk ditanamkan secara permanen atau sementara untuk menyatukan tepi luka untuk membantu penyembuhan atau mencegah perdarahan dari pembuluh darah kecil di mata.', ',0,1602,1570,6809,2721,', 'Alat penjepit pembuluh darah kecil di mata ', '12.02.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2723, 'Artificial eye', '11202003', 8967, 'perangkat menyerupai bagian anterior mata, biasanya terbuat dari kaca atau plastik, dimaksudkan untuk dimasukkan ke dalam mata anterior soket pasien untuk implan orbital, atau bola mata dosis uji, untuk tujuan kosmetik. Perangkat ini tidak dimaksudkan untuk ditanamkan.', ',0,1602,1570,6809,2723,', 'Mata artifisial', '12.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2742, 'Operating headlamp', '11203012', 9288, 'perangkat AC bertenaga atau bertenaga baterai dimaksudkan untuk dikenakan di kepala pengguna untuk menyediakan sumber cahaya untuk membantu visualisasi selama, prosedur diagnostik, atau terapi bedah.', ',0,1602,1571,6810,2742,', 'Headlamp', '12.03.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2743, 'Manual ophthalmic surgical instrument', '11203013', 9287, 'yang tanpa catu daya, perangkat genggam dimaksudkan untuk membantu atau melakukan prosedur bedah mata. Ini jenis generik perangkat termasuk kornea duri manual, mata caliper, mata cannula, kelopak mata klem, klem otot mata, iris klip retractor, orbital kompresor, mata kuret, cystotome, orbital depressor, dilator air mata, erisophake, expressor, mata forcep, mata hook, bola introducer, pisau mata, jarum penjahitan mata, air mata penyelidikan, trabeculotomy penyelidikan, kornea-sklera pukulan, mata retractor, mata cincin (Flieringa), air mata kantung rongeur, gunting mata, enucleating snare, mata spatula, mata spekulasi, mata sendok , mata kentang, trabeculotome atau mata pengguna trephine.', ',0,1602,1571,6810,2743,', 'Instrumen bedah mata manual', '12.03.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2744, 'Ocular surgery irrigation device', '11203014', 6810, 'perangkat dimaksudkan untuk menggantung di atas area mata selama operasi mata untuk memberikan berkelanjutan, irigasi terkontrol untuk bidang bedah.', ',0,1602,1571,6810,2744,', 'Perangkat irigasi operasi mata', '12.03.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2745, 'Keratome', '11203015', 9286, 'perangkat AC bertenaga atau bertenaga baterai dimaksudkan untuk mencukur jaringan dari bagian kornea untuk pipih (ketebalan parsial) transplantasi', ',0,1602,1571,6810,2745,', 'Keratome', '12.03.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2746, 'Ophthalmic laser', '21203016', 9285, 'perangkat AC bertenaga dimaksudkan untuk membekukan atau memotong jaringan mata, orbit, atau kulit di sekitarnya oleh sinar laser', ',0,1602,1571,6810,2746,', 'Laser oftalmik', '12.03.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2747, 'Nd:YAG laser for posterior capsulotomy and peripheral iridotomy', '21203017', 9284, 'Nd: YAG laser untuk capsulotomy posterior dan iridotomy perifer terdiri dari mode terkunci atau Q-switched solid state Nd: YAG laser ditujukan untuk gangguan dari kapsul posterior atau iris melalui kerusakan optik. Nd: YAG laser menghasilkan pulsa pendek, energi rendah, daya tinggi, radiasi optik koheren. Ketika output laser dikombinasikan dengan fokus optik, radiasi tinggi pada target menyebabkan gangguan jaringan melalui kerusakan optik. Sebuah sistem bertujuan terlihat digunakan untuk menargetkan Nd tak terlihat: YAG laser radiasi pada atau di dekat jaringan target', ',0,1602,1571,6810,2747,', 'Laser Nd:YAG ', '12.03.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2748, 'Electronic metal locator', '21203018', 9283, 'perangkat AC bertenaga dengan probe dimaksudkan untuk menemukan benda asing logam dalam mata atau rongga mata', ',0,1602,1571,6810,2748,', 'Locator logam elektrik ', '12.03.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2749, 'AC-powered magnet', '21203019', 9282, 'perangkat AC-powered yang menghasilkan medan magnet dimaksudkan untuk menemukan dan menghapus benda asing logam dari jaringan mata.', ',0,1602,1571,6810,2749,', 'Magnet elektrik ', '12.03.019', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2750, 'Permanent magnet', '11203020', 9281, 'perangkat nonelectric yang menghasilkan medan magnet dimaksudkan untuk menemukan dan menghapus benda asing logam dari jaringan mata', ',0,1602,1571,6810,2750,', 'Magnet nonelektrik', '12.03.020', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2751, 'Ophthalmic surgical marker', '11203021', 9280, 'perangkat dimaksudkan untuk menandai dengan menggunakan tinta, pewarna, atau lekukan lokasi okular atau manipulasi bedah scleral', ',0,1602,1571,6810,2751,', 'Alat penanda bedah mata', '12.03.021', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2752, 'Ocular pressure applicator', '21203022', 9279, 'perangkat manual yang terdiri dari sphygmomanometer-jenis meremas bola, indikator panggilan, band, dan bellow, dimaksudkan untuk menerapkan tekanan pada mata dalam persiapan untuk operasi mata', ',0,1602,1571,6810,2752,', 'Aplikator tekanan mata', '12.03.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2753, 'Phacofragmentation system', '21203023', 9278, 'perangkat AC bertenaga dengan jarum memecah-belah dimaksudkan untuk digunakan dalam operasi katarak mengganggu katarak dengan USG dan ekstrak katarak.', ',0,1602,1571,6810,2753,', 'Sistem fakofragmentasi/phacofragmentation', '12.03.023', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2754, 'Ophthalmic photocoagulator', '21203024', 9277, 'perangkat AC bertenaga dimaksudkan untuk menggunakan energi dari sumber cahaya koheren diperpanjang untuk menutup jalan pembuluh darah retina, koroid, atau iris.', ',0,1602,1571,6810,2754,', 'Fotokoagulator oftalmik', '12.03.024', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2755, 'Ophthalmic eye shield', '11203025', 9276, 'sebuah perangkat yang terdiri dari plastik atau aluminium penutup mata dimaksudkan untuk melindungi mata atau mempertahankan bahan berpakaian di tempat', ',0,1602,1571,6810,2755,', 'Alat pelindung mata ', '12.03.025', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2756, 'Ophthalmic operating spectacles (loupes)', '11203026', 9275, 'Kedokteran kacamata operasi (loupes) adalah perangkat yang terdiri dari lensa cembung atau sistem lensa dimaksudkan untuk dikenakan oleh seorang ahli bedah untuk memperbesar situs bedah selama operasi mata', ',0,1602,1571,6810,2756,', 'Kacamata operasi oftalmik (loupes)', '12.03.026', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2757, 'Ophthalmic sponge', '21203027', 9274, 'sebuah perangkat yang merupakan serapan spons, pad, atau tombak yang terbuat dari kain kasa dilipat, kapas, selulosa, atau bahan lain yang dimaksudkan untuk menyerap cairan dari lapangan operasi dalam operasi mata.', ',0,1602,1571,6810,2757,', 'Ophthalmic sponge', '12.03.027', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2758, 'Ophthalmic instrument table', '11203028', 9273, 'perangkat AC bertenaga atau manual di mana instrumen ophthalmic dimaksudkan untuk ditempatkan', ',0,1602,1571,6810,2758,', 'Meja instrumen oftalmik', '12.03.028', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2759, 'Ophthalmic beta radiation source', '21204001', 9132, 'perangkat dimaksudkan untuk menerapkan radiasi dangkal jinak dan ganas pertumbuhan okular', ',0,1602,1572,6811,2759,', '', '12.04.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2763, 'Low-vision magnifier', '11204005', 9129, 'sebuah perangkat yang terdiri dari lensa pembesar dimaksudkan untuk digunakan oleh pasien yang telah gangguan penglihatan. Perangkat mungkin akan diselenggarakan di tangan atau melekat pada kacamata.', ',0,1602,1572,6811,2763,', 'Lensa pembesar', '12.04.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2764, 'Ptosis crutch', '11204006', 9128, 'perangkat dimaksudkan untuk dipasang pada kacamata seorang pasien yang memiliki ptosis (melorot dari kelopak mata atas sebagai hasil dari pembangunan yang rusak atau kelumpuhan) untuk menahan kelopak mata bagian atas terbuka', ',0,1602,1572,6811,2764,', 'Alat penahan kelopak mata ptosis', '12.04.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2765, 'Ophthalmic bar reader', '11204007', 9127, 'sebuah perangkat yang terdiri dari lensa pembesar dimaksudkan untuk digunakan oleh pasien yang telah gangguan penglihatan. Perangkat ini ditempatkan langsung ke bahan bacaan untuk memperbesar cetak.', ',0,1602,1572,6811,2765,', 'Alat bantu baca bentuk batang ', '12.04.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2766, 'Ophthalmic prism reader', '11204008', 9126, 'perangkat dimaksudkan untuk digunakan oleh pasien yang berada dalam posisi terlentang untuk mengubah sudut cetak untuk membantu membaca', ',0,1602,1572,6811,2766,', 'Alat bantu baca bentuk prisma', '12.04.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2768, 'Magnifying spectacles', '11204010', 9124, 'perangkat yang terdiri dari bingkai kacamata dengan lensa cembung dimaksudkan untuk dikenakan oleh seorang pasien yang telah merugikan visi untuk memperbesar gambar', ',0,1602,1572,6811,2768,', 'Kacamata pembesar', '12.04.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2769, 'Spectacle frame', '11204011', 6811, 'perangkat yang terbuat dari logam atau plastik yang dimaksudkan untuk dimiliki lensa kacamata resep dipakai oleh pasien untuk memperbaiki kesalahan bias', ',0,1602,1572,6811,2769,', '', '12.04.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2771, 'Sunglasses (nonprescription)', '11204013', 6811, 'perangkat yang terdiri dari bingkai kacamata atau klip dengan menyerap, reflektif, berwarna, polarisasi, atau lensa photosensitized dimaksudkan untuk dikenakan oleh seseorang untuk melindungi mata dari sinar matahari yang cerah tetapi tidak untuk memberikan koreksi bias. Perangkat ini biasanya tersedia over-the-counter', ',0,1602,1572,6811,2771,', '', '12.04.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2772, 'Low-vision telescope', '11204014', 9122, 'sebuah perangkat yang terdiri dari susunan lensa atau cermin dimaksudkan untuk digunakan oleh pasien yang telah merugikan visi untuk meningkatkan ukuran nyata dari objek. Ini jenis generik perangkat termasuk teleskop genggam atau tontonan.', ',0,1602,1572,6811,2772,', 'Teleskop low-vision', '12.04.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2773, 'Electronic vision aid', '11204015', 9121, 'perangkat AC bertenaga atau bertenaga baterai yang terdiri dari sebuah sensor elektronik / transduser dimaksudkan untuk digunakan oleh pasien yang telah gangguan penglihatan atau kebutaan untuk menerjemahkan gambar visual benda menjadi sinyal taktil atau auditori', ',0,1602,1572,6811,2773,', 'Alat bantu penglihatan elektronik ', '12.04.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2774, 'Image intensification vision aid', '11204016', 9120, 'perangkat bertenaga baterai dimaksudkan untuk digunakan oleh pasien yang telah membatasi adaptasi gelap atau gangguan penglihatan untuk memperkuat cahaya ambient.', ',0,1602,1572,6811,2774,', 'Alat bantu intensitas penglihatan', '12.04.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2781, 'Blood pressure alarm', '20501002', 7505, 'Alat yang menerima sinyal dari amplifier transduser tekanan darah, proses sinyal dan mengeluarkan alarm bila tekanan darah turun di luar atas atau batas bawah yang telah ditetapkan.', ',0,1604,1576,6777,2781,', 'Alarm tekanan darah', '05.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2782, 'Automatic Blood Pressure', '20501003', 6777, 'Alat yang menerima sinyal listrik dari amplifier transduser tekanan darah dan menunjukkan tekanan sistolik, tekanan diastolik atau tekanan rata-rata berdasarkan sinyal input.', ',0,1604,1576,6777,2782,', 'Blood pressure computer', '05.01.003', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2783, 'Blood pressure cuff', '20501004', 7503, 'Alat yang memiliki kandung kemih tiup di lengan inelastis (manset) untuk memompa dan mengempis kandung kemih. Manset digunakan bersama dengan perangkat lain untuk menentukan tekanan darah pasien.', ',0,1604,1576,6777,2783,', 'Manset tensimeter', '05.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2784, 'Noninvasive blood pressure measurement system', '20501005', 7502, 'Alat yang memberikan sinyal sistolik, diastolik, rata-rata atau kombinasi dari ketiga tekanan yang dapat diturunkan melalui penggunaan tranducers yang ditempatkan pada permukaan tubuh.', ',0,1604,1576,6777,2784,', 'Tensimeter, sphygmomanometer', '05.01.005', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2785, 'Venous blood pressure manometer', '20501006', 7501, 'Alat yang melekat pada kateter vena untuk menunjukkan manometrically tekanan vena sentral atau perifer.', ',0,1604,1576,6777,2785,', 'Manometer tekanan darah vena', '05.01.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2786, 'Diagnostic intravascular catheter', '20501007', 7500, 'Alat yang digunakan untuk merekam tekanan intracardiac, sampel darah dan untuk memperkenalkan zat ke dalam jantung dan pembuluh. Termasuk dalam alat umum ini antara lain right-heart catheters, left-heart catheters dan kateter angiografik.', ',0,1604,1576,6777,2786,', 'Kateter diagnostik intravaskular', '05.01.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2789, 'Fiberoptic oximeter catheter', '20501010', 7497, 'perangkat yang digunakan untuk memperkirakan saturasi oksigen darah. Ini terdiri dari dua bundel serat optik yang melakukan cahaya pada panjang gelombang yang diinginkan melalui darah dan mendeteksi cahaya yang dipantulkan dan tersebar di ujung distal kateter.', ',0,1604,1576,6777,2789,', 'Kateter serat optik oksimeter', '05.01.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2790, 'Flow-directed catheter', '20501011', 7496, 'a device that incorporates a gas-filled balloon to help direct the catheter to the desired position', ',0,1604,1576,6777,2790,', 'Kateter pengarah aliran', '05.01.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2791, 'Percutaneous catheter', '20501012', 7469, 'perangkat yang dimasukkan ke dalam pembuluh darah atau arteri melalui kulit menggunakan dilator dan selubung (introducer) atau kawat panduan', ',0,1604,1576,6777,2791,', 'Kateter perkutan', '05.01.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2806, 'Densitometer', '20501027', 7481, 'sebuah perangkat yang digunakan untuk mengukur transmisi cahaya melalui indikator dalam sampel darah', ',0,1604,1576,6777,2806,', 'Densitometer', '05.01.027', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2812, 'Stetoskop', '20501033', 6777, 'perangkat mekanik yang digunakan untuk memproyeksikan suara yang terkait dengan jantung, arteri, dan vena dan organ internal lainnya.', ',0,1604,1576,6777,2812,', 'Stetoskop', '05.01.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2816, 'Cardiovascular blood flowmeter', '20502003', 6778, 'perangkat yang terhubung ke transducer aliran yang memberi energi pada transduser dan proses dan menampilkan sinyal aliran darah.', ',0,1604,1577,6778,2816,', 'Flowmeter darah untuk kardiovaskular.', '05.02.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2818, 'Cardiac monitor (including cardiotachometer and rate alarm).', '20502005', 7540, 'sebuah perangkat yang digunakan untuk mengukur denyut jantung dari sebuah sinyal analog yang dihasilkan oleh elektrokardiograf, vectorcardiograph, atau monitor tekanan darah. Perangkat ini mungkin terdengar alarm ketika detak jantung berada di luar yang telah ditetapkan batas atas dan bawah.', ',0,1604,1577,6778,2818,', 'Pasien monitor', '05.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2820, 'Ballistocardiograph', '20502007', 6778, 'perangkat, termasuk struktur pendukung yang pasien ditempatkan, yang bergerak dalam menanggapi ejeksi darah dari jantung. Perangkat ini sering memberikan tampilan visual.', ',0,1604,1577,6778,2820,', 'Balistokardiograf', '05.02.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2821, 'Echocardiograph.', '20502008', 7537, 'perangkat yang menggunakan energi ultrasonik untuk membuat gambar struktur jantung. Ini termasuk array bertahap dan dua dimensi scanner.', ',0,1604,1577,6778,2821,', 'Echo kardiograf', '05.02.008', 1, 1, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2822, 'Electrocardiograph', '20502009', 6778, 'sebuah perangkat yang digunakan untuk memproses sinyal listrik ditransmisikan melalui dua atau lebih elektroda elektrokardiograf dan untuk menghasilkan tampilan visual dari sinyal listrik yang dihasilkan oleh jantung', ',0,1604,1577,6778,2822,', 'EKG, ECG', '05.02.009', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2824, 'Electrocardiograph electrode', '20502011', 6778, 'konduktor listrik yang diterapkan pada permukaan tubuh untuk mengirimkan sinyal listrik di permukaan tubuh untuk prosesor yang menghasilkan elektrokardiogram atau vectorcardiogram', ',0,1604,1577,6778,2824,', 'Elektroda EKG', '05.02.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2826, 'Phonocardiograph.', '10502013', 7512, 'perangkat digunakan untuk memperkuat atau kondisi sinyal dari transduser suara jantung. Perangkat ini melengkapi energi eksitasi untuk transduser dan memberikan tampilan visual atau terdengar dari suara hati', ',0,1604,1577,6778,2826,', 'Fonokardiograf', '05.02.013', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2827, 'Vectorcardiograph.', '20502014', 7532, 'sebuah perangkat yang digunakan untuk memproses sinyal listrik ditransmisikan melalui elektroda elektrokardiograf dan untuk menghasilkan tampilan visual besar dan arah dari sinyal listrik yang dihasilkan oleh jantung', ',0,1604,1577,6778,2827,', 'Vektorkardiograf', '05.02.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2832, 'Oscillometer', '20502019', 6778, 'sebuah perangkat yang digunakan untuk mengukur osilasi fisiologis apapun, misalnya, perubahan volume arteri', ',0,1604,1577,6778,2832,', 'Oscillometer', '05.02.019', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2833, 'Pulse Oxymeter / Oximeter / Pulse Oximeter / Oksigen Saturasi/SPO2', '20502020', 6778, 'sebuah perangkat yang digunakan untuk mengirimkan radiasi pada panjang gelombang yang dikenal (s) melalui darah dan untuk mengukur saturasi oksigen darah berdasarkan pada jumlah radiasi yang dipantulkan atau tersebar. Ini dapat digunakan sendiri atau bersama dengan oksimeter kateter serat optik.', ',0,1604,1577,6778,2833,', '', '05.02.020', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2834, 'Ear oximeter', '20502021', 6778, 'perangkat ekstravaskuler digunakan untuk mengirimkan cahaya pada panjang gelombang yang dikenal (s) melalui darah di telinga. Jumlah cahaya yang dipantulkan atau tersebar seperti yang ditunjukkan oleh perangkat ini digunakan untuk mengukur saturasi oksigen darah', ',0,1604,1577,6778,2834,', 'Oksimeter telinga', '05.02.021', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2845, 'Ultrasonic transducer', '20502032', 6778, 'perangkat diterapkan pada kulit untuk mengirim dan menerima energi ultrasonic yang digunakan dalam hubungannya dengan echocardiograph untuk memberikan pencitraan struktur kardiovaskular. Perangkat ini termasuk array bertahap dan dua dimensi scanning transduser.', ',0,1604,1577,6778,2845,', 'Transduser ultrasonik', '05.02.032', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2850, 'Electrocardiograph, Monitor', '20502037', 6778, '', ',0,1604,1577,6778,2850,', '', '05.02.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2851, 'Vascular clip', '20503001', 6779, 'perangkat extravascular implan dirancang untuk menutup jalan, dengan kompresi, aliran darah di pembuluh darah kecil selain kapal intrakranial.', ',0,1604,1578,6779,2851,', '', '05.03.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2854, 'Cardiovascular intravascular filter', '20503004', 6779, 'implan yang ditempatkan di vena cava inferior untuk tujuan mencegah thromboemboli paru (bekuan darah yang dihasilkan pada tungkai bawah dan patah longgar ke dalam aliran darah) mengalir ke sisi kanan jantung dan sirkulasi paru-paru.', ',0,1604,1578,6779,2854,', 'Filter intravaskular kardiovaskular', '05.03.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2856, 'Endovascular Suturing System', '20503006', 7565, 'perangkat medis dimaksudkan untuk memberikan fiksasi dan penyegelan antara graft endovascular dan arteri asli. Sistem ini terdiri dari perangkat implan dan perangkat pengiriman endovascular digunakan untuk implan jahitan endovascular.', ',0,1604,1578,6779,2856,', 'Sistem penjahitan endovaskular', '05.03.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2884, 'Cardiopulmonary bypass heat exchanger.', '20504007', 7618, 'perangkat, yang terdiri dari sistem pertukaran panas yang digunakan dalam sirkulasi extracorporeal untuk menghangatkan atau mendinginkan darah atau perfusi fluida yang mengalir melalui perangkat.', ',0,1604,1579,6780,2884,', 'Penukar panas pada bypass kardiopulmonari.', '05.04.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2904, 'Vascular clamp', '20504027', 6780, 'alat bedah yang digunakan untuk menutup jalan pembuluh darah sementara.', ',0,1604,1579,6780,2904,', 'Penjepit pembuluh darah.', '05.04.027', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2911, 'Embolectomy catheter', '20504003', 6780, 'kateter balon-tipped yang digunakan untuk menghapus thromboemboli, yaitu gumpalan darah yang telah bermigrasi dalam pembuluh darah dari satu situs di pohon vaskular yang lain.', ',0,1604,1579,6780,2911,', 'Kateter embolektomi', '05.04.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2912, 'Septostomy catheter', '20504004', 6780, 'kateter balon yang khusus digunakan untuk membuat atau memperbesar defek septum atrium ditemukan di jantung bayi tertentu', ',0,1604,1579,6780,2912,', 'Kateter septostomi.', '05.04.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2913, '[delete]External cardiac compressor', '30504005', 6780, 'perangkat eksternal yang elektrik, pneumatik, atau didukung manual dan digunakan untuk kompres dada berkala di wilayah jantung untuk memberikan aliran darah selama serangan jantung', ',0,1604,1579,6780,2913,', 'Kompresor jantung eksternal.', '05.04.005', -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (2916, '[delete]Automated external defibrillator (AED)', '30504008', 6780, 'perangkat yang memberikan menjadi tes 50 ohm beban sengatan listrik maksimum 360 joule energi yang digunakan untuk defibrillating (mengembalikan irama jantung normal) atrium atau ventrikel jantung atau untuk mengakhiri aritmia jantung lainnya. Ini jenis generik perangkat termasuk defibrillator energi rendah dengan output listrik maksimum kurang dari 360 joule energi yang digunakan dalam defibrilasi pediatrik atau operasi jantung. Perangkat baik dapat menyinkronkan shock dengan fase yang tepat dari elektrokardiogram atau dapat beroperasi asynchronous. Perangkat memberikan kejutan listrik melalui dayung ditempatkan baik secara langsung di jantung atau di permukaan tubuh', ',0,1604,1579,6780,2916,', '', '05.04.008', -1, 1, 365, NULL, NULL);
