INSERT INTO `aspak_new_alat` VALUES (3015, 'Radiographic system, digital (DR)', '21501072', 6819, 'Digital radiographic systems use various methods to acquire electronic x-ray images, which are digitized for viewing, storage, or hard-copy printing. Digital images are available almost immediately for viewing on a monitor. These images can be manipulated electronically to enhance the region of interest and can be transmitted digitally to other locations. The patient positioning and imaging techniques are identical to those used in conventional radiography. The components of a general-purpose film or digital radiographic table system are the table unit; the Bucky film tray and grid system; the film or digital system; the x-ray generator; the x-ray tube, housing, and suspension system; and the collimator ', ',0,1603,1573,6819,3015,', NULL, NULL, 0, 0, 700, NULL, NULL);
