INSERT INTO `aspak_new_alat` VALUES (3048, 'Acid phosphatase (total or prostatic) test system', '20101001', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim fosfatase asam dalam plasma dan serum.', ',0,3021,3023,6755,3048,', 'Alat uji asam fosfatase (total atau prostatik)', '01.01.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3049, 'Adrenocorticotropic hormone (ACTH) test system', '20101002', 6755, 'perangkat dimaksudkan untuk mengukur hormon adrenokortikotropik dalam plasma dan serum. Pengukuran ACTH digunakan dalam diagnosis diferensial dan pengobatan gangguan tertentu dari kelenjar adrenal seperti sindrom Cushing, insufisiensi adrenocortical, dan ', ',0,3021,3023,6755,3049,', 'Alat uji hormon adrenokortikotropik (ACTH)', '01.01.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3050, 'Alanine amino transferase (ALT/SGPT) test system', '10101003', 6826, 'perangkat dimaksudkan untuk mengukur aktivitas enzim alanin amino transferase (ALT) (juga dikenal sebagai serum glutamat piruvat transaminase atau SGPT) dalam serum dan plasma. Alanin transferase pengukuran amino yang digunakan dalam diagnosis dan pengoba', ',0,3021,3023,6755,3050,', 'Alat uji alanine aminotransferase (ALT / SGPT)/ alat uji fungsi hati', '01.01.003', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3051, 'Albumin test system', '20101004', 6755, 'perangkat dimaksudkan untuk mengukur konsentrasi albumin dalam serum dan plasma. Pengukuran albumin digunakan dalam diagnosis dan pengobatan berbagai penyakit yang melibatkan terutama hati atau ginjal.', ',0,3021,3023,6755,3051,', 'Alat uji albumin', '01.01.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3052, 'Aldolase test system', '10101005', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas aldolase enzim dalam serum atau plasma. Pengukuran Aldolase digunakan dalam diagnosis dan pengobatan tahap awal hepatitis akut dan penyakit otot tertentu seperti progresif Duchenne-jenis distrofi otot.', ',0,3021,3023,6755,3052,', 'Alat uji aldolase', '01.01.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3053, 'Aldosterone test system', '20101006', 6755, 'perangkat dimaksudkan untuk mengukur hormon aldosteron dalam serum dan urin. Pengukuran aldosteron digunakan dalam diagnosis dan pengobatan aldosteronisme primer (kelainan yang disebabkan oleh sekresi berlebihan aldosteron oleh kelenjar adrenal), hiperten', ',0,3021,3023,6755,3053,', 'Alat uji aldosteron', '01.01.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3054, 'Alkaline phosphatase or isoenzymes test system', '20101007', 6755, 'perangkat dimaksudkan untuk mengukur alkaline phosphatase atau isoenzim nya (kelompok enzim dengan aktivitas biologis yang sama) dalam serum atau plasma. Pengukuran alkaline phosphatase atau isoenzim yang digunakan dalam diagnosis dan pengobatan hati, tul', ',0,3021,3023,6755,3054,', 'Alat uji alkalin fosfatase (ALP) atau isoenzim', '01.01.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3055, 'Newborn screening test system for amino acids, free carnitine, and acylcarnitines using tandem mass spectrometry', '20101008', 6755, 'sebuah perangkat yang terdiri dari standar yang stabil isotop internal kontrol bahan, solusi ekstraksi, pelarut aliran, instrumentasi, paket perangkat lunak, dan reagen dan bahan lainnya. Perangkat ini ditujukan untuk pengukuran dan evaluasi asam amino, k', ',0,3021,3023,6755,3055,', 'Alat uji asam amino, karnitin bebas, dan asilkarnitin untuk uji penapisan pada bayi baru lahir menggunakan spektrometer tandem massa', '01.01.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3056, 'Delta-aminolevulinic acid test system', '10101009', 6755, 'perangkat dimaksudkan untuk mengukur tingkat asam ofdelta-aminolevulinic (prekursor porfirin) dalam pengukuran asam urine.Delta-aminolevulinic digunakan dalam diagnosis dan pengobatan keracunan timbal dan porfiria tertentu (penyakit yang mempengaruhi hati', ',0,3021,3023,6755,3056,', 'Alat uji asam delta-aminolevulinat ', '01.01.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3057, 'Ammonia test system', '10101010', 7635, 'perangkat dimaksudkan untuk mengukur kadar amonia dalam darah, serum, dan plasma, pengukuran Amonia digunakan dalam diagnosis dan pengobatan gangguan hati yang berat, seperti sirosis, hepatitis, dan sindrom Reye.', ',0,3021,3023,6755,3057,', 'Alat uji amonia', '01.01.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3058, 'Amylase test system', '20101011', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim amilase dalam serum dan urin. Pengukuran amilase digunakan terutama untuk diagnosis dan pengobatan pankreatitis (radang pankreas).', ',0,3021,3023,6755,3058,', 'Alat uji amilase', '01.01.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3059, 'Androstenedione test system', '10101012', 6755, 'perangkat dimaksudkan untuk mengukur androstenedion (zat yang disekresi oleh testis, ovarium, dan kelenjar adrenal) dalam serum. Pengukuran Adrostenedione digunakan dalam diagnosis dan pengobatan perempuan dengan tingkat androgen yang berlebihan (hormon s', ',0,3021,3023,6755,3059,', 'Alat uji androstenedione', '01.01.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3060, 'Androsterone test system', '10101013', 6755, 'perangkat dimaksudkan untuk mengukur adrosterone hormon dalam serum, plasma, dan urin. Pengukuran androsterone digunakan dalam diagnosis dan pengobatan penyakit gonad dan adrenal.', ',0,3021,3023,6755,3060,', 'Alat uji androsterone', '01.01.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3061, 'Angiotensin I and renin test system/reagen pemeriksaan angiotensin I and renin ', '20101014', 6755, 'perangkat dimaksudkan untuk mengukur tingkat angiotensin I yang dihasilkan oleh renin dalam plasma. Saya pengukuran angiotensin digunakan dalam diagnosis dan pengobatan beberapa jenis hipertensi', ',0,3021,3023,6755,3061,', NULL, '01.01.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3062, 'Angiotensin converting enzyme (A.C.E.) test system', '20101015', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas angiotensin converting enzyme dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit seperti sarkoidosis, penyakit yang ditandai dengan pembentu', ',0,3021,3023,6755,3062,', 'Alat uji angiotensin converting enzyme (A.C.E.)', '01.01.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3063, 'Ascorbic acid test system', '10101016', 6755, 'perangkat dimaksudkan untuk mengukur tingkat asam askorbat (vitamin C) dalam plasma, serum, dan urin. Pengukuran asam askorbat digunakan dalam diagnosis dan pengobatan asam askorbat kekurangan makanan.', ',0,3021,3023,6755,3063,', 'Alat uji asam askorbat/ alat uji vitamin C', '01.01.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3064, 'Aspartate amino transferase (AST/SGOT) test system', '20101017', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim aspartat amino transferase (AST) (juga dikenal sebagai serum glutamat oksaloasetat transferase atau SGOT) dalam serum dan plasma. Aspartat amino transferase pengukuran yang digunakan dalam diagnosis dan', ',0,3021,3023,6755,3064,', 'Alat uji aspartat amino transferase (AST/SGOT)', '01.01.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3065, 'Bilirubin (total or direct) test system', '20101018', 7938, 'perangkat dimaksudkan untuk mengukur kadar bilirubin (total atau langsung) dalam plasma atau serum. Pengukuran tingkat bilirubin, suatu senyawa organik yang terbentuk selama distruction normal dan abnormal sel-sel darah merah, jika digunakan dalam diagnos', ',0,3021,3023,6755,3065,', 'Alat uji bilirubin (total atau terkonjugasi) ', '01.01.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3066, 'Bilirubin (total and unbound) in the neonate test system', '10101019', 7946, 'perangkat dimaksudkan untuk mengukur kadar bilirubin (total dan terikat) dalam darah (serum) dari bayi yang baru lahir untuk membantu dalam menunjukkan risiko bilirubin ensefalopati (kernikterus).', ',0,3021,3023,6755,3066,', 'Alat uji Blirubin total dan unbound pada Neonatus', '01.01.019', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3067, 'Urinary bilirubin and its conjugates (nonquantitative) test system', '10101020', 6755, 'perangkat dimaksudkan untuk mengukur kadar bilirubin konjugasi dalam urin. Pengukuran bilirubin urin dan konjugasi nya (nonquantitative) digunakan dalam diagnosis dan pengobatan penyakit hati tertentu.', ',0,3021,3023,6755,3067,', 'Alat uji bilirubin dan konjugatnya pada urin (nonkuantitatif)', '01.01.020', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3068, 'B-type natriuretic peptide test system', '20101021', 7937, 'sebuah dalam perangkat diagnostik in vitro dimaksudkan untuk mengukur BNP secara keseluruhan darah dan plasma. Pengukuran BNP digunakan sebagai bantuan dalam diagnosis pasien dengan gagal jantung kongestif.', ',0,3021,3023,6755,3068,', 'Alat uji B-type natriuretic peptide/BNP', '01.01.021', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3069, 'Biotinidase test system', '20101022', 6755, 'sebuah dalam perangkat diagnostik in vitro dimaksudkan untuk mengukur aktivitas enzim biotinidase dalam darah. Pengukuran biotinidase digunakan dalam pengobatan dan diagnosis biotinidase kekurangan, kesalahan metabolisme bawaan pada bayi, ditandai dengan ', ',0,3021,3023,6755,3069,', 'Alat uji biotinidase', '01.01.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3070, 'Blood gases (P CO 2, P O 2) and blood pH test system', '20101023', 7940, 'perangkat dimaksudkan untuk mengukur gas-gas tertentu dalam darah, serum, plasma atau pH darah, serum, dan plasma. Pengukuran gas darah (PCO2, PO2) dan pH darah yang digunakan dalam diagnosis dan pengobatan gangguan asam-basa yang mengancam jiwa.', ',0,3021,3023,6755,3070,', 'Alat uji gas darah (P CO2, P O2) dan pH darah', '01.01.023', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3071, 'Blood volume test system', '10101024', 6755, 'perangkat dimaksudkan untuk mengukur volume darah yang bersirkulasi. Pengukuran volume darah yang digunakan dalam diagnosis dan pengobatan syok, perdarahan, dan polisitemia vera (penyakit yang ditandai dengan peningkatan mutlak dalam massa eritrosit dan t', ',0,3021,3023,6755,3071,', 'Alat uji volume darah', '01.01.024', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3072, 'C-peptides of proinsulin test system', '10101025', 6755, 'perangkat dimaksudkan untuk mengukur C-peptida tingkat proinsulin dalam serum, plasma, dan urin. Pengukuran C-peptida proinsulin digunakan dalam diagnosis dan pengobatan pasien dengan sekresi insulin abnormal, termasuk diabetes mellitus.', ',0,3021,3023,6755,3072,', 'Alat uji C-peptides proinsulin', '01.01.025', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3073, 'Calcitonin test system', '20101026', 6755, 'perangkat dimaksudkan untuk mengukur hormon kalsitonin (thyrocalcitonin) tingkat tiroid dalam plasma dan serum. Pengukuran kalsitonin digunakan dalam diagnosis dan pengobatan penyakit yang melibatkan kelenjar tiroid dan paratiroid, termasuk karsinoma dan ', ',0,3021,3023,6755,3073,', 'Alat uji kalsitonin', '01.01.026', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3074, 'Calcium test system', '20101027', 6755, 'perangkat dimaksudkan untuk mengukur kadar kalsium total dalam serum. Pengukuran kalsium yang digunakan dalam diagnosis dan pengobatan penyakit paratiroid, berbagai penyakit tulang, penyakit ginjal kronis dan tetani (kontraksi otot atau kejang intermiten)', ',0,3021,3023,6755,3074,', 'Alat uji kalsium', '01.01.027', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3075, 'Calibrator', '20101028', 6755, 'perangkat ditujukan untuk tujuan medis untuk digunakan dalam sistem tes untuk menetapkan titik acuan yang digunakan dalam penentuan nilai dalam pengukuran zat dalam spesimen manusia.', ',0,3021,3023,6755,3075,', 'Kalibrator', '01.01.028', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3076, 'Bicarbonate/carbon dioxide test system', '20101030', 6755, 'perangkat dimaksudkan untuk mengukur bikarbonat / karbon dioksida dalam darah, serum, dan seluruh darah. Bikarbonat / karbon dioksida pengukuran yang digunakan dalam diagnosis dan pengobatan berbagai gangguan yang berpotensi serius yang berhubungan dengan', ',0,3021,3023,6755,3076,', 'Alat uji bikarbonat/karbondioksida', '01.01.030', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3077, 'Cardiac allograft gene expression profiling test system', '20101031', 6755, 'sebuah perangkat yang mengukur asam ribonukleat (RNA) tingkat ekspresi beberapa gen dan menggabungkan informasi ini untuk menghasilkan tanda tangan (pola, klasifikasi, indeks, nilai) untuk membantu dalam identifikasi probabilitas rendah penolakan selular ', ',0,3021,3023,6755,3077,', 'Alat uji profiling karakteristik gen transplantasi jantung', '01.01.031', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3078, 'Catecholamines (total) test system', '10101032', 6755, 'perangkat dimaksudkan untuk menentukan apakah suatu kelompok senyawa yang sama (epinefrin, norepinefrin, dan dopamin) hadir dalam urin dan plasma. Katekolamin penentuan digunakan dalam diagnosis dan pengobatan medula adrenal dan gangguan hipertensi, dan t', ',0,3021,3023,6755,3078,', 'Alat uji katekolamin', '01.01.032', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3079, 'Chloride test system', '20101033', 6755, 'perangkat dimaksudkan untuk mengukur tingkat klorida dalam plasma, serum, keringat, dan urin. Pengukuran klorida digunakan dalam diagnosis dan pengobatan elektrolit dan gangguan metabolisme seperti cystic fibrosis dan asidosis diabetes.', ',0,3021,3023,6755,3079,', 'Alat uji klorida', '01.01.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3080, 'Cholesterol (total) test system', '10101034', 7636, 'a device intended to measure cholesterol in plasma and serum. Cholesterol measurements are used in the diagnosis and treatment of disorders involving excess cholesterol in the blood and lipid and lipoprotein metabolism disorders.', ',0,3021,3023,6755,3080,', 'Alat uji kolesterol total', '01.01.034', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3081, 'Cholylglycine test system', '20101035', 6755, 'perangkat dimaksudkan untuk mengukur asam empedu cholylglycine dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan gangguan hati, seperti sirosis atau penyakit hati obstruktif.', ',0,3021,3023,6755,3081,', 'Alat uji cholylglycine (CG)', '01.01.035', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3082, 'Chymotrypsin test system', '10101036', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim dalam chymotrypsin darah dan cairan tubuh lain dan dalam tinja. Pengukuran Chymotrypsin digunakan dalam diagnosis dan pengobatan insufisiensi eksokrin pankreas.', ',0,3021,3023,6755,3082,', 'Alat uji chymotrypsin', '01.01.036', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3083, 'Compound S (11-deoxycortisol) test system', '10101037', 6755, 'perangkat dimaksudkan untuk mengukur tingkat senyawa S (11-dioxycortisol) dalam plasma. Senyawa S merupakan perantara steroid dalam biosintesis hormon kortisol adrenal. Pengukuran senyawa S digunakan dalam diagnosis dan pengobatan tertentu adrenal dan kel', ',0,3021,3023,6755,3083,', 'Alat uji compound S (11-deoxycortisol)', '01.01.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3084, 'Conjugated sulfolithocholic acid (SLCG) test system', '20101038', 6755, 'perangkat dimaksudkan untuk mengukur SLCG asam empedu dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan gangguan hati, seperti sirosis atau penyakit hati obstruktif.', ',0,3021,3023,6755,3084,', 'Alat uji asam sulfolithocholic (SLCG) terkonjugasi', '01.01.038', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3085, 'Copper test system', '10101039', 6755, 'perangkat dimaksudkan untuk mengukur tingkat tembaga dalam plasma, serum, dan urin. Pengukuran tembaga yang digunakan dalam diagnosis dan pengobatan anemia, infeksi, radang, dan penyakit Wilson (penyakit keturunan terutama dari sistem hati dan saraf). Has', ',0,3021,3023,6755,3085,', 'Alat uji tembaga', '01.01.039', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3086, 'Corticoids test system', '10101040', 6755, 'perangkat dimaksudkan untuk mengukur tingkat corticoids (hormon dari korteks adrenal) dalam serum dan p lasma. Pengukuran corticoids digunakan dalam diagnosis dan pengobatan gangguan dari korteks kelenjar adrenal, terutama yang berkaitan dengan hipertensi', ',0,3021,3023,6755,3086,', 'Alat uji kortikoid', '01.01.040', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3087, 'Corticosterone test system', '10101041', 6755, 'perangkat dimaksudkan untuk mengukur corticosterone (steroid yang disekresi oleh kelenjar adrenal) tingkat dalam plasma. Pengukuran corticosterone digunakan dalam diagnosis dan pengobatan gangguan seperti gangguan adrenal korteks adrenal dan blok dalam si', ',0,3021,3023,6755,3087,', 'Alat uji kortikosteron', '01.01.041', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3088, 'Cortisol (hydrocortisone and hydroxycorticosterone) test system', '20101042', 6755, 'perangkat dimaksudkan untuk mengukur hormon kortisol dikeluarkan oleh kelenjar adrenal dalam plasma dan urin. Pengukuran kortisol digunakan dalam diagnosis dan pengobatan gangguan kelenjar adrenal.', ',0,3021,3023,6755,3088,', 'Alat uji kortisol (hidrokortison dan hidroksikortikosteron)', '01.01.042', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3089, 'Creatine test system', '10101043', 6755, 'perangkat dimaksudkan untuk mengukur creatine (zat disintesis di hati dan pankreas dan ditemukan dalam cairan biologis) dalam plasma, serum, dan urin. Pengukuran creatine digunakan dalam diagnosis dan pengobatan penyakit otot dan gangguan endokrin termasu', ',0,3021,3023,6755,3089,', 'Alat uji kreatin', '01.01.043', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3090, 'Creatine phosphokinase/creatine kinase or isoenzymes test system', '20101044', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim creatine phosphokinase atau isoenzim nya (kelompok enzim dengan aktivitas biologis yang sama) dalam plasma dan serum. Pengukuran phosphokinase creatine dan isoenzim yang digunakan dalam diagnosis dan pe', ',0,3021,3023,6755,3090,', 'Alat uji kreatinin fosfokinase/kreatinin kinase atau isoenzim', '01.01.044', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3091, 'Creatinine test system', '20101045', 6755, 'perangkat dimaksudkan untuk mengukur kadar kreatinin dalam plasma dan urin. Pengukuran kreatinin digunakan dalam diagnosis dan pengobatan penyakit ginjal, dalam memantau dialisis ginjal, dan sebagai dasar perhitungan untuk mengukur analit urin lainnya.', ',0,3021,3023,6755,3091,', 'Alat uji kreatinin', '01.01.045', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3092, 'Cyclic AMP test system', '20101046', 6755, 'perangkat dimaksudkan untuk mengukur tingkat adenosin 3 \', 5\'-monophosphate (siklik AMP) dalam plasma, urin, dan cairan tubuh lainnya. AMP siklik pengukuran yang digunakan dalam diagnosis dan pengobatan gangguan endokrin, termasuk hiperparatiroidisme (ove', ',0,3021,3023,6755,3092,', 'Alat uji cyclic AMP', '01.01.046', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3093, 'Cyclosporine test system', '20101047', 6755, 'perangkat dimaksudkan untuk menentukan kuantitatif konsentrasi siklosporin sebagai bantuan dalam pengelolaan pasien transplantasi yang menerima terapi dengan obat ini. Ini jenis generik perangkat termasuk immunoassay dan tes kromatografi untuk siklosporin', ',0,3021,3023,6755,3093,', 'Alat uji siklosporin', '01.01.047', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3094, 'Cystine test system', '10101048', 6755, 'perangkat dimaksudkan untuk mengukur sistin asam amino dalam urin. Pengukuran sistin digunakan dalam diagnosis cystinuria (terjadinya sistin dalam urin). Pasien dengan cystinuria sering mengembangkan ginjal calculi (batu).', ',0,3021,3023,6755,3094,', 'Alat uji sistin', '01.01.048', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3095, 'Dehydroepiandrosterone (free and sulfate) test system', '10101049', 6755, 'perangkat dimaksudkan untuk mengukur dehydroepiandrosterone (DHEA) dan sulfat dalam urin, serum, plasma, dan cairan ketuban. Pengukuran dehydroepiandrosterone digunakan dalam diagnosis dan pengobatan DHEA-mensekresi karsinoma adrenal.', ',0,3021,3023,6755,3095,', '', '01.01.049', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3096, 'Desoxycorticosterone test system', '10101050', 6755, 'perangkat dimaksudkan untuk mengukur desoxycorticosterone (DOC) dalam plasma dan urin. Pengukuran DOC digunakan dalam diagnosis dan pengobatan pasien dengan hypermineralocorticoidism (kelebihan retensi natrium dan kehilangan kalium) dan gangguan lain dari', ',0,3021,3023,6755,3096,', 'Alat uji desoksikortikosteron', '01.01.050', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3097, '2,3-Diphosphoglyceric acid test system', '10101051', 6755, 'perangkat dimaksudkan untuk mengukur asam 2,3-difosfogliserat (2,3-DPG) dalam eritrosit (sel darah merah). Pengukuran asam 2,3-difosfogliserat digunakan dalam diagnosis dan pengobatan gangguan darah yang mempengaruhi pengiriman oksigen oleh eritrosit ke j', ',0,3021,3023,6755,3097,', 'Alat uji Asam 2,3- diphosphoglyceric ', '01.01.051', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3098, 'Estradiol test system', '10101052', 6755, 'perangkat dimaksudkan untuk mengukur estradiol, suatu steroid estrogenik, dalam plasma. Pengukuran estradiol digunakan dalam diagnosis dan pengobatan berbagai gangguan seksual hormonal dan dalam menilai fungsi plasenta pada kehamilan rumit.', ',0,3021,3023,6755,3098,', 'Alat uji estradiol', '01.01.052', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3099, 'Estriol test system', '10101053', 6755, 'perangkat dimaksudkan untuk mengukur estriol, sebuah estrogenik steroid, dalam plasma, serum, urin dan perempuan hamil. Pengukuran estriol digunakan dalam diagnosis dan pengobatan gangguan fetoplasenta dalam kasus-kasus tertentu kehamilan berisiko tinggi.', ',0,3021,3023,6755,3099,', 'Alat uji estriol', '01.01.053', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3100, 'Estrogens (total, in pregnancy) test system', '10101054', 6755, 'perangkat dimaksudkan untuk mengukur jumlah estrogen dalam plasma, serum, urin dan selama kehamilan. Perangkat terutama mengukur estrone estradiol ditambah. Pengukuran total estrogen yang digunakan untuk membantu dalam diagnosis dan pengobatan gangguan fe', ',0,3021,3023,6755,3100,', 'Alat uji estrogen (total, dalam kehamilan)', '01.01.054', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3101, 'Estrogens (total, nonpregnancy) test system', '10101055', 6755, 'perangkat dimaksudkan untuk mengukur tingkat estrogen (Total estrone, estradiol, dan estriol) dalam plasma, serum, dan urin dari pria dan wanita tidak hamil. Pengukuran estrogen (total nonpregnancy) digunakan dalam diagnosis dan pengobatan berbagai ganggu', ',0,3021,3023,6755,3101,', 'Alat uji estrogen (total, tidak hamil)', '01.01.055', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3102, 'Estrone test system', '10101056', 6755, 'perangkat dimaksudkan untuk mengukur estrone, steroid estrogenik, dalam plasma. Pengukuran estrone digunakan dalam diagnosis dan pengobatan berbagai gangguan, termasuk infertilitas, amenore, diferensiasi ovarium kerusakan, estrogen mensekresi testis prime', ',0,3021,3023,6755,3102,', 'Alat uji estron', '01.01.056', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3103, 'Etiocholanolone test system', '10101057', 6755, 'perangkat dimaksudkan untuk mengukur etiocholanolone dalam serum dan urin. Etiocholanolone adalah produk metabolisme hormon testosteron dan diekskresikan dalam urin. Pengukuran Etiocholanolone digunakan dalam diagnosis dan pengobatan gangguan pada testis ', ',0,3021,3023,6755,3103,', 'Alat uji etiocholanolone', '01.01.057', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3104, 'Fatty acids test system', '10101058', 6755, 'perangkat dimaksudkan untuk mengukur asam lemak dalam plasma dan serum. Pengukuran asam lemak yang digunakan dalam diagnosis dan pengobatan berbagai gangguan metabolisme lipid.', ',0,3021,3023,6755,3104,', 'Alat uji asam lemak', '01.01.058', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3105, 'Folic acid test system', '20101059', 6755, 'perangkat dimaksudkan untuk mengukur asam folat vitamin dalam plasma dan serum. Pengukuran Asam folat digunakan dalam diagnosis dan pengobatan anemia megaloblastik, yang ditandai dengan adanya megaloblasts (seri sel darah merah yang abnormal) di sumsum tu', ',0,3021,3023,6755,3105,', 'Alat uji asam folat', '01.01.059', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3106, 'Follicle-stimulating hormone test system', '10101060', 6755, 'perangkat dimaksudkan untuk mengukur follicle-stimulating hormone (FSH) dalam plasma, serum, dan urin. Pengukuran FSH yang digunakan dalam diagnosis dan pengobatan kelenjar hipofisis dan gangguan gonad.', ',0,3021,3023,6755,3106,', 'Alat uji follicle-stimulating hormone', '01.01.060', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3107, 'Formiminoglutamic acid (FIGLU) test system', '10101061', 6755, 'perangkat dimaksudkan untuk mengukur asam formiminolutamic dalam urin. Pengukuran FIGLU diperoleh oleh perangkat ini digunakan dalam diagnosis anemia, seperti anemia pernisiosa dan anemia hemolitik kongenital.', ',0,3021,3023,6755,3107,', 'Alat uji formiminoglutamic acid', '01.01.061', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3108, 'Galactose test system', '10101062', 6755, 'perangkat dimaksudkan untuk mengukur galaktosa dalam darah dan urin. Pengukuran galaktosa digunakan dalam diagnosis dan pengobatan dari galaktosemia penyakit keturunan (gangguan metabolisme galaktosa) pada bayi.', ',0,3021,3023,6755,3108,', 'Alat uji galaktosa', '01.01.062', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3109, 'Galactose-1-phosphate uridyl transferase test system', '20101063', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim galaktosa-1-fosfat uridyl transferase dalam eritrosit (sel darah merah). Pengukuran galaktosa-1-fosfat uridyl transferase digunakan dalam diagnosis dan pengobatan dari galaktosemia penyakit keturunan (g', ',0,3021,3023,6755,3109,', 'Alat uji galaktosa-1-fosfat uridil transferase', '01.01.063', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3110, 'Gastric acidity test system', '10101064', 6755, 'perangkat dimaksudkan untuk mengukur keasaman cairan lambung. Pengukuran keasaman lambung digunakan dalam diagnosis dan pengobatan pasien dengan ulkus peptikum, sindroma Zollinger-Ellison (ulkus peptikum karena gastrin-mensekresi tumor pankreas), dan gang', ',0,3021,3023,6755,3110,', 'Alat uji keasaman lambung', '01.01.064', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3111, 'Gastrin test system', '10101065', 6755, 'perangkat dimaksudkan untuk mengukur hormon gastrin dalam plasma dan serum. Pengukuran gastrin digunakan dalam diagnosis dan pengobatan pasien dengan borok, anemia pernisiosa, dan sindrom Zollinger-Ellison (ulkus peptikum karena tumor gastrin-mensekresi p', ',0,3021,3023,6755,3111,', 'Alat uji gastrin', '01.01.065', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3112, 'Globulin test system', '10101066', 6755, 'perangkat dimaksudkan untuk mengukur globulin (protein) dalam plasma dan serum. Pengukuran globulin digunakan dalam diagnosis dan pengobatan pasien dengan berbagai penyakit termasuk hati yang parah dan penyakit ginjal, multiple myeloma, dan gangguan lain ', ',0,3021,3023,6755,3112,', 'Alat uji globulin', '01.01.066', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3113, 'Glucagon test system', '10101067', 6755, 'perangkat dimaksudkan untuk mengukur hormon glukagon pankreas dalam plasma dan serum. Glukagon pengukuran yang digunakan dalam diagnosis dan pengobatan pasien dengan berbagai gangguan metabolisme karbohidrat, termasuk diabetes mellitus, hipoglikemia, dan ', ',0,3021,3023,6755,3113,', 'Alat uji glukagon', '01.01.067', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3114, 'Glucose test system', '20101069', 7942, 'perangkat dimaksudkan untuk mengukur glukosa kuantitatif dalam darah dan cairan tubuh lainnya. Pengukuran Glukosa digunakan dalam diagnosis dan pengobatan gangguan metabolisme karbohidrat termasuk diabetes mellitus, hipoglikemia neonatal, dan hipoglikemia', ',0,3021,3023,6755,3114,', 'Alat uji glukosa/gula darah', '01.01.069', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3115, 'Gamma-glutamyl transpeptidase and isoenzymes test system', '10101070', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim transpeptidase gamma-glutamil (GGTP??) dalam plasma dan serum. Transpeptidase gamma-glutamil dan isoenzim pengukuran yang digunakan dalam diagnosis dan pengobatan penyakit hati seperti sirosis alkoholik', ',0,3021,3023,6755,3115,', 'Alat uji gamma-glutamil transpeptidase dan isoenzim', '01.01.070', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3116, 'Glutathione test system', '10101071', 6755, 'perangkat dimaksudkan untuk mengukur glutathione (yang tripeptide glisin, sistein, dan asam glutamat) dalam eritrosit (sel darah merah). Glutathione pengukuran yang digunakan dalam diagnosis dan pengobatan tertentu obat-induced hemolitik (eritrosit mengha', ',0,3021,3023,6755,3116,', 'Alat uji glutation', '01.01.071', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3117, 'Human growth hormone test system', '10101072', 6755, 'perangkat dimaksudkan untuk mengukur tingkat hormon pertumbuhan manusia dalam plasma. Pengukuran hormon pertumbuhan manusia yang digunakan dalam diagnosis dan pengobatan gangguan yang melibatkan lobus anterior dari kelenjar pituitary.', ',0,3021,3023,6755,3117,', 'Alat uji human growth hormone (HGH)/ Alat uji hormon pertumbuhan', '01.01.072', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3118, 'Histidine test system', '10101073', 6755, 'perangkat dimaksudkan untuk mengukur histidin bebas (asam amino) dalam plasma dan urin. Pengukuran histidin digunakan dalam diagnosis dan pengobatan histidinemia keturunan yang ditandai dengan kelebihan histidin dalam darah dan urin sering mengakibatkan r', ',0,3021,3023,6755,3118,', 'Alat uji histidin', '01.01.073', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3119, 'Urinary homocystine (nonquantitative) test system', '20101074', 6755, 'perangkat dimaksudkan untuk mengidentifikasi homocystine (analog dari asam amino yang sistin) dalam urin. Identifikasi homocystine kemih digunakan dalam diagnosis dan pengobatan homosistinuria (homosystine dalam urin), yang diwariskan gangguan metabolisme', ',0,3021,3023,6755,3119,', 'Alat uji homosistein urin (nonkuantitatif) ', '01.01.074', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3120, 'Hydroxybutyric dehydrogenase test system', '10101075', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim dehidrogenase alpha-hydroxybutric (HBD) dalam plasma atau serum. Pengukuran HBD digunakan dalam diagnosis dan pengobatan infark miokard, kerusakan ginjal (seperti penolakan transplantasi), penyakit hema', ',0,3021,3023,6755,3120,', 'Alat uji hidroksibutirat dehidrogenase', '01.01.075', 1, 0, 700, NULL, NULL);
