INSERT INTO `aspak_new_alat` VALUES (3122, '5-Hydroxyindole acetic acid/serotonin test system', '10101077', 6755, 'perangkat dimaksudkan untuk mengukur asam asetat 5-hydroxyindole / serotonin dalam urin. Pengukuran asam asetat 5-hydroxyindole / serotonin digunakan dalam diagnosis dan pengobatan tumor karsinoid jaringan endokrin.', ',0,3021,3023,6755,3122,', 'Alat uji 5-hydroxyindoleacetic acid (5-HIAA)/ Alat uji serotonin', '01.01.077', 1, 0, 700, NULL, NULL);
