INSERT INTO `aspak_new_alat` VALUES (3124, 'Hydroxyproline test system', '10101079', 6755, 'perangkat dimaksudkan untuk mengukur hidroksiprolin asam amino dalam urin. Pengukuran hidroksiprolin digunakan dalam diagnosis dan pengobatan berbagai kolagen (jaringan ikat) penyakit, penyakit tulang seperti penyakit Paget, dan gangguan endokrin seperti ', ',0,3021,3023,6755,3124,', 'Alat uji hidroksiprolin', '01.01.079', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3125, 'Immunoreactive insulin test system', '10101080', 6755, 'perangkat dimaksudkan untuk mengukur insulin immunoreactive dalam serum dan plasma. Pengukuran insulin immunoreactive digunakan dalam diagnosis dan pengobatan berbagai gangguan metabolisme karbohidrat, termasuk diabetes mellitus, dan hipoglikemia.', ',0,3021,3023,6755,3125,', 'Alat uji insulin immunoreaktif ', '01.01.080', 1, 0, 700, NULL, NULL);
