INSERT INTO `aspak_new_alat` VALUES (3127, 'Iron-binding capacity test system', '10101082', 6755, 'perangkat dimaksudkan untuk mengukur kapasitas pengikat besi dalam serum. Pengukuran kapasitas pengikat besi digunakan dalam diagnosis dan pengobatan anemia.', ',0,3021,3023,6755,3127,', 'Alat uji kapasitas ikat zat besi ', '01.01.082', 1, 0, 700, NULL, NULL);
