INSERT INTO `aspak_new_alat` VALUES (3130, 'Ketones (nonquantitative) test system', '10101085', 6755, 'perangkat dimaksudkan untuk mengidentifikasi keton dalam urin dan cairan tubuh lainnya. Identifikasi keton digunakan dalam diagnosis dan pengobatan asidosis (kondisi yang ditandai oleh keasaman tinggi abnormal cairan tubuh) atau ketosis (kondisi yang dita', ',0,3021,3023,6755,3130,', 'Alat uji keton (nonkuantitatif)', '01.01.085', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3131, 'Lactate dehydrogenase test system', '20101086', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas laktat dehidrogenase enzim dalam serum. Pengukuran dehidrogenase laktat yang digunakan dalam diagnosis dan pengobatan penyakit hati seperti hepatitis akut virus, sirosis, dan karsinoma metastasis hati, penyak', ',0,3021,3023,6755,3131,', 'Alat uji laktat dehidrogenase/LADH', '01.01.086', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3132, 'Lactate dehydrogenase isoenzymes test system', '20101087', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas isoenzim laktat dehidrogenase (kelompok enzim dengan aktivitas biologis yang sama) dalam serum. Pengukuran isoenzim laktat dehidrogenase digunakan dalam diagnosis dan pengobatan penyakit hati, seperti hepatit', ',0,3021,3023,6755,3132,', 'Alat uji isoenzim laktat dehidrogenase/LADH', '01.01.087', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3133, 'Lactic acid test system', '10101088', 6755, 'perangkat dimaksudkan untuk mengukur asam laktat dalam darah utuh dan plasma. Pengukuran asam laktat yang mengevaluasi status asam-basa yang digunakan dalam diagnosis dan pengobatan asidosis laktat (keasaman abnormal tinggi darah).', ',0,3021,3023,6755,3133,', 'Alat uji asam laktat ', '01.01.088', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3134, 'Lecithin/sphingomyelin ratio in amniotic fluid test system', '20101089', 6755, 'perangkat dimaksudkan untuk mengukur lesitin / sfingomielin rasio dalam cairan ketuban. Lesitin dan sphingomyelin adalah fosfolipid (lemak atau zat lemak seperti mengandung fosfor). Pengukuran dari lesitin / sfingomielin rasio dalam cairan ketuban yang di', ',0,3021,3023,6755,3134,', 'Alat uji rasio lesitin/sphingomyelin pada cairan amniotik', '01.01.089', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3135, 'Leucine aminopeptidase test system', '10101090', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim leusin amino-peptidase dalam serum, plasma, dan urin. Pengukuran aminopeptidase Leusin digunakan dalam diagnosis dan pengobatan penyakit hati seperti hepatitis virus dan ikterus obstruktif.', ',0,3021,3023,6755,3135,', 'Alat uji leusin aminopeptidase', '01.01.090', 1, 0, 700, NULL, NULL);
