INSERT INTO `aspak_new_alat` VALUES (3145, 'Nitrite (nonquantitative) test system', '10101100', 6755, 'perangkat dimaksudkan untuk mengidentifikasi nitrit dalam urin. Identifikasi Nitrit digunakan dalam diagnosis dan pengobatan infeksi saluran uninary asal bakteri.', ',0,3021,3023,6755,3145,', 'Alat uji nitrit (nonkuantitatif)', '01.01.100', 1, 0, 700, NULL, NULL);
