INSERT INTO `aspak_new_alat` VALUES (3147, '5\'-Nucleotidase test system', '10101102', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim 5\'-nucleotidase dalam serum dan plasma. Pengukuran 5\'-nucleotidase digunakan dalam diagnosis dan pengobatan penyakit hati dan dalam pembedaan antara hati dan penyakit tulang di hadapan aktivitas alkali ', ',0,3021,3023,6755,3147,', 'Alat uji 5\'-nukleotidase', '01.01.102', 1, 0, 700, NULL, NULL);
