INSERT INTO `aspak_new_alat` VALUES (3149, 'Ornithine carbamyl transferase test system', '10101104', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim ornithine carbamyl transferase (Oktober) dalam serum. Ornithine carbamyl pengukuran transferase digunakan dalam diagnosis dan pengobatan penyakit hati, seperti hepatitis menular, kolesistitis akut (rada', ',0,3021,3023,6755,3149,', 'Alat uji enzim ornithine carbamyl transferase (OCT)', '01.01.104', 1, 0, 700, NULL, NULL);
