INSERT INTO `aspak_new_alat` VALUES (3166, 'Pregnenolone test system', '10101121', 6755, 'perangkat dimaksudkan untuk mengukur pregnenolon (prekursor dalam biosintesis hormon kortisol adrenal dan adrenal androgen) dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit dari korteks', ',0,3021,3023,6755,3166,', 'Alat uji pregnenolone', '01.01.121', 1, 0, 700, NULL, NULL);
