INSERT INTO `aspak_new_alat` VALUES (3170, 'Total protein test system/reagen pemeriksaan protein total', '20101125', 6755, 'perangkat dimaksudkan untuk mengukur jumlah protein (s) dalam serum atau plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan berbagai penyakit yang melibatkan hati, ginjal, atau sumsum tulang serta metabolisme lai', ',0,3021,3023,6755,3170,', NULL, '01.01.125', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3171, 'Protein-bound iodine test system', '10101126', 6755, 'perangkat dimaksudkan untuk mengukur yodium protein yang terikat dalam serum. Pengukuran yodium protein yang terikat diperoleh dengan perangkat ini digunakan dalam diagnosis dan pengobatan gangguan tiroid.', ',0,3021,3023,6755,3171,', 'Alat uji iodin yang terikat dengan protein', '01.01.126', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3172, 'Urinary protein or albumin (nonquantitative) test system', '10101127', 6755, 'perangkat dimaksudkan untuk mengidentifikasi protein atau albumin dalam urin. Identifikasi protein urin atau albumin (nonquantitative) digunakan dalam diagnosis dan pengobatan kondisi penyakit seperti penyakit ginjal atau jantung atau gangguan tiroid, yan', ',0,3021,3023,6755,3172,', 'Alat uji albumin atau protein urin', '01.01.127', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3173, 'Pyruvate kinase test system', '10101128', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas kinase piruvat enzim dalam eritrosit (sel darah merah). Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan berbagai anemia diwariskan karena kekurangan kinase piruvat atau p', ',0,3021,3023,6755,3173,', 'Alat uji piruvat kinase', '01.01.128', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3174, 'Pyruvic acid test system', '10101129', 6755, 'antara dalam metabolisme karbohidrat) dalam plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam evaluasi metabolisme elektrolit dan dalam diagnosis dan pengobatan asam-basa dan elektrolit gangguan atau anoksia (pengurangan oksigen dalam j', ',0,3021,3023,6755,3174,', 'Alat uji asam piruvat', '01.01.129', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3175, 'Quality control material (assayed and unassayed)', '10101130', 6755, 'perangkat ditujukan untuk tujuan medis untuk digunakan dalam sistem tes untuk memperkirakan presisi pengujian dan untuk mendeteksi penyimpangan analitis sistematis yang mungkin timbul dari reagen atau variasi instrumen analitis. Bahan kontrol kualitas (di', ',0,3021,3023,6755,3175,', 'Reagen kontrol kualitas (assayed dan unassayed)', '01.01.130', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3176, 'Sodium test system', '20101131', 7936, 'perangkat dimaksudkan untuk mengukur natrium dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan aldosteronisme (sekresi berlebihan hormon aldosteron), diabetes insipidus (ekskresi kronis da', ',0,3021,3023,6755,3176,', 'Alat uji natrium', '01.01.131', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3177, 'Sorbitol dehydrogenase test system', '10101132', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas enzim dehidrogenase sorbitol dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan gangguan hati seperti sirosis atau hepatitis akut.', ',0,3021,3023,6755,3177,', 'Alat uji sorbitol dehidrogenase', '01.01.132', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3178, 'Blood specimen collection device', '20101133', 7945, 'perangkat ditujukan untuk tujuan medis untuk mengumpulkan dan menangani spesimen darah dan untuk memisahkan serum dari nonserum (seluler) komponen sebelum pengujian lebih lanjut. Ini jenis perangkat generik mungkin termasuk tabung darah koleksi, botol, si', ',0,3021,3023,6755,3178,', 'Alat pengumpul sampel darah', '01.01.133', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3179, 'Tacrolimus test system', '20101134', 6755, 'perangkat dimaksudkan untuk menentukan kuantitatif konsentrasi tacrolimus sebagai bantuan dalam pengelolaan pasien transplantasi yang menerima terapi dengan obat ini. Ini jenis generik perangkat termasuk immunoassay dan tes kromatografi untuk tacrolimus.', ',0,3021,3023,6755,3179,', 'Alat uji tacrolimus', '01.01.134', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3180, 'Testosterone test system', '10101135', 6755, 'perangkat dimaksudkan untuk mengukur testosteron (hormon seks pria) dalam serum, plasma, dan urin. Pengukuran testosteron digunakan dalam diagnosis dan pengobatan gangguan yang melibatkan hormon seks pria (androgen), termasuk hipogonadisme primer dan seku', ',0,3021,3023,6755,3180,', 'Alat uji testosteron', '01.01.135', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3181, 'Thyroxine-binding globulin test system', '20101136', 6755, 'perangkat dimaksudkan untuk mengukur tiroksin (tiroid)-binding globulin (TBG), protein plasma yang mengikat tiroksin, dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit tiroid.', ',0,3021,3023,6755,3181,', 'Alat uji thyroxine-binding globulin (TBG)', '01.01.136', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3182, 'Thyroid stimulating hormone test system', '20101137', 7932, 'perangkat dimaksudkan untuk mengukur thyroid stimulating hormone, juga dikenal sebagai thyrotrophin dan hormon thyrotrophic, dalam serum dan plasma. Pengukuran thyroid stimulating hormon yang dihasilkan oleh hipofisis anterior digunakan dalam diagnosis ti', ',0,3021,3023,6755,3182,', 'Alat uji thyroid stimulating hormone hormon (TSH) ', '01.01.137', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3183, 'Free thyroxine test system', '20101138', 6755, 'perangkat dimaksudkan untuk mengukur bebas (tidak terikat protein) tiroksin (hormon tiroid) dalam serum atau plasma. Tingkat tiroksin bebas dalam plasma diperkirakan mencerminkan jumlah hormon tiroksin yang tersedia ke sel dan karena itu dapat menentukan ', ',0,3021,3023,6755,3183,', 'Alat uji tiroksin / T4 bebas', '01.01.138', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3184, 'Total thyroxine test system', '20101139', 6755, 'perangkat dimaksudkan untuk mengukur jumlah (bebas dan terikat protein) tiroksin (hormon tiroid) dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit tiroid', ',0,3021,3023,6755,3184,', 'Alat uji tiroksin total / T4', '01.01.139', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3185, 'Triglyceride test system', '10101140', 6755, 'perangkat dimaksudkan untuk mengukur trigliserida (lemak netral) dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan pasien dengan diabetes mellitus, nephrosis, obstruksi hati, penyakit lain yang m', ',0,3021,3023,6755,3185,', 'Alat uji trigliserid', '01.01.140', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3186, 'Total triiodothyronine test system', '20101141', 6755, 'perangkat dimaksudkan untuk mengukur triiodothyronine hormon dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit tiroid seperti hipertiroid', ',0,3021,3023,6755,3186,', 'Alat uji triiodotironina total / T3', '01.01.141', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3187, 'Triiodothyronine uptake test system', '20101142', 6755, 'perangkat dimaksudkan untuk mengukur jumlah total situs mengikat tersedia untuk hormon tiroid mengikat protein tiroksin-mengikat, thyroid-binding globulin, prealbumin tiroksin-mengikat, dan albumin serum dan plasma. Perangkat ini memberikan pengukuran lan', ',0,3021,3023,6755,3187,', 'Alat uji triiodotironina / T3 uptake (T3-uptake)', '01.01.142', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3188, 'Triose phosphate isomerase test system', '10101143', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas isomerase fosfat triose enzim dalam eritrosit (sel darah merah). Isomerase fosfat triose merupakan enzim penting dalam glikolisis (konversi energi menghasilkan glukosa menjadi asam laktat dalam berbagai jarin', ',0,3021,3023,6755,3188,', 'Alat uji triomer fosfat isomerase', '01.01.143', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3189, 'Trypsin test system', '10101144', 6755, 'perangkat dimaksudkan untuk mengukur aktivitas tripsin (enzim pankreas penting dalam pencernaan untuk pemecahan protein) dalam darah dan cairan tubuh lain dan dalam tinja. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobat', ',0,3021,3023,6755,3189,', 'Alat uji tripsin', '01.01.144', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3190, 'Free tyrosine test system', '10101145', 6755, 'perangkat dimaksudkan untuk mengukur tirosin bebas (asam amono) dalam serum dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit seperti tyrosinemia bawaan (penyakit yang dapat menyebabkan gangguan hati ', ',0,3021,3023,6755,3190,', 'Alat uji tirosin bebas', '01.01.145', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3191, 'Urea nitrogen test system', '20101146', 6755, '', ',0,3021,3023,6755,3191,', 'Alat uji urea nitrogen / BUN', '01.01.146', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3192, 'Uric acid test system', '10101147', 7634, 'perangkat dimaksudkan untuk mengukur asam urat dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan berbagai gangguan ginjal dan metabolisme, termasuk gagal ginjal, asam urat, leukemia, psori', ',0,3021,3023,6755,3192,', 'Alat uji asam urat', '01.01.147', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3193, 'Urinary calculi (stones) test system', '10101148', 6755, 'perangkat dimaksudkan untuk analisis bate urine. Analisis bate urine digunakan dalam diagnosis dan pengobatan bate pada saluran kemih.', ',0,3021,3023,6755,3193,', 'Alat uji batu kemih', '01.01.148', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3194, 'Urinary urobilinogen (nonquantitative) test system', '10101149', 6755, 'perangkat dimaksudkan untuk mendeteksi dan memperkirakan urobilinogen (a pigmen empedu produk degradasi hemoglobin sel darah merah) dalam urin. Estimasi yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penyakit hati dan (sel dara', ',0,3021,3023,6755,3194,', 'Alat uji urobilinogen urin (nonkuantitatif)', '01.01.149', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3195, 'Uroporphyrin test system', '10101150', 6755, 'perangkat dimaksudkan untuk mengukur uroporphyrin dalam urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan porfiria (penyakit terutama yang terkait dengan warisan metabolisme porfirin terganggu), keracunan timbal, ', ',0,3021,3023,6755,3195,', 'Alat uji uroporphyrin', '01.01.150', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3196, 'Vanilmandelic acid test system', '10101151', 6755, 'perangkat dimaksudkan untuk mengukur asam vanilmandelic dalam urin. Pengukuran asam vanilmandelic diperoleh dengan perangkat ini digunakan dalam diagnosis dan pengobatan neuroblastoma, pheochromocytoma, dan kondisi hipertensi tertentu.', ',0,3021,3023,6755,3196,', 'Alat uji vanillylmandelic acid (VMA)', '01.01.151', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3197, 'Vitamin A test system', '10101152', 6755, 'perangkat dimaksudkan untuk mengukur vitamin A dalam serum atau plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan vitamin kondisi defisiensi, termasuk kebutaan malam, atau kulit, mata, atau gangguan usus.\n', ',0,3021,3023,6755,3197,', 'Alat uji vitamin A', '01.01.152', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3198, 'Vitamin B12 test system', '20101153', 7941, 'perangkat dimaksudkan untuk mengukur vitamin B12in serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan anemia malabsorpsi gastrointestinal.', ',0,3021,3023,6755,3198,', 'Alat uji vitamin B12/sianokobalamin', '01.01.153', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3199, 'Vitamin E test system', '10101154', 6755, 'perangkat dimaksudkan untuk mengukur vitamin E (tokoferol) dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan bayi dengan defisiensi vitamin E sindrom', ',0,3021,3023,6755,3199,', 'Alat uji vitamin E', '01.01.154', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3200, 'Xylose test system', '10101155', 6755, 'perangkat dimaksudkan untuk mengukur xylose (gula) dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan sindrom malabsorpsi gastrointestinal (sekelompok gangguan di mana ada penyerapan subnor', ',0,3021,3023,6755,3200,', 'Alat uji xilosa', '01.01.155', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3201, 'Vitamin D test system', '20101156', 6755, 'perangkat dimaksudkan untuk digunakan dalam laboratorium klinis untuk penentuan kuantitatif dari 25-hidroksivitamin D (25-OH-D) dan metabolit dihidroksilasi lain dari vitamin D dalam serum atau plasma yang akan digunakan dalam penilaian kecukupan vitamin ', ',0,3021,3023,6755,3201,', 'Alat uji vitamin D, ergokalsiferol', '01.01.156', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3202, 'General purpose laboratory equipment labeled or promoted for a specific medical use', '10102001', 8142, 'perangkat yang dimaksudkan untuk mempersiapkan atau memeriksa spesimen dari tubuh manusia dan yang diberi label atau dipromosikan untuk penggunaan medis tertentu.', ',0,3021,3024,6756,3202,', 'Alat laboratorium untuk penggunaan umum', '01.02.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3203, 'Calculator/data processing module for clinical use', '10102002', 8156, 'perangkat elektronik dimaksudkan untuk menyimpan, mengambil, dan data laboratorium proses.', ',0,3021,3024,6756,3203,', 'Kalkulator/modul pemroses data untuk tujuan klinis', '01.02.002', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3204, 'Centrifugal chemistry analyzer for clinical use', '10102003', 8139, 'sebuah alat otomatis yang dimaksudkan untuk centrifugally mencampur sampel dan reagen dan konsentrasi mengukur spektrofotometer dari konstituen sampel. Perangkat ini dirancang untuk digunakan dalam hubungannya dengan bahan tertentu untuk mengukur berbagai', ',0,3021,3024,6756,3204,', 'Alat analisa kimia sentrifugal untuk tujuan klinis', '01.02.003', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3205, 'Continuous flow sequential multiple chemistry analyzer for clinical use', '10102004', 8138, 'sebuah alat otomatis yang dimaksudkan untuk centrifugally mencampur sampel dan reagen dan konsentrasi mengukur spektrofotometer dari konstituen sampel. Perangkat ini dirancang untuk digunakan dalam hubungannya dengan bahan tertentu untuk mengukur berbagai', ',0,3021,3024,6756,3205,', 'Alat analisa kimia multi parameter berkesinambungan untuk tujuan klinis', '01.02.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3206, 'Discrete photometric chemistry analyzer for clinical use', '10102005', 8137, 'perangkat dimaksudkan untuk menduplikasi prosedur analitis pengguna dengan melakukan berbagai langkah otomatis seperti pipetting, mempersiapkan filtrat, pemanas, dan intensitas warna pengukuran. Perangkat ini dirancang untuk digunakan dalam hubungannya de', ',0,3021,3024,6756,3206,', 'Alat analisa kimia fotometri diskrit untuk tujuan klinis', '01.02.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3207, 'Micro chemistry analyzer for clinical use', '10102006', 6756, 'perangkat dimaksudkan untuk menduplikasi prosedur analitis pengguna dengan melakukan berbagai langkah otomatis seperti pipetting, mempersiapkan filtrat, pemanas, dan intensitas warna pengukuran. Karakteristik yang membedakan dari perangkat ini adalah bahw', ',0,3021,3024,6756,3207,', 'Alat analisa kimia mikro untuk tujuan klinis', '01.02.006', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3208, 'Chromatographic separation material for clinical use', '10102007', 8122, 'aksesori perangkat (misalnya, pertukaran ion penyerap, ion exchagne resin, dan kertas ion) dimaksudkan untuk digunakan dalam kromatografi penukar ion, suatu prosedur dimana senyawa dipisahkan dari solusi.', ',0,3021,3024,6756,3208,', 'Peralatan pemisah kromatografi untuk tujuan klinis', '01.02.007', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3209, 'Gas liquid chromatography system for clinical use', '10102008', 8155, 'perangkat dimaksudkan untuk memisahkan satu atau lebih obat-obatan atau senyawa dari campuran. Setiap unsur dalam campuran menguap senyawa dipisahkan sesuai dengan tekanan uapnya. Perangkat mungkin termasuk aksesoris seperti kolom, gas, mendukung kolom, d', ',0,3021,3024,6756,3209,', 'Kromatografi cair gas untuk tujuan klinis', '01.02.008', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3210, 'High pressure liquid chromatography system for clinical use', '10102009', 8154, 'perangkat dimaksudkan untuk memisahkan satu atau lebih obat-obatan atau senyawa dari solusi dengan mengolah campuran senyawa (zat terlarut) melalui kolom dikemas dengan bahan ukuran seragam (fase diam) di bawah pengaruh cairan tekanan tinggi (fase gerak).', ',0,3021,3024,6756,3210,', 'Kromatografi cair tekanan tinggi untuk tujuan klinis', '01.02.009', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3211, 'Thin-layer chromatography system for clinical use', '10102010', 8153, 'perangkat dimaksudkan untuk memisahkan satu atau lebih obat-obatan atau senyawa dari campuran. Campuran senyawa diserap ke fase stasioner atau lapisan tipis bahan inert (misalnya, selulosa, alumina, dll) dan dielusi off dengan bergerak pelarut (fase berge', ',0,3021,3024,6756,3211,', 'Alat uji kromatografi lapis tipis', '01.02.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3212, 'Colorimeter, photometer, or spectrophotometer for clinical use', '10102011', 8152, 'instrumen dimaksudkan untuk mengukur energi radiasi yang dipancarkan, ditransmisikan, diserap, atau tercermin dalam kondisi yang terkendali. Perangkat mungkin termasuk monokromator untuk menghasilkan cahaya dari panjang gelombang tertentu.', ',0,3021,3024,6756,3212,', 'Kolorimeter, fotometer, dan spektrofotometer untuk tujuan klinis', '01.02.011', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3213, 'Clinical sample concentrator', '10102012', 8121, 'perangkat dimaksudkan untuk berkonsentrasi (dengan dialisis, penguapan, dll) serum, urin, cairan serebrospinal, dan cairan tubuh lainnya sebelum cairan dianalisis.', ',0,3021,3024,6756,3213,', 'Konsentrator sampel klinis', '01.02.012', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3214, 'Beta or gamma counter for clinical use', '10102013', 8133, 'perangkat dimaksudkan untuk mendeteksi dan menghitung beta atau gamma radiasi yang dipancarkan oleh sampel klinis. Sampel klinis disiapkan dengan penambahan reagen radioaktif untuk sampel. Pengukuran ini berguna dalam diagnosis dan pengobatan berbagai gan', ',0,3021,3024,6756,3214,', 'Alat penghitung beta atau gamma untuk tujuan klinis', '01.02.013', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3215, 'Densitometer/scanner (integrating, reflectance, TLC, or radiochromatogram) for clinical use', '10102014', 6756, 'perangkat dimaksudkan untuk mengukur konsentrasi suatu zat pada permukaan film atau media pendukung lainnya dengan baik pengukuran fotosel dari transmisi cahaya melalui daerah tertentu medium atau, dalam kasus pemindai radiochromatogram, dengan pengukuran', ',0,3021,3024,6756,3215,', 'Alat pemindai/densitometer untuk tujuan klinis', '01.02.014', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3216, 'Electrophoresis apparatus for clinical use', '10102015', 8130, 'perangkat dimaksudkan untuk molekul atau partikel yang terpisah, termasuk protein plasma, lipoprotein, enzim, dan hemoglobulins atas dasar muatan bersih mereka di media buffer tertentu. Perangkat ini digunakan bersama dengan bahan tertentu untuk mengukur ', ',0,3021,3024,6756,3216,', 'Alat elektroforesis untuk tujuan klinis , Isoelectric focusing system / Imunofiksasi', '01.02.015', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3217, 'Enzyme analyzer for clinical use', '10102016', 8128, 'perangkat dimaksudkan untuk mengukur enzim dalam plasma atau serum dengan pengukuran nonkinetic atau kinetik reaksi enzim-dikatalisasi. Perangkat ini digunakan bersama dengan bahan tertentu untuk mengukur berbagai enzim sebagai bantuan dalam diagnosis dan', ',0,3021,3024,6756,3217,', 'Alat analisa enzim untuk tujuan klinis', '01.02.016', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3218, 'Flame emission photometer for clinical use', '10102017', 8151, 'perangkat dimaksudkan untuk mengukur konsentrasi natrium, kalium, lithium, dan ion logam lainnya dalam cairan tubuh. Variasi abnormal dalam konsentrasi zat-zat dalam tubuh adalah indikasi dari gangguan tertentu (misalnya, ketidakseimbangan elektrolit, dan', ',0,3021,3024,6756,3218,', 'Fotometer nyala emisi untuk tujuan klinis', '01.02.017', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3219, 'Fluorometer for clinical use', '10102018', 8150, 'perangkat dimaksudkan untuk mengukur oleh analit tertentu fluoresensi. Fluoresensi adalah milik zat tertentu memancar, ketika diterangi, cahaya dari panjang gelombang yang berbeda. Perangkat ini digunakan bersama dengan bahan tertentu untuk mengukur berba', ',0,3021,3024,6756,3219,', 'Fluorometer untuk tujuan klinis', '01.02.018', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3221, 'Microtitrator for clinical use', '10102020', 8127, 'perangkat dimaksudkan untuk digunakan dalam micronanalysis untuk mengukur konsentrasi suatu zat dengan mereaksikan dengan ukuran sebuah \"mikro\" Volume larutan standar yang dikenal.', ',0,3021,3024,6756,3221,', 'Microtitrator untuk tujuan klinis', '01.02.020', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3222, 'Nephelometer for clinical use', '10102021', 8126, 'perangkat dimaksudkan untuk memperkirakan konsentrasi partikel dalam suspensi dengan mengukur sifat hamburan cahaya mereka (pembelokan sinar cahaya oleh partikel buram di jalan mereka). Perangkat ini digunakan bersama dengan bahan tertentu untuk mengukur ', ',0,3021,3024,6756,3222,', 'Alat nephelometer untuk tujuan klinis, nefelometer', '01.02.021', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3223, 'Plasma oncometer for clinical use', '10102022', 6756, 'perangkat dimaksudkan untuk mengukur tekanan onkotik plasma, yaitu bahwa sebagian dari total tekanan osmotik plasma disumbangkan oleh protein dan molekul lainnya terlalu besar untuk melewati membran semipermeabel ditentukan. Karena variasi tekanan onkotik', ',0,3021,3024,6756,3223,', 'Oncometer plasma untuk tujuan klinis', '01.02.022', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3224, 'Osmometer for clinical use', '10102023', 6756, 'perangkat dimaksudkan untuk mengukur tekanan osmotik cairan tubuh. Tekanan osmotik adalah tekanan yang dibutuhkan untuk mencegah lewatnya larutan dengan konsentrasi zat terlarut rendah ke larutan dengan konsentrasi zat terlarut lebih besar ketika dua solu', ',0,3021,3024,6756,3224,', 'Osmometer untuk tujuan klinis', '01.02.023', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3225, 'Pipetting and diluting system for clinical use', '10102024', 6756, 'perangkat dimaksudkan untuk memberikan volume yang diukur secara akurat cair pada suhu tertentu untuk digunakan dalam prosedur pengujian tertentu. Ini jenis generik sistem perangkat meliputi, manual, otomatis, dan semi-otomatis dilutors serial, pipettors,', ',0,3021,3024,6756,3225,', 'Alat pemipet dan pengencer untuk tujuan klinis , Penghisap mekanik dan tabung', '01.02.024', 1, 1, 350, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3226, 'Refractometer for clinical use', '10102025', 6756, 'perangkat dimaksudkan untuk menentukan jumlah zat terlarut dalam suatu larutan dengan mengukur indeks bias (rasio kecepatan cahaya dalam ruang hampa dengan kecepatan cahaya dalam larutan). Indeks bias digunakan untuk mengukur konsentrasi analit tertentu (', ',0,3021,3024,6756,3226,', 'Refraktometer untuk tujuan klinis', '01.02.025', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3227, 'Atomic absorption spectrophotometer for clinical use', '10102026', 8145, 'perangkat dimaksudkan untuk mengidentifikasi dan mengukur elemen dan logam (misalnya, timbal dan merkuri) dalam spesimen manusia. Unsur-unsur logam diidentifikasi sesuai dengan panjang gelombang dan intensitas cahaya yang diserap ketika spesimen tersebut ', ',0,3021,3024,6756,3227,', 'Spektrofotometer absorpsi atom untuk tujuan klinis', '01.02.026', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3228, 'Mass spectrometer for clinical use', '10102027', 8144, 'perangkat dimaksudkan untuk mengidentifikasi senyawa organik atau anorganik (misalnya, timbal, merkuri, dan obat-obatan) dalam spesimen manusia oleh ionisasi senyawa dalam penyelidikan dan memisahkan ion dihasilkan melalui medan listrik dan magnetik sesua', ',0,3021,3024,6756,3228,', 'Spektrometer massa untuk tujuan klinis', '01.02.027', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3229, 'Automated urinalysis system', '10102028', 6756, 'perangkat dimaksudkan untuk mengukur tertentu dari sifat fisik dan kandungan kimia dari urin dengan prosedur yang menduplikasi sistem urinalisis manual. Perangkat ini digunakan bersama dengan bahan tertentu untuk mengukur berbagai analit kemih.', ',0,3021,3024,6756,3229,', 'Alat uji analisa urin otomatis', '01.02.028', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3230, 'Plasma viscometer for clinical use', '10102029', 8143, 'perangkat dimaksudkan untuk mengukur viskositas plasma dengan menentukan jangka waktu yang dibutuhkan untuk plasma mengalir jarak diukur melalui tabung gelas dikalibrasi. Pengukuran yang diperoleh oleh perangkat ini digunakan untuk memantau perubahan juml', ',0,3021,3024,6756,3230,', 'Viskometer plasma untuk tujuan klinis', '01.02.029', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3231, 'Acetaminophen test system/reagen pemeriksaan Asetaminofen ', '20103001', 6757, 'perangkat dimaksudkan untuk mengukur acetaminophen, sebuah analgestic dan demam mengurangi obat, dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan acetaminophen overdosis.', ',0,3021,3025,6757,3231,', NULL, '01.03.001', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3232, 'Amikacin test system', '20103002', 6757, 'perangkat dimaksudkan untuk mengukur amikasin, obat antibiotik aminoglikosida, dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan amikasin overdosis dan memantau kadar amikasin untuk memastikan te', ',0,3021,3025,6757,3232,', 'Alat uji amikasin', '01.03.002', 1, 0, 700, NULL, NULL);
