INSERT INTO `aspak_new_alat` VALUES (3234, 'Breath-alcohol test system', '10103004', 8260, 'perangkat intened untuk mengukur alkohol dalam napas manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis keracunan alkohol.', ',0,3021,3025,6757,3234,', 'Alat uji alkohol pada nafas', '01.03.004', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3235, 'Breath nitric oxide test system', '20103005', 6757, 'perangkat dimaksudkan untuk mengukur oksida nitrat pecahan dalam napas manusia. Pengukuran perubahan konsentrasi oksida nitrat dalam pecahan bantu napas berakhir dalam mengevaluasi respon pasien asma untuk terapi anti-inflamasi, sebagai tambahan untuk men', ',0,3021,3025,6757,3235,', 'Alat uji nitrogen monoksida (NO) pada nafas', '01.03.005', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3236, 'Amphetamine test system', '20103006', 6757, 'perangkat dimaksudkan untuk mengukur amfetamin, merangsang sistem saraf pusat obat, dalam plasma dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan amfetamin atau overdosis dan memantau tingkat amfet', ',0,3021,3025,6757,3236,', 'Alat uji amfetamin', '01.03.006', 1, 0, 700, NULL, NULL);
