INSERT INTO `aspak_new_alat` VALUES (3240, 'Benzodiazepine test system', '20103010', 6757, 'perangkat dimaksudkan untuk mengukur salah satu senyawa benzodiazepine, obat penenang dan obat hipnotik, dalam darah, plasma, dan urin. Senyawa benzodiazepin termasuk chlordiazepoxide, diazepam, oxazepam, chlorzepate, flurazepam, dan nitrazepam. Pengukura', ',0,3021,3025,6757,3240,', 'Alat uji benzodiazepin', '01.03.010', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3241, 'Clinical toxicology calibrator ', '20103011', 6757, 'perangkat ditujukan untuk tujuan medis untuk digunakan dalam sistem tes untuk menetapkan titik acuan yang digunakan dalam penentuan nilai dalam pengukuran zat dalam spesimen manusia. Sebuah toksikologi kalibrator klinis dapat berupa campuran obat atau bah', ',0,3021,3025,6757,3241,', 'Kalibrator toksikologi klinis', '01.03.011', 1, 0, 700, NULL, NULL);
