INSERT INTO `aspak_new_alat` VALUES (3244, 'Cocaine and cocaine metabolite test system', '20103014', 6757, 'perangkat dimaksudkan untuk mengukur kokain dan kokain metabolit (benzoylecgonine) dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan kokain atau overdosis.', ',0,3021,3025,6757,3244,', 'Alat uji kokain dan metabolit kokain', '01.03.014', 1, 0, 700, NULL, NULL);
