INSERT INTO `aspak_new_alat` VALUES (3247, 'Digitoxin test system', '20103017', 6757, 'perangkat dimaksudkan untuk mengukur digitoxin, obat kardiovaskular, dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan overdosis digitoxin dan memantau tingkat digitoxin untuk memastikan terapi y', ',0,3021,3025,6757,3247,', 'Alat uji digitoksin', '01.03.017', 1, 0, 700, NULL, NULL);
