INSERT INTO `aspak_new_alat` VALUES (3249, 'Diphenylhydantoin test system', '20103019', 6757, 'perangkat dimaksudkan untuk mengukur diphenylhydantoin, obat antiepilepsi, dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan diphenylhydantoin overdosis dan memantau tingkat diphenylhydantoin unt', ',0,3021,3025,6757,3249,', 'Alat uji difenilhidantoin', '01.03.019', 1, 0, 700, NULL, NULL);
