INSERT INTO `aspak_new_alat` VALUES (3251, 'Ethosuximide test system/reagen pemeriksaan Ethosuximide ', '20103021', 6757, 'perangkat dimaksudkan untuk mengukur ethosuximide, obat antiepilepsi, dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan ethosuximide overdosis dan tingkat pemantauan ethosuximide untuk memastikan', ',0,3021,3025,6757,3251,', NULL, '01.03.021', 1, 0, 700, NULL, NULL);
