INSERT INTO `aspak_new_alat` VALUES (3256, 'Lithium test system', '20103026', 8181, 'perangkat dimaksudkan untuk mengukur lithium (lithium karbonat dari obat) dalam serum atau plasma. Pengukuran lithium digunakan untuk memastikan bahwa dosis obat yang tepat diberikan dalam pengobatan pasien dengan gangguan mental, seperti penyakit manik-d', ',0,3021,3025,6757,3256,', 'Alat uji litium', '01.03.026', 1, 0, 700, NULL, NULL);
