INSERT INTO `aspak_new_alat` VALUES (3259, 'Methamphetamine test system', '20103029', 6757, 'perangkat dimaksudkan untuk mengukur metamfetamin, sistem saraf pusat merangsang obat, dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan metamfetamin atau overdosis.', ',0,3021,3025,6757,3259,', 'Alat uji metamfetamin/ sabu', '01.03.029', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3260, 'Methadone test system', '20103030', 6757, 'perangkat dimaksudkan untuk mengukur metadon, sebuah narkotika obat penghilang rasa sakit adiktif, dalam serum dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan metadon atau overdosis dan untuk mene', ',0,3021,3025,6757,3260,', 'Alat uji metadon', '01.03.030', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3261, 'Methaqualone test system/reagen pemeriksaan Methaqualone ', '20103031', 6757, 'perangkat dimaksudkan untuk mengukur methaqualone, obat penenang hipnotis dan, dalam urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan methaqualone atau overdosis.', ',0,3021,3025,6757,3261,', NULL, '01.03.031', 1, 0, 700, NULL, NULL);
