INSERT INTO `aspak_new_alat` VALUES (3263, 'Neuroleptic drugs radioreceptor assay test system', '20103033', 6757, 'perangkat dimaksudkan untuk mengukur dalam serum atau plasma dopamin reseptor aktivitas memblokir obat neuroleptik dan metabolit aktif mereka. Sebuah obat neuroleptik telah tindakan anti-psikotik yang mempengaruhi aktivitas terutama psikomotor, umumnya ta', ',0,3021,3025,6757,3263,', 'Alat uji radioreseptor obat neuroleptik', '01.03.033', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3264, 'Opiate test system', '20103034', 6757, 'perangkat dimaksudkan untuk mengukur salah satu obat penghilang rasa sakit opiat adiktif narkotika dalam darah, serum, urin, isi lambung, dan air liur. Candu adalah obat alami atau sintetis yang memiliki morfin-seperti tindakan pharmocological. Para opiat', ',0,3021,3025,6757,3264,', 'Alat uji opiat', '01.03.034', 1, 0, 700, NULL, NULL);
