INSERT INTO `aspak_new_alat` VALUES (3266, 'Phenothiazine test system', '20103036', 6757, 'perangkat dimaksudkan untuk mengukur salah satu obat dari kelas fenotiazin dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan fenotiazin atau overdosis.', ',0,3021,3025,6757,3266,', 'Alat uji fenotiazin', '01.03.036', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3267, 'Primidone test system', '20103037', 6757, 'perangkat dimaksudkan untuk mengukur primidone, obat antiepilepsi, dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan primidone overdosis dan tingkat pemantauan primidone untuk memastikan terapi y', ',0,3021,3025,6757,3267,', 'Alat uji primido', '01.03.037', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3268, 'Propoxyphene test system/reagen pemeriksaan Propoxyphene ', '20103038', 6757, 'perangkat dimaksudkan untuk mengukur propoxyphene, obat penghilang rasa sakit, dalam serum, plasma, dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan penggunaan propoxyphene atau overdosis atau dalam memantau ', ',0,3021,3025,6757,3268,', NULL, '01.03.038', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3269, 'Quinine test system', '10103039', 6757, 'perangkat dimaksudkan untuk mengukur kina, demam-mengurangi dan obat penghilang rasa sakit yang dimaksudkan dalam pengobatan malaria, dalam serum dan urin. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan kina overdosi', ',0,3021,3025,6757,3269,', 'Alat uji kina', '01.03.039', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3270, 'Salicylate test system', '20103040', 6757, 'perangkat dimaksudkan untuk mengukur salisilat, kelas analgesik, antipiretik dan obat-obatan anti-inflamasi yang meliputi aspirin, dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan salisilat over', ',0,3021,3025,6757,3270,', 'Alat uji salisilat', '01.03.040', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3271, 'Sirolimus test system', '20103041', 6757, 'perangkat dimaksudkan untuk menentukan kuantitatif konsentrasi sirolimus dalam darah keseluruhan. Pengukuran digunakan sebagai bantuan dalam pengelolaan pasien transplantasi yang menerima terapi dengan sirolimus.', ',0,3021,3025,6757,3271,', 'Alat uji sirolimus', '01.03.041', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3272, 'Sulfonamide test system', '10103042', 6757, 'perangkat dimaksudkan untuk mengukur sulfonamid, salah satu obat antibakteri yang berasal dari sulfanilamide, dalam spesimen manusia. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan overdosis sulfonamide dan memantau ', ',0,3021,3025,6757,3272,', 'Alat uji sulfonamida', '01.03.042', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3273, 'Cannabinoid test system', '20103043', 6757, 'perangkat dimaksudkan untuk mengukur salah satu cannabinoid, senyawa halusinogen endogen untuk mariyuana, dalam serum, plasma, air liur, dan urin. Senyawa cannabinoid includedelta-9-tetrahydrocannabinol, cannabidiol, cannabinol, dan cannabichromene. Pengu', ',0,3021,3025,6757,3273,', 'Alat uji kanabinoid', '01.03.043', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3274, 'Theophylline test system', '20103044', 6757, 'perangkat dimaksudkan untuk mengukur teofilin (obat yang digunakan untuk stimulasi otot-otot dalam sistem saraf kardiovaskular, pernapasan, dan pusat) dalam serum dan plasma. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengo', ',0,3021,3025,6757,3274,', 'Alat uji teofilin', '01.03.044', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3275, 'Tobramycin test system', '20103045', 6757, 'perangkat dimaksudkan untuk mengukur tobramycin, obat antibiotik aminoglikosida, dalam plasma dan serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan tobramycin overdosis dan tingkat pemantauan tobramycin untuk mem', ',0,3021,3025,6757,3275,', 'Alat uji tobramisin', '01.03.045', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3276, 'Tricyclic antidepressant drugs test system', '20103046', 6757, 'perangkat dimaksudkan untuk mengukur salah satu obat antidepresan trisiklik dalam serum. Obat-obatan antidepresan trisiklik termasuk imipramine, desipramine, amitriptyline, nortriptyline, protriptyline, dan doksepin. Pengukuran yang diperoleh oleh perangk', ',0,3021,3025,6757,3276,', 'Alat uji antidepresan trisiklik (TCA)', '01.03.046', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3277, 'Vancomycin test system', '20103047', 6757, 'perangkat dimaksudkan untuk mengukur vankomisin, obat antibiotik, dalam serum. Pengukuran yang diperoleh oleh perangkat ini digunakan dalam diagnosis dan pengobatan vankomisin overdosis dan memantau tingkat vankomisin untuk memastikan terapi yang tepat.\n', ',0,3021,3025,6757,3277,', 'Alat uji vankomisin', '01.03.047', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3278, 'Dye and chemical solution stains', '10201001', 6758, 'campuran pewarna sintetis atau alami atau bahan kimia nondye dalam solusi yang digunakan dalam sel pewarnaan dan jaringan untuk diagnostik histopatologi, Sitopatologi, atau hematologi.', ',0,3022,3026,6758,3278,', 'Pewarna dan larutan zat warna kimia', '02.01.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3279, 'Immunohistochemistry reagents and kits', '30201002', 6758, 'dalam perangkat diagnostik in vitro terdiri dari antibodi poliklonal atau monoklonal diberi label dengan petunjuk penggunaan dan kinerja klaim, yang dapat dikemas dengan reagen tambahan dalam kit. Tujuan penggunaannya adalah untuk mengidentifikasi, dengan', ',0,3022,3026,6758,3279,', 'Reagen dan kit imunohistokimia (IHC), uji pewarnaan antibodi / antigen', '02.01.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3280, 'Synthetic cell and tissue culture media and components/media kultur jaringan dan sel sintetis ', '10202001', 6759, 'zat yang seluruhnya terdiri dari komponen didefinisikan (misalnya, asam amino, vitamin, garam-garam anorganik) yang penting untuk kelangsungan hidup dan pengembangan garis sel manusia dan hewan lainnya. Ini tidak termasuk media kultur jaringan untuk jarin', ',0,3022,3027,6759,3280,', '', '02.02.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3282, 'Cell and tissue culture supplies and equipment', '10202002', 6759, 'perangkat yang digunakan untuk menguji, menyebarkan, memelihara, atau tumbuh sel-sel dan kultur jaringan. Ini termasuk artikel seperti ruang geser budaya, perfusi dan aparat roller, sistem suspensi kultur sel, dan termos kultur jaringan, disk, tabung, dan', ',0,3022,3027,6759,3282,', 'Alat-alat untuk kultur sel & jaringan', '02.02.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3284, 'Chromosome culture kit', '10202003', 6759, 'perangkat yang berisi bahan yang diperlukan (misalnya, Media Minimum Esensial (MEM) media kultur 5A McCoy, phytohemagglutinin, serum janin sapi, antibiotik, dan heparin) yang digunakan untuk jaringan kultur untuk diagnosis kelainan kromosom bawaan.', ',0,3022,3027,6759,3284,', 'Kit kultur kromosom', '02.02.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3286, 'Cultured animal and human cells', '10202004', 6759, 'in vitro baris sel dibudidayakan dari jaringan manusia atau hewan lain yang digunakan dalam berbagai prosedur diagnostik, terutama diagnostik virologi dan sitogenetika studi.', ',0,3022,3027,6759,3286,', 'Kultur sel hewan dan manusia', '02.02.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3288, 'Mycoplasma detection media and components', '10202005', 6759, 'digunakan untuk mendeteksi dan mengisolasi pleuropneumonia-seperti organisme Mycoplasma (PPLO), kontaminan mikroba umum dalam kultur sel.', ',0,3022,3027,6759,3288,', 'Media dan komponen deteksi mycoplasma', '02.02.05', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3290, 'Animal and human sera', '10202006', 6759, 'produk biologi, yang diperoleh dari darah manusia atau hewan lain, yang menyediakan nutrisi yang diperlukan pertumbuhan mempromosikan dalam sistem kultur sel.', ',0,3022,3027,6759,3290,', 'Serum dari hewan dan manusia', '02.02.06', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3292, 'Balanced salt solutions or formulations', '10202007', 6759, 'campuran didefinisikan garam dan glukosa dalam media sederhana. Perangkat ini dimasukkan sebagai komponen penting dari sistem kultur sel yang paling. Komponen Media ini mengontrol pH, tekanan osmotik, sumber energi, dan ion anorganik.', ',0,3022,3027,6759,3292,', 'Hanks balanced salt solution (HBSS)', '02.02.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3295, 'Tissue processing equipment/Peralatan prosesing jaringan', '10203001', 6760, 'Peralatan pengolahan jaringan terdiri dari perangkat yang digunakan untuk mempersiapkan spesimen jaringan manusia untuk pemeriksaan histologis diagnostik dengan mengolah spesimen melalui berbagai tahap decalcifying, infiltrasi, sectioning, dan pemasangan ', ',0,3022,3028,6760,3295,', '', '02.02.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3297, 'Specimen transport and storage container', '10203002', 6760, 'perangkat dimaksudkan untuk menampung spesimen biologi, limbah tubuh, atau eksudat tubuh selama penyimpanan dan transportasi dalam rangka bahwa materi yang terkandung didalamnya dapat dihancurkan atau digunakan secara efektif untuk pemeriksaan diagnostik.', ',0,3022,3028,6760,3297,', 'Wadah penyimpanan dan transport specimen', '02.02.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3299, 'OTC test sample collection systems for drugs of abuse testing', '10203003', 6760, 'perangkat dimaksudkan untuk: Kumpulkan spesimen biologis (seperti rambut, urine, keringat, atau air liur), di luar pengaturan medis dan bukan atas perintah seorang profesional perawatan kesehatan (misalnya, di rumah, asuransi, olahraga, atau tempat kerja ', ',0,3022,3028,6760,3299,', 'Wadah penyimpanan sampel drugs of abuse tests', '02.02.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3301, 'Cytocentrifuge', '10203004', 6760, 'centrifuge digunakan untuk berkonsentrasi sel dari suspensi sel biologis (misalnya, cairan serebrospinal) dan untuk deposit sel-sel pada slide mikroskop kaca untuk pemeriksaan sitologi.', ',0,3022,3028,6760,3301,', 'Cytocentrifuge', '02.02.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3303, 'Device for sealing microsections', '10203005', 6760, 'alat otomatis digunakan untuk menutup sel bernoda dan microsections untuk pemeriksaan histologis dan sitologi.', ',0,3022,3028,6760,3303,', 'Alat sealing microsections', '02.02.05', 1, 0, 700, NULL, NULL);
