INSERT INTO `aspak_new_alat` VALUES (3307, 'Automated slide stainer', '10203007', 6760, 'sebuah perangkat yang digunakan untuk noda histologi, sitologi, dan slide hematologi untuk diagnosis', ',0,3022,3028,6760,3307,', 'IHK SET / Imunohistokimia Set', '02.02.07', 1, 0, 700, NULL, NULL);
