INSERT INTO `aspak_new_alat` VALUES (3313, 'Automated cell counter', '20205001', 6762, 'perangkat sepenuhnya-otomatis atau semi-otomatis yang digunakan untuk menghitung sel darah merah, sel darah putih, atau platelet darah menggunakan sampel darah perifer pasien (sirkulasi darah di salah satu ekstremitas tubuh, seperti lengan). Perangkat ini', ',0,3022,3030,6762,3313,', 'Alat hematologi otomatis penghitung sel', '02.05.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3314, 'Automated differential cell counter', '20205002', 6762, 'perangkat yang digunakan untuk mengidentifikasi satu atau lebih elemen yang terbentuk dari darah. Perangkat ini juga mungkin memiliki kemampuan untuk bendera, menghitung, atau mengklasifikasikan sel hematopoietik imatur atau abnormal dari darah, sumsum tu', ',0,3022,3030,6762,3314,', 'Alat hematologi otomatis penghitung diferensiasi sel', '02.05.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3315, 'Automated blood cell diluting apparatus', '10205003', 6762, 'perangkat otomatis atau semi-otomatis digunakan untuk membuat pengenceran sesuai sampel darah untuk pengujian lebih lanjut.', ',0,3022,3030,6762,3315,', 'Peralatan pengencer sel darah otomatis', '02.05.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3316, 'Automated cell-locating device', '20205004', 6762, 'perangkat digunakan untuk menemukan sel-sel darah pada apusan darah tepi, memungkinkan operator untuk mengidentifikasi dan mengklasifikasikan setiap sel sesuai dengan jenis. (Darah perifer adalah sirkulasi darah di salah satu ekstremitas tubuh, seperti le', ',0,3022,3030,6762,3316,', 'Alat pendeteksi lokasi sel otomatis', '02.05.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3317, 'Red cell indices device', '20205005', 6762, 'Sebuah sel perangkat indeks merah, biasanya bagian dari sistem yang lebih besar, menghitung atau langsung mengukur eritrosit rata-rata volume corpuscular (MCV), hemoglobin sel hidup rata-rata (MCH), dan rata-rata kadar hemoglobin corpuscular (MCHC). Indek', ',0,3022,3030,6762,3317,', 'Indikator sel darah merah', '02.05.05', 1, 0, 700, NULL, NULL);
