INSERT INTO `aspak_new_alat` VALUES (3321, 'Automated hematocrit instrument', '20205009', 6762, 'perangkat otomatis atau semi-otomatis yang mungkin atau mungkin tidak menjadi bagian dari sistem yang lebih besar. Perangkat ini mengukur volume sel darah merah dikemas dari sampel darah untuk membedakan normal dari kondisi abnormal, seperti anemia dan er', ',0,3022,3030,6762,3321,', 'Alat uji hematokrit otomatis', '02.05.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3322, 'Automated hemoglobin system', '20205010', 6762, 'perangkat otomatis atau semi-otomatis yang mungkin atau mungkin tidak menjadi bagian dari sistem yang lebih besar. Jenis generik perangkat terdiri dari reagen, kalibrator, kontrol, dan instrumentasi yang digunakan untuk menentukan isi hemoglobin darah man', ',0,3022,3030,6762,3322,', 'Alat uji hemoglobin otomatis', '02.05.10', 1, 1, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3323, 'Automated heparin analyzer', '20205011', 6762, 'sebuah perangkat yang digunakan untuk menentukan tingkat heparin dalam sampel darah dengan mencampur sampel dengan protamine (zat penetral heparin) dan menentukan photometrically timbulnya udara diaktifkan pembekuan. Analyzer juga menentukan jumlah protam', ',0,3022,3030,6762,3323,', 'Alat uji heparin otomatis', '02.05.11', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3324, 'Automated platelet aggregation system', '20205012', 6762, 'perangkat yang digunakan untuk menentukan perubahan bentuk platelet dan agregasi platelet setelah penambahan reagen menggabungkan ke plasma kaya trombosit.', ',0,3022,3030,6762,3324,', 'Alat uji agregasi platelet/trombosit otomatis', '02.05.12', 1, 0, 700, NULL, NULL);
