INSERT INTO `aspak_new_alat` VALUES (3327, 'Blood volume measuring device', '20205015', 6762, 'manual, semi otomatis, atau sistem otomatis yang digunakan untuk menghitung massa sel darah merah, volume plasma, dan total volume darah.', ',0,3022,3030,6762,3327,', 'Alat pengukur volume darah', '02.05.15', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3328, 'Bleeding time device', '20206001', 8368, 'perangkat, biasanya menggunakan dua bilah pegas, yang menghasilkan dua sayatan kecil di kulit pasien. Lamanya waktu yang dibutuhkan untuk menghentikan pendarahan adalah ukuran efektivitas dari sistem koagulasi, terutama trombosit.', ',0,3022,3031,6763,3328,', 'Alat pengukur lamanya waktu perdarahan', '02.06.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3329, 'Capillary blood collection tube', '10206002', 8360, 'tabung gelas polos atau heparinized diameter yang sangat kecil yang digunakan untuk mengumpulkan darah dengan kapiler.', ',0,3022,3031,6763,3329,', 'Tabung pengumpul darah kapiler', '02.06.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3330, 'Manual blood cell counting device', '10206003', 8367, 'perangkat yang digunakan untuk menghitung sel darah merah, sel darah putih, atau platelet darah.', ',0,3022,3031,6763,3330,', 'Alat penghitung sel darah manual', '02.06.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3331, 'Hematocrit measuring device', '20206004', 6763, 'sistem yang terdiri dari instrumen, tabung, rak, dan sealer dan pemegang. Perangkat ini digunakan untuk mengukur volume sel darah merah dikemas dalam darah untuk menentukan apakah total volume sel darah merah pasien normal atau abnormal. Kondisi abnormal ', ',0,3022,3031,6763,3331,', 'Alat ukur hematokrit', '02.06.04', 1, 0, 700, NULL, NULL);
