INSERT INTO `aspak_new_alat` VALUES (3334, 'Platelet adhesion test', '20206007', 8363, 'perangkat yang digunakan untuk menentukan in vitro fungsi trombosit.', ',0,3022,3031,6763,3334,', 'PFA system, alat uji adhesi platelet', '02.06.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3335, 'Platelet aggregometer', '20206008', 8362, 'perangkat, digunakan untuk menentukan perubahan bentuk platelet dan agregasi platelet setelah penambahan reagen menggabungkan ke plasma kaya platelet.', ',0,3022,3031,6763,3335,', 'Alat uji agregrasi platelet', '02.06.08', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3336, 'Erythrocyte sedimentation rate test', '10206009', 6763, 'sebuah perangkat yang mengukur lamanya waktu yang dibutuhkan untuk sel darah merah dalam sampel darah untuk jatuh jarak tertentu atau sebuah perangkat yang mengukur tingkat sedimentasi yang terjadi di panjang waktu tertentu. Tingkat meningkat mengindikasi', ',0,3022,3031,6763,3336,', 'Alat uji laju sedimentasi eritrosit', '02.06.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3337, 'Adenosine triphosphate release assay', '10207001', 8373, 'sebuah perangkat yang mengukur pelepasan adenosin trifosfat (ATP) dari trombosit mengikuti agregasi. Pengukuran ini dilakukan pada plasma kaya trombosit menggunakan fotometer dan ekstrak kunang-kunang bercahaya. Pengukuran simultan agregasi platelet dan p', ',0,3022,3032,6764,3337,', 'Alat uji pelepasan adenosin trifosfat', '02.07.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3338, 'Antithrombin III assay', '20207002', 8401, 'perangkat yang digunakan untuk menentukan tingkat plasma antitrombin III (zat yang bertindak dengan heparin antikoagulan untuk mencegah pembekuan). Penentuan ini digunakan untuk memantau administrasi heparin dalam pengobatan trombosis. Penentuan ini juga ', ',0,3022,3032,6764,3338,', 'Alat uji anti thrombin III (ATIII)', '02.07.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3339, 'Red blood cell enzyme assay', '20207003', 8400, 'sebuah perangkat yang digunakan untuk mengukur aktivitas dalam sel darah merah dari reaksi enzimatik klinis penting dan produk mereka, seperti kinase piruvat atau 2,3-diphosphoglycerate. Sebuah sel darah assay enzim merah digunakan untuk menentukan cacat ', ',0,3022,3032,6764,3339,', 'Alat uji sel darah merah', '02.07.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3340, 'Activated whole blood clotting time tests', '20207004', 8399, 'perangkat, digunakan untuk memantau terapi heparin untuk pengobatan trombosis vena atau emboli paru dengan mengukur waktu pembekuan darah.', ',0,3022,3032,6764,3340,', 'Alat uji waktu koagulasi darah (ACT)', '02.07.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3341, 'Erythropoietin assay', '20207005', 8398, 'sebuah perangkat yang mengukur konsentrasi erythropoietin (enzim yang mengatur produksi sel darah merah) dalam serum atau urin. Uji ini memberikan informasi diagnostik untuk evaluasi erythrocytosis (peningkatan massa total sel darah merah) dan anemia.', ',0,3022,3032,6764,3341,', 'Alat uji erythropoietin (EPO)', '02.07.05', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3342, 'Euglobulin lysis time tests', '20207006', 8397, 'sebuah perangkat yang mengukur lamanya waktu yang dibutuhkan untuk lisis (pembubaran) gumpalan terbentuk dari fibrinogen dalam fraksi euglobulin (yang sebagian kecil dari plasma yang bertanggung jawab untuk pembentukan plasmin, bekuan melisiskan enzim). T', ',0,3022,3032,6764,3342,', 'Euglobulin lysis time tests', '02.07.06', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3343, 'Factor V Leiden DNA mutation detection systems', '20207007', 8396, 'perangkat yang terdiri dari berbagai reagen dan instrumen yang meliputi polymerase chain reaction (PCR) primer, matriks hibridisasi, cyclers termal, pencitra, dan paket perangkat lunak. Deteksi Faktor V Leiden mutasi membantu dalam diagnosis pasien yang d', ',0,3022,3032,6764,3343,', 'Alat uji mutasi DNA factor V Leiden', '02.07.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3344, 'Factor deficiency test', '20207008', 8395, 'sebuah perangkat yang digunakan untuk mendiagnosa cacat koagulasi tertentu, untuk memantau beberapa jenis terapi, untuk mendeteksi inhibitor koagulasi, dan untuk mendeteksi keadaan pembawa (orang membawa kedua gen resesif untuk defisiensi faktor koagulasi', ',0,3022,3032,6764,3344,', 'Alat uji faktor defisiensi', '02.07.08', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3345, 'Fibrin monomer paracoagulation test', '20207009', 8394, 'sebuah perangkat yang digunakan untuk mendeteksi monomer fibrin dalam diagnosis koagulasi intravaskular diseminata (nonlocalized pembekuan dalam pembuluh darah) atau dalam diagnosis diferensial antara koagulasi intravaskular diseminata dan fibrinolisis pr', ',0,3022,3032,6764,3345,', 'Alat uji parakoagulasi monomer fibrin', '02.07.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3346, 'Fibrinogen/fibrin degradation products assay', '20207010', 8393, 'sebuah perangkat yang digunakan untuk mendeteksi dan mengukur produk degradasi fibrinogen dan produk degradasi fibrin (fragmen protein yang dihasilkan oleh aksi enzimatik plasmin pada fibrinogen dan fibrin) sebagai bantuan dalam mendeteksi keberadaan dan ', ',0,3022,3032,6764,3346,', 'Alat uji produk degradasi fibrinogen/fibrin, D-Dimer', '02.07.10', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3347, 'Fibrinogen determination system', '20207011', 8392, 'sebuah perangkat yang terdiri dari instrumen, reagen, standar, dan kontrol yang digunakan untuk menentukan tingkat fibrinogen dalam koagulasi intravaskular diseminata (nonlocalized pembekuan dalam pembuluh darah) dan fibrinolisis primer (pembubaran fibrin', ',0,3022,3032,6764,3347,', 'Alat uji determinasi fibrinogen (FIB)', '02.07.11', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3348, 'Erythrocytic glucose-6- phosphate dehydrogenase assay', '20207012', 8391, 'sebuah perangkat yang digunakan untuk mengukur aktivitas dehidrogenase glukosa-6-fosfat enzim atau glukosa-6-fosfat dehidrogenase isoenzim. Hasil pengujian ini digunakan dalam diagnosis dan pengobatan anemia hemolitik nonspherocytic bawaan atau anemia hem', ',0,3022,3032,6764,3348,', 'Alat uji G6PD', '02.07.12', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3349, 'Glutathione reductase assay', '20207013', 8390, 'sebuah perangkat yang digunakan untuk menentukan aktivitas enzim glutation reduktase dalam serum, plasma, atau eritrosit dengan teknik seperti fluoresensi dan fotometri. Hasil pengujian ini digunakan dalam diagnosis penyakit hati, defisiensi reduktase glu', ',0,3022,3032,6764,3349,', 'Alat uji glutathione reductase (GR)', '02.07.13', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3350, 'Hemoglobin A[bdi2] assay', '20207014', 8389, 'perangkat yang digunakan untuk menentukan A2content hemoglobin darah manusia. Pengukuran A2is hemoglobin digunakan dalam diagnosis thalassemia (anemia hemolitik herediter ditandai dengan penurunan sintesis satu atau lebih jenis hemoglobin rantai polipepti', ',0,3022,3032,6764,3350,', 'Alat uji hemoglobin A[bdi2], alat uji thalassemia', '02.07.14', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3351, 'Abnormal hemoglobin assay', '20207015', 8388, 'perangkat yang terdiri dari reagen, peralatan, instrumentasi, dan kontrol yang diperlukan untuk mengisolasi dan mengidentifikasi jenis hemoglobin normal ditentukan secara genetik.', ',0,3022,3032,6764,3351,', 'Alat uji hemoglobin abnormal', '02.07.15', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3352, 'Carboxyhemoglobin assay', '20207016', 8387, 'sebuah perangkat yang digunakan untuk menentukan karboksihemoglobin (senyawa terbentuk ketika hemoglobin terkena karbon monoksida) isi darah manusia sebagai bantuan dalam diagnosis keracunan karbon monoksida. Pengukuran ini dapat dilakukan dengan mengguna', ',0,3022,3032,6764,3352,', 'Alat uji carboxyhemoglobin', '02.07.16', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3353, 'Electrophoretic hemoglobin analysis system', '20207017', 8386, 'perangkat yang elektroforesis memisahkan dan mengidentifikasi jenis hemoglobin normal dan abnormal sebagai bantuan dalam diagnosis anemia atau erythrocytosis (peningkatan massa total sel darah merah) karena hemoglobin kelainan.', ',0,3022,3032,6764,3353,', 'Alat uji hemoglobin elektroforesis (Hb ELP)', '02.07.17', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3354, 'Fetal hemoglobin assay', '20207018', 8385, 'perangkat yang digunakan untuk menentukan keberadaan dan distribusi hemoglobin janin (F hemoglobin) dalam sel darah merah atau untuk mengukur jumlah hemoglobin janin hadir. Pengujian dapat digunakan untuk mendeteksi sel darah merah janin dalam sirkulasi i', ',0,3022,3032,6764,3354,', 'Alat uji fetal hemoglobin (HbF)', '02.07.18', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3355, 'Glycosylated hemoglobin assay', '20207019', 8384, 'sebuah perangkat yang digunakan untuk mengukur hemoglobin glikosilasi (A1a, A1b, dan A1c) dalam darah pasien dengan prosedur kromatografi kolom. Pengukuran hemoglobin glikosilasi digunakan untuk menilai tingkat kontrol diabetes pasien dan untuk menentukan', ',0,3022,3032,6764,3355,', 'Alat uji HbA1c', '02.07.19', 1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3356, 'Sulfhemoglobin assay', '20207020', 8383, 'perangkat yang terdiri dari reagen, kalibrator, kontrol, dan instrumentasi yang digunakan untuk menentukan sulfhemoglobin (senyawa sulfur dan hemoglobin) isi dari darah manusia sebagai bantuan dalam diagnosis sulfhemoglobinemia (kehadiran sulfhemoglobin d', ',0,3022,3032,6764,3356,', 'Alat uji sulfhemoglobin (SulfHb)', '02.07.20', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3357, 'Whole blood hemoglobin assays', '20207021', 8382, 'perangkat terdiri atau reagen, kalibrator, kontrol, atau fotometri atau spektrofotometri instrumentasi yang digunakan untuk mengukur kandungan hemoglobin darah keseluruhan untuk mendeteksi anemia. Kategori ini perangkat generik tidak termasuk sistem hemog', ',0,3022,3032,6764,3357,', 'Alat uji hemoglobin (Hb)', '02.07.21', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3358, 'Heparin assay', '20207022', 8381, 'sirkulasi. Tes ini bersifat kuantitatif prosedur waktu pembekuan menggunakan efek heparin pada faktor koagulasi diaktifkan X (faktor Stuart) atau prosedur berdasarkan netralisasi heparin oleh protamine sulfat (protein yang menetralkan heparin).', ',0,3022,3032,6764,3358,', 'Alat uji heparin', '02.07.22', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3359, 'Leukocyte alkaline phosphatase test', '10207023', 8372, 'sebuah perangkat yang digunakan untuk mengidentifikasi enzim alkaline phosphatase leukosit dalam granulosit neutrofilik (leukosit granular stainable oleh pewarna netral). The cytochemical identifikasi alkali fosfatase tergantung pada pembentukan butiran b', ',0,3022,3032,6764,3359,', 'Alat uji alkali fosfatase leukosit', '02.07.23', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3360, 'Leukocyte peroxidase test', '10207024', 8371, 'sebuah perangkat yang digunakan untuk membedakan sel-sel myeloid tertentu yang berasal dari sumsum tulang, yaitu, neutrofil, eosinofil, dan monosit, dari sel-sel limfoid dari sistem limfatik dan sel erythroid dari seri sel darah merah atas dasar aktivitas', ',0,3022,3032,6764,3360,', 'Alat uji peroksidase leukosit', '02.07.24', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3361, 'Platelet factor 4 radioimmunoassay', '20207025', 8380, 'perangkat yang digunakan untuk mengukur tingkat faktor trombosit 4, protein yang dilepaskan selama aktivasi platelet oleh radioimmunoassay. Perangkat ini mengukur activiation trombosit, yang mungkin menunjukkan gangguan koagulasi, seperti infark miokard a', ',0,3022,3032,6764,3361,', 'Alat uji faktor 4 platelet radioimmunoassay', '02.07.25', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3362, 'Prothrombin consumption test', '20207026', 8379, 'perangkat yang digunakan untuk mengukur tingkat faktor trombosit 4, protein yang dilepaskan selama aktivasi platelet oleh radioimmunoassay. Perangkat ini mengukur activiation trombosit, yang mungkin menunjukkan gangguan koagulasi, seperti infark miokard a', ',0,3022,3032,6764,3362,', 'Alat uji pemakaian protrombin', '02.07.26', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3363, 'Prothrombin-proconvertin test and thrombotest', '20207027', 8378, 'perangkat yang digunakan dalam regulasi terapi kumarin (administrasi antikoagulan kumarin seperti natrium warfarin dalam pengobatan trombosis vena dan emboli paru) dan sebagai tes diagnostik dalam hubungannya dengan, atau sebagai pengganti dari, Quick pro', ',0,3022,3032,6764,3363,', 'Alat uji prothrombin-proconvertin dan thrombotest', '02.07.27', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3364, 'Prothrombin time test', '20207028', 8377, 'sebuah perangkat yang digunakan sebagai prosedur skrining umum untuk mendeteksi kemungkinan kekurangan faktor pembekuan dalam jalur koagulasi ekstrinsik, yang melibatkan reaksi antara koagulasi faktor III dan VII, dan memantau pasien yang menerima terapi ', ',0,3022,3032,6764,3364,', 'Alat uji waktu protrombin (PT)', '02.07.28', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3365, 'Sickle cell test', '20207029', 8376, 'sebuah perangkat yang digunakan untuk menentukan kadar hemoglobin sel sabit darah manusia untuk mendeteksi sifat sel sabit atau penyakit sel sabit.', ',0,3022,3032,6764,3365,', 'Alat uji sel sabit', '02.07.29', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3366, 'Thrombin time test', '20207030', 8375, 'sebuah perangkat yang digunakan untuk mengukur konsentrasi fibrinogen dan mendeteksi fibrin atau fibrinogen produk perpecahan untuk evaluasi gangguan perdarahan.', ',0,3022,3032,6764,3366,', 'Alat uji waktu trombin', '02.07.30', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3367, 'Thromboplastin generation test', '10207031', 8370, 'perangkat yang digunakan untuk mendeteksi dan mengidentifikasi faktor koagulasi kekurangan dan inhibitor koagulasi.', ',0,3022,3032,6764,3367,', 'Alat uji pertumbuhan tromboplastin', '02.07.31', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3368, 'Partial thromboplastin time tests', '20207032', 8374, 'sebuah perangkat yang digunakan untuk skrining utama untuk kelainan koagulasi, untuk evaluasi efek terapi pada gangguan prokoagulan, dan sebagai uji untuk faktor koagulasi kekurangan dari jalur koagulasi intrinsik.', ',0,3022,3032,6764,3368,', 'Alat uji PTT (APTT)', '02.07.32', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3369, 'Bothrops atrox reagent', '20208001', 8411, 'perangkat terbuat dari bisa ular dan digunakan untuk menentukan tingkat fibrinogen darah untuk membantu dalam evaluasi koagulasi intravaskular diseminata (nonlocalized pembekuan dalam pembuluh darah) pada pasien yang menerima terapi heparin (administrasi ', ',0,3022,3033,6765,3369,', 'Reagen bothrops atrox', '02.08.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3370, 'Calibrator for cell indices', '20208002', 8410, 'perangkat yang mendekati seluruh darah atau sel darah tertentu dan yang digunakan untuk mengatur instrumen dimaksudkan untuk mengukur volume sel rata-rata (MCV), berarti hemoglobin corpuscular (MCH), dan rata-rata kadar hemoglobin corpuscular (MCHC), atau', ',0,3022,3033,6765,3370,', 'Kalibrator untuk indikator sel', '02.08.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3371, 'Calibrator for hemoglobin or hematocrit measurement', '20208003', 8409, 'perangkat yang mendekati seluruh darah, sel darah merah, atau turunan hemoglobin dan yang digunakan untuk mengatur instrumen dimaksudkan untuk mengukur hemoglobin, hematokrit, atau keduanya. Ini adalah bahan yang karakteristik telah tepat dan akurat diten', ',0,3022,3033,6765,3371,', 'Kalibrator untuk pengukuran hemoglobin atau hematokrit', '02.08.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3372, 'Calibrator for platelet counting', '20208004', 8408, 'sebuah perangkat yang menyerupai trombosit dalam plasma atau darah utuh dan yang digunakan untuk mengatur alat menghitung trombosit. Ini adalah suspensi dari partikel atau sel yang ukuran, bentuk konsentrasi, dan karakteristik lainnya telah tepat dan akur', ',0,3022,3033,6765,3372,', 'Kalibrator untuk menghitung platelet', '02.08.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3373, 'Calibrator for red cell and white cell counting', '20208005', 8407, 'sebuah perangkat yang menyerupai merah atau sel darah putih dan yang digunakan untuk mengatur instrumen dimaksudkan untuk menghitung sel darah merah, sel darah putih, atau keduanya. Ini adalah suspensi dari partikel atau sel yang ukuran, bentuk, konsentra', ',0,3022,3033,6765,3373,', 'Kalibrator untuk menghitung sel darah merah and sel darah putih', '02.08.05', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3374, 'Blood cell diluent', '10208006', 6765, 'perangkat yang digunakan untuk mencairkan darah untuk pengujian lebih lanjut, seperti menghitung sel darah.', ',0,3022,3033,6765,3374,', 'Pengencer sel darah', '02.08.06', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3375, 'Lymphocyte separation medium', '10208007', 8404, 'perangkat yang digunakan untuk mengisolasi limfosit dari darah.', ',0,3022,3033,6765,3375,', 'Media pemisahan limfosit', '02.08.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3376, 'Red cell lysing reagent', '10208008', 8403, 'perangkat yang digunakan untuk melisiskan (menghancurkan) sel darah merah untuk penentuan hemoglobin atau bantuan dalam penghitungan sel darah putih.', ',0,3022,3033,6765,3376,', 'Reagen pelisis sel darah merah', '02.08.08', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3377, 'Hematology quality control mixture', '20208009', 8406, 'perangkat yang digunakan untuk melisiskan (menghancurkan) sel darah merah untuk penentuan hemoglobin atau bantuan dalam penghitungan sel darah putih.sebuah perangkat yang digunakan untuk memastikan akurasi dan presisi dari manual, semi otomatis, dan pene', ',0,3022,3033,6765,3377,', 'Kontrol untuk hematologi', '02.08.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3378, 'Russell viper venom reagent', '10208010', 8402, 'perangkat yang digunakan untuk menentukan penyebab peningkatan waktu protrombin.', ',0,3022,3033,6765,3378,', 'Reagen bisa ular Russell viper', '02.08.10', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3379, 'Blood bank supplies', '10209001', 6766, 'perangkat tujuan umum ditujukan untuk penggunaan in vitro dalam darah perbankan. Ini jenis generik perangkat mencakup produk seperti pipet bank darah, slide pengelompokan darah, tabung mengetik darah, rak mengetik darah, dan kompres dingin untuk reagen an', ',0,3022,3034,6766,3379,', 'Perlengkapan bank darah', '02.09.01', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3380, 'Empty container for the collection and processing of blood and blood components', '20209002', 6766, 'perangkat ditujukan untuk tujuan medis yang merupakan kantong kosong plastik atau plastik atau botol kaca yang digunakan untuk mengumpulkan, menyimpan, atau mentransfer darah dan komponen darah untuk diproses lebih lanjut.', ',0,3022,3034,6766,3380,', 'Wadah kosong untuk pengumpulan dan pengolahan darah serta komponennya', '02.09.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3381, 'Vacuum-assisted blood collection system', '10209003', 6766, 'perangkat ditujukan untuk tujuan medis yang menggunakan vakum untuk mengambil darah untuk reinfusion berikutnya.', ',0,3022,3034,6766,3381,', 'Wadah pengumpul darah vakum', '02.09.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3382, 'Processing system for frozen blood', '20209004', 8432, 'sebuah perangkat yang digunakan untuk glycerolize sel darah merah sebelum pembekuan untuk meminimalkan hemolisis (gangguan dari membran sel darah merah disertai dengan pelepasan hemoglobin) karena pembekuan dan pencairan sel darah merah dan deglycerolize ', ',0,3022,3034,6766,3382,', 'Alat pengolah darah beku', '02.09.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3383, 'Blood group substances of nonhuman origin for in vitro diagnostic use', '20209005', 8414, 'bahan, seperti kelompok zat-zat tertentu darah yang dibuat dari sumber-sumber bukan manusia (misalnya, babi, sapi, dan kuda) yang digunakan untuk mendeteksi, mengidentifikasi, atau menetralisir antibodi terhadap berbagai antigen golongan darah manusia. In', ',0,3022,3034,6766,3383,', 'Alat uji deteksi antigen pada sel darah, identifikasi antibodi golongan darah', '02.09.05', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3384, 'Automated blood grouping and antibody test system', '20209006', 8431, 'perangkat yang digunakan untuk eritrosit kelompok (sel darah merah) dan untuk mendeteksi antibodi terhadap antigen golongan darah.', ',0,3022,3034,6766,3384,', 'Alat uji golongan darah dan antibodi otomatis', '02.09.06', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3385, 'Blood grouping view box', '10209007', 8430, 'perangkat dengan kaca atau permukaan melihat plastik, yang dapat diterangi dan dipanaskan, yang digunakan untuk melihat reaksi sel dalam pengujian antigen-antibodi.', ',0,3022,3034,6766,3385,', 'Alat untuk melihat penggolongan darah', '02.09.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3386, 'Blood mixing devices and blood weighing devices', '10209008', 8413, 'perangkat ditujukan untuk tujuan medis yang digunakan untuk mencampur komponen darah atau darah dengan agitasi. Sebuah darah berat perangkat adalah perangkat ditujukan untuk tujuan medis yang digunakan untuk menimbang komponen darah atau darah mereka diku', ',0,3022,3034,6766,3386,', 'Alat pencampur dan penimbang darah', '02.09.08', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3387, 'Blood and plasma warming device', '20209009', 8429, '\"a) Nonelectromagnetic darah atau plasma perangkat pemanasan - (1) Identifikasi Sebuah darah dan plasma perangkat pemanasan nonelectromagnetic adalah perangkat yang menghangatkan darah atau plasma, dengan cara selain radiasi elektromagnetik, sebelum pembe', ',0,3022,3034,6766,3387,', 'Alat penghangat darah dan plasma', '02.09.09', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3388, 'Cell-freezing apparatus and reagents for in vitro diagnostic use', '10209010', 8412, 'evices digunakan untuk membekukan sel-sel darah merah manusia untuk digunakan diagnostik in vitro.', ',0,3022,3034,6766,3388,', 'Alat pembekuan sel dan reagen untuk penggunaan diagnostik in vitro', '02.09.10', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3389, 'Automated blood cell separator', '20209011', 8416, 'sebuah perangkat yang menggunakan prinsip pemisahan sentrifugal atau penyaringan untuk secara otomatis menarik seluruh darah dari donor, memisahkan seluruh darah menjadi komponen darah, mengumpulkan satu atau lebih komponen darah, dan kembali ke donor sis', ',0,3022,3034,6766,3389,', 'Alat pemisah sel darah otomatis', '02.09.11', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3390, 'Blood bank centrifuge for in vitro diagnostic use', '10209012', 8428, 'perangkat hanya digunakan untuk memisahkan sel darah untuk tes diagnostik lebih lanjut.', ',0,3022,3034,6766,3390,', 'Alat sentrifus untuk penggunaan diagnostik in vitro', '02.09.12', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3391, 'Automated cell-washing centrifuge for immuno-hematology', '20209013', 8427, 'sebuah perangkat yang digunakan untuk memisahkan dan mempersiapkan sel dan sera untuk lebih lanjut dalam pengujian diagnostik in vitro.', ',0,3022,3034,6766,3391,', '', '02.09.13', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3392, 'Automated Coombs test systems', '20209014', 6766, 'sebuah perangkat yang digunakan untuk mendeteksi dan mengidentifikasi antibodi dalam serum pasien atau antibodi terikat untuk sel darah merah. Tes Coombs digunakan untuk diagnosis penyakit hemolitik dari anemia hemolitik yang baru lahir, dan autoimun. Tes', ',0,3022,3034,6766,3392,', 'Alat uji Coombs otomatis', '02.09.14', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3393, 'Copper sulfate solution for specific gravity determinations', '10209015', 8425, 'sebuah perangkat yang digunakan untuk menentukan apakah isi hemoglobin darah donor potensial memenuhi tingkat yang diperlukan (12,5 gram per 100 mililiter darah untuk wanita dan 13,5 gram per 100 mililiter darah untuk pria).', ',0,3022,3034,6766,3393,', 'Alat uji hemoglobin dengan metode determinasi spesifik gravitasi copper sulphate', '02.09.15', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3394, 'Stabilized enzyme solution', '20209016', 8424, 'reagen ditujukan untuk tujuan medis yang digunakan untuk meningkatkan reaktivitas sel darah merah dengan antibodi tertentu, termasuk antibodi yang tidak terdeteksi oleh teknik lainnya. Solusi ini enzim papain termasuk, bromelin, ficin, dan tripsin.', ',0,3022,3034,6766,3394,', 'Larutan enzim penstabil', '02.09.16', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3395, 'Lectins and protectins', '20209017', 8423, 'protein yang berasal dari tumbuhan dan hewan yang lebih rendah yang menyebabkan aglutinasi sel di hadapan antigen tertentu. Zat ini digunakan untuk mendeteksi antigen golongan darah dalam tujuan diagnostik in vitro.', ',0,3022,3034,6766,3395,', 'Lektin dan protektin', '02.09.17', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3396, 'Environmental chamber for storage of platelet concentrate', '20209018', 8422, 'perangkat yang digunakan untuk menahan plasma kaya trombosit dalam kisaran suhu yang terpilih.', ',0,3022,3034,6766,3396,', 'Wadah penyimpanan konsentrat platelet', '02.09.18', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3397, 'Potentiating media for in vitro diagnostic use', '20209019', 8421, 'media, seperti sapi albumin, yang digunakan untuk menangguhkan sel darah merah dan meningkatkan reaksi sel untuk pengujian antigen-antibodi.', ',0,3022,3034,6766,3397,', 'Media potensial untuk penggunaan diagnostik in vitro', '02.09.19', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3398, 'Quality control kit for blood banking reagents', '20209020', 8420, 'sebuah perangkat yang terdiri dari serum, sel, buffer, dan antibodi yang digunakan untuk menentukan spesifisitas, potensi, dan reaktivitas sel dan reagen yang digunakan untuk penyimpanan darah.', ',0,3022,3034,6766,3398,', 'Kontrol untuk reagen bank darah', '02.09.20', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3399, 'Blood storage refrigerator and blood storage freezer', '20209021', 8419, 'perangkat yang ditujukan untuk tujuan medis yang digunakan untuk melestarikan darah dan produk darah dengan cara menyimpannya pada suhu dingin atau beku.', ',0,3022,3034,6766,3399,', 'Lemari pendingin tempat penyimpanan dan pembekuan darah\nRefrigerator Hemodialisa', '02.09.21', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3400, 'Heat-sealing device', '10209022', 8418, 'perangkat ditujukan untuk tujuan medis yang menggunakan panas untuk menutup kantong plastik yang mengandung darah atau komponen darah.', ',0,3022,3034,6766,3400,', 'Alat penyegel dengan panas, thermosealer', '02.09.22', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3401, 'Transfer set', '20209023', 8417, 'perangkat ditujukan untuk tujuan medis yang terdiri dari sepotong pipa dengan adapter yang cocok digunakan untuk mentransfer darah atau plasma dari satu wadah ke wadah lain.', ',0,3022,3034,6766,3401,', 'Alat transfer darah', '02.09.23', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3402, 'Antimicrobial susceptibility test disc', '20301001', 8439, 'sebuah perangkat yang terdiri dari cakram kertas antimicrobic-diresapi digunakan untuk mengukur dengan teknik difusi cakram-agar atau teknik elusi disc-kaldu dalam kerentanan in vitro bakteri patogen yang paling penting secara klinis terhadap agen antimik', ',0,3020,3041,6767,3402,', 'Alat uji sensitivitas antimikroba', '03.01.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3403, 'Antimicrobial susceptibility test powder', '20301002', 8438, 'sebuah perangkat yang terdiri dari bubuk obat antimikroba dikemas dalam botol dalam jumlah tertentu dan dimaksudkan untuk digunakan dalam laboratorium klinis untuk menentukan dalam kerentanan vitro bakteri patogen kepada agen terapi ini. Hasil tes digunak', ',0,3020,3041,6767,3403,', 'Alat uji sensitivitas antimikroba (serbuk)', '03.01.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3404, 'Fully automated short-term incubation cycle antimicrobial susceptibility system', '20301003', 8437, 'sebuah perangkat yang menggabungkan konsentrasi agen antimikroba ke dalam sistem untuk tujuan menentukan dalam kerentanan vitro bakteri patogen diisolasi dari spesimen klinis. Hasil tes diperoleh dari jangka pendek (kurang dari 16 jam) inkubasi digunakan ', ',0,3020,3041,6767,3404,', 'Alat untuk identifikasi mikroba dan uji sensitivitas antibiotika', '03.01.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3405, 'Culture medium for antimicrobial susceptibility tests', '20301004', 8436, 'perangkat ditujukan untuk tujuan medis yang terdiri dari media mampu mendukung pertumbuhan banyak bakteri patogen yang tunduk pada tes kerentanan antimikroba. Media harus bebas dari komponen diketahui bertentangan dengan agen umum yang tes kerentanan dila', ',0,3020,3041,6767,3405,', 'Media kultur untuk uji sensitivitas antimikroba', '03.01.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3406, 'Staphylococcal typing bacteriophage', '10302001', 8448, 'perangkat yang terdiri dari virus bakteri ditujukan untuk tujuan medis untuk mengidentifikasi bakteri staphylococcal patogen melalui penggunaan kerentanan bakteri terhadap kerusakan oleh virus. Hasil tes digunakan terutama untuk pengumpulan informasi epid', ',0,3020,3042,6768,3406,', 'Alat uji tipe staphylococcal bacteriophage', '03.02.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3407, 'Anaerobic chamber', '10302002', 8467, 'perangkat ditujukan untuk tujuan medis untuk menjaga lingkungan anaerobik (oksigen bebas). Hal ini digunakan untuk mengisolasi dan menumbuhkan mikroorganisme anaerobik.', ',0,3020,3042,6768,3407,', 'Wadah / ruang anaerob', '03.02.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3408, 'Coagulase plasma', '10302003', 8447, 'sebuah perangkat yang terdiri dari hewan beku-kering atau plasma manusia yang ditujukan untuk tujuan medis untuk melakukan tes koagulase terutama pada bakteri staphylococcal. Ketika dilarutkan, plasma cairan bergumpal oleh aksi dari enzim koagulase yang d', ',0,3020,3042,6768,3408,', 'Plasma koagulasi', '03.02.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3409, 'Automated colony counter', '10302004', 8446, 'alat mekanis ditujukan untuk tujuan medis untuk menentukan jumlah koloni bakteri hadir pada media kultur bakteriologi yang terkandung dalam piring petri. Jumlah koloni dihitung digunakan dalam diagnosis penyakit sebagai ukuran derajat infeksi bakteri.', ',0,3020,3042,6768,3409,', 'Alat penghitung koloni otomatis', '03.02.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3410, 'Manual colony counter', '10302005', 8445, 'perangkat ditujukan untuk tujuan medis yang terdiri dari sistem grid dicetak ditumpangkan pada layar diterangi. Piring petri yang berisi koloni bakteri akan dihitung ditempatkan pada layar untuk melihat lebih baik dan kemudahan penghitungan. Jumlah koloni', ',0,3020,3042,6768,3410,', 'Alat penghitung koloni manual', '03.02.05', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3411, 'Multipurpose culture medium', '10302006', 8466, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair atau padat yang ditujukan untuk tujuan medis untuk budidaya dan identifikasi beberapa jenis mikroorganisme patogen tanpa perlu suplemen gizi tambahan. Hasil tes membantu dalam diagnosis penya', ',0,3020,3042,6768,3411,', 'Media kultur serbaguna', '03.02.06', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3412, 'Differential culture medium', '10302007', 8465, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair dimaksudkan untuk tujuan medis untuk mengolah dan mengidentifikasi berbagai jenis mikroorganisme patogen. Identifikasi mikroorganisme ini dilakukan dengan penambahan komponen biokimia spesifi', ',0,3020,3042,6768,3412,', 'Media kultur diferensial', '03.02.07', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3413, 'Enriched culture medium', '10302008', 8464, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair atau padat yang ditujukan untuk tujuan medis untuk budidaya dan identifikasi beberapa jenis mikroorganisme patogen tanpa perlu suplemen gizi tambahan. Hasil tes membantu dalam diagnosis penya', ',0,3020,3042,6768,3413,', 'Media kultur yang diperkaya', '03.02.08', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3414, 'Microbiological assay culture medium', '10302009', 8463, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair atau padat yang ditujukan untuk tujuan medis untuk menumbuhkan mikroorganisme uji yang dipilih untuk mengukur dengan prosedur mikrobiologi konsentrasi dalam serum pasien zat tertentu, seperti', ',0,3020,3042,6768,3414,', 'Media kultur uji mikrobiologis', '03.02.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3415, 'Selective culture medium', '10302010', 8462, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair atau padat yang ditujukan untuk tujuan medis untuk mengolah dan mengidentifikasi mikroorganisme patogen tertentu. Perangkat ini berisi satu atau lebih komponen yang menekan pertumbuhan mikroo', ',0,3020,3042,6768,3415,', 'Media kultur selektif', '03.02.10', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3416, 'Transport culture medium', '10302011', 8461, 'sebuah perangkat yang terdiri dari semipadat, biasanya non-hara, media yang mempertahankan kelangsungan hidup patogen yang diduga terkandung dalam spesimen pasien saat dalam perjalanan dari daerah koleksi spesimen ke laboratorium. Perangkat membantu dalam', ',0,3020,3042,6768,3416,', 'Media kultur transport', '03.02.11', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3417, 'Culture medium for pathogenic Neisseria spp', '20302012', 8460, 'sebuah perangkat yang terutama terdiri dari bahan biologis cair atau padat yang digunakan untuk mengolah dan mengidentifikasi pathogenicNeisseria spp. Identifikasi membantu dalam diagnosis penyakit yang disebabkan oleh bakteri milik genusNeisseria, sepert', ',0,3020,3042,6768,3417,', 'Media kultur untuk Neisseria spp patogen', '03.02.12', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3418, 'Oxidase screening test for gonorrhoea', '30302013', 8444, 'perangkat in vitro yang terdiri dari artikel yang dimaksudkan untuk mengidentifikasi dengan reaksi kimia, sitokrom oksidase, enzim oksidasi yang berhubungan dengan bakteri tertentu includingNeisseria gonorrhoeae. Sebuah sampel cairan dari uretra laki-laki', ',0,3020,3042,6768,3418,', 'Alat uji penapisan oksidase untuk gonore', '03.02.13', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3419, 'Automated medium dispensing and stacking device', '10302014', 8459, 'perangkat ditujukan untuk tujuan medis untuk mengeluarkan medium kultur mikrobiologi ke dalam piring petri dan kemudian mekanis tumpukan cawan petri.', ',0,3020,3042,6768,3419,', 'Alat untuk mengisi dan menyusun media kultur otomatis', '03.02.14', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3420, 'Supplement for culture media', '10302015', 8458, 'perangkat, seperti campuran vitamin atau gula, yang ditambahkan ke media kultur basal padat atau cair untuk menghasilkan formulasi yang diinginkan dan yang dimaksudkan untuk tujuan medis untuk meningkatkan pertumbuhan mikroorganisme pemilih (mereka yang m', ',0,3020,3042,6768,3420,', 'Suplemen untuk media kultur', '03.02.15', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3421, 'Quality control kit for culture media', '10302016', 8443, 'sebuah perangkat yang terdiri dari kertas cakram (atau bahan lain yang cocok), masing-masing diresapi dengan tertentu, beku-kering, mikroorganisme yang layak, dimaksudkan untuk tujuan medis untuk menentukan apakah medium kultur yang diberikan mampu menduk', ',0,3020,3042,6768,3421,', 'Alat kontrol kualitas untuk kultur media', '03.02.16', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3422, 'Microtiter diluting and dispensing device', '10302017', 8457, 'alat mekanis ditujukan untuk tujuan medis untuk mengeluarkan atau serial encer jumlah yang sangat kecil reagen biologi atau kimia untuk digunakan dalam berbagai prosedur diagnostik.', ',0,3020,3042,6768,3422,', 'Mikrotiter untuk pengencer dan penyaluran', '03.02.17', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3423, 'Microbiological incubator', '10302018', 8456, 'perangkat dengan berbagai ruang atau kompartemen berisi air di mana kondisi lingkungan terkontrol, khususnya suhu, dipertahankan. Hal ini dimaksudkan untuk tujuan medis untuk menumbuhkan mikroorganisme dan membantu dalam diagnosis penyakit.', ',0,3020,3042,6768,3423,', 'Inkubator mikrobiologi', '03.02.18', 1, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3424, 'Microbial growth monitor', '10302019', 8449, 'perangkat ditujukan untuk tujuan medis yang mengukur konsentrasi bakteri disuspensikan dalam medium cair dengan mengukur perubahan sifat cahaya hamburan, densitas optik, impedansi listrik, atau dengan membuat jumlah bakteri secara langsung. Perangkat memb', ',0,3020,3042,6768,3424,', 'Alat pemantau pertumbuhan mikroba', '03.02.19', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3425, 'Gas-generating device', '10302020', 8442, 'perangkat ditujukan untuk tujuan medis yang menghasilkan jumlah yang telah ditentukan gas yang dipilih untuk digunakan dalam ruang tertutup dalam rangka membangun kondisi atmosfer yang cocok untuk budidaya mikroorganisme dengan persyaratan atmosfer khusus', ',0,3020,3042,6768,3425,', 'Peralatan Pembangkit Gas', '03.02.20', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3426, 'Wood\'s fluorescent lamp', '10302021', 8453, 'perangkat ditujukan untuk tujuan medis untuk mendeteksi bahan fluorescent (misalnya, fluorescein pigmen yang diproduksi oleh mikroorganisme tertentu) sebagai bantuan dalam identifikasi mikroorganisme ini. Perangkat membantu dalam diagnosis penyakit.', ',0,3020,3042,6768,3426,', 'Lampu fluorosensi Wood, Wood’s lamp', '03.02.21', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3427, 'Microorganism differentiation and identification device', '10302022', 8452, 'perangkat ditujukan untuk tujuan medis yang terdiri dari satu atau lebih komponen, seperti media diferensial budaya, reagen biokimia, dan cakram kertas atau kertas strip diresapi dengan', ',0,3020,3042,6768,3427,', 'Perangkat diferensiasi dan identifikasi mikroorganisme (Filariasis)', '03.02.22', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3428, 'Automated zone reader', '10302023', 8451, 'alat mekanis ditujukan untuk tujuan medis untuk mengukur diameter zona penghambatan pertumbuhan mikroba (atau pameran), seperti yang diamati pada permukaan media kultur tertentu yang digunakan dalam disk-difusi agar tes kerentanan antimikroba. Perangkat m', ',0,3020,3042,6768,3428,', 'Pembaca zona otomatis', '03.02.23', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3429, 'Microbiological specimen collection and transport device', '10302024', 8450, 'ruang mengumpulkan spesimen dimaksudkan untuk tujuan medis untuk mempertahankan kelangsungan hidup atau integritas mikroorganisme dalam spesimen selama penyimpanan spesimen setelah koleksi mereka dan selama transportasi mereka dari daerah pengumpulan ke l', ',0,3020,3042,6768,3429,', 'Wadah penyimpanan dan transport untuk spesimen mikrobiologi', '03.02.24', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3430, 'Acinetobacter calcoaceticus serological reagents', '10303001', 8517, 'perangkat yang terdiri ofAcinetobacter antigen calcoaceticus dan antisera digunakan untuk mengidentifikasi bakteri ini dari isolat berbudaya berasal dari spesimen klinis. Identifikasi membantu dalam diagnosis penyakit yang disebabkan oleh bacteriumAcineto', ',0,3020,3043,6769,3430,', 'Reagen serologi Acinetobacter calcoaceticus', '03.03.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3431, 'Adenovirus serological reagents', '10303002', 8562, 'perangkat yang terdiri dari antigen dan antisera yang digunakan dalam uji serologis untuk mengidentifikasi antibodi terhadap adenovirus dalam serum. Selain itu, beberapa reagen tersebut terdiri dari antisera adenovirus terkonjugasi dengan pewarna fluoresc', ',0,3020,3043,6769,3431,', 'Adenovirus serological reagents', '03.03.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3432, 'Arizona spp. serological reagents', '10303003', 8516, 'perangkat yang terdiri dari antiserum dan antigen digunakan untuk identifyArizona spp. pada isolat berbudaya berasal dari spesimen klinis. Alat bantu identifikasi dalam diagnosis penyakit yang disebabkan oleh bakteri milik genusArizona dan memberikan info', ',0,3020,3043,6769,3432,', 'Reagen Serologi Arizona Spp', '03.03.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3433, 'Aspergillus spp. serological reagents', '10303004', 8561, 'perangkat yang terdiri dari antigen dan antisera digunakan dalam berbagai uji serologis untuk mengidentifikasi antibodi toAspergillus spp. dalam serum. Identifikasi membantu dalam diagnosis aspergillosis yang disebabkan oleh jamur milik genusAspergillus. ', ',0,3020,3043,6769,3433,', 'Reagen serologi Aspergillus spp.', '03.03.04', 1, 0, 700, NULL, NULL);
