INSERT INTO `aspak_new_alat` VALUES (3504, 'Complement reagent', '10304002', 8577, 'sebuah perangkat yang terdiri dari komplemen, protein serum alami dari hewan berdarah panas seperti kelinci percobaan, yang dapat dimasukkan sebagai bagian komponen dari alat tes serologi digunakan dalam diagnosis penyakit.', ',0,3020,3044,6770,3504,', 'Reagen komplemen', '03.04.02', 1, 0, 700, NULL, NULL);
