INSERT INTO `aspak_new_alat` VALUES (3511, 'Rocket immunoelectrophoresis equipment. ', '10304009', 6770, 'sebuah perangkat yang digunakan untuk melakukan tes tertentu pada protein dengan menggunakan prosedur yang disebut roket immunoelectrophoresis. Dalam prosedur ini, arus listrik menyebabkan protein dalam larutan bermigrasi melalui agar gel yang mengandung ', ',0,3020,3044,6770,3511,', 'Peralatan imunoelektroforesis rocket', '03.04.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3512, 'Support gel.', '10304010', 8566, 'sebuah perangkat yang terdiri dari agar-agar atau agarosa persiapan yang digunakan saat mengukur berbagai jenis, atau bagian, molekul protein dengan berbagai teknik immunochemical, seperti immunoelectrophoresis, imunodifusi, atau kromatografi.', ',0,3020,3044,6770,3512,', 'Gel pendukung', '03.04.10', 1, 0, 700, NULL, NULL);
