INSERT INTO `aspak_new_alat` VALUES (3521, 'Alpha -1-antitrypsin immunological test system', '20305009', 8663, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur dengan teknik immunochemical thealpha-1 antitrypsin-(protein plasma) dalam serum, cairan tubuh lain, dan jaringan. Bantuan pengukuran dalam diagnosis beberapa kondisi termasuk sirosis', ',0,3020,3045,6771,3521,', 'Alat uji imunologi alpha -1-antitrypsin.', '03.05.09', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3522, 'Bence-Jones proteins immunological test system', '20305010', 8662, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur dengan teknik immunochemical protein Bence-Jones dalam urin dan plasma. Molekul imunoglobulin biasanya terdiri dari pasang rantai polipeptida (subunit) dari ukuran yang tidak sama (ra', ',0,3020,3045,6771,3522,', 'Alat uji imunologi protein Bence-Jones.', '03.05.10', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3523, 'Beta -globulin immunological test system', '10305011', 8620, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur oleh immunochemical teknik beta globulin (protein serum) dalam tubuh protein serum dan lainnya fluids.Beta-globulin includebeta-lipoprotein, transferin, glikoprotein, dan pelengkap, d', ',0,3020,3045,6771,3523,', 'Alat uji imunologi beta-globulin', '03.05.11', 1, 0, 700, NULL, NULL);
