INSERT INTO `aspak_new_alat` VALUES (3528, 'Cohn fraction II immunological test system', '10305016', 8617, 'sebuah perangkat yang terdiri dari reagen yang mengandung atau digunakan untuk mengukur bahwa fraksi plasma yang mengandung protein globulin gamma, terutama dari kelas IgG. Perangkat ini dapat digunakan sebagai coprecipitant dalam metode radioimmunoassay,', ',0,3020,3045,6771,3528,', 'Alat uji imunologi Cohn fraction II', '03.05.16', 1, 0, 700, NULL, NULL);
