INSERT INTO `aspak_new_alat` VALUES (3575, 'Thyroid autoantibody immunological test system', '20305063', 8635, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur dengan teknik immunochemical autoantibodi tiroid (antibodi yang dihasilkan terhadap jaringan tubuh sendiri). Pengukuran autoantibodi tiroid dapat membantu dalam diagnosis gangguan tir', ',0,3020,3045,6771,3575,', 'Alat uji imunologi autoantibodi tiroid.', '03.05.63', 1, 0, 700, NULL, NULL);
