INSERT INTO `aspak_new_alat` VALUES (3577, 'Inter- alpha trypsin inhibitor immunological test system.', '10305065', 8595, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur dengan teknik immunochemical antar-alpha inhibitor tripsin (protein) dalam cairan tubuh serum dan lainnya. Pengukuran antar-alpha tripsin inhibitor dapat membantu dalam diagnosis infe', ',0,3020,3045,6771,3577,', 'Alat uji imunologi Inter- alpha trypsin inhibitor', '03.05.65', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3578, 'Cystic fibrosis transmembrane conductance regulator (CFTR) gene mutation detection system', '20305066', 8633, 'sebuah perangkat yang digunakan untuk mendeteksi secara bersamaan dan mengidentifikasi panel mutasi dan varian pada gen CFTR. Hal ini dimaksudkan sebagai bantuan dalam pengujian diagnostik konfirmasi individu yang diduga cystic fibrosis (CF), identifikasi', ',0,3020,3045,6771,3578,', 'Alat uji mutasi gen (CFTR)', '03.05.66', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3579, 'Quality control material for cystic fibrosis nucleic acid assays', '20305067', 8632, 'perangkat dimaksudkan untuk membantu memantau keandalan sistem tes dengan mendeteksi penyimpangan analitis seperti yang mungkin timbul dari reagen atau variasi instrumen dalam pengujian genetik. Jenis perangkat termasuk rekombinan, sintetis, dan sel kontr', ',0,3020,3045,6771,3579,', 'Kontrol kualitas uji asam nukleat fibrosis kistik.', '03.05.67', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3580, 'Tumor-associated antigen immunological test system', '20306001', 8684, 'sebuah perangkat yang terdiri dari reagen yang digunakan untuk mengukur secara kualitatif maupun kuantitatif, dengan teknik immunochemical, antigen tumor terkait dalam serum, plasma, urin, atau cairan tubuh lain. Perangkat ini dimaksudkan sebagai bantuan ', ',0,3020,3046,6772,3580,', 'Alat uji imunologi antigen terkait tumor.', '03.06.01', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3581, 'Immunomagnetic circulating cancer cell selection and enumeration system', '20306002', 8683, 'sebuah perangkat yang terdiri dari probe biologi, fluorochromes, dan reagen lainnya, pelestarian dan persiapan perangkat, dan alat analisis semiautomated untuk memilih dan menghitung sel-sel kanker yang beredar dalam sampel disiapkan darah keseluruhan. Pe', ',0,3020,3046,6772,3581,', 'Alat uji immunomagnetic circulating sel kanker dan enumerasi', '03.06.02', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3582, 'AFP-L3% immunological test system', '20306003', 8682, 'perangkat in vitro yang terdiri dari reagen dan alat otomatis yang digunakan untuk mengukur secara kuantitatif, dengan teknik immunochemical, AFP dan AFP-L3 subfraksi dalam serum manusia. Perangkat ini ditujukan untuk digunakan diagnostik in vitro sebagai', ',0,3020,3046,6772,3582,', 'Alat uji imunologi AFP-L3%', '03.06.03', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3583, 'Gene expression profiling test system for breast cancer prognosis', '20306004', 8681, 'sebuah perangkat yang mengukur asam ribonukleat (RNA) tingkat ekspresi beberapa gen dan menggabungkan informasi ini untuk menghasilkan tanda tangan (pola atau classifier atau indeks) untuk membantu dalam prognosis kanker payudara sebelumnya didiagnosis.', ',0,3020,3046,6772,3583,', 'Alat uji ekspresi gen pada prognosis kanker payudara', '03.06.04', 1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (3584, 'Ovarian Adnexal Mass Assessment Score Test System', '20306005', 8677, 'sebuah perangkat yang mengukur satu atau lebih protein dalam serum atau plasma. Ini menghasilkan hasil tunggal untuk kemungkinan bahwa massa panggul adneksa pada seorang wanita, untuk siapa operasi direncanakan, adalah ganas. Tes ini untuk digunakan adjun', ',0,3020,3046,6772,3584,', 'Alat uji nilai massa adneksa ovarian (ovarium)', '03.06.05', 1, 0, 700, NULL, NULL);
