INSERT INTO `aspak_new_alat` VALUES (4147, 'Dinamometer elektrik/AC-powered dynamometer', '21301002', 6812, 'Suatu alat dengan daya AC dimaksudkan  untuk menilai fungsi neuromuskuler atau tingkat penyumbatan neuromuskuler dengan mengukur, menggunakan transduser gaya (sebuah perangkat yang mengubah kekuatan menjadi impuls listrik), cengkeraman-kekuatan tangan pasien.', ',0,1594,1538,6812,4147,', NULL, NULL, 0, 0, 700, NULL, NULL);
