INSERT INTO `aspak_new_alat` VALUES (4150, 'Bone cap', '11302001', 9384, 'perangkat berbentuk jamur dimaksudkan untuk ditanamkan terbuat dari silikon elastomer atau polietilen dengan berat molekul ultra-tinggi. Hal ini digunakan untuk menutupi ujung terputus dari tulang panjang, seperti humerus atau tibia, untuk mengontrol pertumbuhan berlebih tulang pada remaja diamputasi.', ',0,1594,1539,6813,4150,', 'Bone cap', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4151, 'Bone fixation cerclage', '21302002', 9452, 'perangkat dimaksudkan untuk implan yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan yang terdiri dari pita logam atau lembaran datar atau kawat. Perangkat ini melilit batang tulang panjang, berlabuh ke tulang dengan kawat atau sekrup, dan digunakan dalam fiksasi fraktur.', ',0,1594,1539,6813,4151,', 'Pengikat cerclage untuk fiksasi tulang ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4152, 'Bone heterograft', '31302003', 9451, 'perangkat dimaksudkan untuk implan yang terbuat dari tulang sapi dewasa dan digunakan untuk mengganti tulang manusia setelah operasi pada daerah cervical dari tulang belakang.', ',0,1594,1539,6813,4152,', 'Heterograft tulang ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4153, 'Intramedullary fixation rod', '21302004', 9450, 'perangkat dimaksudkan untuk implan yang terdiri dari batang yang terbuat dari paduan seperti kobalt-kromium-molibdenum dan stainless steel. Hal ini dimasukkan ke dalam medula (sumsum tulang) kanal tulang panjang untuk fiksasi fraktur.', ',0,1594,1539,6813,4153,', 'Batang fiksasi untuk intramedular ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4154, 'Elektromyogram (EMG)/Evoke Potential/Neurostimulator', '21001040', 6799, '', ',0,1595,1541,6799,4154,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4155, 'Passive tendon prosthesis', '21302005', 9449, 'perangkat dimaksudkan untuk ditanamkan terbuat dari elastomer silikon atau polyester yang diperkuat medis kelas elastomer silikon dimaksudkan untuk digunakan dalam bedah rekonstruksi tendon fleksor tangan. Perangkat ini ditanamkan untuk jangka waktu 2 sampai 6 bulan untuk membantu pertumbuhan selubung tendon baru. Perangkat ini tidak dimaksudkan sebagai implan permanen atau berfungsi sebagai pengganti ligamen atau tendon atau berfungsi sebagai perancah untuk ingrowth jaringan lunak.', ',0,1594,1539,6813,4155,', 'Prostesis tendon pasif', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4156, 'Polymethylmethacrylate (PMMA) bone cement', '21302006', 9448, '', ',0,1594,1539,6813,4156,', 'Semen tulang polimetilmetakrilat (PMMA) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4157, 'Single/multiple component metallic bone fixation appliances and accessories', '21302007', 9447, 'perangkat dimaksudkan untuk ditanamkan terdiri dari satu atau lebih komponen logam dan pengencang metaliknya. Perangkat berisi piring, kombinasi paku / piring, atau pisau / kombinasi piring yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, stainless steel, dan titanium, yang dimaksudkan untuk menahan dalam posisi dengan pengencang, seperti sekrup dan paku, atau baut, mur, dan ring. Alat ini digunakan untuk fiksasi fraktur ujung proksimal atau distal tulang panjang, seperti intracapsular, intertrochanteric, intercervical, supracondylar, atau patah tulang condylar femur, karena perpaduan sendi, atau untuk prosedur bedah yang melibatkan pemotongan tulang . Perangkat dapat ditanamkan atau melekat melalui kulit sehingga kekuatan yang menarik (traksi) dapat diterapkan untuk sistem kerangka.', ',0,1594,1539,6813,4157,', 'Peralatan dan aksesori untuk fiksasi tulang dengan kandungan logam tunggal/jamak ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4158, 'Smooth or threaded metallic bone fixation fastener', '21302008', 9446, 'perangkat dimaksudkan untuk implan yang terdiri dari kawat segmen kaku atau batang yang terbuat dari paduan, seperti kobalt-kromium-molibdenum dan stainless steel, yang mungkin halus di luar, sepenuhnya atau sebagian berulir, lurus atau berbentuk U; baik yang berujung tumpul, tajam , atau  memiliki bentuk, kepala pipih di ujungnya. Ini dapat digunakan untuk fiksasi patah tulang, untuk rekonstruksi tulang, sebagai pin panduan untuk pemasangan implan lainnya, atau dapat ditanamkan melalui kulit sehingga kekuatan yang menarik (traksi) dapat diterapkan untuk sistem kerangka.', ',0,1594,1539,6813,4158,', 'Pengencang fiksasi tulang ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4159, 'Resorbable calcium salt bone void filler device', '21302009', 9445, 'implan resorbable dimaksudkan untuk mengisi kekosongan tulang atau kesenjangan pada ekstremitas, tulang belakang, dan panggul yang disebabkan oleh trauma atau operasi dan tidak intrinsik bagi stabilitas struktur tulang.', ',0,1594,1539,6813,4159,', 'Alat pengisi kekosongan tulang berbahan garam', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4160, 'Spinal interlaminal fixation orthosis', '21302010', 9444, 'perangkat dimaksudkan untuk ditanamkan terbuat dari paduan, seperti stainless steel, yang terdiri dari berbagai kait dan ditempatkan posterior kompresi atau distraksi batang. Perangkat ini ditanamkan, biasanya di tiga vertebra yang berdekatan, untuk meluruskan dan immobilisasi tulang belakang untuk memungkinkan cangkok tulang untuk menggabungkan vertebra bersama-sama. Perangkat ini digunakan terutama dalam pengobatan skoliosis (kelengkungan lateral tulang belakang), tetapi juga dapat digunakan dalam pengobatan fraktur atau dislokasi tulang belakang, tingkat 3 dan 4 dari spondylolisthesis (dislokasi tulang belakang) , dan sindrom tulang punggung bawah.', ',0,1594,1539,6813,4160,', 'Ortosis fiksasi interlaminal tulang belakang ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4161, 'Spinal intervertebral body fixation orthosis', '21302011', 9443, 'perangkat dimaksudkan untuk ditanamkan terbuat dari titanium. Ini terdiri dari berbagai piring vertebral yang menekan ke masing-masing dari serangkaian badan vertebra. An eye-jenis sekrup dimasukkan ke dalam sebuah lubang di tengah masing-masing piring. Sebuah kabel dikepang berulir melalui setiap mata-jenis sekrup. Kabel ini dikencangkan dengan perangkat ketegangan dan itu diikat atau berkerut pada setiap mata-jenis sekrup. Perangkat ini digunakan untuk menerapkan kekuatan terhadap serangkaian tulang untuk memperbaiki \"bergoyang,\" skoliosis (kelengkungan lateral tulang belakang), atau kondisi lain.', ',0,1594,1539,6813,4161,', 'Ortosis fiksasi intervertebral tulang belakang ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4162, 'Pedicle screw spinal system', '21302012', 6813, 'beberapa perangkat komponen, terbuat dari berbagai bahan, termasuk paduan seperti stainless steel 316L, 316LVM stainless steel, stainless steel 22Cr-13Ni-5menit, Ti-6Al-4V, dan titanium unalloyed, yang memungkinkan ahli bedah untuk membangun implan sistem agar sesuai anatomi pasien dan persyaratan fisiologis. Perakitan implan tulang belakang seperti terdiri dari kombinasi jangkar (misalnya, baut, kait, dan / atau sekrup), mekanisme interkoneksi menggabungkan mur, sekrup, lengan, atau baut, anggota memanjang (misalnya, pelat, batang, dan / atau piring / batang kombinasi), dan / atau konektor melintang.', ',0,1594,1539,6813,4162,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4163, 'Intervertebral body fusion device ', '21302013', 6813, 'komponen perangkat implan tulang belakang satu atau beberapa yang terbuat dari berbagai bahan, termasuk titanium dan polimer. Perangkat ini dimasukkan ke dalam ruang intervertebralis tubuh dari tulang belakang leher atau lumbosakral, dan dimaksudkan untuk fusi tubuh intervertebralis.', ',0,1594,1539,6813,4163,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4164, 'Ankle joint metal/composite semi-constrained cemented prosthesis', '21302014', 9441, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sendi pergelangan kaki. Perangkat membatasi translasi dan rotasi: dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen talar pelapisan terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen pelaburan tibialis dibuat dari polietilen dengan berat molekul ultra-tinggi dengan serat karbon komposit, dan terbatas pada mereka prostesis ditujukan untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4164,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4165, 'Ankle joint metal/polymer semi-constrained cemented prosthesis', '21302015', 9440, '', ',0,1594,1539,6813,4165,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4166, 'Ankle joint metal/polymer non-constrained cemented prosthesis', '31302016', 9439, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sendi pergelangan kaki. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen tibialis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen talar terbuat dari polietilen dengan berat molekul ultra-tinggi, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4166,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4167, 'Elbow joint metal/polymer constrained cemented prosthesis', '21302017', 9438, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sendi siku. Ini terbuat dari paduan, seperti kobalt-kromium-molibdenum, atau paduan ini dan berat molekul polietilen bushing ultra-tinggi. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan terdiri dari dua komponen yang saling berhubungan. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4167,', 'Prostesis mengandung logam/polimer constrained cemented pada sendi siku ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4168, 'Elbow joint metal/polymer semi-constrained cemented prosthesis', '21302018', 9437, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sendi siku. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen humeri pelapisan terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen resurfacing radial terbuat dari polietilen dengan berat molekul ultra-tinggi. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4168,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4170, 'Transesophageal Echocardiogram (TEE)', '20501037', 6777, '', ',0,1604,1576,6777,4170,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4171, 'Elbow joint radial (hemi-elbow) polymer prosthesis', '21302019', 9436, 'perangkat dimaksudkan untuk implan yang terbuat dari silikon medis kelas elastomer digunakan untuk menggantikan ujung proksimal jari-jari.', ',0,1594,1539,6813,4171,', 'Prostesis mengandung polimer pada sendi siku radial (hemi-elbow) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4172, 'Elbow joint humeral (hemi-elbow) metallic uncemented prosthesis', '31302020', 9435, 'perangkat dimaksudkan untuk ditanamkan terbuat dari paduan, seperti kobalt-kromium-molibdenum, yang digunakan untuk menggantikan ujung distal humerus dibentuk oleh troklea humeri dan humeri capitulum. Jenis generik perangkat terbatas pada prostesis dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4172,', 'Prostesis mengandung logam uncemented pada sendi siku humeral (hemi-elbow) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4173, 'Finger joint metal/metal constrained uncemented prosthesis', '31302021', 9434, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan interphalangeal metacarpophalangeal atau proksimal (jari) bersama. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan terdiri dari dua komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis terbuat dari paduan, seperti kobalt-kromium-molibdenum, atau protesa yang terbuat dari paduan dan berat molekul polietilen ultra-tinggi. Ini jenis generik perangkat terbatas pada prostesis dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4173,', 'Prostesis mengandung logam/logam constrained ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4174, 'Finger joint metal/metal constrained cemented prosthesis', '31302022', 9433, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan metacarpophalangeal (jari) bersama. Perangkat ini mencegah dislokasi di lebih dari satu pesawat anatomi dan memiliki komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4174,', 'Prostesis mengandung logam/logam constrained cemented pada sendi jari tangan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4175, 'Finger joint metal/polymer constrained cemented prosthesis', '31302023', 9432, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan interphalangeal metacarpophalangeal atau proksimal (jari) bersama. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi, dan terdiri dari dua komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan berat molekul polietilen ultra-tinggi, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4175,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4176, 'Finger joint polymer constrained prosthesis', '21302024', 9431, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan interphalangeal metacarpophalangeal atau proksimal (jari) bersama. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen fleksibel di-sendi tunggal yang terbuat baik dari silikon elastomer atau kombinasi pf polypropylene dan bahan polyester. The fleksibel komponen di-sendi bisa ditutupi dengan lapisan karet silikon.', ',0,1594,1539,6813,4176,', 'Prostesis mengandung polimer constrained pada sendi jari tangan ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4177, 'Hip joint metal constrained cemented or uncemented prosthesis', '31302025', 9430, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pinggul. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan memiliki komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan dimaksudkan untuk digunakan dengan atau tanpa semen tulang (888,3027). Perangkat ini tidak dimaksudkan untuk fiksasi biologis.', ',0,1594,1539,6813,4177,', 'Prostesis mengandung logam constrained cemented atau uncemented pada sendi pinggul', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4178, 'Hip joint metal/polymer constrained cemented or uncemented prosthesis', '21302026', 9429, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pinggul. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan memiliki komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen acetabular terbuat dari ultra-tinggi berat molekul polietilen dengan atau tanpa shell logam, terbuat dari paduan, seperti sebagai kobalt-kromium-molibdenum dan paduan titanium. Ini jenis generik perangkat ini dimaksudkan untuk digunakan dengan atau tanpa semen tulang', ',0,1594,1539,6813,4178,', 'Prostesis mengandung logam/polimer constrained cemented atau uncemented pada sendi pinggul ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4179, 'Hip joint metal/metal semi-constrained, with a cemented acetabular component, prosthesis ', '31302027', 6813, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk mengganti sendi panggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari femoral dan komponen acetabular, baik yang terbuat dari paduan, seperti kobalt-kromium-molibdenum. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4179,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4180, 'Hip joint metal/metal semi-constrained, with an uncemented acetabular component, prosthesis ', '31302028', 6813, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk mengganti sendi panggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari femoral dan komponen acetabular, baik yang terbuat dari paduan, seperti kobalt-kromium-molibdenum. Komponen femoralis dimaksudkan untuk diperbaiki dengan semen tulang. Komponen acetabular ini dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4180,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4181, 'Hip joint metal/composite semi-constrained cemented prosthesis', '21302029', 9426, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk mengganti sendi panggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen acetabular terbuat dari polietilen dengan berat molekul ultra-tinggi dengan serat karbon komposit. Kedua komponen ini dimaksudkan untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4181,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4182, 'Hip joint metal/polymer semi-constrained cemented prosthesis', '21302030', 9425, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pinggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen pelapisan kembali acetabular terbuat dari polietilen dengan berat molekul ultra-tinggi dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4182,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4183, 'Hip joint metal/ceramic/polymer semi-constrained cemented or nonporous uncemented prosthesis ', '21302031', 6813, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pinggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen pelapisan kembali acetabular terbuat dari polietilen dengan berat molekul ultra-tinggi dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4183,', 'Prostesis mengandung logam/keramik/polimer semiconstrained cemented atau nonporous uncemented pada sendi pinggul ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4184, 'Hip joint metal/polymer/metal semi-constrained porous-coated uncemented prosthesis ', '21302032', 6813, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pinggul. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki keterkaitan seluruh sendi. Ini jenis generik perangkat memiliki komponen femoralis terbuat dari kobalt-kromium-molibdenum (Co-Cr-Mo) atau paduan titanium-aluminium-vanadium (Ti-6Al-4V) paduan dan komponen acetabular terdiri dari ultra-tinggi polietilen dengan berat molekul permukaan bantalan mengartikulasikan tetap di shell logam yang terbuat dari Co-Cr-Mo atau Ti-6Al-4V. Femoralis batang dan shell acetabular memiliki lapisan berpori terbuat dari, dalam kasus Co-Cr-Mo substrat, manik-manik dari paduan yang sama, dan dalam kasus Ti-6Al-4V substrat, serat dari titanium murni komersial atau Ti-paduan 6Al-4V. Lapisan berpori memiliki porositas volume yang antara 30 dan 70 persen, ukuran pori rata-rata antara 100 dan 1.000 mikron, porositas interkoneksi, dan ketebalan lapisan berpori antara 500 dan 1.500 mikron. Jenis generik perangkat memiliki desain untuk mencapai fiksasi biologis untuk tulang tanpa menggunakan semen tulang', ',0,1594,1539,6813,4184,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4185, 'Hip joint femoral (hemi-hip) metallic cemented or uncemented prosthesis', '21302033', 9422, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sebagian dari sendi pinggul. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum. Ini jenis generik perangkat termasuk desain yang dimaksudkan untuk tetap ke tulang dengan semen tulang (888.3027) serta desain yang memiliki jendela besar-seperti lubang di batang perangkat dan yang dimaksudkan untuk digunakan tanpa semen tulang. Namun, dalam desain yang terakhir, fiksasi perangkat tidak dicapai dengan cara ingrowth tulang.', ',0,1594,1539,6813,4185,', 'Prostesis mengandung logam cemented atau uncemented pada sendi pinggul femoral (hemi-hip) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4186, 'Hip joint (hemi-hip) acetabular metal cemented prosthesis', '31302034', 9421, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sebagian dari sendi pinggul. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen acetabular terbuat dari paduan, seperti kobalt-kromium-molibdenum. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4186,', 'Prostesis acetabular berbahan logam cemented pada sendi pinggul (hemi-hip)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4187, 'Hip joint femoral (hemi-hip) trunnion-bearing metal/polyacetal cemented prosthesis', '31302035', 9420, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk menggantikan kepala dan leher femur. Ini jenis generik perangkat termasuk prostesis yang terdiri dari batang logam yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dengan silinder trunnion bantalan terintegrasi di ujung atas dari batang yang cocok dengan reses di kepala perangkat. Kepala perangkat terbuat dari polyacetal (polioksimetilen) dan tertutup oleh paduan logam, seperti kobalt-kromium-molibdenum. The trunnion bearing memungkinkan kepala perangkat berputar pada batangnya. Prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4187,', 'Prostesis trunnion-bearing berbahan logam/poliasetal cemented pada sendi pinggul femoral (hemi-hip)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4188, 'Hip joint femoral (hemi-hip) metal/polymer cemented or uncemented prosthesis', '21302036', 9419, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk menggantikan kepala dan leher femur. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen acetabular snap-fit terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan berat molekul ultra-tinggi polyethylene. Ini jenis generik perangkat mungkin sudah ditetapkan ke tulang dengan semen tulang (888.3027) atau ditanamkan oleh impaksi', ',0,1594,1539,6813,4188,', 'Prostesis mengandung logam/polimer cemented atau uncemented pada sendi pinggul femoral (hemi-hip) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4189, 'Hip joint femoral (hemi-hip) metallic resurfacing prosthesis', '21302037', 9418, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan sebagian dari sendi pinggul. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen resurfacing femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum.', ',0,1594,1539,6813,4189,', 'Prostesis mengandung logam pengganti lapisan pada sendi pinggul femoral (hemi-hip) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4190, 'Hip joint metal/polymer or ceramic/polymer semiconstrained resurfacing cemented prosthesis ', '31302038', 6813, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk menggantikan permukaan sendi pinggul sambil menjaga kepala femoral dan leher. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki keterkaitan seluruh sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen femoralis topi terbuat dari paduan logam, seperti kobalt-kromium-molibdenum, atau bahan keramik, yang ditempatkan di atas kepala femoral pembedahan disiapkan, dan komponen polimer resurfacing acetabular. Kedua komponen ini dimaksudkan untuk digunakan dengan semen tulang ', ',0,1594,1539,6813,4190,', 'Prostesis mengandung logam/polimer atau keramik/polimer ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4191, 'Knee joint femorotibial metallic constrained cemented prosthesis', '31302039', 9416, '', ',0,1594,1539,6813,4191,', 'Prostesis mengandung logam constrained cemented pada sendi lutut femoratibial ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4192, 'Swan Ganz Catheter', '20501038', 6777, '', ',0,1604,1576,6777,4192,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4193, 'Intra-aortic Ballon Pump (IABP)', '20501039', 6777, '', ',0,1604,1576,6777,4193,', NULL, NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4195, 'Wheeled stretcher', '20903042', 7358, '', ',0,1599,1560,6798,4195,', 'Tandu beroda, brankar ambulan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4196, 'Knee joint femorotibial metal/composite non-constrained cemented prosthesis', '21302040', 9415, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis condylar resurfacing atau komponen yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen condylar tibialis atau komponen yang terbuat dari polietilen dengan berat molekul ultra-tinggi dengan serat karbon komposit dan dimaksudkan untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4196,', 'Prostesis mengandung logam/komposit nonconstrained cemented padasendi lutut femoratibial ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4197, 'Knee joint femorotibial metal/composite semi-constrained cemented prosthesis ', '21302041', 6813, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen tibialis dengan permukaan sendi yang terbuat dari polietilen dengan berat molekul ultra-tinggi dengan serat karbon komposit-dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4197,', 'Prostesis mengandung logam/komposit semiconstrained cemented pada sendi lutut femoratibial ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4198, 'Knee joint femorotibial metal/polymer constrained cemented prosthesis', '21302042', 9413, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi terjemahan atau rotasi dalam satu atau lebih pesawat dan memiliki komponen yang dihubungkan bersama atau affined. Ini jenis generik perangkat termasuk prostesis terdiri dari gabungan bola-dan-socket terletak antara bertangkai femoral dan bertangkai komponen tibialis dan pelari dan melacak bersama antara setiap pasangan kondilus femoralis dan tibialis. Bola-dan-socket sendi terdiri dari bola di kepala kolom naik dari bertangkai komponen tibialis. Bola, kolom, dataran tinggi tibialis, dan batang untuk fiksasi komponen tibialis terbuat dari paduan, seperti kobalt-kromium-molibdenum. Bola dari komponen tibialis diadakan dalam soket dari komponen femoralis dengan permukaan luar datar komponen femoralis itu. Flat permukaan luar komponen tibialis berbatasan kedua permukaan datar timbal balik dalam rongga komponen femoralis dan flensa pada komponen femoralis dirancang untuk mencegah perpindahan distal. Batang komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, tapi soket komponen yang terbuat dari polietilen dengan berat molekul ultra-tinggi. Komponen femoralis memiliki pelari logam yang sejajar dengan ultra-tinggi berat molekul polietilen trek bahwa pers-masuk ke komponen tibialis metalik. Kelas generik juga mencakup perangkat yang atas dan bawah komponen dihubungkan dengan baut yang solid melewati bantalan jurnal jari-jari yang lebih besar, memungkinkan beberapa rotasi melintang di pesawat, busur minimal penculikan / adduksi. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4198,', 'Prostesis mengandung logam/polimer constrained cemented pada sendi lutut femorotibial', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4199, 'Knee joint femorotibial metal/polymer semi-constrained cemented prosthesis', '21302044', 9411, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen tibialis terbuat dari polietilen dengan berat molekul ultra-tinggi dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4199,', 'Prostesis mengandung logam/polimer semiconstrained cemented pada sendi lutut femorotibial ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4200, 'Knee joint femorotibial metal/polymer non-constrained cemented prosthesis', '21302043', 9412, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis condylar resurfacing atau komponen yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen tibialis atau komponen yang terbuat dari polietilen dengan berat molekul ultra-tinggi dan dimaksudkan untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4200,', 'Prostesis mengandung logam/polimer nonconstrained cemented pada sendi lutut femorotibial', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4201, 'Knee joint femorotibial (uni-compartmental) metal/polymer porous-coated uncemented prosthesis ', '21302045', 6813, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat dirancang untuk mencapai fiksasi biologis untuk tulang tanpa menggunakan semen tulang. Identifikasi ini termasuk prostesis lutut tetap bantalan mana ultra-tinggi berat molekul polietilen tibialis bantalan kaku dijamin ke baseplate tibialis logam', ',0,1594,1539,6813,4201,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4202, 'Knee joint patellofemoral polymer/metal semi-constrained cemented prosthesis ', '21302046', 6813, 'perangkat dua bagian dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut dalam pengobatan arthritis patellofemoral primer atau chondromalacia. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk komponen yang terbuat dari paduan, seperti kobalt-kromium-molibdenum atau baja austenitik, untuk resurfacing alur interkondilaris (sulkus femoralis) pada aspek anterior femur distal, dan komponen patela terbuat dari ultra-tinggi berat molekul polietilen. Ini jenis generik perangkat terbatas pada alat-alat yang dimaksudkan untuk digunakan dengan semen tulang (888,3027). Komponen patela dirancang untuk ditanamkan hanya dengan komponen femoralis nya.', ',0,1594,1539,6813,4202,', 'Prostesis mengandung logam/polimer semiconstrained cemented pada sendi lutut patelofemoral ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4203, 'Alat pembuka gips elektric (Cast removal instrument)', '11303014', 6814, 'an AC-powered, hand-held device intended to remove a cast from a patient. This generic type of device includes the electric cast cutter and cast vacuum.', ',0,1594,1540,6814,4203,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4204, 'Knee joint patellofemorotibial polymer/metal/metal constrained cemented prosthesis', '31302047', 9408, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi lutut. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan memiliki komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis, komponen tibialis, baut silinder dan penguncian perangkat keras yang menyertainya yang semuanya terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen resurfacing retropatellar terbuat dari molekul ultra-tinggi berat polietilena. Komponen permukaan retropatellar dapat melekat pada patella resected baik dengan sekrup logam atau semen tulang. Semua berasal komponen logam dalam jenis generik dimaksudkan untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4204,', 'Prostesis mengandung polimer/logam/logam constrained cemented pada sendi lutut patelofemorotibial', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4205, 'Knee joint patellofemorotibial polymer/metal/polymer semi-constrained cemented prosthesis ', '21302048', 6813, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen femoralis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen tibialis atau komponen dan komponen resurfacing retropatellar terbuat dari polietilen dengan berat molekul ultra-tinggi. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4205,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4206, 'Alat pembuka gips', '11303015', 6814, 'a nonpowered hand-held device intended to be used in applying or removing a cast. This generic type of device includes the cast knife, cast spreader, plaster saw, plaster dispenser, and casting stand.', ',0,1594,1540,6814,4206,', '', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4207, 'Knee joint patellofemorotibial metal/polymer porous-coated uncemented prosthesis', '21302049', 9406, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat dirancang untuk mencapai fiksasi biologis untuk tulang tanpa menggunakan semen tulang. Identifikasi ini termasuk prostesis lutut tetap bantalan mana ultra tinggi berat molekul polietilen tibialis bantalan kaku dijamin ke pelat dasar tibialis logam', ',0,1594,1539,6813,4207,', 'Prostesis mengandung logam/polimer porous-coated uncemented pada sendi lutut patelofemorotibial ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4208, 'Knee joint femoral (hemi-knee) metallic uncemented prosthesis', '31302050', 9405, 'perangkat yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang terdiri dari komponen femoralis dengan atau tanpa tonjolan (s) untuk peningkatan fiksasi dan terbatas pada mereka protesa dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4208,', 'Prostesis mengandung logam uncemented pada sendi lutut femoralis (hemi-knee', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4209, 'Knee joint patellar (hemi-knee) metallic resurfacing uncemented prosthesis', '21302051', 9404, 'perangkat yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dimaksudkan untuk ditanamkan untuk menggantikan permukaan artikular retropatellar dari sendi patellofemoral. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen resurfacing retropatellar dan sekrup ortopedi untuk menancapkan sisa patela. Ini jenis generik dari perangkat ini terbatas pada mereka protesa dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4209,', 'Prostesis mengandung uncemented pengganti lapisan pada sendi lutut patela (hemiknee) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4211, 'Knee joint tibial (hemi-knee) metallic resurfacing uncemented prosthesis', '21302052', 9403, 'perangkat dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi lutut. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini prostesis terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan dimaksudkan untuk muncul kembali satu kondilus tibia. Jenis generik perangkat ini terbatas pada mereka protesa dimaksudkan untuk digunakan tanpa semen tulang', ',0,1594,1539,6813,4211,', 'Prostesis mengandung logam uncemented pengganti lapisan pada sendi lutut tibialis (hemiknee) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4212, 'Shoulder joint metal/metal or metal/polymer constrained cemented prosthesis', '31302053', 9402, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi bahu. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan memiliki komponen yang dihubungkan bersama. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen humeri terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen glenoid terbuat dari paduan ini atau kombinasi dari paduan ini dan berat molekul polietilen ultra-tinggi. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4212,', 'Prostesis mengandung logam/logam atau logam/polimer constrained cemented pada sendi bahu', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4213, 'Shoulder joint metal/polymer non-constrained cemented prosthesis', '21302054', 9401, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi bahu. Perangkat membatasi minimal (kurang dari kendala anatomi normal) terjemahan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen humeri terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan komponen resurfacing glenoid terbuat dari polietilen dengan berat molekul ultra-tinggi, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4213,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4215, 'Minor Surgery Set', '21603058', 6824, '', ',0,1601,1567,6824,4215,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4216, 'Hecting set', '21603059', 6824, '', ',0,1601,1567,6824,4216,', 'Set angkat jahitan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4217, 'Circumsisi set', '21603060', 6824, '', ',0,1601,1567,6824,4217,', NULL, NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4218, 'Shoulder joint metal/polymer semi-constrained cemented prosthesis', '21302055', 9400, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi bahu. Perangkat membatasi translasi dan rotasi dalam satu atau lebih pesawat melalui geometri permukaan yang mengartikulasikan. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen humeri pelapisan terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan glenoid resurfacing komponen yang terbuat dari polietilen dengan berat molekul ultra-tinggi, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan tulang semen', ',0,1594,1539,6813,4218,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4219, 'Holter Monitor', '20502038', 6778, '', ',0,1604,1577,6778,4219,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4220, 'Shoulder joint metal/polymer/metal nonconstrained or semi-constrained porous-coated uncemented prosthesis ', '21302056', 6813, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi bahu. Perangkat membatasi gerakan dalam satu atau lebih pesawat. Ini tidak memiliki hubungan across-the-sendi. Ini jenis generik perangkat termasuk prostesis yang memiliki komponen humeri terbuat dari paduan seperti kobalt-kromium-molibdenum (Co-Cr-Mo) dan titanium-aluminium-vanadium (Ti-6Al-4V) paduan, dan komponen pelaburan glenoid dibuat berat molekul polietilen ultra-tinggi, atau kombinasi dari permukaan mengartikulasikan ultra-tinggi berat molekul bantalan tetap di shell logam yang terbuat dari paduan seperti Co-Cr-Mo dan Ti-6Al-4V. Komponen humerus dan dukungan glenoid memiliki lapisan berpori terbuat dari, dalam kasus komponen Co-Cr-Mo, manik-manik dari paduan sama atau bubuk titanium murni komersial, dan dalam kasus komponen Ti-6Al-4V, manik-manik atau serat dari titanium murni komersial atau paduan Ti-6Al-4V, atau bubuk titanium murni komersial. Lapisan berpori memiliki porositas volume yang antara 30 dan 70 persen, ukuran pori rata-rata antara 100 dan 1.000 mikron, porositas interkoneksi, dan ketebalan lapisan berpori antara 500 dan 1.500 mikron. Ini jenis generik perangkat dirancang untuk mencapai fiksasi biologis untuk tulang tanpa menggunakan semen tulang', ',0,1594,1539,6813,4220,', 'Prostesis mengandung logam/polimer/logam nonconstrained atau semiconstrained porous-coated uncemented pada sendi bahu', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4221, 'Shoulder joint humeral (hemi-shoulder) metallic uncemented prosthesis', '21302058', 9397, 'perangkat yang terbuat dari paduan, seperti kobalt-kromium-molibdenum. Ini memiliki batang intramedulla dan dimaksudkan untuk ditanamkan untuk menggantikan permukaan artikular dari ujung proksimal humerus dan diperbaiki tanpa semen tulang (888,3027). Perangkat ini tidak dimaksudkan untuk fiksasi biologis', ',0,1594,1539,6813,4221,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4222, 'Shoulder joint glenoid (hemi-shoulder) metallic cemented prosthesis', '31302057', 9398, 'perangkat yang memiliki glenoid (socket) komponen yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, atau paduan dengan berat molekul polietilen ultra-tinggi dan dimaksudkan untuk ditanamkan untuk menggantikan bagian dari sendi bahu. Ini jenis generik dari perangkat ini terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4222,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4223, 'Toe joint polymer constrained prosthesis', '21302059', 9396, 'perangkat yang terbuat dari elastomer silikon atau poliester diperkuat elastomer silikon dimaksudkan untuk ditanamkan untuk menggantikan pertama metatarsophalangeal (jempol kaki) bersama. Ini jenis generik perangkat terdiri dari fleksibel komponen di-sendi tunggal yang mencegah dislokasi di lebih dari satu bidang anatomi.', ',0,1594,1539,6813,4223,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4224, 'Toe joint phalangeal (hemi-toe) polymer prosthesis', '21302060', 9395, 'perangkat yang terbuat dari silikon elastomer dimaksudkan untuk ditanamkan untuk menggantikan dasar falang proksimal jari kaki', ',0,1594,1539,6813,4224,', 'Prostesis mengandung polimer pada sendi jari kaki phalangeal (hemi-toe)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4225, 'Wrist joint carpal lunate polymer prosthesis', '21302061', 9394, 'perangkat one-piece yang terbuat dari silikon elastomer dimaksudkan untuk ditanamkan untuk menggantikan tulang karpal bulan sabit dari pergelangan tangan', ',0,1594,1539,6813,4225,', 'Prostesis mengandung polimer pada sendi pergelangan tangan carpal lunate', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4226, 'Wrist joint carpal scaphoid polymer prosthesis', '21302062', 9393, 'perangkat one-piece yang terbuat dari silikon elastomer dimaksudkan untuk ditanamkan untuk menggantikan tulang skafoid karpal pergelangan tangan.', ',0,1594,1539,6813,4226,', 'Prostesis mengandung polimer pada sendi pergelangan tangan carpal scaphoid', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4227, 'Wrist joint carpal trapezium polymer prosthesis', '21302063', 9392, 'perangkat one-piece yang terbuat dari elastomer silikon atau silikon elastomer / poliester bahan yang dimaksudkan untuk ditanamkan untuk menggantikan trapezium tulang karpal pergelangan tangan.', ',0,1594,1539,6813,4227,', 'Prostesis mengandung polimer pada sendi pergelangan tangan carpal trapezium', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4228, 'Wrist joint polymer constrained prosthesis', '21302064', 9391, 'perangkat yang terbuat dari polyester yang diperkuat elastomer silikon dimaksudkan untuk ditanamkan untuk mengganti sendi pergelangan tangan. Ini jenis generik perangkat terdiri dari fleksibel komponen di-sendi tunggal yang mencegah dislokasi di lebih dari satu bidang anatomi.', ',0,1594,1539,6813,4228,', 'Prostesis mengandung polimer constrained pada sendi pergelangan tangan ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4229, 'Wrist joint metal constrained cemented prosthesis', '21302065', 9390, 'perangkat dimaksudkan untuk ditanamkan untuk mengganti sendi pergelangan tangan. Perangkat mencegah dislokasi di lebih dari satu pesawat anatomi dan terdiri dari baik fleksibel komponen di-sendi tunggal atau dua komponen yang dihubungkan bersama. Ini jenis generik perangkat terbatas ke perangkat yang terbuat dari paduan, seperti kobalt-kromium-molibdenum, dan terbatas pada mereka prostesis dirancang untuk digunakan dengan semen tulang', ',0,1594,1539,6813,4229,', 'Prostesis mengandung logam constrained cemented pada sendi pergelangan tangan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4230, 'Wrist joint metal/polymer semi-constrained cemented prosthesis', '21302066', 9389, 'Wrist joint metal/polymer semi-constrained cemented prosthesis', ',0,1594,1539,6813,4230,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4231, 'Wrist joint ulnar (hemi-wrist) polymer prosthesis', '21302067', 9388, 'perangkat berbentuk jamur terbuat dari kelas elastomer silikon medis atau polietilen dengan berat molekul ultra-tinggi dimaksudkan untuk ditanamkan ke dalam kanal intramedulla tulang dan diadakan di tempat oleh jahitan. Tujuannya adalah untuk menutupi ujung resected dari ulna distal untuk mengendalikan pertumbuhan berlebih tulang dan memberikan permukaan artikular untuk jari-jari dan tulang pergelangan tangan.', ',0,1594,1539,6813,4231,', 'Prostesis mengandung polimer pada sendi pergelangan tangan ulnar (hemi-wrist)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4232, 'Cement dispenser', '11303002', 9087, 'perangkat mirip alat suntik tanpa catu daya dimaksudkan untuk digunakan dalam menempatkan semen tulang (888.3027) ke situs bedah.', ',0,1594,1540,6814,4232,', 'Dispenser semen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4233, 'Cement mixer for clinical use', '11303003', 9086, 'perangkat yang terdiri dari wadah dimaksudkan untuk digunakan dalam pencampuran semen tulang', ',0,1594,1540,6814,4233,', 'Pengaduk semen medis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4234, 'Cement monomer vapor evacuator', '11303004', 9085, 'perangkat dimaksudkan untuk digunakan selama operasi untuk mengandung atau menghapus asap yang tidak diinginkan, seperti uap monomer dari semen tulang', ',0,1594,1540,6814,4234,', 'Evakuator uap monomer semen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4235, 'Cement ventilation tube', '11303005', 9084, 'perangkat seperti tabung biasanya terbuat dari plastik dimaksudkan untuk dimasukkan ke dalam rongga bedah untuk memungkinkan pelepasan udara atau cairan dari rongga karena sedang diisi dengan semen tulang', ',0,1594,1540,6814,4235,', 'Tabung ventilasi semen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4236, 'Depth gauge for clinical use', '11303006', 9083, 'alat pengukur dimaksudkan untuk berbagai keperluan medis, seperti untuk menentukan panjang tepat sekrup untuk ikat ujung tulang patah.', ',0,1594,1540,6814,4236,', 'Gauge medis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4237, 'Orthopedic manual surgical instrument ', '11303007', 6814, 'perangkat genggam tanpa sumber daya yang ditujukan untuk tujuan medis untuk memanipulasi jaringan, atau untuk digunakan dengan perangkat lain dalam bedah ortopedi. Ini jenis generik perangkat termasuk applier cerclage, penusuk, bender, bor brace, bros, duri, pembuka botol, countersink, pin crimper, pemotong kawat, sopir prosthesis, ekstraktor, berkas, garpu, pemegang jarum, penabrak, membungkuk atau contouring instrumen, instrumen kompresi, pelintas, soket positioner, penyelidikan, femoralis leher pukulan, pendorong soket, alat untuk membesarkan lubang, rongeur, gunting, obeng, skid tulang, pokok driver, sekrup tulang pemula, stripper bedah, memadatkan, tekan tulang, trephine, kawat twister, dan kunci pas .', ',0,1594,1540,6814,4237,', 'Instrumen bedah ortopedi manual ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4238, 'Sonic surgical instrument and accessories/attachments ', '11303008', 6814, 'perangkat genggam dengan berbagai aksesori atau lampiran, seperti ujung tombak yang bergetar pada frekuensi tinggi, dan ditujukan untuk tujuan medis untuk memotong tulang atau bahan lainnya, seperti akrilik', ',0,1594,1540,6814,4238,', 'Instrumen bedah dengan frekuensi tinggi dan aksesori', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4239, 'Template for clinical use', '11303010', 9094, 'sebuah perangkat yang terdiri dari pola atau panduan dimaksudkan untuk tujuan medis, seperti memilih atau posisi implan ortopedi atau membimbing penandaan jaringan sebelum pemotongan.', ',0,1594,1540,6814,4239,', 'Template medis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4240, 'Cast component', '11303013', 9091, 'perangkat ditujukan untuk tujuan medis untuk melindungi atau mendukung gips. Ini jenis generik perangkat termasuk tumit cor, toe cap, dukungan cor, dan besi berjalan.', ',0,1594,1540,6814,4240,', 'Komponen cast', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4242, 'Diagnostic electromyograph needle electrode', '21401004', 9462, '', ',0,1598,1555,6815,4242,', 'Elektroda elektromiograf ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4243, 'Force-measuring platform', '11401006', 9460, 'A force-measuring platform is a device intended for medical purposes that converts pressure applied upon a planar surface into analog mechanical or electrical signals. This device is used to determine ground reaction force, centers of percussion, centers of torque, and their variations in both magnitude and direction with time.', ',0,1598,1555,6815,4243,', 'Alat ukur gaya', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4244, 'Intermittent pressure measurement system ', '11401007', 6815, 'An intermittent pressure measurement system is an evaluative device intended for medical purposes, such as to measure the actual pressure between the body surface and the supporting media.', ',0,1598,1555,6815,4244,', 'Sistem ukur tekanan intermiten ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4245, 'Continuous flush catheter', '20501008', 7499, '', ',0,1604,1576,6777,4245,', 'Kateter pembilas kontinu', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4246, 'Electrode recording catheter or electrode recording probe', '20501009', 7498, '', ',0,1604,1576,6777,4246,', 'Kateter atau probe elektroda perekam', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4247, 'Intracavitary phonocatheter system', '20501013', 7495, '', ',0,1604,1576,6777,4247,', 'Sistem fonokateter intrakavitari', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4248, 'Steerable catheter', '20501014', 7494, '', ',0,1604,1576,6777,4248,', 'Kateter yang dapat dikendalikan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4249, 'Steerable catheter control system', '20501015', 7493, '', ',0,1604,1576,6777,4249,', 'Sistem pengendali kateter', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4250, 'Catheter cannula', '20501016', 7492, '', ',0,1604,1576,6777,4250,', 'Kanula kateter', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4251, 'Vessel dilator for percutaneous catheterization', '20501017', 7491, '', ',0,1604,1576,6777,4251,', 'Bejana dilator untuk kateterisasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4252, 'Catheter guide wire', '20501018', 7490, '', ',0,1604,1576,6777,4252,', 'Kateter guide wire', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4253, 'Catheter introducer', '20501019', 7489, '', ',0,1604,1576,6777,4253,', 'Kateter introducer', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4254, 'Catheter balloon repair kit', '20501020', 7488, '', ',0,1604,1576,6777,4254,', 'Kit perbaikan balon kateter', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4255, 'Trace microsphere', '20501021', 7487, '', ',0,1604,1576,6777,4255,', 'Trace microsphere.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4256, 'Catheter tip occluder', '20501022', 7486, '', ',0,1604,1576,6777,4256,', 'Ujung kateter occluder', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4257, 'Catheter stylet', '20501023', 7485, '', ',0,1604,1576,6777,4257,', 'Stylet kateter', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4258, 'Trocar', '20501024', 7484, 'A trocar is a sharp-pointed instrument used with a cannula for piercing a vessel or chamber to facilitate insertion of the cannula', ',0,1604,1576,6777,4258,', 'Trocar', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4259, 'Programmable diagnostic computer', '20501025', 7483, '', ',0,1604,1576,6777,4259,', 'Komputer diagnostik terprogram', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4260, 'Single-function, preprogrammed diagnostic computer', '20501026', 7482, '', ',0,1604,1576,6777,4260,', 'Komputer diagnostik fungsi-tunggal dan terprogram.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4261, 'Angiographic injector and syringe', '20501028', 7480, '', ',0,1604,1576,6777,4261,', 'Alat suntik / spuit dan injektor angiografi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4262, 'Indicator injector', '20501029', 7479, '', ',0,1604,1576,6777,4262,', 'Indicator injector', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4263, 'Syringe actuator for an injector', '20501030', 7478, '', ',0,1604,1576,6777,4263,', 'Alat suntik / spuit aktuator untuk injektor', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4264, 'External programmable pacemaker pulse generator', '20501031', 7468, '', ',0,1604,1576,6777,4264,', 'Generator pulsa pacemaker / pacu jantung eksternal yang dapat diprogram', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4265, 'Withdrawal-infusion pump', '20501032', 7477, '', ',0,1604,1576,6777,4265,', 'Penarik pompa infus', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4266, 'Thermodilution probe', '20501034', 7467, '', ',0,1604,1576,6777,4266,', 'Probe termodilusi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4267, 'Blood pressure computer', '20501035', 7504, '', ',0,1604,1576,6777,4267,', 'Komputer pengukur tekanan darah', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4268, 'Baby Suction Pump', '20903055', 6798, '', ',0,1599,1560,6798,4268,', NULL, NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4270, 'Resusitator bayi/neonatus', '20403083', 6775, '', ',0,1592,1531,6775,4270,', '', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4271, 'Biopotential amplifier and signal conditioner', '20502001', 6778, '', ',0,1604,1577,6778,4271,', 'Penguat biopotensial dan pengkondisi sinyal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4272, 'Transducer signal amplifier and conditioner.', '20502002', 7543, '', ',0,1604,1577,6778,4272,', 'Penguat sinyal transducer dan kondisioner.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4273, 'Miniature pressure transducer', '11401008', 9453, 'A miniature pressure transducer is a device intended for medical purposes to measure the pressure between a device and soft tissue by converting mechanical inputs to analog electrical signals.', ',0,1598,1555,6815,4273,', 'Miniatur transduser tekanan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4274, 'Diagnostic muscle stimulator', '21401009', 9458, 'A diagnostic muscle stimulator is a device used mainly with an electromyograph machine to initiate muscle activity. It is intended for medical purposes, such as to diagnose motor nerve or sensory neuromuscular disorders and neuromuscular function.', ',0,1598,1555,6815,4274,', 'Alat diagnosa stimulasi otot', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4275, 'Isokinetic testing and evaluation system', '21401010', 9457, 'An isokinetic testing and evaluation system is a rehabilitative exercise device intended for medical purposes, such as to measure, evaluate, and increase the strength of muscles and the range of motion of joints.', ',0,1598,1555,6815,4275,', 'Sistem uji isokinetik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4276, 'Prosthetic and orthotic accessory', '11402001', 9252, 'A prosthetic and orthotic accessory is a device intended for medical purposes to support, protect, or aid in the use of a cast, orthosis (brace), or prosthesis. Examples of prosthetic and orthotic accessories include the following: A pelvic support band and belt, a cast shoe, a cast bandage, a limb cover, a prosthesis alignment device, a postsurgical pylon, a transverse rotator, and a temporary training splint.', ',0,1598,1556,6816,4276,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4277, 'Extravascular blood flow probe.', '20502004', 7541, '', ',0,1604,1577,6778,4277,', 'Probe pemeriksaan aliran darah ekstravaskular', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4278, 'Apex cardiograph (vibrocardiograph)', '20502006', 6778, '', ',0,1604,1577,6778,4278,', 'Apex cardiograph (vibrocardiograph).', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4279, 'Cane/Tongkat', '11402002', 6816, 'A cane is a device intended for medical purposes that is used to provide minimal weight support while walking. Examples of canes include the following: A standard cane, a forearm cane, and a cane with a tripod, quad, or retractable stud on the ground end.', ',0,1598,1556,6816,4279,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4280, 'Mechanical chair/Kursi mekanis', '11402003', 6816, 'A mechanical chair is a manually operated device intended for medical purposes that is used to assist a disabled person in performing an activity that the person would otherwise find difficult to do or be unable to do. Examples of mechanical chairs include the following: A chair with an elevating seat used to raise a person from a sitting position to a standing position and a chair with casters used by a person to move from one place to another while sitting.', ',0,1598,1556,6816,4280,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4281, 'Electrocardiograph lead switching adaptor', '20502010', 6778, '', ',0,1604,1577,6778,4281,', 'Adaptor switching EKG', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4283, 'Emergency Trolley / Resuscitation Crash Cart ', '20903057', 6798, '', ',0,1599,1560,6798,4283,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4284, 'Electrocardiograph surface electrode tester.', '20502012', 7533, '', ',0,1604,1577,6778,4284,', 'Penguji permukaan elektrokardiograf', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4285, 'Medical cathode-ray tube display.', '20502015', 7531, '', ',0,1604,1577,6778,4285,', 'Penampil hasil medis dengan CTR', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4286, 'Electric positioning chair', '21402004', 9229, 'An electric positioning chair is a device with a motorized positioning control that is intended for medical purposes and that can be adjusted to various positions. The device is used to provide stability for patients with athetosis (involuntary spasms) and to alter postural positions.', ',0,1598,1556,6816,4286,', 'Kursi posisi elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4287, 'kruk/penopang/Crutch', '11402005', 6816, 'digunakan untuk orang-orang cacat dalam memberikan dukungan/penopang saat berjalan, minimal untuk berat badan sedang.', ',0,1598,1556,6816,4287,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4288, 'Flotation cushion/Bantal flotasi', '11402006', 6816, 'A flotation cushion is a device intended for medical purposes that is made of plastic, rubber, or other type of covering, that is filled with water, air, gel, mud, or any other substance allowing a flotation media, used on a seat to lessen the likelihood of skin ulcers.', ',0,1598,1556,6816,4288,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4289, 'External limb orthotic component', '11402007', 9251, 'An external limb orthotic component is a device intended for medical purposes for use in conjunction with an orthosis (brace) to increase the function of the orthosis for a patient\'s particular needs. Examples of external limb orthotic components include the following: A brace-setting twister and an external brace stirrup.', ',0,1598,1556,6816,4289,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4290, 'External limb prosthetic component', '11402008', 9250, 'An external limb prosthetic component is a device intended for medical purposes that, when put together with other appropriate components, constitutes a total prosthesis. Examples of external limb prosthetic components include the following: Ankle, foot, hip, knee, and socket components; mechanical or powered hand, hook, wrist unit, elbow joint, and shoulder joint components; and cable and prosthesis suction valves.', ',0,1598,1556,6816,4290,', 'Komponen prostesis eksternal anggota gerak', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4291, 'Limb orthosis', '11402009', 9249, 'A limb orthosis (brace) is a device intended for medical purposes that is worn on the upper or lower extremities to support, to correct, or to prevent deformities or to align body structures for functional improvement. Examples of limb orthoses include the following: A whole limb and joint brace, a hand splint, an elastic stocking, a knee cage, and a corrective shoe.', ',0,1598,1556,6816,4291,', 'Ortosis anggota gerak', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4292, 'Truncal orthosis', '11402010', 9248, 'A truncal orthosis is a device intended for medical purposes to support or to immobilize fractures, strains, or sprains of the neck or trunk of the body. Examples of truncal orthoses are the following: Abdominal, cervical, cervical-thoracic, lumbar, lumbo-sacral, rib fracture, sacroiliac, and thoracic orthoses and clavicle splints.', ',0,1598,1556,6816,4292,', 'Ortosis badan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4293, 'External assembled lower limb prosthesis', '21402011', 9247, 'An external assembled lower limb prosthesis is a device that is intended for medical purposes and is a preassembled external artificial limb for the lower extremity. Examples of external assembled lower limb prostheses are the following: Knee/shank/ankle/foot assembly and thigh/knee/shank/ankle/foot assembly.', ',0,1598,1556,6816,4293,', 'Prostesis ekternal rakitan untuk anggota gerak bawah', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4294, 'Plinth', '11402012', 9226, 'A plinth is a flat, padded board with legs that is intended for medical purposes. A patient is placed on the device for treatment or examination.', ',0,1598,1556,6816,4294,', 'Alas periksa', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4295, 'Rigid pneumatic structure orthosis', '31402013', 9225, 'A rigid pneumatic structure orthosis is a device intended for medical purposes to provide whole body support by means of a pressurized suit to help thoracic paraplegics walk.', ',0,1598,1556,6816,4295,', 'Ortosis tulang pnuematik rigid', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4296, 'Arm sling', '11402014', 9246, 'An arm sling is a device intended for medical purposes to immobilize the arm, by means of a fabric band suspended from around the neck.', ',0,1598,1556,6816,4296,', 'Mitela, penyangga tangan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4297, 'Congenital hip dislocation abduction splint', '11402015', 9224, 'A congenital hip dislocation abduction splint is a device intended for medical purposes to stabilize the hips of a young child with dislocated hips in an abducted position (away from the midline).', ',0,1598,1556,6816,4297,', 'Splint abduksi dislokasi kongenital', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4298, 'Denis Brown splint', '11402016', 9245, 'A Denis Brown splint is a device intended for medical purposes to immobilize the foot. It is used on young children with tibial torsion (excessive rotation of the lower leg) or club foot', ',0,1598,1556,6816,4298,', 'Denis Brown splint', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4299, 'Powered wheeled stretcher/Stretcher beroda elektrik', '21402017', 6816, 'A powered wheeled stretcher is a battery-powered table with wheels that is intended for medical purposes for use by patients who are unable to propel themselves independently and who must maintain a prone or supine position for prolonged periods because of skin ulcers or contractures (muscle contractions).', ',0,1598,1556,6816,4299,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4300, 'Nonpowered communication system', '11402018', 9243, 'A nonpowered communication system is a mechanical device intended for medical purposes that is used to assist a patient in communicating when physical impairment prevents writing, telephone use, reading, or talking. Examples of nonpowered communications systems include an alphabet board and a page turner.', ',0,1598,1556,6816,4300,', 'Sistem komunikasi nonelektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4302, 'Powered environmental control system', '21402020', 9241, 'A powered environmental control system is an AC- or battery-powered device intended for medical purposes that is used by a patient to operate an environmental control function. Examples of environmental control functions include the following: to control room temperature, to answer a doorbell or telephone, or to sound an alarm for assistance.', ',0,1598,1556,6816,4302,', 'Sistem kontrol lingkungan (elektrik)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4303, 'Mechanical table', '11402021', 9223, 'A mechanical table is a device intended for medical purposes that has a flat surface that can be inclined or adjusted to various positions. It is used by patients with circulatory, neurological, or musculoskeletal conditions to increase tolerance to an upright or standing position.', ',0,1598,1556,6816,4303,', 'Meja mekanik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4304, 'Powered communication system', '21402019', 9242, 'A powered communication system is an AC- or battery-powered device intended for medical purposes that is used to transmit or receive information. It is used by persons unable to use normal communication methods because of physical impairment. Examples of powered communication systems include the following: a specialized typewriter, a reading machine, and a video picture and word screen.', ',0,1598,1556,6816,4304,', 'Sistem komunikasi elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4305, 'Powered table', '11402022', 9222, 'A powered table is a device intended for medical purposes that is an electrically operated flat surface table that can be adjusted to various positions. It is used by patients with circulatory, neurological, or musculoskeletal conditions to increase tolerance to an upright or standing position.', ',0,1598,1556,6816,4305,', 'Meja elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4306, 'Cane, crutch, and walker tips and pads', '11402023', 9240, 'Cane, crutch, and walker tips and pads are rubber (or rubber substitute) device accessories intended for medical purposes that are applied to the ground end of mobility aids to prevent skidding or that are applied to the body contact area of the device for comfort or as an aid in using an ambulatory assist device.', ',0,1598,1556,6816,4306,', 'Bantalan tongkat, kruk, dan alat bantu jalan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4307, 'Oxygen set+flowmeter', '10403084', 6775, '', ',0,1592,1531,6775,4307,', NULL, NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4308, 'Motorized three-wheeled vehicle', '21402024', 9221, 'A motorized three-wheeled vehicle is a gasoline-fueled or battery-powered device intended for medical purposes that is used for outside transportation by disabled persons.', ',0,1598,1556,6816,4308,', 'Kursi beroda tiga bermotor', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4309, 'Special grade wheelchair', '21402028', 9238, 'A special grade wheelchair is a device with wheels that is intended for medical purposes to provide mobility to persons restricted to a sitting position. It is intended to be used in all environments for long-term use, e.g., for paraplegics, quadraplegics, and amputees.', ',0,1598,1556,6816,4309,', 'Kursi roda khusus', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4310, 'Stair-climbing wheelchair. ', '31402029', 6816, 'A stair-climbing wheelchair is a device with wheels that is intended for medical purposes to provide mobility to persons restricted to a sitting position. The device is intended to climb stairs by means of two endless belt tracks that are lowered from under the chair and adjusted to the angle of the stairs.', ',0,1598,1556,6816,4310,', 'Kursi roda untuk menaiki tangga', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4311, 'Standup wheelchair', '21402030', 9237, 'A standup wheelchair is a device with wheels that is intended for medical purposes to provide mobility to persons restricted to a sitting position. The device incorporates an external manually controlled mechanical system that is intended to raise a paraplegic to an upright position by means of an elevating seat.', ',0,1598,1556,6816,4311,', 'Kursi roda berdiri', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4312, 'Wheelchair accessory/Aksesoris kursi roda', '21402031', 6816, 'A wheelchair accessory is a device intended for medical purposes that is sold separately from a wheelchair and is intended to meet the specific needs of a patient who uses a wheelchair. Examples of wheelchair accessories include but are not limited to the following: armboard, lapboard, pusher cuff, crutch and cane holder, overhead suspension sling, head and trunk support, and blanket and leg rest strap.', ',0,1598,1556,6816,4312,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4313, 'Wheelchair component. ', '11402032', 6816, 'A wheelchair component is a device intended for medical purposes that is generally sold as an integral part of a wheelchair, but may also be sold separately as a replacement part. Examples of wheelchair components are the following: Armrest, narrowing attachment, belt, extension brake, curb climber, cushion, antitip device, footrest, handrim, hill holder, leg rest, heel loops, and toe loops.', ',0,1598,1556,6816,4313,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4314, 'Wheelchair elevator', '21402033', 9236, 'A permanently mounted wheelchair platform lift is a motorized vertical or inclined platform lift device permanently installed in one location that is intended for use in mitigating mobility impairment caused by injury or other disease by providing a guided platform to move a person from one level to another, with or without a wheelchair.', ',0,1598,1556,6816,4314,', 'Elevator kursi roda', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4315, 'Wheelchair platform scale', '11402034', 9235, 'A wheelchair platform scale is a device with a base designed to accommodate a wheelchair. It is intended for medical purposes to weigh a person who is confined to a wheelchair.', ',0,1598,1556,6816,4315,', 'Kursi roda dengan timbangan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4316, 'Daily activity assist device', '11403001', 8833, 'A daily activity assist device is a modified adaptor or utensil (e.g., a dressing, grooming, recreational activity, transfer, eating, or homemaking aid) that is intended for medical purposes to assist a patient to perform a specific function.', ',0,1598,1557,6817,4316,', 'Alat bantu aktivitas harian', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4317, 'Immersion hydrobath', '21403002', 8792, 'An immersion hydrobath is a device intended for medical purposes that consists of water agitators and that may include a tub to be filled with water. The water temperature may be measured by a gauge. It is used in hydrotherapy to relieve pain and itching and as an aid in the healing process of inflamed and traumatized tissue, and it serves as a setting for removal of contaminated tissue.', ',0,1598,1557,6817,4317,', 'Bak air perendam ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4318, 'Nonpowered sitz bath', '11403004', 8832, 'A nonpowered sitz bath is a device intended for medical purposes that consists of a tub to be filled with water for use in external hydrotherapy to relieve pain or pruritis and to accelerate the healing of inflamed or traumatized tissues of the perianal and perineal areas.', ',0,1598,1557,6817,4318,', 'Baskom sitz non-elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4319, 'Line isolation monitor', '10502017', 6778, '', ',0,1604,1577,6778,4319,', 'Monitor batas isolasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4320, 'Powered flotation therapy bed', '21403007', 8829, 'A powered flotation therapy bed is a device that is equipped with a mattress that contains a large volume of constantly moving water, air, mud, or sand. It is intended for medical purposes to treat or prevent a patient\'s bedsores, to treat severe or extensive burns, or to aid circulation. The mattress may be electrically heated.', ',0,1598,1557,6817,4320,', 'Powered flotation therapy bed', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4321, 'Manual patient rotation bed', '11403008', 8828, 'A manual patient rotation bed is a device that turns a patient who is restricted to a reclining position. It is intended for medical purposes to treat or prevent bedsores, to treat severe and extensive burns, or to aid circulation.', ',0,1598,1557,6817,4321,', 'Kasur rotasi pasien manual', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4322, 'Signal isolation system.', '10502016', 7530, '', ',0,1604,1577,6778,4322,', 'Sistem sinyal isolasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4323, 'Powered patient rotation bed', '21403009', 8827, 'A powered patient rotation bed is a device that turns a patient who is restricted to a reclining position. It is intended for medical purposes to treat or prevent bedsores, to treat severe and extensive burns, urinary tract blockage, and to aid circulation.', ',0,1598,1557,6817,4323,', 'Kasur rotasi pasien elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4324, 'Moist steam cabinet', '21403010', 8826, 'A moist steam cabinet is a device intended for medical purposes that delivers a flow of heated, moisturized air to a patient in an enclosed unit. It is used to treat arthritis and fibrosis (a formation of fibrosis tissue) and to increase local blood flow.', ',0,1598,1557,6817,4324,', 'Alat sauna', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4325, 'Portable leakage current alarm.', '10502018', 7511, '', ',0,1604,1577,6778,4325,', 'Alarm kebocoran arus portabel.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4326, 'Exercise component/Komponen latihan', '21403014', 6817, 'An exercise component is a device that is used in conjunction with other forms of exercise and that is intended for medical purposes, such as to redevelope muscles or restore motion to joints or for use as an adjunct treatment for obesity. Examples include weights, dumbbells, straps, and adaptive hand mitts.', ',0,1598,1557,6817,4326,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4327, 'Nonmeasuring exercise equipment', '21403015', 8820, 'Nonmeasuring exercise equipment consist of devices intended for medical purposes, such as to redevelop muscles or restore motion to joints or for use as an adjunct treatment for obesity. Examples include a prone scooter board, parallel bars, a mechanical treadmill, an exercise table, and a manually propelled exercise bicycle.', ',0,1598,1557,6817,4327,', 'Alat latihan fisik medis tanpa alat ukur', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4328, 'Powered exercise equipment', '11403017', 8790, 'Powered exercise equipment consist of powered devices intended for medical purposes, such as to redevelop muscles or restore motion to joints or for use as an adjunct treatment for obesity. Examples include a powered treadmill, a powered bicycle, and powered parallel bars.', ',0,1598,1557,6817,4328,', 'Alat latihan elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4329, 'Impedance phlebograph', '20502022', 6778, '', ',0,1604,1577,6778,4329,', 'Phlebograph impedansi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4330, 'Impedance plethysmograph.', '20502023', 7524, '', ',0,1604,1577,6778,4330,', 'Plethysmograph impedansi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4331, '[delete]Nonmeasuring exercise equipment', '11403016', 6817, 'Nonmeasuring exercise equipment consist of devices intended for medical purposes, such as to redevelop muscles or restore motion to joints or for use as an adjunct treatment for obesity. Examples include a prone scooter board, parallel bars, a mechanical treadmill, an exercise table, and a manually propelled exercise bicycle.', ',0,1598,1557,6817,4331,', 'Alat latihan fisik medis tanpa alat ukur', NULL, -1, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4332, 'Powered finger exerciser', '11403018', 8819, 'A powered finger exerciser is a device intended for medical purposes to increase flexion and the extension range of motion of the joints of the second to the fifth fingers of the hand', ',0,1598,1557,6817,4332,', 'Alat latihan jari elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4333, 'Iontophoresis device', '21403020', 8817, 'An iontophoresis device is a device that is intended to use a direct current to introduce ions of soluble salts or other drugs into the body and induce sweating for use in the diagnosis of cystic fibrosis or for other uses if the labeling of the drug intended for use with the device bears adequate directions for the device\'s use with that drug. When used in the diagnosis of cystic fibrosis, the sweat is collected and its composition and weight are determined.', ',0,1598,1557,6817,4333,', 'Alat iontophoresis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4334, 'Hydraulic, pneumatic, or photoelectric plethysmographs.', '20502024', 7523, '', ',0,1604,1577,6778,4334,', 'Plethysmographs hidrolik, pneumatik, atau fotoelektrik.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4335, 'Powered external limb overload warning device', '21403021', 8816, 'powered external limb overload warning device is a device intended for medical purposes to warn a patient of an overload or an underload in the amount of pressure placed on a leg', ',0,1598,1557,6817,4335,', 'Alat peringatan penggunaan anggota gerak eksternal elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4336, 'Powered inflatable tube massager', '21403022', 8815, 'A powered inflatable tube massager is a powered device intended for medical purposes, such as to relieve minor muscle aches and pains and to increase circulation. It simulates kneading and stroking of tissues with the hands by use of an inflatable pressure cuff', ',0,1598,1557,6817,4336,', 'Alat pijat dengan tekanan udara elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4337, 'Therapeutic massager', '11403023', 8814, 'A therapeutic massager is an electrically powered device intended for medical purposes, such as to relieve minor muscle aches and pains', ',0,1598,1557,6817,4337,', 'Alat terapi pijat', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4338, 'Cold pack/Kompres dingin/Cold Compress', '11403024', 6817, 'A cold pack is a device intended for medical purposes that consists of a compact fabric envelope containing a specially hydrated pliable silicate gel capable of forming to the contour of the body and that provides cold therapy for body surfaces', ',0,1598,1557,6817,4338,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4339, 'Medical magnetic tape recorder.', '20502025', 7522, '', ',0,1604,1577,6778,4339,', 'Perekam magnetik medis.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4340, 'Paper chart recorder.', '10502026', 7521, '', ',0,1604,1577,6778,4340,', 'Kertas perekam grafik, kertas EKG', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4341, 'Hot or cold disposable pack', '11403025', 8812, 'A hot or cold disposable pack is a device intended for medical purposes that consists of a sealed plastic bag incorporating chemicals that, upon activation, provides hot or cold therapy for body surfaces', ',0,1598,1557,6817,4341,', 'Kompres panas atau dingin sekali pakai', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4342, 'Apex cardiographic transducer.', '20502027', 7520, '', ',0,1604,1577,6778,4342,', 'Transduser apex kardiografik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4343, 'Extravascular blood pressure transducer', '20502028', 6778, '', ',0,1604,1577,6778,4343,', 'Transduser tekanan darah ekstravaskular.', NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4344, 'Implantable Intra-aneurysm Pressure Measurement System', '20502029', 7510, '', ',0,1604,1577,6778,4344,', 'Sistem pengukuran tekanan intraaneurisma yang diimplan.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4345, 'Heart sound transducer.', '20502030', 7518, '', ',0,1604,1577,6778,4345,', 'Transduser suara jantung.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4346, 'Water circulating hot or cold pack', '21403026', 8811, 'A water circulating hot or cold pack is a device intended for medical purposes that operates by pumping heated or chilled water through a plastic bag and that provides hot or cold therapy for body surfaces', ',0,1598,1557,6817,4346,', 'Kompres panas atau dingin dengan sirkulasi air', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4347, 'Catheter tip pressure transducer.', '20502031', 7517, '', ',0,1604,1577,6778,4347,', 'Kateter tip bertekanan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4348, 'Vessel occlusion transducer.', '20502033', 7509, '', ',0,1604,1577,6778,4348,', 'Transduser oklusi pembuluh darah', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4349, 'Patient transducer and electrode cable (including connector).', '20502034', 7515, '', ',0,1604,1577,6778,4349,', 'Transduser dan kabel elektroda pasien (termasuk konektor).', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4350, 'Radiofrequency physiological signal transmitter and receiver.', '20502035', 7514, '', ',0,1604,1577,6778,4350,', 'Pemancar dan penerima sinyal fisiologis radio frekuensi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4351, 'Telephone electrocardiograph transmitter and receiver', '20502036', 6778, '', ',0,1604,1577,6778,4351,', 'Pemancar dan penerima elektrokardiograf', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4352, 'Vena cava clip', '20503002', 6779, '', ',0,1604,1578,6779,4352,', 'Penjepit vena cava.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4353, 'Vascular embolization device', '20503003', 7569, '', ',0,1604,1578,6779,4353,', 'Peralatan embolisasi vaskular', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4354, 'Vascular graft prosthesis', '20503005', 7564, '', ',0,1604,1578,6779,4354,', 'Prostesis graft pembuluh darah (pembuluh darah buatan)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4355, 'Intracardiac patch or pledget made of polypropylene, polyethylene terephthalate, or polytetrafluoroethylene.', '20503007', 7558, '', ',0,1604,1578,6779,4355,', 'Patch intrakardiak terbuat dari polypropylene, polyethylene terephthalate, atau polytetrafluoroethylene', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4356, 'Intra-aortic balloon and control system ', '20503008', 6779, '', ',0,1604,1578,6779,4356,', 'Balon intra-aorta dan sistem kontrol', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4357, 'Ventricular bypass (assist) device', '30503009', 6779, '', ',0,1604,1578,6779,4357,', 'Alat bantu bypass ventrikular.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4358, 'External pacemaker pulse generator', '30503010', 6779, '', ',0,1604,1578,6779,4358,', 'Generator pacu jantung eksternal', NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4359, 'Moist heat pack', '11403027', 8810, 'A moist heat pack is a device intended for medical purposes that consists of silica gel in a fabric container used to retain an elevated temperature and that provides moist heat therapy for body surfaces.', ',0,1598,1557,6817,4359,', 'Kompres panas lembab', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4360, 'Powered heating pad', '21403028', 8809, 'A powered heating pad is an electrical device intended for medical purposes that provides dry heat therapy for body surfaces. It is capable of maintaining an elevated temperature during use', ',0,1598,1557,6817,4360,', 'Bantalan pemanas elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4361, 'Presssure-applying device', '11403029', 8808, 'A pressure-applying device is a device intended for medical purposes to apply continuous pressure to the paravertebral tissues for muscular relaxation and neuro-inhibition. It consists of a table with an adjustable overhead weight that, in place of the therapist\'s hands, presses on the back of a prone patient', ',0,1598,1557,6817,4361,', 'Alat terapi dengan tekanan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4363, 'Implantable pacemaker pulse generator.', '30503011', 7580, '', ',0,1604,1578,6779,4363,', 'Generator pacu jantung implan.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4364, 'Pacemaker lead adaptor', '20503012', 6779, '', ',0,1604,1578,6779,4364,', 'Adaptor pacu jantung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4365, 'Pacemaker generator function analyzer', '20503013', 6779, '', ',0,1604,1578,6779,4365,', 'Alat analisis fungsi generator pacu jantung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4367, 'Indirect pacemaker generator function analyzer', '20503014', 6779, '', ',0,1604,1578,6779,4367,', 'Alat analisis fungsi generator pacu jantung tidak langsung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4368, 'Pacemaker polymeric mesh bag.', '10503015', 7556, '', ',0,1604,1578,6779,4368,', 'Pacu jantung polymeric mesh bag', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4369, 'Pacemaker charger', '10503016', 6779, '', ',0,1604,1578,6779,4369,', 'Pengisi daya pacu jantung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4370, 'Cardiovascular permanent or temporary pacemaker electrode ', '20503017', 6779, '', ',0,1604,1578,6779,4370,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4371, 'Pacemaker test magnet', '10503018', 6779, '', ',0,1604,1578,6779,4371,', 'Alat uji magnet pacu jantung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4372, 'Pacemaker programmers', '30503019', 6779, '', ',0,1604,1578,6779,4372,', 'Pemrogram pacu jantung', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4373, 'Pacemaker repair or replacement material', '30503020', 6779, '', ',0,1604,1578,6779,4373,', 'Bahan perbaikan atau penggantian pacu jantung', NULL, 0, 0, 700, NULL, NULL);
