INSERT INTO `aspak_new_alat` VALUES (4385, 'Traction accessory', '11403034', 8802, 'A traction accessory is a nonpowered accessory device intended for medical purposes to be used with powered traction equipment to aid in exerting therapeutic pulling forces on the patient\'s body. This generic type of device includes the pulley, strap, head halter, and pelvic belt', ',0,1598,1557,6817,4385,', 'Aksesoris traksi', NULL, 0, 0, 700, NULL, NULL);
