INSERT INTO `aspak_new_alat` VALUES (4388, 'Powered heating unit', '11403036', 6817, 'A powered heating unit is a device intended for medical purposes that consists of an encased cabinet containing hot water and that is intended to heat and maintain hot packs at an elevated temperature', ',0,1598,1557,6817,4388,', 'Unit pemanas elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4389, 'Nuclear whole body counter', '11501004', 9311, 'a device intended to measure the amount of radionuclides in the entire body', ',0,1603,1573,6819,4389,', 'Alat pengukur jumlah paparan nuklir', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4390, 'PET CT', '21501007', 6819, 'An emission computed tomography system is a device intended to detect the location and distribution of gamma ray- and positron-emitting radionuclides in the body and produce cross-sectional images through computer reconstruction of the data', ',0,1603,1573,6819,4390,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4391, 'Scanner Fluoroskopi/Fluorescent scanner', '21501008', 6819, 'A fluorescent scanner is a device intended to measure the induced fluorescent radiation in the body by exposing the body to certain x-rays or low-energy gamma rays', ',0,1603,1573,6819,4391,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4392, 'Nuclear rectilinear scanner', '11501009', 6819, 'A nuclear rectilinear scanner is a device intended to image the distribution of radionuclides in the body by means of a detector (or detectors) whose position moves in two directions with respect to the patient', ',0,1603,1573,6819,4392,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4393, 'Nuclear uptake probe', '11501011', 9310, 'A nuclear whole body scanner is a device intended to measure and image the distribution of radionuclides in the body by means of a wide-aperture detector whose position moves in one direction with respect to the patient', ',0,1603,1573,6819,4393,', 'Probe nuklir', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4394, 'Nuclear whole body scanner', '11501012', 9309, 'A nuclear scanning bed is an adjustable bed intended to support a patient during a nuclear medicine procedure', ',0,1603,1573,6819,4394,', 'Alat pemindai paparan nuklir', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4395, 'Nuclear scanning bed', '11501013', 6819, 'A radionuclide dose calibrator is a radiation detection device intended to assay radionuclides before their administration to patients', ',0,1603,1573,6819,4395,', NULL, NULL, 0, 0, 700, NULL, NULL);
