INSERT INTO `aspak_new_alat` VALUES (4401, 'Nuclear electrocardiograph synchronizer ', '11501019', 6819, 'A radionuclide test pattern phantom is a device that consists of an arrangement of radiopaque or radioactive material sealed in a solid pattern intended to serve as a test for a performance characteristic of a nuclear medicine imaging device', ',0,1603,1573,6819,4401,', 'EKG nuklir synchronizer', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4402, 'Phantom Uji Radionuklida/Radionuclide test pattern phantom', '11501020', 6819, 'A nonfetal ultrasonic monitor is a device that projects a continuous high-frequency sound wave into body tissue other than a fetus to determine frequency changes (doppler shift) in the reflected wave and is intended for use in the investigation of nonfetal blood flow and other nonfetal body tissues in motion', ',0,1603,1573,6819,4402,', NULL, NULL, 0, 0, 700, NULL, NULL);
