INSERT INTO `aspak_new_alat` VALUES (4404, 'Ultrasonic pulsed echo imaging system', '21501023', 9370, 'a device intended to project a pulsed sound beam into body tissue to determine the depth or location of the tissue interfaces and to measure the duration of an acoustic pulse from the transmitter to the tissue interface and back to the receiver', ',0,1603,1573,6819,4404,', 'USG echo', NULL, 0, 0, 365, NULL, NULL);
