INSERT INTO `aspak_new_alat` VALUES (4430, 'ID Printer/Camera; marker radiografi; marker timbal/Radiographic film marking system', '11501029', 6819, 'A radiographic film marking system is a device intended for medical purposes to add identification and other information onto radiographic film by means of exposure to visible light', ',0,1603,1573,6819,4430,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4431, 'Image-intensified fluoroscopic x-ray system ', '21501030', 6819, 'An image-intensified fluoroscopic x-ray system is a device intended to visualize anatomical structures by converting a pattern of x-radiation into a visible image through electronic amplification. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,4431,', 'Image intesified fluoroscopic (dengan tabung penguat sinar); pesawat sinar X, fluoroscopy', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4432, 'Non-image-intensified fluoroscopic x-ray system ', '21501031', 6819, 'A non-image-intensified fluoroscopic x-ray system is a device intended to be used to visualize anatomical structures by using a fluorescent screen to convert a pattern of x-radiation into a visible image. This generic type of device may include signal analysis and display equipment, patient and equipment supports, component parts, and accessories', ',0,1603,1573,6819,4432,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4433, 'Spot-film device', '21501032', 9361, 'A spot-film device is an electromechanical component of a fluoroscopic x-ray system that is intended to be used for medical purposes to position a radiographic film cassette to obtain radiographs during fluoroscopy', ',0,1603,1573,6819,4433,', 'Spot film /alat penangkap cahaya', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4434, 'HTT(High Tension Transformer)/Diagnostic x-ray high voltage generator', '11501034', 6819, 'A diagnostic x-ray high voltage generator is a device that is intended to supply and control the electrical energy applied to a diagnostic x-ray tube for medical purposes', ',0,1603,1573,6819,4434,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4435, 'Digital mammography system/Pesawat Mammografi Digital', '21501036', 6819, 'A full-field digital mammography system is a device intended to produce planar digital x-ray images of the entire breast', ',0,1603,1573,6819,4435,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4436, 'Diagnostic x-ray tube housing assembly/Rumah tabung sinar  x', '11501041', 6819, 'A diagnostic x-ray tube housing assembly is an x-ray generating tube encased in a radiation-shielded housing that is intended for diagnostic purposes', ',0,1603,1573,6819,4436,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4437, 'Diagnostic x-ray tube mount/Lengan Penyangga tabung sinar x', '11501042', 6819, 'A diagnostic x-ray tube mount is a device intended to support and to position the diagnostic x-ray tube housing assembly for a medical radiographic procedure', ',0,1603,1573,6819,4437,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4438, 'Pneumoencephalographic chair/Kursi pemeriksaan pneumoen cefalografi', '21501043', 6819, 'A pneumoencephalographic chair is a chair intended to support and position a patient during pneumoencephalography (x-ray imaging of the brain)', ',0,1603,1573,6819,4438,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4439, 'Radiologic patient cradle', '11501044', 9353, 'A radiologic patient cradle is a support device intended to be used for rotational positioning about the longitudinal axis of a patient during radiologic procedures', ',0,1603,1573,6819,4439,', 'Alat fiksasi pasien radioterapi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4440, 'Kaset radiografi/Radiographic film cassette', '21501046', 6819, 'A radiographic film cassette is a device intended for use during diagnostic x-ray procedures to hold a radiographic film in close contact with an x-ray intensifying screen and to provide a light-proof enclosure for direct exposure of radiographic film', ',0,1603,1573,6819,4440,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4441, 'Radiographic film/cassette changer', '21501047', 9350, 'A radiographic film/cassette changer is a device intended to be used during a radiologic procedure to move a radiographic film or cassette between x-ray exposures and to position it during the exposure', ',0,1603,1573,6819,4441,', 'Alat pengganti kaset / film rontgen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4442, ' Radiographic film/cassette changer programmer', '21501048', 9349, 'A radiographic film/cassette changer programmer is a device intended to be used to control the operations of a film or cassette changer during serial medical radiography', ',0,1603,1573,6819,4442,', 'Program pengganti kaset / film rontgen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4443, 'Wall-mounted radiographic cassette holder', '11501049', 9348, 'A wall-mounted radiographic cassette holder is a device that is a support intended to hold and position radiographic cassettes for a radiographic exposure for medical use', ',0,1603,1573,6819,4443,', 'Kaset holder', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4444, 'Radiographic grid', '11501052', 9345, 'A radiographic grid is a device that consists of alternating radiolucent and radiopaque strips intended to be placed between the patient and the image receptor to reduce the amount of scattered radiation reaching the image receptor', ',0,1603,1573,6819,4444,', 'Grid radiograf', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4445, 'Radiographic head holder', '11501053', 9344, 'A radiographic head holder is a device intended to position the patient\'s head during a radiographic procedure', ',0,1603,1573,6819,4445,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4446, 'Radiologic quality assurance instrument', '11501054', 9343, 'A radiologic quality assurance instrument is a device intended for medical purposes to measure a physical characteristic associated with another radiologic device', ',0,1603,1573,6819,4446,', 'Instrumen penjamin kualitas radiologi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4447, 'Radiographic anthropomorphic phantom', '11501055', 9342, 'A radiographic anthropomorphic phantom is a device intended for medical purposes to simulate a human body for positioning radiographic equipment', ',0,1603,1573,6819,4447,', 'Phantom anthropomorphic', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4448, 'Radiographic intensifying screen', '11501056', 9341, 'A radiographic intensifying screen is a device that is a thin radiolucent sheet coated with a luminescent material that transforms incident x-ray photons into visible light and intended for medical purposes to expose radiographic film', ',0,1603,1573,6819,4448,', 'Layar penguat sinar X', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4449, 'Radiographic ECG/respirator synchronizer', '11501057', 9301, 'A radiographic ECG/respirator synchronizer is a device intended to be used tocoordinatean x-ray film exposure with the signal from an electrocardiograph (ECG) or respirator at a predetermined phase of the cardiac or respiratory cycle', ',0,1603,1573,6819,4449,', 'Radiographic ECG/respirator synchronizer', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4450, 'Transilluminator for breast evaluation', '31501059', 9339, 'A transilluminator, also known as a diaphanoscope or lightscanner, is an electrically powered device that uses low intensity emissions of visible light and near-infrared radiation (approximately 700-1050 nanometers (nm)), transmitted through the breast, to visualize translucent tissue for the diagnosis of cancer, other conditions, diseases, or abnormalities', ',0,1603,1573,6819,4450,', 'Transiluminator untuk payudara', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4451, ' Medical image storage device', '11501060', 9338, 'A medical image storage device is a device that provides electronic storage and retrieval functions for medical images', ',0,1603,1573,6819,4451,', 'Tempat penyimpanan film', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4452, 'Medical image communications device', '11501061', 9337, 'A medical image communications device provides electronic transfer of medical image data between medical devices', ',0,1603,1573,6819,4452,', 'Alat komunikasi gambar medis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4454, 'Medical image digitizer', '21501062', 9336, 'A medical image digitizer is a device intended to convert an analog medical image into a digital format. Examples include Iystems employing video frame grabbers, and scanners which use lasers or charge-coupled devices', ',0,1603,1573,6819,4454,', 'Digitizer hasil sinar X', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4455, 'Medical image hardcopy device', '21501063', 9335, 'A medical image hardcopy device is a device that produces a visible printed record of a medical image and associated identification information', ',0,1603,1573,6819,4455,', 'Pencetak film sinar X ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4456, 'Storage phosphor plate', '21501071', 6819, '', ',0,1603,1573,6819,4456,', NULL, NULL, 0, 0, 700, NULL, NULL);
