INSERT INTO `aspak_new_alat` VALUES (4458, 'Medical neutron radiation therapy system', '21502002', 9185, 'A medical neutron radiation therapy system is a device intended to generate high-energy neutrons for radiation therapy', ',0,1603,1574,6820,4458,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4459, 'Patient care suction apparatus', '20505001', 6781, '', ',0,1604,4411,6781,4459,', 'Alat penghisap cairan yang digunakan bersamaan dengan kateter intra-toraks', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4460, 'Manual radionuclide applicator system', '11502003', 9174, 'A manual radionuclide applicator system is a manually operated device intended to apply a radionuclide source into the body or to the surface of the body for radiation therapy', ',0,1603,1574,6820,4460,', 'Aplikator radionuklida manual', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4461, 'Remote controlled radionuclide applicator system', '21502004', 9184, 'A remote controlled radionuclide applicator system is an electromechanical or pneumatic device intended to enable an operator to apply, by remote control, a radionuclide source into the body or to the surface of the body for radiation therapy', ',0,1603,1574,6820,4461,', 'Aplikator radionuklida otomatis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4462, 'Percutaneous Transluminal Coronary Angioplasty (PTCA) Catheter ', '20505002', 6781, '', ',0,1604,4411,6781,4462,', 'Kateter PTCA', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4463, 'Radiation therapy beam-shaping block', '21502005', 9183, 'A radiation therapy beam-shaping block is a device made of a highly attenuating material (such as lead) intended for medical purposes to modify the shape of a beam from a radiation therapy source', ',0,1603,1574,6820,4463,', 'Radiation therapy beamshaping block', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4466, ' Powered radiation therapy patient support assembly', '21502009', 9180, 'A powered radiation therapy patient support assembly is an electrically powered adjustable couch intended to support a patient during radiation therapy', ',0,1603,1574,6820,4466,', 'Alat penunjang terapi radiasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4467, 'Light beam patient position indicator', '21502010', 9172, 'A light beam patient position indicator is a device that projects a beam of light (incoherent light or laser) to determine the alignment of the patient with a radiation beam. The beam of light is intended to be used during radiologic procedures to ensure proper positioning of the patient and to monitor alignment of the radiation beam with the patient\'s anatomy', ',0,1603,1574,6820,4467,', 'Indikator posisi pasien untuk paparan sinar radiasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4468, 'External cardiac compressor', '20505005', 6781, '', ',0,1604,4411,6781,4468,', 'Kompresor jantung eksternal.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4469, ' Therapeutic x-ray tube housing assembly', '21502013', 9177, 'A therapeutic x-ray tube housing assembly is an x-ray generating tube encased in a radiation-shielded housing intended for use in radiation therapy', ',0,1603,1574,6820,4469,', 'Wadah tabung sinar X', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4470, 'External counter-pulsating device', '20505006', 6781, '', ',0,1604,4411,6781,4470,', 'Alat penghitung denyut jantung eksternal.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4471, 'Defibrilator', '20505007', 6781, '', ',0,1604,4411,6781,4471,', NULL, NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4472, 'External facial fracture fixation appliance ', '21602001', 6823, 'An external facial fracture fixation appliance is a metal apparatus intended to be used during surgical reconstruction and repair to immobilize maxillofacial bone fragments in their proper facial relationship', ',0,1601,1566,6823,4472,', 'Alat fiksasi fraktur wajah eksternal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4473, 'Automated external defibrillator system', '20505008', 8702, '', ',0,1604,4411,6781,4473,', 'Automated external defibrillator (AED)', NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4474, 'Polytetrafluoroethylene with carbon fibers composite implant material ', '21602003', 6823, 'A polytetrafluoroethylene with carbon fibers composite implant material is a porous device material intended to be implanted during surgery of the chin, jaw, nose, or bones or tissue near the eye or ear. The device material serves as a space-occupying substance and is shaped and formed by the surgeon to conform to the patient\'s need', ',0,1601,1566,6823,4474,', 'Material implan PTFE dengan serat karbon', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4475, 'Silicone inflatable breast prosthesis', '31602004', 9199, 'A silicone inflatable breast prosthesis is a silicone rubber shell made of polysiloxane(s), such as polydimethylsiloxane and polydiphenylsiloxane, that is inflated to the desired size with sterile isotonic saline before or after implantation', ',0,1601,1566,6823,4475,', 'Payudara prostesis inflatable silikon', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4477, 'External prosthesis adhesive', '11602011', 9187, ' An external prosthesis adhesive is a silicone-type adhesive intended to be used to fasten to the body an external aesthetic restoration prosthesis, such as an artificial nose', ',0,1601,1566,6823,4477,', 'Perekat prostesis eksternal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4478, 'External aesthetic restoration prosthesis', '11602012', 9192, ' An external aesthetic restoration prosthesis is a device intended to be used to construct an external artificial body structure, such as an ear, breast, or nose. Usually the device is made of silicone rubber and it may be fastened to the body with an external prosthesis adhesive. The device is not intended to be implanted', ',0,1601,1566,6823,4478,', 'Restorasi prostesis estetika eksternal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4479, 'Defibrillator tester', '20505009', 6781, '', ',0,1604,4411,6781,4479,', 'Penguji defibrilator.', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4480, 'Inflatable extremity splint', '11602013', 9191, 'An inflatable extremity splint is a device intended to be inflated to immobilize a limb or an extremity', ',0,1601,1566,6823,4480,', 'Inflatable extremity splint', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4481, 'External transcutaneous cardiac pacemaker (noninvasive)', '20505010', 6781, '', ',0,1604,4411,6781,4481,', 'Pacu jantung transkutan eksternal (non-invasif)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4482, 'Noninflatable extremity splint', '11602014', 9190, 'A noninflatable extremity splint is a device intended to immobilize a limb or an extremity. It is not inflatable', ',0,1601,1566,6823,4482,', 'Noninflatable extremity splint', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4483, 'Plastic surgery kit and accessories', '11602015', 9189, 'A plastic surgery kit and accessories is a device intended to be used to reconstruct maxillofacial deficiencies. The kit contains surgical instruments and materials used to make maxillofacial impressions before molding an external prosthesis', ',0,1601,1566,6823,4483,', 'Kit bedah plastik dan aksesori', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4484, 'Perekat jaringan/Tissue adhesive', '21603001', 6824, 'A tissue adhesive for the topical approximation of skin is a device intended for topical closure of surgical incisions, including laparoscopic incisions, and simple traumatic lacerations that have easily approximated skin edges. Tissue adhesives for the topical approximation of skin may be used in conjunction with, but not in place of, deep dermal stitches', ',0,1601,1567,6824,4484,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4485, 'Compressible limb sleeve', '20505011', 6781, '', ',0,1604,4411,6781,4485,', 'Compressible limb sleeve', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4486, 'Tissue adhesive with adjunct wound closure device for topical approximation of skin ', '21603002', 6824, 'A tissue adhesive for the topical approximation of skin is a device intended for topical closure of surgical incisions, including laparoscopic incisions, and simple traumatic lacerations that have easily approximated skin edges. Tissue adhesives for the topical approximation of skin may be used in conjunction with, but not in place of, deep dermal stitches', ',0,1601,1567,6824,4486,', 'Perekat jaringan dengan tambahan alat penanda luka', NULL, 0, 0, 700, NULL, NULL);
