INSERT INTO `aspak_new_alat` VALUES (4489, 'Wound dressing with poly (diallyl dimethyl ammonium chloride) (pDADMAC) additive ', '21603004', 6824, 'A wound dressing with pDADMAC additive is intended for use as a primary dressing for exuding wounds, 1st and 2d degree burns, and surgical wounds, to secure and prevent movement of a primary dressing, and as a wound packing', ',0,1601,1567,6824,4489,', 'Dressing dengan aditif poly (diallyl dimethyl ammonium chloride) (pDADMAC)', NULL, 0, 0, 700, NULL, NULL);
