INSERT INTO `aspak_new_alat` VALUES (4512, 'Surgical apparel/Pakaian Bedah', '21603009', 6824, 'Surgical apparel are devices that are intended to be worn by operating room personnel during surgical procedures to protect both the surgical patient and the operating room personnel from transfer of microorganisms, body fluids, and particulate material. Examples include surgical caps, hoods, masks, gowns, operating room shoes and shoe covers, and isolation masks and gowns. Surgical suits and dresses, commonly known as scrub suits, are excluded', ',0,1601,1567,6824,4512,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4516, 'Implantable clip', '21603013', 8900, 'An implantable clip is a clip-like device intended to connect internal tissues to aid healing. It is not absorbable', ',0,1601,1567,6824,4516,', 'Klip yang dapat diimplan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4518, 'Contact cooling system for aesthetic use', '21603015', 8909, 'A contact cooling system for aesthetic use is a device that is a combination of a cooling pad associated with a vacuum or mechanical massager intended for the disruption of adipocyte cells intended for non-invasive aesthetic use', ',0,1601,1567,6824,4518,', 'Sistem pendingin kontak untuk penggunaan estetika', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4519, 'Cryosurgical unit and accessories', '21603016', 8945, 'A cryosurgical unit with a liquid nitrogen cooled cryoprobe and accessories is a device intended to destroy tissue during surgical procedures by applying extreme cold, A cryosurgical unit with a nitrous oxide cooled cryoprobe and accessories is a device intended to destroy tissue during surgical procedures, including urological applications, by applying extreme cold, A cryosurgical unit with a carbon dioxide cooled cryoprobe or a carbon dioxide dry ice applicator and accessories is a device intended to destroy tissue during surgical procedures by applying extreme cold. The device is intended to treat disease conditions such as tumors, skin cancers, acne scars, or hemangiomas (benign tumors consisting of newly formed blood vessels) and various benign or malignant gynecological conditions affecting vulvar, vaginal, or cervical tissue.', ',0,1601,1567,6824,4519,', 'Unit cryosurgical dan aksesori', NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4520, ' Surgical drape and drape accessories', '21603017', 8944, 'A surgical drape and drape accessories is a device made of natural or synthetic materials intended to be used as a protective patient covering, such as to isolate a site of surgical incision from microbial and other contamination', ',0,1601,1567,6824,4520,', 'Duk bolong dan aksesori', NULL, 0, 0, 700, NULL, NULL);
