INSERT INTO `aspak_new_alat` VALUES (4581, ' Absorbable powder for lubricating a surgeon\'s glove', '31603025', 8937, 'Absorbable powder for lubricating a surgeon\'s glove is a powder made from corn starch that meets the specifications for absorbable powder in the United States Pharmacopeia (U.S.P.) and that is intended to be used to lubricate the surgeon\'s hand before putting on a surgeon\'s glove. The device is absorbable through biological degradation', ',0,1601,1567,6824,4581,', 'Serbuk absorbable untuk lubrikasi sarung tangan bedah', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4582, 'Absorbable hemostatic agent and dressing', '31603026', 8936, 'An absorbable hemostatic agent or dressing is a device intended to produce hemostasis by accelerating the clotting process of blood. It is absorbable', ',0,1601,1567,6824,4582,', 'Bahan dan dressing hemostatik absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4583, 'Absorbable poly(glycolide/l-lactide) surgical suture', '21603027', 8935, 'An absorbable poly(glycolide/l-lactide) surgical suture (PGL suture) is an absorbable sterile, flexible strand as prepared and synthesized from homopolymers of glycolide and copolymers made from 90 percent glycolide and 10 percentl-lactide, and is indicated for use in soft tissue approximation. A PGL suture meets United States Pharmacopeia (U.S.P.) requirements as described in the U.S.P. \"Monograph for Absorbable Surgical Sutures;\" it may be monofilament or multifilament (braided) in form; it may be uncoated or coated; and it may be undyed or dyed with an FDA-approved color additive. Also, the suture may be provided with or without a standard needle attached', ',0,1601,1567,6824,4583,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4584, 'Absorbable poly(hydroxybutyrate) surgical suture produced by recombinant DNA technology', '21603028', 8934, 'An absorbable poly(hydroxybutyrate) surgical suture is an absorbable surgical suture made of material isolated from prokaryotic cells produced by recombinant deoxyribonucleic acid (DNA) technology. The device is intended for use in general soft tissue approximation and ligation', ',0,1601,1567,6824,4584,', 'Benang bedah poli (hidroksibutirat) absorbable yang diproduksi dengan teknologi DNA rekombinan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4585, 'Polytetrafluoroethylene injectable', '31603030', 8932, 'Polytetrafluoroethylene injectable is an injectable paste prosthetic device composed of polytetrafluoroethylene intended to be used to augment or reconstruct a vocal cord', ',0,1601,1567,6824,4585,', 'Injeksi politetrafluoroetilen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4586, 'Focused ultrasound stimulator system for aesthetic use', '21603032', 8895, 'A Focused Ultrasound Stimulator System for Aesthetic Use is a device using focused ultrasound to produce localized, mechanical motion within tissues and cells for the purpose of producing either localized heating for tissue coagulation or for mechanical cellular membrane disruption intended for noninvasive aesthetic use', ',0,1601,1567,6824,4586,', 'Sistem stimulator ultrasound terfokus untuk penggunaan estetika', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4587, 'Ultraviolet lamp for dermatologic disorders', '21603033', 8930, 'An ultraviolet lamp for dermatologic disorders is a device (including a fixture) intended to provide ultraviolet radiation of the body to photoactivate a drug in the treatment of a dermatologic disorder if the labeling of the drug intended for use with the device bears adequate directions for the device\'s use with that drug', ',0,1601,1567,6824,4587,', 'Ultraviolet lamp for dermatologic disorders', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4591, 'Non-Powered suction apparatus device intended for negative pressure wound therapy', '21603037', 8884, 'A non-powered suction apparatus device intended for negative pressure wound therapy is a device that is indicated for wound management via application of negative pressure to the wound for removal of fluids, including wound exudate, irrigation fluids, and infectious materials. It is further indicated for management of wounds, burns, flaps, and grafts.', ',0,1601,1567,6824,4591,', 'Perangkat alat penghisap tanpa daya yang ditujukan untuk terapi luka tekanan negatif', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4593, 'Implantable staple', '21603040', 8925, 'An implantable staple is a staple-like device intended to connect internal tissues to aid healing. It is not absorbable.', ',0,1601,1567,6824,4593,', 'Staples implan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4594, 'Removable skin staple', '11603041', 8903, 'A removable skin staple is a staple-like device intended to connect external tissues temporarily to aid healing. It is not absorbable', ',0,1601,1567,6824,4594,', 'Staples kulit yang dapat dilepas ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4595, ' Powered suction pump', '21603042', 8924, 'A powered suction pump is a portable, AC-powered or compressed air-powered device intended to be used to remove infectious materials from wounds or fluids from a patient\'s airway or respiratory support system. The device may be used during surgery in the operating room or at the patient\'s bedside. The device may include a microbial filter.', ',0,1601,1567,6824,4595,', 'Pompa suction elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4596, 'Manual surgical instrument for general use', '11603043', 8923, 'A manual surgical instrument for general use is a nonpowered, hand-held, or hand-manipulated device, either reusable or disposable, intended to be used in various general surgical procedures. The device includes the applicator, clip applier, biopsy brush, manual dermabrasion brush, scrub brush, cannula, ligature carrier, chisel, clamp, contractor, curette, cutter, dissector, elevator, skin graft expander, file, forceps, gouge, instrument guide, needle guide, hammer, hemostat, amputation hook, ligature passing and knot-tying instrument, knife, blood lancet, mallet, disposable or reusable aspiration and injection needle, disposable or reusable suturing needle, osteotome, pliers, rasp, retainer, retractor, saw, scalpel blade, scalpel handle, one-piece scalpel, snare, spatula, stapler, disposable or reusable stripper, stylet, suturing apparatus for the stomach and intestine, measuring tape, and calipers.', ',0,1601,1567,6824,4596,', 'Instrumen bedah umum', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4597, 'Laser surgical instrument for use in general and plastic surgery and in dermatology', '21603044', 8922, 'A carbon dioxide laser for use in general surgery and in dermatology is a laser device intended to cut, destroy, or remove tissue by light energy emitted by carbon dioxide', ',0,1601,1567,6824,4597,', 'Instrumen laser bedah umum, bedah plastik dan dermatologi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4598, 'Absorbable surgical gut suture', '21603046', 8921, 'An absorbable surgical gut suture, both plain and chromic, is an absorbable, sterile, flexible thread prepared from either the serosal connective tissue layer of beef (bovine) or the submucosal fibrous tissue of sheep (ovine) intestine, and is intended for use in soft tissue approximation', ',0,1601,1567,6824,4598,', 'Benang bedah gut yang dapat diserap', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4599, 'Absorbable polydioxanone surgical suture', '21603047', 8920, 'An absorbable polydioxanone surgical suture is an absorbable, flexible, sterile, monofilament thread prepared from polyester polymer poly (p-dioxanone) and is intended for use in soft tissue approximation, including pediatric cardiovascular tissue where growth is expected to occur, and ophthalmic surgery. It may be coated or uncoated, undyed or dyed, and with or without a standard needle attached', ',0,1601,1567,6824,4599,', 'Benang bedah polidioksanon ]absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4600, 'Suture retention device', '11603048', 8919, 'A suture retention device is a device, such as a retention bridge, a surgical button, or a suture bolster, intended to aid wound healing by distributing suture tension over a larger area in the patient.', ',0,1601,1567,6824,4600,', 'Benang bedah retensi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4601, 'Nonabsorbable poly(ethylene terephthalate) surgical suture', '21603051', 8917, 'onabsorbable poly(ethylene terephthalate) surgical suture is a multifilament, nonabsorbable, sterile, flexible thread prepared from fibers of high molecular weight, long-chain, linear polyesters having recurrent aromatic rings as an integral component and is indicated for use in soft tissue approximation. The poly(ethylene terephthalate) surgical suture meets U.S.P. requirements as described in the U.S.P. Monograph for Nonabsorbable Surgical Sutures; it may be provided uncoated or coated; and it may be undyed or dyed with an appropriate FDA listed color additive. Also, the suture may be provided with or without a standard needle attached.', ',0,1601,1567,6824,4601,', 'Benang bedah poli(etilen tereftalat) non absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4602, 'Nonabsorbable polypropylene surgical suture', '21603052', 8916, 'Nonabsorbable polypropylene surgical suture is a monofilament, nonabsorbable, sterile, flexible thread prepared from long-chain polyolefin polymer known as polypropylene and is indicated for use in soft tissue approximation.', ',0,1601,1567,6824,4602,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4603, 'Nonabsorbable polyamide surgical suture', '21603053', 8915, 'Nonabsorbable polyamide surgical suture is a nonabsorbable, sterile, flexible thread prepared from long-chain aliphatic polymers Nylon 6 and Nylon 6,6 and is indicated for use in soft tissue approximation.', ',0,1601,1567,6824,4603,', 'Benang bedah poliamid non absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4604, ' Natural nonabsorbable silk surgical suture', '21603054', 8914, 'Natural nonabsorbable silk surgical suture is a nonabsorbable, sterile, flexible multifilament thread composed of an organic protein called fibroin. This protein is derived from the domesticated speciesBombyx mori (B. mori ) of the familyBombycidae.', ',0,1601,1567,6824,4604,', 'Benang bedah sutra alami non absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4605, 'Nonabsorbable expanded polytetrafluoroethylene surgical suture', '21603055', 8913, 'Nonabsorbable expanded polytetrafluoroethylene (ePTFE) surgical suture is a monofilament, nonabsorbable, sterile, flexible thread prepared from ePTFE and is intended for use in soft tissue approximation and ligation, including cardiovascular surgery. It may be undyed or dyed with an approved color additive and may be provided with or without an attached needle(s)', ',0,1601,1567,6824,4605,', 'Benang bedah polytetrafluoroethylene expanded non absorbable', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4606, 'Suction lipoplasty system', '21603056', 8912, 'A suction lipoplasty system is a device intended for aesthetic body contouring. The device consists of a powered suction pump (containing a microbial filter on the exhaust and a microbial in-line filter in the connecting tubing between the collection bottle and the safety trap), collection bottle, cannula, and connecting tube. The microbial filters, tubing, collection bottle, and cannula must be capable of being changed between patients. The powered suction pump has a motor with a minimum of1/3horsepower, a variable vacuum range from 0 to 29.9 inches of mercury, vacuum control valves to regulate the vacuum with accompanying vacuum gauges, a single or double rotary vane (with or without oil), a single or double diaphragm, a single or double piston, and a safety trap.', ',0,1601,1567,6824,4606,', 'Sistem lipoplasti suction', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4607, 'Air-handling apparatus for a surgical operating room', '21604001', 9473, 'Air-handling apparatus for a surgical operating room is a device intended to produce a directed, nonturbulent flow of air that has been filtered to remove particulate matter and microorganisms to provide an area free of contaminants to reduce the possibility of infection in the patient', ',0,1601,1568,6825,4607,', 'Alat pengatur udara untuk ruang operasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4608, 'Low level laser system for aesthetic use ', '21604004', 6825, 'A Low Level Laser System for Aesthetic Use is a device using low level laser energy for the disruption of adipocyte cells within the fat layer for the release of fat and lipids from these cells for noninvasive aesthetic use.', ',0,1601,1568,6825,4608,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4609, ' Topical oxygen chamber for extremities', '21604005', 9470, 'A topical oxygen chamber for extremities is a device that is intended to surround a patient\'s limb and apply humidified oxygen topically at a pressure slightly greater than atmospheric pressure to aid healing of chronic skin ulcers such as bedsores.', ',0,1601,1568,6825,4609,', 'Chamber oksigen topikal untuk ektrimitas', NULL, 0, 0, 700, NULL, NULL);
