INSERT INTO `aspak_new_alat` VALUES (4713, 'Caries detection device', '20601004', 6782, 'perangkat dimaksudkan untuk menunjukkan adanya kerusakan pada gigi pasien dengan menggunakan arus listrik', ',0,1596,1544,6782,4713,', 'Alat deteksi karies gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4714, 'Anomaloscope', '11201003', 9051, '', ',0,1602,4655,6808,4714,', 'Anomaloskop', NULL, 0, 0, 700, NULL, NULL);
