INSERT INTO `aspak_new_alat` VALUES (4716, 'Laser fluorescence caries detection device', '20601005', 6782, 'Sebuah fluoresensi perangkat deteksi karies laser laser, detektor fluoresensi bertempat di sebuah handpiece gigi, dan konsol kontrol yang melakukan kalibrasi perangkat, serta variabel memancarkan nada dan fungsi pengukuran fluoresensi. Tujuan penggunaan perangkat untuk membantu dalam deteksi kerusakan gigi dengan mengukur peningkatan Laser diinduksi fluoresensi.', ',0,1596,1544,6782,4716,', 'Alat deteksi karies gigi dengan laser fluorosensi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4717, 'Dental x-ray exposure alignment device', '10601008', 6782, ' perangkat dimaksudkan untuk posisi film x-ray dan untuk menyelaraskan situs pemeriksaan dengan sinar x-ray.', ',0,1596,1544,6782,4717,', 'Perangkat penyelaras paparan sinar x gigi, beam alignment device', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4718, 'Dental x-ray position indicating device', '10601010', 6782, 'Perangkat ini dimaksudkan untuk menyelaraskan situs pemeriksaan dengan sinar x-ray dan untuk membatasi dimensi bidang sinar-x gigi dengan membatasi ukuran utama berkas sinar-x', ',0,1596,1544,6782,4718,', 'Position Indicating Device (PID), cone, tube', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4719, 'Lead-lined position indicator', '10601011', 6782, 'melekat pada tabung x-ray gigi dan dimaksudkan untuk membantu dalam posisi tabung, untuk mencegah misfocusing dari x-ray dengan menyerap radiasi divergen, dan untuk mencegah kebocoran radiasi.', ',0,1596,1544,6782,4719,', 'Lead-lined position indicator', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4720, 'Sulfide detection device', '20601012', 6782, 'Perangkat ini ditujukan untuk digunakan in vivo, secara manual mengukur periodontal saku kedalaman probing, mendeteksi ada tidaknya perdarahan saat probing, dan mendeteksi keberadaan sulfida di kantong-kantong periodontal, sebagai tambahan dalam diagnosis penyakit periodontal pada pasien dewasa .', ',0,1596,1544,6782,4720,', 'Alat deteksi sulfida', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4721, 'Ophthalmic chair', '11201006', 9048, '', ',0,1602,4655,6808,4721,', 'Kursi periksa mata', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4722, 'Jaw tracking device', '10601015', 7126, 'perangkat tanpa sumber daya atau bertenaga listrik yang mengukur dan catatan jarak anatomi dan sudut dalam ruang tiga dimensi, untuk menentukan posisi relatif dari mandibula sehubungan dengan lokasi dan posisi rahang atas, sementara pada saat istirahat dan selama gerakan rahang.', ',0,1596,1544,6782,4722,', 'Alat pengukur pergerakan rahang', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4723, 'Opthalmic camera', '21201005', 6808, '', ',0,1602,4655,6808,4723,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4724, 'Noble metal alloy/Alloy logam mulia', '20602001', 6783, 'perangkat terutama terdiri dari logam mulia, seperti emas, paladium, platinum, atau perak, yang dimaksudkan untuk digunakan dalam pembuatan cor atau porselin-menyatu-to-metal mahkota dan jembatan restorasi.', ',0,1596,1545,6783,4724,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4725, 'Bahan tambal amalgam; tumpatan amalgam/Dental amalgam, mercury, and amalgam alloy', '20602002', 6783, 'sebuah perangkat yang terdiri dari kombinasi unsur merkuri, diberikan sebagai cairan dalam jumlah besar, sachet, atau bentuk kapsul predosed, dan paduan amalgam terutama terdiri dari perak, timah, dan tembaga, diberikan sebagai bubuk dalam jumlah besar, tablet, atau kapsul predosed bentuk, untuk mengisi langsung lesi karies atau cacat struktural dalam gigi. Perangkat ini juga mencakup perangkat individu komponen, merkuri dan paduan amalgam, ketika ditujukan untuk dikombinasikan dengan satu sama lain untuk membentuk amalgam gigi.', ',0,1596,1545,6783,4725,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4726, 'Preformed anchor', '10602006', 7205, 'Peralatan yang terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar atau logam kelompok platinum yang digunakan untuk dimasukkan ke dalam alat gigi, seperti gigi tiruan, untuk membantu menstabilkan alat di mulut pasien.', ',0,1596,1545,6783,4726,', 'Jangkar gigi tiruan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4727, 'Visual acuity chart', '11201007', 9047, '', ',0,1602,4655,6808,4727,', 'Snellen chart', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4728, 'Resin applicator/Kuas resin', '10602007', 6783, 'Peralatan seperti sikat untuk digunakan dalam menyebarkan resin gigi pada gigi selama aplikasi bahan warna gigi.', ',0,1596,1545,6783,4728,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4729, 'Color vision plate illuminator', '11201008', 9046, '', ',0,1602,4655,6808,4729,', 'Plat illuminator penglihatan warna', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4730, 'Articulator', '10602008', 7203, 'Peralatan yang digunakan untuk mensimulasikan gerakan bagian atas pasien dan rahang bawah. Plester cetakan gigi pasien dan gusi ditempatkan dalam perangkat untuk mereproduksi oklusi (gigitan) dan artikulasi rahang pasien. Artikulator digunakan untuk menyesuaikan gigi palsu atau menyediakan perawatan ortodontik.', ',0,1596,1545,6783,4730,', 'Dental articulator', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4731, 'Color vision tester', '11201009', 9045, '', ',0,1602,4655,6808,4731,', 'Penguji penglihatan warna', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4732, 'Distometer', '11201010', 9044, '', ',0,1602,4655,6808,4732,', 'Distometer/Alat untuk mengukur jarak antara kornea dan lensa korektif', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4733, 'Precision attachment', '10602009', 6783, 'Alat yang terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum yang digunakan dalam kedokteran gigi prostetik dalam hubungannya dengan gigi tiruan sebagian lepasan. ', ',0,1596,1545,6783,4733,', 'Prosthodontics precision attachment', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4734, 'Resin tooth bonding agent/Etching; bonding', '20602010', 6783, 'Bahan perangkat, seperti metil metakrilat, yang digunakan untuk dicat pada interior rongga gigi untuk meningkatkan retensi restorasi, seperti mengisi.', ',0,1596,1545,6783,4734,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4735, 'Facebow', '10602011', 7200, 'Peralatan yang digunakan dalam fabrikasi gigi tiruan untuk menentukan hubungan spasial antara bagian atas dan rahang bawah. Penentuan ini dimaksudkan untuk digunakan dalam menempatkan gigi tiruan gips akurat menjadi artikulator dan dengan demikian membantu penempatan gigi tiruan menjadi basis gigi tiruan.', ',0,1596,1545,6783,4735,', 'Dental facebow', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4736, 'Calcium hydroxide cavity liner/Ca(OH)2', '20602013', 6783, 'Bahan yang digunakan untuk diterapkan pada interior rongga yang disiapkan sebelum penyisipan bahan restoratif, seperti amalgam, untuk melindungi pulp gigi.', ',0,1596,1545,6783,4736,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4737, 'Cavity varnish/Varnish', '20602014', 6783, 'Peralatan yang terdiri dari senyawa yang digunakan untuk melapisi rongga gigi yang disiapkan sebelum penyisipan bahan restoratif. Perangkat ini dimaksudkan untuk mencegah penetrasi bahan restoratif, seperti amalgam, ke dalam jaringan dentin.', ',0,1596,1545,6783,4737,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4738, 'Dental cement', '20602015', 7142, 'Peralatan yang terdiri dari berbagai bahan selain zinc oxide-eugenol yang digunakan untuk mengisi gigi sementara atau sebagai semen dasar, untuk membubuhkan perangkat gigi seperti mahkota atau jembatan, atau untuk diterapkan pada gigi untuk melindungi pulpa gigi.', ',0,1596,1545,6783,4738,', 'Semen gigi berbahan Zinc oxide eugenol, temporary dental cement', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4739, 'Preformed clasp/Klamer; cangkolan', '10602016', 6783, 'Peralatan prefabrikasi terbuat dari paduan austenitik atau paduan mengandung 75 persen atau emas yang lebih besar dan logam dari kelompok platinum digunakan untuk dimasukkan ke dalam alat gigi, seperti gigi tiruan sebagian, untuk membantu menstabilkan alat di mulut pasien dengan pengancing alat ke sebuah gigi di sekitarnya. ', ',0,1596,1545,6783,4739,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4740, 'Hydrophilic resin coating for dentures', '20602017', 7194, 'Peralatan yang terdiri dari polimer penahan air yang digunakan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigi tiruan dan kenyamanan', ',0,1596,1545,6783,4740,', 'Pelapis resin hidrofilik untuk gigi tiruan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4741, 'Coating material for resin fillings/Varnish', '20602018', 6783, 'Peralatan yang digunakan untuk diterapkan pada permukaan pengisi gigi resin restoratif agar halus, glasir-seperti finish pada permukaan pengisi.', ',0,1596,1545,6783,4741,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4742, 'Preformed crown/Mahkota sediaan; mahkota sementara', '10602019', 6783, 'Peralatan prefabrikasi yang terbuat dari plastik atau austenitik paduan atau paduan 75 persen atau lebih besar dari emas  yang lebih besar dan logam kelompok platinum dimaksudkan untuk ditempelkan sementara ke gigi setelah penghapusan, atau kerusakan, mahkota alami (yang sebagian dari gigi yang biasanya menjorok di atas gusi). Hal ini dimaksudkan untuk digunakan sebagai restorasi fungsional sampai mahkota permanen dibangun. Perangkat ini juga mungkin dimaksudkan untuk digunakan sebagai restorasi fungsional untuk gugur buruk membusuk (bayi) gigi sampai gigi dewasa meletus.', ',0,1596,1545,6783,4742,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4743, 'Gold or stainless steel cusp', '10602020', 7147, 'Peralatan prefabrikasi yang terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau lebih besar dari emas dan logam kelompok platinum atau stainless steel dimaksudkan untuk memberikan puncak tetap (proyeksi pada permukaan pengunyah pada gigi) untuk mencapai keselarasan oklusal (gigitan yang tepat) antara gigi dan gigi tiruan lepasan.', ',0,1596,1545,6783,4743,', 'Cusp terbuat dari emas atau stainless steel', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4744, 'Preformed cusp', '10602021', 7146, 'Peralatan prefabrikasi yang terbuat dari plastik atau austenitik paduan atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum dimaksudkan untuk digunakan sebagai titik puncak sementara (proyeksi pada permukaan pengunyah gigi) untuk mencapai keselarasan oklusal (gigitan yang tepat ) sebelum restorasi permanen gigi.', ',0,1596,1545,6783,4744,', 'Cusp siap pakai', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4746, 'Ethylene oxide homopolymer and/or carboxymethylcellulose sodium denture adhesive', '10602023', 7149, 'perangkat yang berisi homopolimer etilen oksida dan / atau karboksimetilselulosa natrium dimaksudkan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigitiruan dan kenyamanan.', ',0,1596,1545,6783,4746,', 'Homopolimer etilena oksida dan/atau perekat natrium karboksimetilselulosa/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4747, 'Carboxymethylcellulose sodium and cationic polyacrylamide polymer denture adhesive', '30602024', 7190, 'perangkat terdiri dari karboksimetilselulosa natrium dan kationik poliakrilamida polimer dimaksudkan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigitiruan dan kenyamanan.', ',0,1596,1545,6783,4747,', 'Karboksimetilselulosa natrium dan perekat kationik poliakrilamida kationik/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4748, 'Ethylene oxide homopolymer and/or karaya denture adhesive', '10602025', 7189, 'Perangkat terdiri dari etilen oksida homopolimer dan / atau karaya dimaksudkan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigitiruan dan kenyamanan.', ',0,1596,1545,6783,4748,', 'Homopolimer etilena oksida dan/atau perekat gigi karaya/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4749, 'Polyacrylamide polymer (modified cationic) denture adhesive', '30602026', 6783, 'Peralatan terdiri dari poliakrilamida polimer (dimodifikasi kationik) dimaksudkan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigitiruan dan kenyamanan.', ',0,1596,1545,6783,4749,', 'Bahan perekat polimer polyacrylamide (dimodifikasi kationik)/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4750, 'Karaya and sodium borate with or without acacia denture adhesive', '10602022', 7192, 'Peralatan yang terdiri dari karaya dan sodium borate dengan atau tanpa akasia digunakan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigi tiruan dan kenyamanan.', ',0,1596,1545,6783,4750,', 'Karaya dan natrium borat dengan atau tanpa perekat gigi tiruan akasia denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4751, 'Carboxymethylcellulose sodium and/or polyvinylmethylether maleic acid calcium-sodium double salt denture adhesive', '10602027', 7187, 'Peralatan terdiri dari natrium karboksimetilselulosa dan / atau polyvinylmethylether asam maleat kalsium-garam natrium ganda digunakan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigi tiruan dan kenyamanan.', ',0,1596,1545,6783,4751,', 'Carboxymethylselulose sodium dan/atau polyvinylmethylether maleic acid kalsium-sodium double salt gigi tiruan perekat/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4752, 'Optokinetic drum', '11201011', 9043, '', ',0,1602,4655,6808,4752,', 'Drum optokinetik/ Alat untuk memperoleh dan mengevaluasi nystagmus pada pasien', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4753, 'Polyvinylmethylether maleic anhydride (PVM-MA), acid copolymer, and carboxymethylcellulose sodium (NACMC) denture adhesive', '30602028', 7186, 'Peralatan terdiri dari anhidrida maleat polyvinylmethylether, kopolimer asam dan karboksimetilselulosa natrium digunakan untuk diterapkan pada basis gigi tiruan sebelum gigi tiruan dimasukkan ke dalam mulut pasien untuk meningkatkan retensi gigi tiruan dan kenyamanan.', ',0,1596,1545,6783,4753,', 'Anhidrida maleat polivinilmetileter (PVM-MA), kopolimer asam, dan perekat gigi tiruan natriumkarboksimetilselulosa (NACMC)/denture adhesive', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4754, 'Corneal electrode', '21201012', 9042, '', ',0,1602,4655,6808,4754,', 'Elektroda kornea/ Alat untuk memberikan data yang menunjukkan perubahan potensial listrik di retina setelah elektroretinografi (stimulasi oleh cahaya) ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4755, 'OTC denture cleanser', '10602029', 7185, 'Peralatan yang terdiri dari materi dalam bentuk bubuk, tablet, atau pasta yang digunakan untuk menghilangkan kotoran dari peralatan gigi palsu yang dapat dilepas, seperti jembatan atau gigi palsu. Alat gigi dilepas dari mulut pasien bila alat tersebut dibersihkan.', ',0,1596,1545,6783,4755,', 'Pembersih gigi OTC', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4756, 'Mechanical denture cleaner', '10602030', 7184, 'Peralatan yang biasanya AC-powered yang terdiri dari wadah untuk secara mekanis mengagitasi larutan pembersih gigi tiruan. Peralatan ini digunakan untuk membersihkan gigi tiruan dengan perendaman dalam larutan pembersih agitasi dalam wadah.', ',0,1596,1545,6783,4756,', 'Alat pembersih gigi mekanik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4757, 'OTC denture cushion or pad', '10602031', 7183, 'Peralatan sekali pakai noncustom made yang dimaksudkan untuk meningkatkan kesesuaian dari gigi tiruan lepas atau gigi tiruan yang tidak nyaman.', ',0,1596,1545,6783,4757,', 'Bantalan denture OTC', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4758, 'OTC denture reliner', '20602032', 7182, 'Peralatan yang terdiri dari bahan seperti resin plastik yang digunakan untuk diterapkan sebagai lapisan permanen atau lapisan di dasar atau jaringan-yang menghubungkan permukaan gigi tiruan. Peralatan ini digunakan untuk menggantikan lapisan gigi usang.', ',0,1596,1545,6783,4758,', 'Dentur reliner OTC', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4759, 'OTC denture repair kit', '20602033', 7181, 'Peralatan yang terdiri dari bahan seperti resin plastik yang digunakan untuk diterapkan sebagai lapisan permanen atau lapisan di dasar atau jaringan-yang menghubungkan permukaan gigi tiruan. Peralatan ini digunakan untuk menggantikan lapisan gigi usang.', ',0,1596,1545,6783,4759,', 'Kit perbaikan denture OTC', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4760, 'Preformed gold denture tooth/Gold crown', '10602034', 6783, 'Peralatan yang terdiri dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum dimaksudkan untuk digunakan sebagai gigi atau sebagian gigi pada gigi tiruan sebagian tetap atau dilepas.', ',0,1596,1545,6783,4760,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4761, 'Preformed plastic denture tooth/Crown akrilik', '20602035', 6783, 'Peralatan prefabrikasi, terdiri dari bahan seperti metil metakrilat, yang digunakan sebagai gigi pada permukaan gigi tiruan.', ',0,1596,1545,6783,4761,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4762, 'Partially fabricated denture kit', '20602036', 7178, 'Peralatan yang terdiri dari gigi preformed bersambungan yang digunakan dalam pembuatan gigi tiruan. Dasar gigi tiruan dibuat menggunakan mulut pasien sebagai cetakan, dengan sebagian polimerisasi bahan dasar gigi tiruan resin sedangkan bahan berada dalam kontak dengan jaringan mulut. Setelah dasar gigi tiruan dibuat, gigi preformed terhubung secara kimiawi terikat pada dasar.', ',0,1596,1545,6783,4762,', 'Kit fabricated dentur', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4763, 'Endosseous dental implant abutment/Abutment', '20602037', 6783, 'Komponen prostetik premanufactured yang langsung terhubung ke implan gigi endosseous dan digunakan sebagai bantuan dalam rehabilitasi prostetik.', ',0,1596,1545,6783,4763,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4764, 'Subperiosteal implant material/Implant gigi', '20602039', 6783, 'Peralatan yang terdiri dari titanium atau kobalt krom molibdenum digunakan untuk membangun perangkat prostetik kustom dimana pembedahan ditanamkan ke bagian bawah atau atas rahang antara periosteum (jaringan ikat yang menutupi tulang) dan mendukung struktur tulang. Peralatan ini ditujukan untuk memberikan dukungan untuk prostesis, seperti gigi palsu.', ',0,1596,1545,6783,4764,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4765, 'Impression material/Bahan cetak', '20602040', 6783, 'Peralatan yang terdiri dari bahan seperti alginat atau polisulfida digunakan untuk ditaruh di atas nampan cetakan preformed dan digunakan untuk mereproduksi struktur gigi dan gusi pasien. Peralatan ini digunakan agar  dapat memberikan model untuk belajar dan untuk produksi perangkat prostetik restoratif, seperti inlays emas dan gigi palsu.', ',0,1596,1545,6783,4765,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4766, 'Optical Impression Systems for CAD/CAM', '20602041', 7173, 'Peralatan yang digunakan untuk merekam karakteristik topografi gigi, tayangan gigi, atau model batu dengan metode analog atau digital, digunakan dalam desain yang dibantu komputer dan pembuatan perangkat prostetik gigi restoratif. Sistem tersebut dapat terdiri dari kamera, scanner, sensor dan komputer dengan perangkat lunak.', ',0,1596,1545,6783,4766,', 'CAD/CAM', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4767, 'Resin impression tray material', '20602042', 7172, 'Peralatan yang digunakan dalam cetakan gigi dua langkah proses fabrikasi. Perangkat ini terdiri dari bahan resin, seperti metil metakrilat, dan digunakan untuk membentuk cetakan nampan kustom yang digunakan dalam kasus-kasus di mana sebuah nampan cetakan preformed tidak sesuai, seperti pembuatan mahkota, jembatan, atau gigi tiruan penuh. Sebuah plester awal atau model batu gigi dan gusi pasien dibuat. Resin cetakan bahan baki diterapkan pada model studi awal ini untuk membentuk sebuah nampan kustom. Baki ini kemudian diisi dengan bahan cetakan dan dimasukkan ke mulut pasien untuk membuat cetakan.', ',0,1596,1545,6783,4767,', 'Bahan tray resin', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4768, 'Polytetrafluoroethylene (PTFE) vitreous carbon materials', '20602043', 7171, 'Peralatan yang terdiri dari politetrafluoroetilena (PTFE) vitreous karbon yang digunakan dalam maksilofasial alveolar augmentasi (membangun daerah rahang atas atau bawah yang berisi soket di mana gigi berakar) atau dimaksudkan untuk melapisi bedah implan logam untuk ditempatkan di alveoli (soket di mana gigi berakar) atau temporomandibular joint (sendi antara bagian atas dan rahang bawah).', ',0,1596,1545,6783,4768,', 'Bahan PTFE carbon', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4769, 'Tooth shade resin material/Bahan tambal resin komposit', '20602044', 6783, 'Peralatan yang terdiri dari bahan seperti bisphenol-A metakrilat glisidil (Bis-GMA) dimaksudkan untuk mengembalikan lesi karies atau cacat struktural dalam gigi.', ',0,1596,1545,6783,4769,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4770, 'Base metal alloy', '20602045', 7169, 'Peralatan yang terdiri dari logam dasar, seperti nikel, kromium, atau kobalt, yang dimaksudkan untuk digunakan dalam pembuatan cor atau mahkota porcelain-fused-to-metal dan jembatan restorasi.', ',0,1596,1545,6783,4770,', 'Bahan campuran logam basis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4771, 'Pantograph', '10602046', 7168, 'Peralatan yang digunakan untuk melekatkan pada kepala pasien untuk menduplikasi gerakan rahang bawah untuk membantu dalam pembangunan perangkat gigi restoratif dan prostetik. ', ',0,1596,1545,6783,4771,', 'Dental pantograph', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4772, 'Retentive and splinting pin', '20602047', 7167, 'Peralatan yang terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum dimaksudkan untuk ditempatkan secara permanen pada gigi untuk memberikan retensi dan stabilisasi untuk restorasi, seperti mahkota, atau untuk bergabung dengan dua atau lebih gigi bersama-sama.', ',0,1596,1545,6783,4772,', 'Pin/pasak', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4773, 'Bracket adhesive resin and tooth conditioner/Bonding bracket', '20602048', 6783, 'Peralatan yang terdiri dari suatu senyawa perekat, seperti polimetilmetakrilat, dimaksudkan untuk semen braket ortodontik ke permukaan gigi.', ',0,1596,1545,6783,4773,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4775, 'Pit and fissure sealant and conditioner', '20602050', 7164, 'Peralatan yang terdiri dari resin, seperti polimetilmetakrilat, untuk digunakan terutama pada anak-anak untuk menutup pit dan fisura depresi (kesalahan dalam enamel) di permukaan gigi untuk mencegah gigi berlubang.', ',0,1596,1545,6783,4775,', 'Pit and fissure sealant', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4776, 'Temporary crown and bridge resin', '20602051', 7163, 'Peralatan yang terdiri dari bahan, seperti polimetilmetakrilat, dimaksudkan untuk membuat prostesis sementara, seperti mahkota atau jembatan, untuk digunakan sampai restorasi permanen dibuat.', ',0,1596,1545,6783,4776,', 'Bahan resin untuk crown dan bridge sementara', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4778, 'Root canal filling resin/Bahan pengisi saluran akar', '10602053', 6783, 'Peralatan yang terdiri dari bahan, seperti metil metakrilat, dimaksudkan untuk digunakan selama terapi endodontik untuk mengisi saluran akar gigi.', ',0,1596,1545,6783,4778,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4779, 'Endodontic paper point/Paper point', '10602054', 6783, 'Peralatan yang terbuat dari kertas dimaksudkan untuk digunakan selama terapi endodontik untuk kering, atau menerapkan obat untuk, saluran akar gigi.', ',0,1596,1545,6783,4779,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4780, 'Endodontic silver point', '10602055', 7159, 'perangkat terbuat dari perak dimaksudkan untuk digunakan selama terapi endodontik untuk mengisi secara permanen saluran akar gigi.', ',0,1596,1545,6783,4780,', 'Paper point pengisi saluran akar gigi dari perak', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4781, 'Gutta percha', '10602056', 7145, 'perangkat yang terbuat dari getah beku pohon-pohon tropis tertentu yang ditujukan untuk mengisi saluran akar gigi. The getah perca melunak oleh panas dan dimasukkan ke dalam saluran akar, di mana mengeras karena cools.', ',0,1596,1545,6783,4781,', 'Gutta percha', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4782, 'Denture relining, repairing, or rebasing resin', '20602049', 6783, 'Peralatan yang terdiri dari bahan seperti metil metakrilat, digunakan untuk reline permukaan gigi tiruan bahwa jaringan kontak, untuk memperbaiki gigi tiruan retak, atau untuk membentuk basis gigi tiruan baru. ', ',0,1596,1545,6783,4782,', 'Relining, repairing, rebasing dari resin untuk gigi tiruan lepasan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4783, 'Root canal post', '10602052', 7162, 'Peralatan yang terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum dimaksudkan untuk menggabungkan ke dalam saluran akar gigi untuk menstabilkan dan mendukung restorasi.', ',0,1596,1545,6783,4783,', 'Penstabil akar gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4784, 'Endodontic stabilizing splint', '20602057', 7158, 'perangkat terbuat dari bahan, seperti titanium, dimaksudkan untuk dimasukkan melalui saluran akar ke atas atau bawah tulang rahang untuk menstabilkan gigi.', ',0,1596,1545,6783,4784,', 'Splint penstabil akar gigi (contoh: terbuat dari titanium)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4787, 'Posterior artificial tooth with a metal insert', '10602058', 7144, 'perangkat porselen dengan menyisipkan terbuat dari paduan austenitik atau paduan yang mengandung 75 persen atau emas yang lebih besar dan logam kelompok platinum dimaksudkan untuk menggantikan gigi alami. Perangkat ini melekat pada gigi sekitarnya dengan jembatan dan dimaksudkan untuk menyediakan perbaikan dalam penampilan dan oklusi fungsional (gigitan).', ',0,1596,1545,6783,4787,', 'Gigi artifisial posterior dengan insert logam', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4788, 'Backing and facing for an artificial tooth', '10602059', 6783, 'perangkat dimaksudkan untuk digunakan dalam pembuatan alat gigi tetap atau dilepas, seperti mahkota atau jembatan. Dukungan, yang terbuat dari emas, melekat pada alat gigi dan mendukung menghadap gigi berwarna, yang terbuat dari porselen atau plastik.', ',0,1596,1545,6783,4788,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4789, 'Porcelain tooth', '10602060', 7157, '', ',0,1596,1545,6783,4789,', 'Gigi palsu dari porselen', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4790, 'Bone grafting material', '20602061', 7156, 'bahan seperti hidroksiapatit, trikalsium fosfat, dan asam polylactic polyglycolic, atau kolagen, yang dimaksudkan untuk mengisi, menambah, atau merekonstruksi cacat periodontal atau tulang daerah mulut dan maksilofasial.', ',0,1596,1545,6783,4790,', 'Bone graft; bahan cangkok tulang', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4792, 'Total temporomandibular joint prosthesis', '30602062', 7155, 'perangkat yang dimaksudkan untuk ditanamkan dalam tulang rahang manusia untuk menggantikan kondilus mandibula dan meningkatkan fossa glenoid secara fungsional merekonstruksi sendi temporomandibular.', ',0,1596,1545,6783,4792,', 'Prostesis TMJ', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4793, 'Glenoid fossa prosthesis', '30602063', 7154, 'perangkat yang dimaksudkan untuk ditanamkan dalam sendi temporomandibular untuk menambah sebuah fossa glenoid atau untuk memberikan suatu permukaan artikulasi untuk kepala kondilus mandibula.', ',0,1596,1545,6783,4793,', 'Prostesis glenoid fossa', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4794, 'Mandibular condyle prosthesis', '30602064', 7153, 'dimaksudkan untuk ditanamkan di rahang manusia untuk menggantikan kondilus mandibula dan mengartikulasikan dalam fossa glenoid.', ',0,1596,1545,6783,4794,', 'Prostesis mandibular condylar', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4795, 'Interarticular disc prosthesis (interpositional implant)', '30602065', 7152, 'perangkat yang dimaksudkan untuk menjadi sebuah antarmuka antara permukaan mengartikulasikan alami dari kondilus mandibula dan glenoid fossa.', ',0,1596,1545,6783,4795,', 'Prostesis disc inter-artikular (implan interpositional)', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4796, 'Endosseous dental implant accessories/Bur implant', '10602066', 6783, 'Endosseous aksesoris implan gigi adalah perangkat bertenaga manual dimaksudkan untuk membantu dalam penempatan atau penghapusan implan gigi endosseous dan abutment, mempersiapkan lokasi untuk penempatan implan endosseous gigi atau abutment, bantuan dalam pemasangan implan gigi endosseous atau abutment, bantuan dalam fabrikasi prosthetics gigi, dan digunakan sebagai aksesori dengan implan gigi endosseous bila kontak jaringan akan berlangsung kurang dari 1 jam. Perangkat ini meliputi bor, obeng, perangkat countertorque, penempatan dan removal tools, potongan laboratorium yang digunakan untuk pembuatan prosthetics gigi, dan abutment sidang.', ',0,1596,1545,6783,4796,', '', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4797, 'Bone cutting instrument and accessories', '20603001', 7222, 'perangkat logam dimaksudkan untuk digunakan dalam bedah mulut rekonstruksi untuk mengebor atau dipotong menjadi rahang atas atau lebih rendah dan dapat digunakan untuk mempersiapkan tulang untuk memasukkan kawat, pin, atau sekrup. Perangkat ini meliputi bor pengguna tulang dan kawat driver, bor tulang bertenaga, rotary handpiece pemotongan tulang, dan tulang AC bertenaga melihat.', ',0,1596,1546,6784,4797,', 'Instrumen dan aksesori pemotong tulang rahang', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4798, 'Intraoral dental drill/Connector handpiece/contra angle', '10603002', 6784, 'perangkat rotary dimaksudkan untuk melekat pada handpiece gigi untuk mengebor lubang pada gigi untuk mengamankan cor atau pin preformed untuk mempertahankan peralatan gigi operatif.', ',0,1596,1546,6784,4798,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4799, 'Dental handpiece and accessories/Contra angle hand piece', '10603003', 6784, 'AC-powered, bertenaga air, udara bertenaga, atau belt-driven, perangkat genggam yang mungkin termasuk controller kaki untuk pengaturan kecepatan dan arah rotasi atau lampiran kontra-angle untuk sulit untuk menjangkau daerah-daerah dimaksudkan untuk mempersiapkan gigi berlubang untuk restorasi, seperti tambalan, dan untuk membersihkan gigi.', ',0,1596,1546,6784,4799,', '', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4800, 'Gas-powered jet injector', '20602004', 7221, 'perangkat jarum suntik dimaksudkan untuk mengelola anestesi lokal. Jarum suntik ini didukung oleh cartridge yang mengandung karbon dioksida bertekanan yang memberikan tekanan untuk memaksa anestesi dari jarum suntik.', ',0,1596,1546,6784,4800,', 'Injector bertekanan gas', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4801, 'Spring-powered jet injector', '20602005', 7220, 'perangkat jarum suntik dimaksudkan untuk mengelola anestesi lokal. Jarum suntik ini didukung oleh mekanisme pegas yang menyediakan tekanan untuk memaksa anestesi dari jarum suntik.', ',0,1596,1546,6784,4801,', 'Injector pegas', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4802, 'Dental diamond instrument/Bor diamond', '10603006', 6784, 'perangkat abrasif dimaksudkan untuk kelancaran permukaan gigi selama pemasangan mahkota atau jembatan. Perangkat ini terdiri dari poros yang dimasukkan ke dalam handpiece dan kepala yang memiliki chip berlian tertanam ke dalamnya. Rotasi dari instrumen berlian memberikan tindakan kasar ketika kontak gigi.', ',0,1596,1546,6784,4802,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4803, 'Dental hand instrument', '10603007', 7218, 'perangkat genggam dimaksudkan untuk melakukan berbagai tugas dalam kedokteran gigi umum dan prosedur bedah mulut. ', ',0,1596,1546,6784,4803,', 'Instrumen gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4804, 'Intraoral ligature and wire lock', '20603008', 7217, 'perangkat logam dimaksudkan untuk membatasi segmen tulang retak di rongga mulut. Segmen tulang distabilkan dengan membungkus ligatur (kawat) sekitar segmen tulang retak dan mengunci ujungnya.', ',0,1596,1546,6784,4804,', 'Ligature wire', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4805, 'Fiber optic dental light', '10603009', 7216, 'sebuah perangkat yang sangat ringan, biasanya AC-powered, yang terdiri dari kaca atau serat plastik yang memiliki sifat optik khusus. Perangkat ini biasanya menempel pada handpiece gigi dan dimaksudkan untuk menerangi struktur mulut pasien', ',0,1596,1546,6784,4805,', 'Lampu gigi serat optik', NULL, 0, 1, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4806, 'Dental injecting needle', '10603011', 6784, 'ramping, perangkat logam berongga dengan titik yang tajam dimaksudkan untuk melekat pada jarum suntik untuk menyuntikkan anestesi lokal dan obat-obatan lainnya.', ',0,1596,1546,6784,4806,', 'Jarum injeksi gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4807, 'Bone plate', '20603012', 7214, 'perangkat logam yang ditujukan untuk menstabilkan struktur tulang retak di rongga mulut. Segmen tulang yang melekat pada plat dengan sekrup untuk mencegah gerakan segmen.', ',0,1596,1546,6784,4807,', 'Pelat tulang rahang', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4808, 'Rotary scaler', '20603013', 7213, 'perangkat abrasif dimaksudkan untuk melekat pada handpiece bertenaga untuk menghilangkan deposit kalkulus dari gigi selama pembersihan gigi dan periodontal (gusi) terapi.', ',0,1596,1546,6784,4808,', 'Scaler', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4809, 'Intraosseous fixation screw or wire', '20603015', 7211, 'perangkat logam yang ditujukan untuk dimasukkan ke segmen tulang rahang retak untuk mencegah gerakan mereka.', ',0,1596,1546,6784,4809,', 'Screw atau kawat fiksasi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4810, 'Orthodontic plastic bracket', '20604002', 7230, 'perangkat plastik yang dimaksudkan untuk ditempelkan pada gigi untuk menerapkan tekanan pada gigi dari kawat ortodontik fleksibel untuk mengubah posisinya.', ',0,1596,1547,6785,4810,', 'Bracket gigi plastik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4811, 'Extraoral orthodontic headgear', '20604003', 7229, 'perangkat dirancang untuk digunakan dengan alat ortodontik untuk mengerahkan tekanan pada gigi dari luar mulut. Tutup kepala memiliki tali dimaksudkan untuk membungkus leher pasien atau kepala dan bagian busur batin dimaksudkan untuk diikat ke alat ortodontik di mulut pasien.', ',0,1596,1547,6785,4811,', 'Headgear ortodontik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4812, 'Preformed tooth positioner', '10604004', 7228, 'perangkat plastik yang merupakan kesan gigitan disempurnakan dimaksudkan untuk mencegah gigi pasien dari posisi pergeseran atau memindahkan gigi ke posisi akhir setelah peralatan ortodontik (kawat gigi) telah dihapus. Pasien menggigit bawah pada perangkat selama beberapa jam sehari untuk memaksa gigi ke posisi akhir atau untuk menjaga gigi dalam posisi mereka dikoreksi.', ',0,1596,1547,6785,4812,', 'Pengatur posisi gigi siap pakai, retainer', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4814, 'Intraoral devices for snoring and intraoral devices for snoring and obstructive sleep apnea', '20604006', 6785, 'perangkat yang dipakai saat tidur untuk mengurangi kejadian mendengkur dan untuk mengobati apnea tidur obstruktif. Perangkat ini dirancang untuk meningkatkan patensi jalan napas dan mengurangi turbulensi udara dan obstruksi jalan napas. Klasifikasi termasuk perangkat palatal mengangkat, perangkat penahan lidah, dan perangkat reposisi mandibula.', ',0,1596,1547,6785,4814,', 'Alat anti dengkur', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4815, 'Oral rinse to reduce the adhesion of dental plaque', '20604007', 7225, 'Perangkat ini diberi nama generik lisan bilas untuk mengurangi adhesi plak gigi dan diidentifikasi sebagai perangkat dimaksudkan untuk mengurangi keberadaan plak bakteri pada gigi dan permukaan mukosa mulut dengan cara fisik. Jenis perangkat termasuk mereka perangkat yang bertindak dengan mengurangi keterikatan dan menghambat pertumbuhan plak bakteri', ',0,1596,1547,6785,4815,', 'Cairan untuk mengurangi plak/karang gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4816, 'Abrasive device and accessories', '10605001', 7260, 'perangkat dibangun berbagai abrasive, seperti chip berlian, yang terpaku pada kertas lak berbasis. Perangkat ini ditujukan untuk menghilangkan bahan restoratif yang berlebihan, seperti emas, dan untuk kelancaran permukaan kasar dari restorasi oral, seperti mahkota. Perangkat ini melekat pada betis yang diselenggarakan oleh sebuah handpiece. Perangkat ini mencakup disk abrasif, penjaga disk abrasif, titik abrasif, polishing jalur agen, dan roda polishing.', ',0,1596,1548,6786,4816,', 'Alat abrasif dan aksesori', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4817, 'Oral cavity abrasive polishing agent', '10605002', 7259, 'perangkat dalam pasta atau bentuk bubuk yang mengandung bahan abrasif, seperti silika apung, dimaksudkan untuk menghilangkan kotoran dari gigi. The abrasive polish diterapkan pada gigi dengan lampiran handpiece (profilaksis cangkir).', ',0,1596,1548,6786,4817,', 'Bahan pemoles oral, prophylaxis pastes', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4818, 'Saliva absorber', '10605003', 7258, 'perangkat yang terbuat dari kertas atau kapas dimaksudkan untuk menyerap kelembaban dari rongga mulut selama prosedur gigi.', ',0,1596,1548,6786,4818,', 'Penyerap saliva, dental cotton roll; saliva absorber pad', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4819, 'Ultraviolet activator for polymerization', '20605048', 7257, 'Penggerak ultraviolet untuk polimerisasi adalah perangkat yang menghasilkan radiasi ultraviolet dimaksudkan untuk polimerisasi (set) pit gigi resin dan fissure sealant atau bahan restoratif dengan transmisi cahaya melalui tongkat.', ',0,1596,1548,6786,4819,', 'Dental curing UV light; UV light curing unit; curing UV light polymerization unit', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4820, 'Airbrush', '20605005', 7256, 'perangkat AC bertenaga dimaksudkan untuk digunakan dalam hubungannya dengan kertas artikulasi. Perangkat ini menggunakan partikel udara didorong untuk kasar permukaannya permukaan restorasi gigi. Daerah yang tidak merata dari restorasi tersebut kemudian diidentifikasi dengan menggunakan kertas artikulasi.', ',0,1596,1548,6786,4820,', 'Airbrush', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4821, 'Anesthetic warmer', '10605006', 7255, 'perangkat AC bertenaga mana tabung yang berisi larutan anestesi dimaksudkan untuk ditempatkan untuk menghangatkan mereka sebelum pemberian obat bius.', ',0,1596,1548,6786,4821,', 'Penghangat obat anestesi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4822, 'Articulation paper', '10605007', 7254, 'perangkat terdiri dari kertas yang dilapisi dengan tinta dye dimaksudkan untuk ditempatkan antara gigi atas dan bawah pasien ketika gigi berada dalam posisi gigitan untuk mencari daerah yang tidak rata atau tinggi.', ',0,1596,1548,6786,4822,', 'Articulating paper', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4823, 'Base plate shellac', '10605008', 7253, 'perangkat terdiri dari lak dimaksudkan untuk membangun kembali tepi oklusal gigi palsu penuh atau parsial.', ',0,1596,1548,6786,4823,', 'Pelat dasar cetak gigi terbuat dari shellac', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4824, 'Dental chair and accessories', '10605009', 7238, 'perangkat, biasanya AC bertenaga, di mana pasien duduk. Perangkat ini dimaksudkan untuk benar posisi pasien untuk melakukan prosedur gigi. Sebuah unit operasi gigi dapat disertakan.', ',0,1596,1548,6786,4824,', 'Kursi gigi dan aksesori', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4825, 'Prophylaxis cup', '10605010', 7252, 'erangkat terbuat dari karet dimaksudkan untuk dimiliki oleh handpiece gigi dan digunakan untuk menerapkan agen polishing selama profilaksis (pembersihan). Handpiece gigi berputar cangkir karet memegang agen polishing dan pengguna berlaku untuk gigi untuk menghilangkan kotoran.', ',0,1596,1548,6786,4825,', 'Prophylaxis cup', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4826, 'Rubber dam and accessories', '10605011', 7251, 'perangkat terdiri dari lembaran tipis lateks dengan lubang di tengah dimaksudkan untuk mengisolasi gigi dari cairan di mulut selama prosedur gigi, seperti mengisi persiapan rongga. Perangkat ini membentang di sekitar gigi dengan memasukkan gigi melalui lubang di tengah. ', ',0,1596,1548,6786,4826,', 'Rubber dam dan aksesori', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4827, 'Ultraviolet detector', '20605012', 7250, 'perangkat dimaksudkan untuk menyediakan sumber sinar ultraviolet yang digunakan untuk mengidentifikasi bahan dinyatakan tak terlihat, seperti plak gigi, hadir dalam atau pada gigi.', ',0,1596,1548,6786,4827,', 'Detektor ultraviolet', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4828, 'Dental floss', '10605013', 7249, 'perangkat seperti tali yang terbuat dari katun atau serat lain yang dimaksudkan untuk menghilangkan plak dan partikel makanan dari antara gigi untuk mengurangi kerusakan gigi. Serat perangkat dapat dilapisi dengan lilin untuk digunakan lebih mudah.', ',0,1596,1548,6786,4828,', 'Benang gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4829, 'Heat source for bleaching teeth', '10605014', 7237, 'perangkat AC-powered yang terdiri dari cahaya atau pemanas listrik dimaksudkan untuk menerapkan panas ke gigi setelah diperlakukan dengan pemutih.', ',0,1596,1548,6786,4829,', 'Alat pemutih gigi dengann sumber panas', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4830, 'Oral irrigation unit', '10605015', 7236, 'perangkat AC bertenaga dimaksudkan untuk memberikan aliran bertekanan air untuk menghilangkan partikel makanan dari antara gigi dan mempromosikan kondisi baik periodontal (gusi).', ',0,1596,1548,6786,4830,', '', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4831, 'Impression tube', '10605016', 7248, 'perangkat yang terdiri dari tabung tembaga berongga dimaksudkan untuk mengambil kesan gigi. Tabung berongga diisi dengan bahan cetak. Salah satu ujung tabung ditutup dengan bahan lunak, seperti lilin, akhir tersisa menyelinap atas gigi untuk membuat kesan.', ',0,1596,1548,6786,4831,', 'Tabung impresi, copper tube', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4832, 'Massaging pick or tip for oral hygiene', '10605018', 7247, 'kaku, perangkat runcing dimaksudkan untuk digunakan secara manual untuk merangsang dan memijat gusi untuk mempromosikan kondisi baik periodontal (gusi).', ',0,1596,1548,6786,4832,', 'Tusuk gigi, gum massager; gum stimulator; rubber tip stimulator', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4833, 'Porcelain powder for clinical use', '20605019', 7246, 'perangkat yang terdiri dari campuran kaolin, felspar, kuarsa, atau zat lain yang dimaksudkan untuk digunakan dalam produksi gigi tiruan dalam gigitiruan tetap atau dilepas, mahkota jaket, facings, dan veneer. Perangkat ini digunakan dalam kedokteran gigi prostetik dengan memanaskan campuran bubuk sampai suhu tinggi dalam oven untuk menghasilkan prostesis keras dengan finishing seperti gelas.', ',0,1596,1548,6786,4833,', 'Serbuk porselen gigi', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4834, 'Silicate protector', '10605020', 7245, 'perangkat yang terbuat dari silikon dimaksudkan untuk diterapkan dengan aplikator berujung penyerap ke permukaan restorasi baru untuk mengecualikan sementara cairan dari permukaannya.', ',0,1596,1548,6786,4834,', 'Protektor silikat', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4835, 'Endodontic dry heat sterilizer', '30605022', 7244, 'perangkat dimaksudkan untuk mensterilkan instrumen gigi endodontik dan lainnya dengan penerapan panas kering. Panas dipasok melalui manik-manik kaca yang telah dipanaskan oleh listrik.', ',0,1596,1548,6786,4835,', 'Sterilizer panas kering endodontik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4836, 'Cartridge syringe', '20605023', 7243, 'perangkat dimaksudkan untuk menyuntikkan agen anestesi subkutan atau intramuskular. Perangkat ini terdiri dari jarum suntik ke dalam tubuh logam yang sekali pakai, sebelumnya diisi, carpule kaca (cartridge silinder) yang mengandung anestesi ditempatkan. Setelah melampirkan jarum ke tubuh jarum suntik dan mengaktifkan carpule oleh sebagian memasukkan torak pada jarum suntik, perangkat ini digunakan untuk mengelola suntikan kepada pasien.', ',0,1596,1548,6786,4836,', 'Dental cartridge syringe', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4838, 'Manual toothbrush', '10605024', 7242, 'perangkat terdiri dari poros dengan baik alamiah maupun sintetis bulu di salah satu ujung dimaksudkan untuk menghilangkan plak patuh dan sisa-sisa makanan dari gigi untuk mengurangi kerusakan gigi.', ',0,1596,1548,6786,4838,', 'Sikat gigi manual', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4839, 'Powered toothbrush', '10605025', 7233, 'perangkat AC bertenaga atau bertenaga baterai yang terdiri dari pegangan yang berisi motor yang menyediakan gerakan mekanis untuk sikat dimaksudkan untuk diterapkan pada gigi. Perangkat ini dimaksudkan untuk menghilangkan plak patuh dan sisa-sisa makanan dari gigi untuk mengurangi kerusakan gigi.', ',0,1596,1548,6786,4839,', 'Sikat gigi elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4840, 'Disposable fluoride tray/Sendok cetak disposible', '10605026', 6786, 'perangkat yang terbuat dari styrofoam dimaksudkan untuk berlaku fluoride topikal pada gigi. Untuk menggunakan baki, pasien menggigit bawah pada baki yang telah diisi dengan larutan fluorida.', ',0,1596,1548,6786,4840,', NULL, NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4841, 'Preformed impression tray', '10605027', 7240, 'perangkat logam atau plastik yang dimaksudkan untuk dimiliki bahan cetak, seperti alginat, untuk membuat kesan gigi pasien atau proses alveolar (soket gigi tulang) untuk mereproduksi struktur gigi dan gusi pasien.', ',0,1596,1548,6786,4841,', 'Cetakan gigi siap pakai', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4842, 'Intraoral dental wax', '10605028', 7239, 'perangkat terbuat dari lilin dimaksudkan untuk membangun pola yang custom made protesa gigi logam, seperti mahkota dan jembatan, dilemparkan. Dalam kedokteran gigi ortodontik, perangkat ini dimaksudkan untuk membuat pola gigitan pasien untuk membuat model studi gigi.', ',0,1596,1548,6786,4842,', 'Dental wax; lilin dental', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4843, 'Two-point discriminator', '11001003', 8785, 'a device with points used for testing a patient\'s touch discrimination.', ',0,1595,1541,6799,4843,', 'Alat uji diskriminasi sentuhan', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4844, 'Electroconductive media', '21001005', 8783, 'the conductive creams or gels used with external electrodes to reduce the impedance (resistance to alternating current) of the contact between the electrode surface and the skin.', ',0,1595,1541,6799,4844,', 'Elektrokonduktif', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4845, 'Cortical electrode', '21001006', 8782, 'an electrode which is temporarily placed on the surface of the brain for stimulating the brain or recording the brain\'s electrical activity.', ',0,1595,1541,6799,4845,', 'Elektroda kortikal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4846, 'Cutaneous electrode', '21001007', 8781, 'an electrode that is applied directly to a patient\'s skin either to record physiological signals (e.g., the electroencephalogram) or to apply electrical stimulation.', ',0,1595,1541,6799,4846,', 'Elektroda kulit', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4847, 'Depth electrode', '21001008', 8780, 'an electrode used for temporary stimulation of, or recording electrical signals at, subsurface levels of the brain.', ',0,1595,1541,6799,4847,', 'Elektroda stimulasi atau perekaman sinyal listrik di bawah permukaan otak', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4848, 'Nasopharyngeal electrode', '21001009', 8779, 'an electrode which is temporarily placed in the nasopharyngeal region for the purpose of recording electrical activity.', ',0,1595,1541,6799,4848,', 'Elektroda nasofaring', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4849, 'Needle electrode', '21001010', 8778, 'a device which is placed subcutaneously to stimulate or to record electrical signals.', ',0,1595,1541,6799,4849,', 'Elektroda jarum', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4850, 'Electroencephalograph electrode/lead tester', '11001012', 8776, 'a device used for testing the impedance (resistance to alternating current) of the electrode and lead system of an electroencephalograph to assure that an adequate contact is made between the electrode and the skin.', ',0,1595,1541,6799,4850,', 'Elektroda EEG', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4851, 'Electroencephalograph test signal generator', '11001014', 8774, 'a device used to test or calibrate an electroencephalograph.', ',0,1595,1541,6799,4851,', 'Generator sinyal uji EEG', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4852, 'Nystagmograph', '21001015', 8773, ' a device used to measure, record, or visually display the involuntary movements (nystagmus) of the eyeball.', ',0,1595,1541,6799,4852,', 'Nistagmograf', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4853, 'Galvanic skin response measurement device', '21001019', 8769, 'a device used to determine autonomic responses as psychological indicators by measuring the electrical resistance of the skin and the tissue path between two electrodes applied to the skin.', ',0,1595,1541,6799,4853,', 'Alat pengukur respon kulit galvanis', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4854, 'Nerve conduction velocity measurement device', '21001020', 8768, 'a device which measures nerve conduction time by applying a stimulus, usually to a patient\'s peripheral nerve. This device includes the stimulator and the electronic processing equipment for measuring and displaying the nerve conduction time.', ',0,1595,1541,6799,4854,', 'Alat pengukur kecepatan konduksi saraf', NULL, 0, 0, 700, NULL, NULL);
