INSERT INTO `aspak_new_alat` VALUES (4856, 'Powered direct-contact temperature measurement device', '21001022', 8766, 'a device which contains a power source and is used to measure differences in temperature between two points on the body.', ',0,1595,1541,6799,4856,', 'Alat pengukur suhu elektrik', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4857, 'Intracranial pressure monitoring device', '21001024', 8764, 'a device used for short-term monitoring and recording of intracranial pressures and pressure trends. The device includes the transducer, monitor, and interconnecting hardware.', ',0,1595,1541,6799,4857,', 'Alat pemantau tekanan intrakranial', NULL, 0, 0, 700, NULL, NULL);
