INSERT INTO `aspak_new_alat` VALUES (4860, 'Ocular plethysmograph', '31001027', 8761, 'a device used to measure or detect volume changes in the eye produced by pulsations of the artery, to diagnose carotid artery occlusive disease (restrictions on blood flow in the carotid artery).', ',0,1595,1541,6799,4860,', 'Pletismograf okular', NULL, 0, 0, 700, NULL, NULL);
