INSERT INTO `aspak_new_alat` VALUES (4890, 'Manual cranial drills, burrs, trephines, and their accessories ', '21002012', 6800, 'Manual cranial drills, burrs, trephines, and their accessories are bone cutting and drilling instruments that are used without a power source on a patient\'s skull.', ',0,1595,1542,6800,4890,', 'Alat pemotong dan pengebor tulang (trefin, gerinda, dll) manual', NULL, 0, 0, 700, NULL, NULL);
