INSERT INTO `aspak_new_alat` VALUES (4975, 'Repetitive transcranial magnetic stimulation system ', '21003018', 6801, 'an external device that delivers transcranial repetitive pulsed magnetic fields of sufficient magnitude to induce neural action potentials in the prefrontal cortex to treat the symptoms of major depressive disorder without inducing seizure in patients who have failed at least one antidepressant medication and are currently not on any antidepressant therapy.', ',0,1595,1543,6801,4975,', 'Sistem stimulasi magnetik transkranial', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4976, 'External functional neuromuscular stimulator', '21003019', 8733, 'an electrical stimulator that uses external electrodes for stimulating muscles in the leg and ankle of partially paralyzed patients (e.g., after stroke) to provide flexion of the foot and thus improve the patient\'s gait.', ',0,1595,1543,6801,4976,', 'Stimulator neuromuskuler fungsional eksternal', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4978, 'Implanted cerebellar stimulator', '31003020', 8732, 'a device used to stimulate electrically a patient\'s cerebellar cortex for the treatment of intractable epilepsy, spasticity, and some movement disorders.', ',0,1595,1543,6801,4978,', 'Implan stimulator cerebellar', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4979, 'Implanted diaphragmatic/phrenic nerve stimulator ', '31003021', 6801, 'a device that provides electrical stimulation of a patient\'s phrenic nerve to contract the diaphragm rhythmically and produce breathing in patients who have hypoventilation (a state in which an abnormally low amount of air enters the lungs) caused by brain stem disease, high cervical spinal cord injury, or chronic lung disease. ', ',0,1595,1543,6801,4979,', 'Implan stimulator saraf diaphragmatic /phrenic', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4980, 'Implanted intracerebral/subcortical stimulator for pain relief ', '31003022', 6801, 'a device that applies electrical current to subsurface areas of a patient\'s brain to treat severe intractable pain.', ',0,1595,1543,6801,4980,', 'Implan stimulator intracerebral / subcortical untuk menghilangkan rasa sakit', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4981, 'Implanted spinal cord stimulator for bladder evacuation ', '31003023', 6801, 'an electrical stimulator used to empty the bladder of a paraplegic patient who has a complete transection of the spinal cord and who is unable to empty his or her bladder by reflex means or by the intermittent use of catheters.', ',0,1595,1543,6801,4981,', 'Implan stimulator sumsum tulang belakang untuk evakuasi kandung kemih', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4982, 'Implanted neuromuscular stimulator', '31003024', 8728, 'a device that provides electrical stimulation to a patient\'s peroneal or femoral nerve to cause muscles in the leg to contract, thus improving the gait in a patient with a paralyzed leg.', ',0,1595,1543,6801,4982,', 'Implan stimulator saraf otot', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4983, 'Implanted peripheral nerve stimulator for pain relief', '21003025', 8727, 'a device that is used to stimulate electrically a peripheral nerve in a patient to relieve severe intractable pain.', ',0,1595,1543,6801,4983,', 'Implan stimulator saraf perifer untuk menghilangkan rasa sakit', NULL, 0, 0, 700, NULL, NULL);
