INSERT INTO `aspak_new_alat` VALUES (4985, 'Implanted spinal cord stimulator for pain relief', '21003026', 8726, 'a device that is used to stimulate electrically a patient\'s spinal cord to relieve severe intractable pain. The stimulator consists of an implanted receiver with electrodes that are placed on the patient\'s spinal cord and an external transmitter for transmitting the stimulating pulses across the patient\'s skin to the implanted receiver.', ',0,1595,1543,6801,4985,', 'Implan stimulator sumsum tulang belakang untuk menghilangkan rasa sakit', NULL, 0, 0, 700, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (4986, 'Transcutaneous electrical nerve stimulator for pain relief ', '21003027', 6801, 'a device used to apply an electrical current to electrodes on a patient\'s skin to treat pain.', ',0,1595,1543,6801,4986,', 'Stimulator transkutan elektrik untuk menghilangkan rasa sakit', NULL, 0, 0, 700, NULL, NULL);
