INSERT INTO `aspak_new_alat` VALUES (6676, '[delete]Ultrasonic pulsed doppler imaging system', '21102027', 6803, 'USG Doppler adalah sebuah tes non-invasif yang dapat digunakan untuk memperkirakan aliran darah yang melalui pembuluh darah dengan cara memantulkan gelombang suara frekuensi tinggi dari sirkulasi sel darah merah. USG biasa akan menggunakan gelombang suara untuk menghasilkan gambar, tetapi tidak dapat menunjukkan aliran darah seseorang.', ',0,1597,1550,6803,6676,', 'Doppler ultrasound / USG', NULL, -1, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (6677, 'Bioelectrical Impedance Analysis (BIA)', '10901034', 6796, 'salah satu alat yang digunakan untuk mengukur komposisi tubuh. Alat ini merupakan evolusi dari timbangan berat badan yang bekerja sebagai elektroda untuk mengukur sinyal listrik pada tubuh, sehingga nilai massa otot, lemak tubuh, kadar air tubuh, lemak viseral (lemak dalam organ), Basal Metabolic Rate (BMR) dan massa tulang dapat diketahui.', ',0,1599,1558,6796,6677,', '', NULL, 0, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (6678, 'ABPM dan HBPM (Ambulatoir dan Hospital Blood Pressure Monitoring)', '10901035', 6796, 'pemantauan tekanan darah selama 24 jam ketika pasien sedang beraktivitas dan tidur. Dengan ABPM, tensi pasien akan diketahui dengan lebih akurat.', ',0,1599,1558,6796,6678,', '', NULL, 0, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (6679, 'Continues Glucose Monitoring (CGM)', '10101158', 6755, ' alat yang digunakan untuk memantau glukosa darah secara terus-menerus oleh orang-orang dengan diabetes tipe I atau tipe II.', ',0,3021,3023,6755,6679,', '', NULL, 0, 0, 365, NULL, NULL);
INSERT INTO `aspak_new_alat` VALUES (6680, 'Insulin Pump', '10101159', 6755, 'alat medis yang digunakan untuk pemberian insulin dalam pengobatan diabetes mellitus, juga dikenal sebagai terapi insulin subkutan terus menerus.', ',0,3021,3023,6755,6680,', '', NULL, 0, 0, 365, NULL, NULL);
